INSERT INTO my_information VALUES ('253','南大街世茂海湾1号 2室2厅2卫 136O','43','1492137855','365','1523673855','【世茂租售中心】承诺：真实存在！真实委托！真实价格！<br />\r\n<br />\r\n选择世茂租售中心&nbsp;是您省时省力省心的佳选择！&nbsp;我们自世茂海湾1号交付起就专业致力于世茂项目。我们了解世茂的一砖一瓦。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为专一，所以更加专业！<br />\r\n<br />\r\n【房源描述】：<br />\r\n<br />\r\n【产权性质】双证齐全<br />\r\n<br />\r\n【售房原因】多套，房主诚意出售<br />\r\n<br />\r\n【房屋买点】养正、十中学区，精装修，宜商宜住，可改两室，4部高速电梯<br />\r\n<br />\r\n【户型特点】三室两厅三卫大客厅很方正，全明户型，房屋年代新，层高3米，<br />\r\n<br />\r\n刷卡乘梯私密安全24小时物业安保<br />\r\n<br />\r\n【周边配套】：<br />\r\n<br />\r\n1、学校：幼儿园―实验幼儿园、云龙幼儿园、双育幼儿园；小学―养正小学、南山路小徐、葡萄山小学、潇翔小学；初中―十中、一中；<br />\r\n<br />\r\n2、医院：烟台山医院、毓璜顶医院、妇幼保健院、传染病医院；<br />\r\n<br />\r\n3、购物：家家悦、振华购物中心、世茂广场、北河街市场、进德商贸市场、红利市场；<br />\r\n<br />\r\n4、周边环境：张裕葡萄酒博物馆、滨海广场、第一海水浴场、烟台山风景区、朝阳街酒吧；<br />\r\n<br />\r\n5、银行：中国银行、交通银行、光大银行、恒丰银行、招商银行、浦发银行、农业银行、工商银行等；<br />\r\n<br />\r\n6、交通：1、2、3、5、6、10、17、18、43、46、47、50、52等；<br />\r\n<br />\r\n照片为同类型户型的精装修图片，供参考','shahala','刘女士','88153569','88153569@qq.com','13053561585','0','2','1','','59.46.64.20','辽宁省沈阳市电信','1','/attachment/information/201704/pre_1492137855m0yiq.jpg','1','1','0','1','0','0','0','0','二手房出售','ershoufang','1','0','','0.00000000000000000','0.00000000000000000','','1','10','0');
