INSERT INTO my_information VALUES ('405','整租 | 【美南&#8226;美房源】 万泰麓溪公馆 高端封','41','1494461732','365','1525997732','美南・美房源】<br />\r\n<br />\r\n美南/烟房承诺，真实存在、真实委托、真实价格，如有虚假，请拨打电话投诉。<br />\r\n<br />\r\n【房屋优势】<br />\r\n<br />\r\n1房源信息：本房位于万泰麓溪公馆，温馨3居，家具家电全齐，有冰箱、洗衣机、热水器等家用电器。拎包即可入住！<br />\r\n<br />\r\n2价格：小区内家电齐全3居室价格低房源<br />\r\n<br />\r\n3周边配套：万泰麓溪公馆位于莱山区观海路迟家以西，总用地面积6.86公顷。规划总建筑面积173090.4平方米，其中地上建筑面积129910平方米（包括住宅建筑面积127124.46平方米，公建建筑面积2735.54平方米、垃圾站50平方米），地下建筑面积43180.4平方米。<br />\r\n<br />\r\n万泰麓溪公馆容积率1.89，建筑密度11.9%，绿化率35.5%，规划停车位1118个。建筑层数为18-24层，总户数为730套。<br />\r\n交通状况<br />\r\n<br />\r\n公交：乘坐1、5、7、18、23、33、50、52、53、55、62路迟家站点下车西行步行100米即可<br />\r\n项目配套<br />\r\n<br />\r\n中小学:烟台二中东校区、自然智慧文化艺术学校<br />\r\n幼儿园:市直机关幼儿园<br />\r\n综合商场:万光诚润、家家悦超市<br />\r\n银行:中国银行、农业银行、工商银行、建设银行、中信银行、商业银行、农村信用社、恒丰银行、交通银行、华夏银行<br />\r\n医院:胜利油田疗养院、毓璜顶医院莱山分院、烟台市口腔医院莱山分院、光华医院、京华眼科医院等<br />\r\n小区内设会所<br />\r\n<br />\r\n5看房时间：看房方便钥匙房<br />\r\n<br />\r\n【服务承诺】<br />\r\n<br />\r\n一次的交易、一辈子的服务，这是美南的服务宗旨。所以，从加入美南的天，我就谨记“客户重要”这五字的含义。美南6大服务承诺，是美南经纪人的职业底线，我会从严遵守，欢迎您多加指导。<br />\r\n<br />\r\n【自我介绍】<br />\r\n<br />\r\n我是美南莱山片区的经纪人，在解放路到黄海城市花园这个商圈我工作了1年多。曾经为120多位客户提供房屋居间成交服务，同时为超过1500位客户提供咨询服务，荣获公司五星级经纪人、区域等称号。<br />\r\n<br />\r\n不管您是买房、卖房还是咨询，我都将为你提供专业的房产知识和购房建议。欢迎随时拨打我的电话。','十三哥','慕辰','45478741','45478741@qq.com','13376381050','0','2','1','','112.103.60.72','黑龙江省哈尔滨市电信','1','/attachment/information/201705/pre_1494461732drxfg.jpg','2','1','0','1','0','0','0','0','房屋出租','chuzu','1','0','','0.00000000000000000','0.00000000000000000','','1','1','0');
INSERT INTO my_information VALUES ('406','映雪佳苑 3室 南北通透 照片真实','41','1494461834','365','1525997834','1、房屋特点：<br />\r\n<br />\r\n装修配置：精装修，干净整洁(温馨舒适），三室一厅，家具家电齐全，拎包即可入住。<br />\r\n<br />\r\n2、小区环境：<br />\r\n<br />\r\n小区环境幽雅，绿化率高，车位充足，房子不临街，确保您睡眠环境足够安静。<br />\r\n<br />\r\n3、周边配套：<br />\r\n<br />\r\n周边配套完善，市场、超市、商场、电影院、幼儿园、学校、医院、银行，一应俱全，满足您一切生活需求。<br />\r\n<br />\r\n4、交通：<br />\r\n<br />\r\n主干道，公交线路众多；交通便捷，生活购物方便。<br />\r\n<br />\r\n5、补充：<br />\r\n<br />\r\n看房时间：该房房东已经托管给我们，房屋管家。钥匙在我们这里，随时可以预约看房，看房免费。<br />\r\n<br />\r\n实地看过房子，这种配置租这个价位合理，此房为小区内房源。<br />\r\n<br />\r\n公司简介<br />\r\n<br />\r\n山东烟台筑家房地产经纪有限公司成立于2010年4月6日，总部地址位于烟台开发区泰山路天一大厦309室。现拥有开发区、芝罘区、福山区11家分行、1家装饰设计公司。筑家坚持以“客户需求为服务目标，客户满意为服务标准”的企业宗旨，“安全，高效，专业，诚信”的经营理念，“热情，专业，负责”的职业素养，“我承诺！我做到！”的服务宗旨，在市场运作方面形成了筑家地产所特有的先进的经营模式。筑家坚持“以人为本，能者重用”的用人理念，为进一步规划房地产经纪市场，筑家地产严格要求经纪人素质、专业知识、操作技能，不定期严格考核经纪人各项指标，定期以业绩、工作态度、客户反馈等各方面数据为标志评定经纪人等级，以专业化、系统化、规范化的培训体系，不断壮大着筑家地产的队伍。2011年筑家引进先进的租房模式“房屋管家”业务，全权为房东打理房子，为客户提供“信心，顺心，安心，放心，省心”的五心级服务，在市场上形成了先进的经营模式。透明交易，不吃差价，签三方约，用心服务，态度热忱真诚，满足客户需求，积极投身社会公益。<br />\r\n<br />\r\n个人简介<br />\r\n<br />\r\n我是筑世家园金牌租赁顾问：孙晓静，有多年房产服务经验，期待能为您服务！若是这套房子您感觉不合适，可以点击我的头像去我的网络店铺看看，或者打电话告诉我您的需求，本人将为您进行专业详细的介绍，全心全意为您找到满意的房子。','十三哥','慕辰','45478741','45478741@qq.com','13376381050','0','1','1','','112.103.60.72','黑龙江省哈尔滨市电信','1','/attachment/information/201705/pre_1494461834v9tvm.jpg','2','1','0','1','0','0','0','0','房屋出租','chuzu','1','0','','0.00000000000000000','0.00000000000000000','','1','10','0');
