INSERT INTO my_information VALUES ('450','人间仙境蓬莱，这里有你的温馨家园。','42','1494581469','365','1526117469','基本信息<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;房屋类型<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;民居<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;面积<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;67O<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;入住时间<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;18:00以后<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;出租类型<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;整套出租<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;可住人数<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;6人<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;退房时间<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;12:00以前<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;户型<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;2室1厅1厨1阳台<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;最少入住<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;1天<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;接待时间<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;06:00-21:00<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;卫生间<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;独立*1<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;最多入住<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;天数不限<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;发票<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;不提供<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;地下室<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;否<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;押金<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;500元<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;外宾接待<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;不接待<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;双人床<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;1.5mx2m（1张）<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;双人沙发床<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;1张<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;双人床<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;1.8m*2m（1张）<br />\r\n<br />\r\n配套设施<br />\r\n免费项<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;冰箱<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;洗衣机<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;淋浴<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;24小时热水<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;沐浴露洗发水<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;牙具香皂<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;毛巾浴巾<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;拖鞋<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;电梯<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;保安<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;欢迎小孩<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;欢迎老人<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;无障碍设施<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;电视<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;空调<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;无线WIFI<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;可以做饭(有调料)<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;清洁费<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;饮水机<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;对讲系统<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;电脑<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;浴缸<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;可以吸烟<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;有线网络<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;暖气<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;可养宠物<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;停车位<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;允许聚会<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;可以加床<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;早餐<br />\r\n<br />\r\n详细介绍<br />\r\n房屋面积67O，两室一厅一厨一卫，精装修，水电暖齐全，彩电冰箱洗衣机一应俱全，每个卧室都装有空调，可以在厨房做一些家常便饭。干净整洁，舒适温馨，床单一客一换，提供一次性洗漱用品。离蓬莱阁，海洋极地世界，三仙山，八仙渡，欧乐堡等景区都比较近！可以提供各景点优惠门票！”温馨家园”是我专为来蓬莱旅游或度假的朋友提供的一项短期租房服务。当您来到蓬莱旅游风景区，住在我为您精心准备的房子里，欣赏、游览之余，还能把自己真正融入到人间仙境之中，走进平民百姓的生活，与他们一道去买菜、做饭、逛街、游乐，不会有异乡人的感觉，哪怕只是短短的几天，您会发现，“温馨家园”给您的是一份家的自在、舒适和温馨。开这个旅馆是希望能多多认识来自全国各地的朋友！！我将会以最大的热情为你的仙境之旅提供全程服务。希望你来的时候是我的客人，你走的时候是我的朋友！不管你是学生，是蓝领白领，是农民兄弟还是工薪阶层，我和我的温馨家园都会敞开大门欢迎你！<br />\r\n地理位置<br />\r\n南环路与芝山花园交汇处，西临蓬莱市中医院。<br />\r\n交通状况<br />\r\n蓬莱汽车站乘4路公交车到半岛蓝庭站点下车即到。的车招手即到。<br />\r\n周边生活<br />\r\n超市&nbsp;小吃&nbsp;医院<br />\r\n其他<br />\r\n要使用厨房的话需做好卫生!<br />\r\n房客须知<br />\r\n*&nbsp;请带好您的有效身份证件办理入住。*&nbsp;请爱护房间内设施和物品。*&nbsp;请勿将房间用于违法活动','abc888999','田小姐','68997789','68997789@qq.com','17753513623','0','2','1','','42.102.208.27','黑龙江省电信','1','/attachment/information/201705/pre_149458146987reg.jpg','1','1','0','1','0','0','0','0','日租/短租','duanzu','1','0','','0.00000000000000000','0.00000000000000000','','1','3','0');
