INSERT INTO my_information VALUES ('480','烟台家具服务中心:家具补漆,皮革维修翻新,配送安装','113','1494769154','365','1526305154','无忧家具售后维修中心<br />\r\n联系人：胡师傅<br />\r\n联系电话：17052643196<br />\r\n<br />\r\n烟台无忧家具售后维修中心，为您提供较优质的配送安装，维修服务！忠于商家，为商家树立良好的企业形象，为客户带去优质高效放心的服务，优质师傅共廉签订。<br />\r\n<br />\r\n维修方面：全能精修所有家具所有类型损伤。维修宗旨-客户满意签字客户不满意签字不收任何费用，实物拍照为收费基础。接单效率-接单即会跟客户预约避免客户焦急等待，维修完成主动让客户签满意签字，维修完成近照。认真负责的态度服务每一位客户！专人审核无需商家费心，杜绝师傅维修质量差，现场乱加价等情况的发生。<br />\r\n配送安装服务准则：师傅提货及时！物流仔细检查外包，如有损坏立即通知商家，约定时间内完成。客户当面拆包如有物流磕碰联系商家，精细安装。如因师傅自身安装不到位，免费上门安装。<br />\r\n文明用语，屏蔽一切会引起商家客户误会言语，安装到位。现场能带走的垃圾全部带完。让客户真切体会商家的优质服务。<br />\r\n<br />\r\n无忧售后配送维修真诚邀请广大家具卖家，各大平台店商长期合作。长期合作服务效率较高，价格较低！诚信、优质、低价合作是我们的宗旨！！有意向的商家可致电（17052643196）咨询<br />\r\n本地优质诚信师傅加盟。所有合作师傅需通过技能水平&nbsp;评测。服务态度评测，需具有一定的谈话技巧，沟通能力&nbsp;，优质共廉师傅招募中（17052643196）同城招募满，此条即止<br />\r\n<br />\r\n服务项目：家具配送安装&nbsp;家具补漆&nbsp;皮革破损维修，沙发翻新&nbsp;家具贴膜<br />\r\n<br />\r\n一：实木家具维修：各种实木家具、红木家具、板式家具、办公家具、沙发塌陷；地板、木门、门套、橱柜、楼梯。扶手、木雕、工艺品等开裂、磕碰伤、伐伤、断裂、掉漆、物流损坏等修复、翻新保养。<br />\r\n二：真皮皮革维修：皮沙发物流刮伤、皮床等皮制家具的开线、伐痕、破洞等局部修复、上色、改色、翻新保养。各种皮革修复、单色皮、花色皮、青光皮、珠光皮、凹凸皮；翻新上色、换皮换套。<br />\r\n三：大理石维修：各种大理石磕碰、划伤、起包等问题的修复。<br />\r\n四：家具配送安装：办公家具：屏风、班台、会议桌、班台、员工椅子、书柜、茶几、沙发等；民用家具：床、衣柜、妆台、书柜、书桌、餐台、沙发、餐椅、茶几、斗柜、酒柜等拆装搬运各种家具。<br />\r\n五：家具贴膜：家具贴膜的特点：耐高温(260度)、耐磨、防划伤、高光透明提升木纹清晰感、保护家具不退色、手感平滑、易清洗打理家具、防潮防油垢、玻璃餐桌防爆等功能。适用于大理石家具、各种玻璃家具、钢琴漆家具、哑光漆家具、实木家具、红木家具、橡木家具、金箔家具、银箔家具等等。<br />\r\n六：无忧连锁沙发翻新：床头靠背软包翻新、沙发维修、沙发塌陷、换海绵、换绷带、换拉簧；真皮沙发清洗上光、沙发整体换皮、局部换皮、真皮、仿皮、环保皮；定做各种沙发套，高低档样品任你选择，做工精细，价格合理。','a18766519721','刘笃青(经纪人)','18766519721','18766519721@qq.com','18766519721','0','1','1','','42.102.208.27','黑龙江省电信','1','/attachment/information/201705/pre_1494769154rglx0.jpg','1','1','0','1','0','0','0','0','家居维修','jiajuweixiu','1','0','','0.00000000000000000','0.00000000000000000','','1','3','0');
INSERT INTO my_information VALUES ('481','上海超音波热板熔接机长荣塑胶熔接装备优惠政策','136','1496646511','365','1528182511','上海超音波热板熔接机,长荣塑胶熔接装备优惠政策。<br />\r\n超音波热板熔接机特点：本机具有结构简单，操作方便，生产效率高等特点。熔接后可达到水密，气密的要求，适用各种形状，大小和材质的热塑性塑料件熔接。PLC电脑控制系统、安全、稳定、无误操作，是一种用途广泛，经济实用，生产效率较高的熔接工艺。<br />\r\n适用：车灯、方向灯、保险杆、洗衣机平衡环、吸尘器、浮球、栈板等相关产品。<br />\r\n型号：EGH-400,500,&nbsp;电源：220VAC~380VAC<br />\r\n功率：5KW―10KW&nbsp;&nbsp;气压：0.8MPA&nbsp;&nbsp;0.5M3<br />\r\n尺寸：L1440*W1220*H2080MM&nbsp;重量：1000KG・上海超音波热板熔接机厂，上海长荣塑胶熔接装备有限公司','evergreen168','孙亚英','759075074','evergreensh@163.com','021-57561574','0','1','1','','117.25.125.89','福建省福州市电信','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('482','SPG-SRX02CE调速器电话_SRX02CE调速器选购_','136','1496647505','365','1528183505','SPG-SRX02CE调速器电话_SRX02CE调速器选购_上海幸萌。上海SPG-SRX02CE调速器幸萌售后电话:021-34679878。上海幸萌工贸发展有限公司提供上海SPG-SRX02CE调速器售后服务。<br />\r\nSPG-SRX02CE调速器特点：减速比减机对马达回转数的比率。SPG-SRX02CE调速器马达回转数在减速机的出力轴1÷减速比。减速机的减速比为了对应马达回转数的差异，为使减速机出力轴的回转数一样。减速比有3，5，7.5，1.2，15…的系列以及1.2倍减速比的3.6，6，&nbsp;9，15，18……等系列。SPG-SRX02CE调速器在50Hz的地区减速比为3的情・与60Hz的地区减速比为3.6的减速机出力轴回转数几乎相同。SPG-SRX02CE调速器，当然50Hz地区和60Hz地区，都能使用所有种类的减速机。<br />\r\n<br />\r\n找上海SPG-SRX02CE调速器售后就找上海幸萌，上海SPG-SRX02CE调速器售后电话:021-34679878。','xingmeng012','刘小姐','','quanjin@xm-motor.com','021-54884023','0','1','1','','117.25.125.89','福建省福州市电信','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('483','木板年画价格厦门中画哪家好手工艺木板首选','136','1496729503','365','1528265503','木板年画价格厦门中画哪家好手工艺木板首选&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;木版年画到了清代中晚期，民间年画达到了鼎盛阶段，是中.国历史悠久的汉族传统民间艺术形式，有着一千多年的历史。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;在汉族民间，年画就是年的象征，不贴年画就不算过年。清末民初年间，年画的使用地区覆盖了除西藏以外的全国各地，包括台湾在内。&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;厦门中画商贸有限公司供应各类手工艺品，其中木版年画有大大小小几十个产地，其中著名的有:重庆梁平、天津杨柳青、河北武强、山东潍坊、苏州桃花坞、河南朱仙镇、四川绵竹等地。年画已不仅是节日的装饰品，它所具有的文化价值和艺术价值，使它成为反映中.国民间社会生活的百科全书。&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;海西手绘油画艺术落户于美丽的鹭岛福州厦门，厦门是国内最早发展手绘油画的经济特区。厦门海西手绘油画长期签约厦门一线画家百人团队,和海沧油画交易市场，乌石浦油画村200多家画廊稳定合作。','ssong555','经理','3107876424','xdsqczkyqs644@163.com','0592-88844422','0','1','1','','222.76.57.34','福建省福州市连江县电信','1','/attachment/information/201706/pre_1496729503hjkdf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
