INSERT INTO my_information VALUES ('500','富氢水机批发|广州健益环保|富氢水机','136','1496818515','365','1528354515','富氢水机批发|广州健益环保|富氢水机&nbsp;|&nbsp;广州市健益环保科技有限公司<br />\r\n	广州健益环保|富氢水机排名|富氢水机批发<br />\r\n	&nbsp;<br />\r\n	央视品牌厂家&nbsp;有实力的厂家――广州健益&nbsp;<br />\r\n	一个又一个的老板因为经销&nbsp;代理&nbsp;OEM了我们的产品而致富&nbsp;<br />\r\n	电解水机&nbsp;生态仪&nbsp;负离子空气净化器&nbsp;车载空气净化器&nbsp;十年来始终不变地做这几款产品&nbsp;&nbsp;专业性强&nbsp;值得信赖！！&nbsp;<br />\r\n	健益招商总经理电话&nbsp;一三七五一八三一九八七&nbsp;&nbsp;曹经理&nbsp;<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	富氢水，又名水素水（Hydrogen&nbsp;Water），水中溶入适量氢气，在日本称呼氢水为水素水。味道很中性，跟喝开水或纯净水无分别，无色无味无气。加入氢气的水具有很强的还原功能，可以中和身体血液和细胞里的活性氧（自油基），水素水的负电位有-300~-500（mv）抗氧能力，即以0为中位，负数数值愈大，代表抗氧能力愈强。<br />\r\n	<br />\r\n	富氢水具有超过所有维生素A&nbsp;、C、E、绿茶等人类已知的抗氧化剂，负电位达到惊奇的-500mV，全面清除人体恶性活性氧（自油基）。<br />\r\n	富氢水是最好的抗氧化物，集高氢量、弱碱性、负电位、小份子水为一体，平衡身体酸碱度，可有效防止多种疾病。富氢水很容易进入细胞通道，参与新陈代谢，从而促进细胞排毒，增加了细胞的水合作用，提升人体的免疫力。对胆结石的融化、心脑血管、脑动脉硬化、高血压、唐尿病、改善女性生理周期、肠胃循环、便秘、消除女性更年期症状、排除身体毒素等均有显著的治疗和预防的作用。富氢水除了饮用外，还是非常有效的保湿化妆水，对皮肤美容、祛除色斑特别有效。用“富氢水”洗脸，让皮肤远离活性氧的危害，肌肤能变光滑，延缓肌肤衰老。每天饮用1.5-2升“富氢水”会消除脂肪肝，排除肠毒，恢复体力，减肥效果明显。<br />\r\n&nbsp;<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	健宜电解水机拥有时尚外观<br />\r\n	(1)时尚精简设计-&nbsp;外观简约，银色过光油外壳，尊贵液晶线面板<br />\r\n	(2)七个功能按键<br />\r\n	7个档位分为电解还原水4个档位，分别是:初期饮用、泡茶、烹调料理、煮饭<br />\r\n	净水档位;<br />\r\n	酸性水2个档位:美容洗颜档位、杀菌洗涤档位。<br />\r\n	<br />\r\n	(3)&nbsp;&nbsp;五套公率，适合各地水质<br />\r\n	(3)智能自动清洗:<br />\r\n	健宜电解水机采用了智能自动清洗技术，关闭阀门时水机自动倒极清洗，健宜电解水机的自动清洗技术可以保证电解槽电极板的正常工作，延长电极板寿命。清洗灯亮后水机自动清洗，设定灯亮时表示提示滤芯更换。电流调节设定、滤芯更换及清洗设定。<br />\r\n	(4)滤芯更换提示:<br />\r\n	(5)前置过滤净水器与健宜JMSM-A-998电解水机想关联，可记录每天过滤水量，通过液显示面板即可看到使用的水量。滤芯需要更换时有提示。','hgsyt359','曹','2850613130','gzjianyi6@163.com','020-82088760','0','1','1','','116.23.93.196','广东省广州市电信','1','/attachment/information/201706/pre_1496818515v8oos.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
