INSERT INTO my_information VALUES ('532','桑黄供应商_野生桑黄_十月细润','136','1496911514','365','1528447514','桑黄供应商_野生桑黄_十月细润&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n	&nbsp;<br />\r\n	十月细润桑黄降低抗癌剂副作用<br />\r\n半年后，能够在家中享用可口的三餐，也七月十九日动手术，切除卵巢。结果又发现大肠息肉。手术后开始接受抗癌剂的治疗。丈夫听说有「治疗癌症的新药」，于是立刻购买桑黄粉让我每天饮用一袋。&nbsp;投与抗癌剂之初，反复出现呕吐等副作用，无法喝水。甚至产生倦怠感，无力上厕所，导致情绪低落。&nbsp;第二次的抗癌剂注射预定在一周后，但是副作用却愈来愈严重，发烧、肠内积存废气等，结果变更为两周后才继续治疗。&nbsp;照镜子时发现自己骨瘦如柴，令我十分震惊，担心自己会衰弱致死，突然觉得很落寞。&nbsp;后来，每天持续饮用桑黄粉，投与抗癌剂十天后，逐渐变得轻松。在投与癌剂之后，不再出现恶心的现象，而且食欲大增。&nbsp;桑黄粉支持我与疾病搏斗的生活&nbsp;原本痛苦的情绪消失，涌现希望。能够正常进食后出院，改看门诊，每周接受一次抗癌剂的治疗。&nbsp;一大早到医院去，直到下午三点之前都要躺在病床上接受抗癌剂的点滴注射。一边打点滴一，一边享用美味的午餐。打完点滴后，就轻轻松松地回家。<br />\r\n能做家事，体重甚至增了五公斤。虽然因为副作用而掉发，但是除此之外，身体状况和以前没什么两样。&nbsp;如果当时副作用日益严重&nbsp;<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	导购：十月细润桑黄&nbsp;<br />\r\n	&nbsp;指定销售商：&nbsp;<br />\r\n	&nbsp;通化十月细润生物科技有限公司&nbsp;<br />\r\n	&nbsp;销售热线：&nbsp;13844598075&nbsp;<br />\r\n	&nbsp;微信：13844598075','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','36.49.147.137','吉林省吉林市电信','1','/attachment/information/201706/pre_1496911514iea7u.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('533','安康火锅加盟重庆老火锅加盟老社长','136','1496913959','365','1528449959','火锅加盟重庆老火锅加盟老社长<br />\r\n<br />\r\n&nbsp;&nbsp;重庆火锅加盟事业正在全国展开，创业投资者纷纷加入，现在已经是大众创业时代，创业者年龄也更加年轻化，也更加注重餐饮的时尚感。许多人就在怀疑，重庆老火锅能有发展市场吗？&nbsp;<br />\r\n<br />\r\n吃重庆火锅还是老火锅好<br />\r\n<br />\r\n吃重庆火锅还是老火锅好<br />\r\n<br />\r\n吃重庆火锅还是老火锅好<br />\r\n<br />\r\n&nbsp;&nbsp;重庆老社长知青火锅是正宗牛油火锅，牛油火锅底料是由花椒、辣椒、豆瓣等香料经过专业熬制，不添加任何香精的天然品，重庆老火锅的“老”也是指老配方、老味道，对店内装修风格有极大的包容性、适应性。重庆老社长知青火锅加盟店大多数都是以简单大气，体现60年代知青文化为主。<br />\r\n<br />\r\n吃重庆火锅还是老火锅好<br />\r\n<br />\r\n吃重庆火锅还是老火锅好<br />\r\n<br />\r\n&nbsp;&nbsp;做餐饮要追求消费量，要时刻把握消费者心理，开重庆火锅加盟店也是一种学问。但主导消费者消费的还是味道，餐饮是一门吃的学问，人们吃得好了，自然还会来。重庆老社长知青火锅把味道当做根本生产力，是正宗的重庆老火锅味儿。重庆老社长知青火锅欢迎大家随时拨打加盟热线进行咨询。<br />\r\n<br />\r\nhttp://www.laoshezhanghg.com/<br />\r\n<br />\r\n加盟咨询：023-60362400','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.188.225','重庆市电信','1','/attachment/information/201706/pre_1496913959tudvd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
