INSERT INTO my_information VALUES ('535','师大高端_南昌平面广告设计培训班_南昌广告设计培训班','136','1496915269','365','1528451269','师大高端_南昌平面广告设计培训班_南昌广告设计培训班&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	南昌平面广告培训学校,南昌平面广告设计培训班,师大高端<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	平面设计&nbsp;<br />\r\n	南昌平面广告培训学校,南昌平面广告设计培训班,师大高端软件课程：<br />\r\nPhotoshop：图像处理、编辑、通道、图层、路径综合运用，图像色彩的校正，各种特效滤镜的使用、特效字的制作，图像输出与优化等；灵活运用图层风格、流体变形及褪底和蒙板。<br />\r\nCorelDraw：通过CorelDraw全方面的设计及网页功能融合到现有的设计方案中，制作矢量插图、设计及图像，出色地设计公司标志、简报、彩页、手册、产品包装、标识、网页及其它。<br />\r\nIllustrator:&nbsp;学习图形绘制、包装、宣传页的制作，更加方便地进行LOGO及CI设计，就会成为一名真正的美术大师，在Photoshop的基础上再学它如虎添翼，效率成倍提高。<br />\r\nIndesign：学习排版设计的基本法则、使用方法与技巧，工具箱、快捷键的使用，菜单功能及操作技巧，出版物、书籍、宣传彩页、报纸杂志等的高级专业排版制作的方法。<br />\r\n3、印刷知识与硬件设备：印刷方式，菲林输出，打稿，印刷工艺流程，扫描仪、电子分色、打印机、刻录机、数码相机的实践操作等，学习印刷工艺流程，能够解决印刷中常见问题，亲身体验平面设计工作环境等。<br />\r\n4、高级实战课程：图案设计，图形创意，CIS设计制作（企业形象设计），广告平面设计，广告战略，广告文字应用原则及编排方法，字体设计，商标设计、CI设计、包装设计、POP广告等，版式设计、招贴设计，书籍装帧设计，杂志设计。<br />\r\n5、毕业设计：以广告公司的实际设计流程，完成从客户双方进行意向沟通，确认制作，方案设计，制作完稿，交货验收，&nbsp;让学员真实感受平面设计完整过程。&nbsp;<br />\r\n	&nbsp;<br />\r\n南昌平面广告培训学校,南昌平面广告设计培训班,师大高端&nbsp;我们的优势：&nbsp;<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。&nbsp;<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间&nbsp;<br />\r\n	3.实力师资，我们的老师水平绝对够；&nbsp;<br />\r\n	4.免费试听，推荐就业；&nbsp;<br />\r\n	5.一次不会免费二次重修，过了为止&nbsp;<br />\r\n	南昌平面广告培训学校,南昌平面广告设计培训班,师大高端&nbsp;高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。&nbsp;<br />\r\n	&nbsp;<br />\r\n	南昌平面广告培训学校,南昌平面广告设计培训班,师大高端&nbsp;学校开设&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	&nbsp;<br />\r\n	联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','182.110.15.247','江西省九江市电信','1','/attachment/information/201706/pre_149691526951ywj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
