INSERT INTO my_information VALUES ('553','苏州 多功能牵引床厂家首选兴鑫医用设备','136','1496998229','365','1528534229','江苏兴鑫医用设备有限公司是专业的苏州&nbsp;多功能牵引床厂家。<br />\r\n&nbsp;江苏兴鑫医用设备有限公司http://www.xxmedical.com/多功能牵引床主要作用：<br />\r\n（1）多功能牵引床起腰部的固定和制动作用：牵引时，在作用力和反作用力的平衡状况下，受牵拉的腰部处于一个相对固定的正常列线状态，以便于减轻或消除部分的充血、渗出、水肿等炎症反应。<br />\r\n（2）多功能牵引床松懈腰背部肌肉：腰椎间盘突出症，因为脊神经的受压或受刺激，多伴有腰背部肌肉痉挛，这么不仅导致了腰部的疼痛表现，而且还会导致腰椎的列线不正。多功能牵引床牵引疗法，能够逐步使腰背肌放松，免除肌肉痉挛。<br />\r\n（3）多功能牵引床恢复腰椎的正常列线：在牵引时，若将患者腰椎放置在生理曲线状，跟着牵引时刻的延伸，列线不正的状况能够逐步康复至正常。<br />\r\n（4）多功能牵引床改善突出物与神经之间的联系：关于腰椎间盘突出症轻型或早期的病人，牵引疗法可使椎空隙逐步被牵开，而有利于突出物的还纳。关于患病时间相对较长的患者，牵引可合粘连组织和挛缩的韧带、关节囊牵开使椎管空隙相应增宽，两边狭隘的椎间孔也可一起被牵开，然后减轻或消除了对神经根的压迫与影响，对减轻下肢麻木和疼痛有较好效果。牵引是医治腰椎病的最有效办法之一。通过力学作用，力与反作用力的原理，对腰椎施加牵引力，拉宽椎空隙然后达到：<br />\r\n①减轻椎间盘压力，&nbsp;推进椎间盘回纳，免除对神经根等组织的影响和压迫。<br />\r\n②消除炎症，促进血液循环。<br />\r\n③消除肌痉挛，改进部分血液循环。颈腰椎牵引床是选用机械传动实行牵引的一种新式牵引床。可自行操控，适用于颈椎病的牵引及腰椎病平行、摇晃牵引，美观大方。欢迎联系江苏兴鑫医用设备有限公司张姝琛索取&nbsp;多功能牵引床资料！','jbpnq249','张姝琛','','2880670880@qq.com','512-58554180','0','1','1','','117.82.21.28','江苏省苏州市电信','1','/attachment/information/201706/pre_1496998229xuleh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
