INSERT INTO my_information VALUES ('557','杀菌灭藻剂厂家_杀菌灭藻剂多少钱_廊坊森卓','136','1497001854','365','1528537854','杀菌灭藻剂厂家_杀菌灭藻剂多少钱_廊坊森卓&nbsp;|&nbsp;廊坊森卓化工有限公司<br />\r\n廊坊杀菌灭藻剂多少钱？廊坊森卓告诉你价格。<br />\r\n廊坊森卓告诉你廊坊杀菌灭藻剂价格多少钱。要价格便宜的杀菌灭藻剂请找廊坊森卓化工有限公司购买。廊坊森卓化工有限公司的杀菌灭藻剂价格便宜，质量一流。<br />\r\n适用范围：&nbsp;<br />\r\n　　杀菌灭藻剂广泛用于石油、化工、化肥、电力、冶金、纺织、塑胶等工业循环冷却水系统:&nbsp;<br />\r\n　2油田注水系统&nbsp;<br />\r\n　　杀菌灭藻剂2中央空调冷却水系统&nbsp;<br />\r\n　　杀菌灭藻剂2注塑工业循环冷却水系统&nbsp;<br />\r\n　　2烧结炉冷却循环水系统&nbsp;<br />\r\n　　2其他冷却循环水系统&nbsp;<br />\r\n　　防止菌藻繁殖和消除微生物粘泥。&nbsp;<br />\r\n　　杀菌灭藻剂性能特点：&nbsp;<br />\r\n　　●本品能高效预防和抑制循环冷却水系统中的菌藻类微生物大量繁殖，防止冷却水系统产生和沉积生物性粘泥。&nbsp;<br />\r\n　　●对已经产生的生物性粘泥和藻类，也能迅速穿透细菌因产生抗药性而增厚的细胞壁，因而在已产生抗药性的循环水体系中使用也具有较强的持久杀菌效果,能有效灭活并快速剥离和分散清除。&nbsp;<br />\r\n　　●本品属非氧化性杀生剂，对pH值的适应范围广，在碱性和酸性条件下均可发挥杀菌灭藻作用。&nbsp;<br />\r\n　　●本品无毒无害,属中性环保药剂,长期使用对设备无腐蚀损伤.这一点有区别于市埸其他带腐蚀性的产品.&nbsp;<br />\r\n　　杀菌灭藻剂使用方法：&nbsp;<br />\r\n　　●初始投药：按系统总水量（保有水量），每吨水投加10-15kg计算总药量。将总药量一次性缓慢连续投入系统，每天投加一次，连续投加2~3天。&nbsp;<br />\r\n　　●维持投药：按系统总水量，每吨投加水1千克计算总药量,将总药量一次投入系统。&nbsp;<br />\r\n　　●视用户要求程度,也可采用如下方法决定加药量:&nbsp;<br />\r\n　　①可根据冷却水含菌量-,要求较高,须定期加药,加药量按每周取水样化验结果得出.&nbsp;<br />\r\n　　②或冷却塔填料上的藻类附着量确定投药周期-要求一般,可用肉眼辩别决定加药时间与加药量&nbsp;<br />\r\n　　欲了解廊坊杀菌灭藻剂价格多少钱，请联系廊坊森卓化工有限公司崔先生，地址：河北廊坊开发区正大街18号，联系电话：17060866664.13191966664<br />\r\n廊坊杀菌灭藻剂,杀菌灭藻剂价格,杀菌灭藻剂多少钱','wycta417','崔先生','59284339','714385184@qq.com','0316-2186676','0','1','1','','101.75.198.212','河北省联通','1','/attachment/information/201706/pre_1497001854antlu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('558','廊坊森卓,锅炉清灰剂价格,锅炉清灰剂厂家','136','1497005057','365','1528541057','廊坊森卓,锅炉清灰剂价格,锅炉清灰剂厂家&nbsp;|&nbsp;廊坊森卓化工有限公司<br />\r\n廊坊森卓化工有限公司是最专业的河北锅炉清灰剂厂家。<br />\r\n锅炉清灰剂固体燃料在锅炉内燃烧时，锅炉受热面和烟道上都会粘附烟灰。受热面上积灰一毫米厚，导热系数降低50倍左右，使锅炉热效率降低，增加能耗，缩短使用寿命，积灰严重时，不仅热交换恶化，而且，由于烟道阻力增加，会影响锅炉正常运行，甚至还要被迫停炉清除烟灰而影响生产，以往清除烟灰是采用人工清刷或蒸汽吹除不仅劳动强度大、效率低、影响操作人员的健康，而且清灰又不彻底，还易损伤锅炉。本厂生产的锅炉清灰剂能使锅炉管束上的烟灰、硬垢完全脱落，并能在烟灰硬垢脱落后露出金属表面形成一层防腐膜，保护金属受面而不受酸性有害气体，如SO2等腐蚀，从而延长锅炉的使用寿命，减少维修期，提高锅炉热效率。&nbsp;<br />\r\n　　锅炉清灰剂用量：&nbsp;<br />\r\n　　根据用户结的灰垢的厚度而定，通常每吨燃煤加5~15公斤，首次加药建议为正常量的2~3倍，如果烟垢特别严重的可加大用量或持续期，一般为一周左右。使用锅炉清灰剂7-15天内为一个周期。&nbsp;<br />\r\n　　锅炉清灰剂三.使用方法&nbsp;<br />\r\n　　①燃煤锅炉可直接将药投入到炉膛旺火区即可。&nbsp;<br />\r\n　　②必须按规定投药量集中投药效果最佳。&nbsp;<br />\r\n　　③对煤粉炉，沸腾炉和油炉，可直接将药投入旺火区。&nbsp;<br />\r\n　　④按用药量中规定的数量及投药次数使用。&nbsp;<br />\r\n　　⑤新运行没结灰垢的锅炉，用药量为燃料消耗量的千分之2．5。&nbsp;<br />\r\n　　⑥已结灰垢的锅炉，起初投药量为正常时的2―3倍。一般一周左右，灰垢可清除干净，此时可恢复正常投药量。&nbsp;<br />\r\n　　公司的产品得到广大中外客户的欢迎，期待与您真诚的合作<br />\r\n锅炉清灰剂厂家咨询电话：0316-2186676。17060866664.13191966664','wycta417','崔先生','59284339','714385184@qq.com','0316-2186676','0','1','1','','101.75.198.212','河北省联通','1','/attachment/information/201706/pre_1497005057wtz3f.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
