INSERT INTO my_information VALUES ('560','十月细润|桑黄价格|野生桑黄','136','1497059714','365','1528595714','十月细润|桑黄价格|野生桑黄&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	桑黄可以长久吃吗？&nbsp;<br />\r\n	医圣李时珍说：“桑黄味苦，平，无毒，主治：胸中结，益心气，补中，增智慧，不忘，久服轻身不老，延年神仙。”日本京都大学教授直井幸雄说：“桑黄像个傻瓜相机,不需要知道病理、药理,只要按下快门,它就会顺应人的体质,作最适当的调整”。由此可见，桑黄是可以终身服用而百益无一害的健康食品，且无任何禁忌，偶尔吃一次对于长久健康不会有什么太大的作用；只有长期食用桑黄，50岁的人看起来像40岁左右，70岁的人看起来像50岁上下，因此久食桑黄可达到强身健体、返老还童的功效。台湾徐孝思先生，73岁高龄，连续食用桑黄13年，现今望其外形50岁以下，30岁的健康体质，20岁的心理年龄，已得到返老还童之功效，长生不老为其终结追求目标。科学论述，人体细胞历时七年可全部更新一次，因此，当你久食桑黄（七年以上）就会得到陈老先生的返老还童效果。<br />\r\n&nbsp;<br />\r\n	导购：十月细润桑黄&nbsp;<br />\r\n	&nbsp;指定销售商：&nbsp;<br />\r\n	&nbsp;通化十月细润生物科技有限公司&nbsp;<br />\r\n	&nbsp;销售热线：&nbsp;13844598075&nbsp;<br />\r\n	&nbsp;微信：13844598075','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','123.172.233.122','吉林省白城市电信','1','/attachment/information/201706/pre_1497059714pawca.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
