INSERT INTO my_information VALUES ('576','合肥纹眉，绣眉，纹绣培训学校当然米娅国际','136','1497150036','365','1528686036','合肥纹眉，绣眉，纹绣培训学校当然米娅国际<br />\r\n合肥米娅国际，本中心于2012年正式进入合肥，是一家致力于将私人<br />\r\n形象订制、纹绣、翘睫术、美甲、护理服务打造为一体的专业形象中心。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;5年来我们在纹绣行业不断积累经验、追求更高技术更诚信服务每位顾客，现在我们不仅拥有为您塑造美丽的国际先进纹绣技术，更一直禀行“无上责任，更高技术，服务至亲，美好如愿”的鼎诺。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;未来时间里，我们将更加努力让米娅成为安徽合肥爱美人士最信赖的形象订制圣地，也将最时尚的妆容与先进的技术完美结合，这样才能始终走在美妆行业的前沿！<br />\r\n我们对所有想来学习纹眉的创业着的承诺<br />\r\n1.包学到会为止，零基础到精通<br />\r\n2.真人实操，区别于其他机构只是观摩，每个学员都安排真人独立操作<br />\r\n3.老师一对一指导，根据每个学员情况定制不同的学习方案<br />\r\n4.自由安排学习时间，上班也可以休息日学习！<br />\r\n米娅的培训教学没有年龄限制，在家的宝妈或是刚就业出来的女孩们，对美业爱好者，或者像自己变美并且提升自己去改变别人的人群，边上班的可边学习，公司创始人刘兰多次赴国外学习先进的技术，并发展了一支专业的纹绣，翘睫术的培训团队，曾多次赴国外参赛并取得奖项，我们拥有强大的师资团队，让所有学员拥有最好的老师可随时交流教学！即使学成后仍可定期进修解决学术问题！<br />\r\n联系微信：my18356954121&nbsp;&nbsp;&nbsp;电话：18356954121<br />\r\n地址：合肥市黄山路与岳西路交口汇峰大厦','liulan5208','刘兰','290090207','290090207@qq.com','0551-56954121','0','1','1','','211.162.10.125','安徽省合肥市鹏博士长城宽带','1','/attachment/information/201706/pre_14971500361wjj8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('577','杭州减肥代餐奶昔加盟_力淘生物科技_杭州减肥代餐奶昔报价','136','1497151185','365','1528687185','杭州减肥代餐奶昔加盟_力淘生物科技_杭州减肥代餐奶昔报价&nbsp;|&nbsp;魔力俏奶昔<br />\r\n	力淘生物科技|杭州减肥代餐奶昔排名|杭州减肥代餐奶昔报价<br />\r\n	&nbsp;<br />\r\n	快结束高考啦，这个仲夏，最重要的话题是什么？&nbsp;<br />\r\n	当然是――减肥！怎样减肥瘦身&nbsp;<br />\r\n	&nbsp;<br />\r\n	其实大家知不知道单纯的节食、运动都不能有效减肥！&nbsp;<br />\r\n	那怎么才能更好地减肥呢？&nbsp;<br />\r\n	今天给大家介绍一个超有效的产品――魔力俏Fiber39奶昔&nbsp;<br />\r\n	相信大家都对这个产品很熟悉，小编就先从这个产品的历史说起吧：<br />\r\n	1983年，来自澳大利亚的莫莉姐妹（Kellin&amp;amp;Jesse）做了一个了不起的尝试……从此奠基了魔力俏品牌的核心理念。<br />\r\n	&nbsp;<br />\r\n	Kellin&amp;amp;Jesse&nbsp;想“受罪式”的减肥，提倡人们“少吃多动”，然而“多吃少动”是人类的天性，如何能将“受罪式”的减肥转为愉悦的，以“美食塑造快乐健康美丽”为最终目的，进而帮助千千万万因肥胖而饱受健康美丽威胁的人们。广州代餐奶昔&nbsp;<br />\r\n	&nbsp;<br />\r\n	Jesse的晚期生涯，在悉尼担任大学荣誉教授期间，曾将她的这段经历与学生们分享，而在课上的众多学生中，有一位在听完教授分享的故事后深感认同，这一名学生，就是魔力俏的创始人，她以教授的姓氏莫莉（Molly），命名了自己的品牌以纪念教授对她的启蒙…<br />\r\n	&nbsp;<br />\r\n	为了使最终的食品在健康以及营养成分等技术层面无可挑剔，MollyQueens魔力俏斥重金聘请美国国际健康产业联合会的数十名营养师对MollyQueens魔力俏旗下的所有食品进行联合开发。他们根据教授的理念与方法，在现代科学先进的提纯技术支持下，从各种食物里提取出负热量，低血糖的成分，根据人体所需营养成分调配再加以特定的比例进行混合，经过反复试验，成功研制出了MollyQueens魔力俏,能够征服大众味蕾的美味低消化率的系列食品。<br />\r\n	不同于市面上所有食品，MollyQueens魔力俏始终秉承“美食塑造快乐健康美丽”的理念，所谓“快乐”，除了最基本的，所有原料均是纯天然、有益于人体健康以外，“美食”更意味着MollyQueens魔力俏的食品，能够满足人们对美味食物的原始需求，而非难以下咽的，“受罪式”的传统食物。<br />\r\n	&nbsp;<br />\r\n	魔力俏减肥成分&nbsp;<br />\r\n	魔力俏是唯一一款由23种纤体食材和16种营养，全面均衡丰富的营养保证人体所需,提高代谢水平，有利于肝脏合成氧化酶，为肝脏分解脂肪助力！持久维持血糖平稳,可避免餐后脂肪的积累，又可避免血糖降低引起的饥饿感,从而避免了暴饮暴食导致的过多热量摄入！有效减少热量摄入，轻松切断脂肪源头，加大身体脂肪消耗。<br />\r\n	&nbsp;<br />\r\n	魔力俏减肥成分&nbsp;<br />\r\n	1F控制升糖指数，增强饱腹感&nbsp;<br />\r\n	魔力俏Fiber39奶昔精选低升糖指数食材，可持久维持血糖平稳，不会出现因餐后血糖快速上升引起的胰岛素大量分泌，既可避免餐后脂肪的积累，又可避免血糖降低引起的饥饿感，从而避免了暴饮暴食导致的过多热量摄入。所以，采用低升糖指数的食材，使血糖平稳的维持在正常值的下限是维持饱腹感的重要途经。代餐奶昔哪个牌子好&nbsp;&nbsp;<br />\r\n	2F减少热量摄入，加大脂肪消耗&nbsp;<br />\r\n	用纯牛奶调制后一杯魔力俏Fiber39奶昔的热量只有不到200大卡，只有普通一餐的五分之一，每天用魔力俏Fiber39奶昔代替1-2顿正餐可有效减少500-1000大卡的热量摄入，我们人体正常热量摄入需求一天最低需要摄入1000千卡热量，正常身体一天消耗的热量大概为2000-2400千卡的热量，根据人体在摄入热量与消耗处于负平衡状态时，人体机能会动用存储在体内的脂肪，以维持人体生命活动的需要用魔力俏Fiber39奶昔代餐可减少身体热量摄入，加大身体脂肪消耗这样算下来一周正常减1-1.5公斤脂肪是没有问题的，一个月正常减8-12斤是没有问题的。<br />\r\n	3F营养丰富均衡，美味食物&nbsp;<br />\r\n	魔力俏Fiber39奶昔是由23种纤体食材和16种营养成分，一共39种配料里提取出低热量的成分，根据人体所需营养成分调配再加以特定的比例进行混合，调配出征服大众味蕾的美味低消化率食物。其中含人体细胞的7大营养素（蛋白质，纤维，维生素，矿物质，脂肪，碳水化合物，水），41种的微量元素，全面均衡丰富的营养成分既能保证人体所需，提高基础代谢率，形成健康体质，又能促进肝脏合成氧化酶类的物质，为肝脏分解脂肪助力！<br />\r\n	4F健康管理教练全程指导，塑造快乐健康美丽&nbsp;<br />\r\n	经验丰富的健康管理教练一如您的私家健康顾问，全程指导代餐过程，详解食物特性，剖析饮食习惯，确保代餐的同时让您掌握必要的健康知识，塑造快乐健康美丽。<br />\r\n	魔力俏Fiber39奶昔是通过营养均衡，提高代谢水平。持久维持血糖平稳，持续维持饱腹感。可避免餐后脂肪的积累，不会产生多余的脂肪。摄入低热量的食物，加大身体脂肪消耗来实现减肥效果。<br />\r\n	<br />\r\n	<br />\r\n&nbsp;<br />\r\n	魔力俏Fiber39奶昔美体瘦身导师微信（p20140830）','laixunle1','李先生','1925234276','1925234276@qq.com','4008883953','0','1','1','','119.131.77.13','广东省广州市电信','1','/attachment/information/201706/pre_1497151185bu0n1.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
