INSERT INTO my_information VALUES ('592','茶西施建盏诚招全国各地区代理分销，微信号hushui1982','136','1497181840','365','1528717840','诚招全国各地区代理分销，需要看图片咨询的请加微信号hushui1982<br />\r\n	<br />\r\n	在中.国茶文化浩如烟海的长河里，建盏是茶器中令人仰止的高峰，它以朴实的材质、简洁的线条、幻化的斑彩，展示了自然的极致之美，闪烁着深遂的神光。&nbsp;在茶文化复苏的今天，建盏能否像宋代陶谷在《清异录》中所说：“闽中造盏，花纹鹧鸪斑点，试茶家珍之。”研究复原建盏的意义何在？这是喜爱建盏、探索建盏的人必须面对的命题。&nbsp;在科技发达、物质丰富的今天，建盏依然熠熠生辉，光彩照人，因为建盏丰富的内涵，赋予它永恒的生命。<br />\r\n	建盏是心灵的朋友。在商品经济社会里，人们在寻找心灵家园，建盏朴实无化、泰然自若、藏而不露的个性与现代人静思求远，返朴归真，追求闲雅简约的观念不谋而合，小小建盏，盛住了世人的烦心。建盏是中.国茶文化最具形象力的载体，虽默默无语，却集茶、道、禅的意境于一身，是参禅悟道的神器。.','cxsjz345','胡水','462164208','pinjiang88@126.com','0595-87399994','0','1','1','','175.43.80.26','福建省泉州市联通','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
