INSERT INTO my_information VALUES ('610','师大高端|吉安学平面设计哪里好|吉安学平面广告设计哪里好','136','1497246791','365','1528782791','师大高端|吉安学平面设计哪里好|吉安学平面广告设计哪里好&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	吉安平面广告设计培训班,吉安学平面设计哪里好,师大高端<br />\r\n&nbsp;平面设计&nbsp;<br />\r\n	一个视觉作品的生存底线，应该看他是否具有感动他人的能量，是否顺利地传递出背后的信息，事实上她更像人际关系学，依靠魅力来征服对象，事实上平面设计者所担任的是多重角色，平面设计代表着客户的产品，客户需要你的感情去打动他人，平面设计是一种与特定目的有着密切联系的艺术。&nbsp;<br />\r\n	<br />\r\n	1、创意：是平面设计的第一要素，没有好的创意，就没有好的作品，创意中要考虑观众、传播媒体、文化背景三个条件。&nbsp;<br />\r\n	2、构图：构图就是要解决图形、色彩和文字三者之间的空间关系，做到新颖，合理和统一。&nbsp;<br />\r\n3、色彩：好的平面设计作品在画面色彩的运用上注意调和、对比、平衡、节奏与韵律。&nbsp;<br />\r\n	&nbsp;<br />\r\n	我们的优势：&nbsp;<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。&nbsp;<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间&nbsp;<br />\r\n	3.实力师资，我们的老师水平绝对够；&nbsp;<br />\r\n	4.免费试听，推荐就业；&nbsp;<br />\r\n	5.一次不会免费二次重修，过了为止&nbsp;<br />\r\n	<br />\r\n	吉安平面广告设计培训班,吉安学平面设计哪里好,师大高端高端电脑培训中心2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。&nbsp;<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	另外学校开设：&nbsp;室内设计培训&nbsp;&nbsp;平面设计培训&nbsp;&nbsp;园林景观设计培训&nbsp;&nbsp;&nbsp;网页设计培训&nbsp;&nbsp;&nbsp;办公软件培训&nbsp;&nbsp;&nbsp;网络营销培训&nbsp;<br />\r\n	联系人：张老师&nbsp;&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.33.242','江西省南昌市电信','1','/attachment/information/201706/pre_1497246791yvsjd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('611','榆林立体车库最具性价比推荐厂家','136','1497247944','365','1528783944','榆林立体车库最具性价比推荐厂家就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201706/pre_14972479444c2nk.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('612','哈尔滨减肥奶昔代餐供应商,力淘生物科技,哈尔滨减肥奶昔代餐报','136','1497248352','365','1528784352','哈尔滨减肥奶昔代餐供应商,力淘生物科技,哈尔滨减肥奶昔代餐报价&nbsp;|&nbsp;魔力俏奶昔<br />\r\n	力淘生物科技,哈尔滨减肥奶昔代餐厂家,哈尔滨减肥奶昔代餐排名<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	<br />\r\n		最近的调查报告发现，旅行社员工、律师和法官，是最容易让人发胖的职业。其他易“增重”的职业还包括：社工、教师、艺术家、行政助理、医生、警察、消防员、司机、行销/公关人员和资讯科技人员。工作的忙碌未必让人变瘦，反而有40%的人因目前的工作而变胖，超过20%的人体重至少增加4.5公斤，14%的人至少增加9公斤。研究人员调查分析后发现，44%的人整天坐在办公桌前，连吃饭都不曾离开。代餐奶昔哪个牌子好<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		不过，中.国容易发胖的职业与美国略有不同。国内不少调查发现，司机、IT工作者、公司职员、教师、医生等职业较易发胖。专家指出，这些职业需要坐的时间长，工作压力较大。很多人无法理解，为什么明明忙得不可开交，可体重却越来越高呢？除了可能有易胖基因外，一是工作压力大的人，可能会通过喝含糖饮料、吃零食减压，闲下来时吃得更多，运动又不充分，吃进去的能量远远大于消耗的能量；二是工作的紧张会影响神经内分泌系统的正常分泌，比如导致压力激素皮质醇增加，人也容易发胖，而神经的过度兴奋也会让人不知不觉吃得多。<br />\r\n	<br />\r\n	<br />\r\n		但同时爱美又是女人的天性，她们会为了穿上一件好看的衣服或者好看的裙子而选择节食减肥，希望自己可以瘦下来，其实这对身体的照成很大的危害。<br />\r\n	<br />\r\n	<br />\r\n		节食减肥对身体的危害<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		节食减肥危害1：优质蛋白不足<br />\r\n	<br />\r\n	<br />\r\n		大家都知道，人体形成的基本单位是细胞，而细胞的形成主要成分则是蛋白质。既然每个器官都会涉及到蛋白质，那么当我们优质蛋白摄入不足的时候，便会影响整个身体的机能。皮肤变得暗沉、无光泽、易衰老（胶原蛋白流失）；新陈代谢紊乱，内分泌失调，长痘（酶和激素不能充分生成）；抵抗力下降（缺少抗体）；缺乏严重者更会水肿（渗透压无法调节）。<br />\r\n	<br />\r\n	<br />\r\n		节食减肥危害2：各种维生素不足<br />\r\n	<br />\r\n	<br />\r\n		缺少维生素A容易引起肠胃及泌尿系统感染，甚至影响生殖系统。缺少维生素B会使降低碳水化合物及脂肪代谢，易肥胖。缺少维生素会使胶原蛋白合成出现障碍，影响皮肤的弹性及光泽。身体排毒功能出现障碍。抵抗力明显下降。<br />\r\n	<br />\r\n	<br />\r\n		节食减肥危害3：体内蛋白质被消耗<br />\r\n	<br />\r\n	<br />\r\n		营养吸收不足时，身体会优先消耗体内蛋白质而非脂肪！而蛋白质通常不会被完全分解，从而产生自由基！自由基绝对是人体疾病及衰老的罪魁祸首。<br />\r\n	<br />\r\n	<br />\r\n		节食减肥危害4：基础代谢率下降，成为易胖体质<br />\r\n	<br />\r\n	<br />\r\n		长期节食会使我们身体缺乏营养，为了维持生命的正常活动，基础代谢率会降低。这也是节食减肥遇到瓶颈的原因。<br />\r\n	<br />\r\n	<br />\r\n		节食减肥危害5：极易反弹的更高<br />\r\n	<br />\r\n	<br />\r\n		大家都说越减越肥。其真相就是节食减肥带来的这个“功效”。当达到瓶劲减不下来后，很多MM会自暴自弃，开始恢复正常饮食。而此时脂肪细胞由于长时间被抑制，就像紧绷的弹簧恢复了原来的弹性，加速成长及扩张。外加因为节食而低的可怜的基础代谢率，使脂肪如雨后春笋般堆积起来。<br />\r\n	<br />\r\n	<br />\r\n		因为单纯的过度的节食，只会造成身体所需营养素的缺失，致使免疫功能下降，影响身体健康，久而久之，就会感到疲惫、虚弱和易怒，并加大了感染流行性疾病的概率。<br />\r\n	<br />\r\n	<br />\r\n		均衡营养饮食减肥方法魔力俏<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		均衡营养饮食减肥方法主要是通过选用健康、营养的低热量食品，养成健康的饮食习惯，这是受益终身的办法。减肥是生活习惯改变的过程，只有改变了生活习惯才能减肥。减肥没有失败，只有放弃。<br />\r\n	<br />\r\n	<br />\r\n		1、每天定时定量吃好三餐！！！（严禁挨饿）<br />\r\n	<br />\r\n	<br />\r\n		2、不吃夜宵与西式快餐。<br />\r\n	<br />\r\n	<br />\r\n		3、每天喝至少2升水（1热水瓶或10杯）。<br />\r\n	<br />\r\n	<br />\r\n		4、每天吃一个苹果与400克蔬菜（除四季豆、嫩大豆、黄花菜太生是有毒素的，其它越生越好）。<br />\r\n	<br />\r\n	<br />\r\n		5、避免吃煎、炸食品、蛋黄（1个蛋黄等于6个蛋白的热量）、动物油、高脂肪高热量食品。<br />\r\n	<br />\r\n	<br />\r\n		6、蔬菜最好是凉拌，凉拌用油少，营养又好。汤其实没什么营养，而盐和油又很多，千万别吃。<br />\r\n	<br />\r\n	<br />\r\n		7、延长进食时间可降低食欲，（胃饱后把饱的信息传到大脑需15分钟）<br />\r\n	<br />\r\n	<br />\r\n		8、用餐顺序应该先蔬菜，再粮食加蔬菜，最后肉类，这种顺序能使您多吃蔬菜，少吃粮食与肉类。<br />\r\n	<br />\r\n	<br />\r\n		9、&nbsp;不吃含高脂、高盐或高糖的零食。如：瓜子、果仁、果冻、蜜饯（这是水果舍去维生素与水分后，留下糖与渣的垃圾食品）。<br />\r\n	<br />\r\n	<br />\r\n		10、猪肉的脂肪含量高，含有可以快速长肉的激素，尽量少吃可选择羊肉、兔肉、贝类等。<br />\r\n	<br />\r\n	<br />\r\n		11、少吃肉后最好每天吃些豆制品，还要吃鱼，用于补充钙与蛋白质，一般海水鱼比淡水鱼好，带鱼很好，全部是野生的，淡水鱼中草鱼是很少吃饲料的。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n&nbsp;<br />\r\n	魔力俏Fiber39奶昔美体瘦身导师微信（p20140830）','laixunle1','李先生','1925234276','1925234276@qq.com','4008883953','0','1','1','','119.131.77.13','广东省广州市电信','1','/attachment/information/201706/pre_1497248352bkued.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('613','十月细润_桑黄批发_桑黄供应商','136','1497250115','365','1528786115','十月细润_桑黄批发_桑黄供应商&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	桑黄可以长久吃吗？&nbsp;<br />\r\n	医圣李时珍说：“桑黄味苦，平，无毒，主治：胸中结，益心气，补中，增智慧，不忘，久服轻身不老，延年神仙。”日本京都大学教授直井幸雄说：“桑黄像个傻瓜相机,不需要知道病理、药理,只要按下快门,它就会顺应人的体质,作最适当的调整”。由此可见，桑黄是可以终身服用而百益无一害的健康食品，且无任何禁忌，偶尔吃一次对于长久健康不会有什么太大的作用；只有长期食用桑黄，50岁的人看起来像40岁左右，70岁的人看起来像50岁上下，因此久食桑黄可达到强身健体、返老还童的功效。台湾徐孝思先生，73岁高龄，连续食用桑黄13年，现今望其外形50岁以下，30岁的健康体质，20岁的心理年龄，已得到返老还童之功效，长生不老为其终结追求目标。科学论述，人体细胞历时七年可全部更新一次，因此，当你久食桑黄（七年以上）就会得到陈老先生的返老还童效果。<br />\r\n&nbsp;<br />\r\n	导购：十月细润桑黄&nbsp;<br />\r\n	&nbsp;指定销售商：&nbsp;<br />\r\n	&nbsp;通化十月细润生物科技有限公司&nbsp;<br />\r\n	&nbsp;销售热线：&nbsp;13844598075&nbsp;<br />\r\n	&nbsp;微信：13844598075','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','36.49.148.7','吉林省吉林市电信','1','/attachment/information/201706/pre_1497250115obwak.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('614','厦门生锈复古灯箱品牌定制厂家哪里有','136','1497253579','365','1528789579','生锈灯箱产生的条件<br />\r\n当今社会，城市的夜晚灯箱招牌随处可见，吸引眼球的灯箱是所有商家渴望拥有的，不惜代价！现如今，<br />\r\n您拥有了他们渴望的东西――生锈灯箱。生锈灯箱，有着国际领先直角折边技术，颠覆传统，助您实现梦想！<br />\r\n生锈灯箱，作为一种创意产品，广泛适用于商场超市、商业中心、大型建筑、单位招牌、宾馆酒楼、美容美发、银行、火车站、汽车站、大型展会、烟酒商店、网吧、足疗洗浴、服装店、饰品店、五金建材店、手机店、电话亭、汽修汽配、洗车、舞厅、KTV等室内外广告，深受喜爱，它彻底颠覆传统呆板的广告招牌表现形式，使消费者产生浓厚兴趣和好奇心，纷纷驻足观看。<br />\r\n生锈灯箱的应用<br />\r\n生锈灯箱，还可应用于影楼、室内外软装饰、工艺礼品业等，用途广泛。<br />\r\n1、节能环保，政策支持。　LED是目前公认的节能的光源之一，无噪音、无发热、无电弧、无高压启动，安全可靠，寿命长达10万小时；24小时用电小于0.5度/m2，比其它光源节能90%。国家启动“白天美化，夜间亮化”全民节能工程，产品均采用LED，直接推动节能光源的普及，潜力巨大。<br />\r\n2、复古创意，引人注目。　生锈灯箱，利用传统的灯箱材料和独特的技术制作而成，十分具有创意吸引客户的眼球。<br />\r\n适用范围<br />\r\n1、婚沙摄影、家庭装饰；<br />\r\n2、室内外指示牌；<br />\r\n3、大型展览工程或活动展览展示；<br />\r\n4、商场、银行、宾馆、酒店、等墙面装饰宣传；<br />\r\n5、机场、地铁、车站、公交站台等广告媒体；<br />\r\n6、工艺礼品；<br />\r\n7、广告牌；<br />\r\n8、店铺招牌、标示。<br />\r\n厦门金顶峰文化传播有限公司（www.xmggzz.com），是一家大型专业从事广告字、发光字、吸塑灯箱、LED吸塑字、LED显示屏、吸塑标识、广告灯箱、广告标识、新型广告产品的设计、开发、制作和安装，一条龙服务的专业综合性广告传媒公司。<br />\r\n公司自创立以来，始终秉承“协同、创新、卓越”&nbsp;的经营理念，致力于广告标识标牌的设计、制作、安装，技术领域涵盖户外广告、吸塑灯箱、亚克力工艺品、大型钢结构架、LED夜景工程、标识广告系统工程、平面发光字工程、导示系统工程。在政府、电信、商场、金融、院校、宾馆、等领域取得了良好成绩。<br />\r\n以几年的努力积累，我们深入了各个领域，品牌家电（格力、美的、海尔）、大型商超，餐饮连锁店（安德鲁森、德克士）、大牌体育服饰（匹克运动、鸿星尔克、乔丹体育）等。<br />\r\n欢迎广大用户咨询了解，<br />\r\n电话：1855666676&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;彭立峰经理。','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','1','1','','121.204.218.199','福建省厦门市电信','1','/attachment/information/201706/pre_14972535795dr7c.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('615','青州管家婆|青州管家婆进销存财务软件找青州梦雅科技','136','1497256015','365','1528792015','潍坊梦雅科技有限公司是一家集销售、服务于一体的综合性软件公司，本着以互利共赢为原则，以互信求安全，以互利求合作，共同解决当前企业面临信息化管理难的问题，全面优化企业流程，快速整合企业资源，最大化的帮助企业提升核心竞争力。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;公司现经营产品包含：软件定制开发项目，（思迅、用友、管家婆）财务软件、进销存软件、生产管理软件、企业erp软件等、潍坊企业网站的建设，涉及软件领域多个行业；其中管家婆代理地区有：潍坊管家婆软件总代理、青州管家婆软件总代理、临朐管家婆软件总代理、寿光管家婆软件总代理、高密管家婆软件总代理、诸城管家婆软件总代理、昌邑管家婆软件总代理、昌乐管家婆软件总代理、安丘管家婆软件总代理、帮企业全面性的优化信息管理。青州市博雅电子商贸有限公司www.qingzhouboya.com<br />\r\n电话：13406618827&nbsp;&nbsp;13864617160<br />\r\n一店：青州市鸿翔家电数码广场西北角-梦雅科技<br />\r\n二店：青州市百货大楼电脑城东北角-博雅办公<br />\r\n公司官网：www.qingzhouboya.com','bydzgs168','梦雅','364949376','2262363225@qq.com','0138-64617160','0','1','1','','182.32.200.56','山东省济南市电信','1','/attachment/information/201706/pre_1497256015ffnzj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('616','师大高端|九江室内装潢设计班|九江学室内装潢设计哪里好','136','1497257486','365','1528793486','师大高端|九江室内装潢设计班|九江学室内装潢设计哪里好&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	九江室内装潢设计班_九江学室内设计哪里好_师大高端<br />\r\n&nbsp;<br />\r\n	室内装潢设计<br />\r\n	九江室内装潢设计班_九江学室内设计哪里好_师大高端课程安排：<br />\r\n	【1】Photoshop初中级图像处理课程。<br />\r\n	【2】AutoCAD初中级课程<br />\r\n	【3】手绘课程<br />\r\n	【4】Auto&nbsp;CAD高级课程<br />\r\n	【5】三维造型设计：3Ds&nbsp;Max（二维与三维造型建模、材质编辑、灯光环境设置、效果图渲染输出等）<br />\r\n	【6】三维渲染输出：3D&nbsp;V-ray(V-ray渲染器概况、V-ray&nbsp;材料编辑器、V-ray&nbsp;灯光系统、V-ray材质与灯光综合应用、V-ray&nbsp;渲染输出)+Photoshop效果图后期处理<br />\r\n	【7】专业课程：<br />\r\n	1、室内预算及造价。<br />\r\n	2、装饰材料及施工工艺（掌握水泥、石材、陶瓷、S玻璃、板材、涂料、织物、塑料、金属、灯具、洁具、胶粘剂等各种材料的性能特点和应用范围，学习施工过程中质量管理的方法）；<br />\r\n	3、谈单技巧：进行一次成功的签单需要哪些步骤，注意哪些事项，谈桌上的利益、礼仪都是我们要学习的内容<br />\r\n	4、工地实践：导师带领学员们一起实际量房实践，在工地现场，以平时的理论与工地的实践相结合，让所学的理论知识以及对材料的了解，以及材料的运用，在施工现场得到最直观的理解。&nbsp;<br />\r\n	5、毕业设计：专项设计训练做方案（居住空间设计、办公空间设计案例、商业空间设计案例、餐饮酒店装修案例、展示空间设计等）<br />\r\n	&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	九江室内装潢设计班_九江学室内设计哪里好_师大高端高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。<br />\r\n	九江室内装潢设计班_九江学室内设计哪里好_师大高端另外学校开设&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	联系人：&nbsp;张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.33.242','江西省南昌市电信','1','/attachment/information/201706/pre_1497257486cftad.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('617','丹东减肥奶昔代餐品牌|丹东减肥奶昔代餐厂家|力淘生物科技','136','1497258625','365','1528794625','丹东减肥奶昔代餐品牌|丹东减肥奶昔代餐厂家|力淘生物科技&nbsp;|&nbsp;魔力俏奶昔<br />\r\n	丹东减肥奶昔代餐图片_力淘生物科技_丹东减肥奶昔代餐品牌<br />\r\n	<br />\r\n	<br />\r\n	每个女生的生活里都有这么一个朋友常抱怨自己的身材差但又不肯少吃一口饭多走一步路，这类人面对食物时最常说的一句话就是“都这么胖了，还吃什么吃”但其实呢。一点都没少吃好吧当你看到她吃的如此忘形想提醒她还在减肥时她的回答又是这样的“哎呀，吃完这顿再减啦”真的，对此我只能微微一笑再加个白眼，表示我无奈说。代餐奶昔减肥&nbsp;<br />\r\n	别人再怎么说你胖你自己不说减肥这都不是问题，只能说其他人多嘴但你每天说着减肥却又吃的比谁都多这就是你的不对了。你减肥的目的可能是因为他人的言论，可能是因为自己的健康，可能是因为想要的身材，不管原因如何只要想减肥成功除了你自己的努力别人帮不了你什么。<br />\r\n	&nbsp;<br />\r\n	说着减肥但又大吃大喝的人其实比谁都渴望瘦身，成功之所以这么做的原因不仅仅因为意志力还有一个更重要的原因就是他们对自己没有信心。每天想着自己瘦不下来怎么可能瘦的下来嘛那些瘦身成功的人都是每天对自己说“我一定会瘦下来的”给自己一点积极的暗示也会让减肥变得容易的多。减肥的过程，就是一场安全无风险的整容手术。减肥变化的绝不只体型，还有脸蛋、气质和心情。减肥是女人一生的事业所以不只是你一个人在进行不放弃自己身材的女人生活得都不会太差。如何快速减肥&nbsp;<br />\r\n	&nbsp;<br />\r\n	<br />\r\n		长按下方可以复制，再去微信添加好友<br />\r\n	<br />\r\n	<br />\r\n		baby-smdk<br />\r\n	<br />\r\n	<br />\r\n		加了微信后，请私信美体瘦身导师你的具体情况，看看美体瘦身导师怎么说！<br />\r\n	<br />\r\n地址：广东广州广州市天河区天河软件园，联系电话：4008883953','laixunle1','李先生','1925234276','1925234276@qq.com','4008883953','0','1','1','','119.131.77.13','广东省广州市电信','1','/attachment/information/201706/pre_1497258625t8xom.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
