INSERT INTO my_information VALUES ('635','南昌室内建筑培训班|师大高端|南昌室内设计速成班','136','1497336141','365','1528872141','南昌室内建筑培训班|师大高端|南昌室内设计速成班<br />\r\n&nbsp;<br />\r\n	室内设计师培训目标<br />\r\n培养学员掌握室内设计的基本理论到高级专业知识，能从事室内装修、室外建筑大厦，园林规划、家具设计及技术与管理的高级技术应用性专门人才<br />\r\n	南昌室内建筑培训班|师大高端|南昌室内设计速成班培训课程<br />\r\n1、、Auto&nbsp;CAD&nbsp;从基础工具到综合制图高级技法。涵盖家装、工装、园林、室外建筑、机械等各类图纸的绘制，平、立、剖面图，水电路图、施工图等。<br />\r\n2、3D&nbsp;max&nbsp;室内设计：客厅、卧室、跃层、别墅、商场、饭店、大堂等复杂家装、工装室内制图。室外设计：民用小区建筑、商业大厦、全景鸟瞰图、园林规划图、城市景观图、建筑立面图、门脸装修图等室外效果图制作技法。<br />\r\n3、Vray&nbsp;高级渲染参数精讲，渲染流程和各面板的参数详解及常用参数设置、真实材质、真实灯光技巧，快速渲染技巧，照片级高质量出图技法等。<br />\r\n4、Photoshop<br />\r\n涵盖室内外效果图后期美化修饰，建筑动画材质贴图制作，影楼照片处理、平面设计应用等<br />\r\n5、设计师专业课装饰材料、施工工艺，装修预算，报价技巧，客户心理学，签约技巧，量房，岗前培训等高级设计师必备素质。<br />\r\n6、建筑风水正确认识风水，风水古今现状，风水原理，石家庄风水建筑分析，风水故宫、风水常识，身边的风水剖析，建筑装饰行业风水运用。<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n南昌室内建筑培训班|师大高端|南昌室内设计速成班&nbsp;&nbsp;南昌高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。&nbsp;<br />\r\n	&nbsp;<br />\r\n另外学校开设&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训&nbsp;<br />\r\n	&nbsp;<br />\r\n	联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.33.61','江西省南昌市电信','1','/attachment/information/201706/pre_1497336141xxtto.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
