INSERT INTO my_information VALUES ('640','12338妇女维权服务热线系统','136','1497338946','365','1528874946','12338妇女维权服务热线系统<br />\r\n<br />\r\n具体内容请查阅：<br />\r\nhttp://www.boyucom.com/<br />\r\nhttp://www.boyucom.com/solution.htm<br />\r\nhttp://www.boyucom.com/BYICCdetails.htm<br />\r\n<br />\r\n妇女儿童维权可打12338公益热线<br />\r\n<br />\r\n在深拨打，可获所在辖区区妇联提供的法律、政策、心理等咨询服务。<br />\r\n<br />\r\n　　今天是国际反家庭暴力日，深圳市“12338”妇女儿童维权公益服务热线将正式开通至各区妇联，妇女儿童在深圳使用移动手机、固定电话拨打12338，根据语音导航选择所在辖区的区妇联，可获得法律、政策、心理等方面的咨询服务。<br />\r\n<br />\r\n　　12338妇女儿童维权公益服务热线是妇联组织为广大妇女群众提供法律、政策、心理等咨询服务，接受侵权投诉，化解矛盾纠纷的社会公益服务专用号码。2006年4月18日，深圳市妇联开通全国统一的妇女维权公益服务热线电话“12338”，咨询内容包括与妇女儿童有关的政治权益、财产权益、婚姻家庭权益、教育权益、劳动权益等各方面权益内容。<br />\r\n<br />\r\n　　此次12338热线开通至各区妇联，妇女儿童可通过拨打12338热线向各级妇联组织反映情况，提出意见、建议或诉求。各级妇联组织将高效、快捷地对来电反映的事项做协调工作；对来电的妇女儿童在生活、工作中遇到的各种问题和纠纷进行咨询解答，使其了解相关法律、法规，合法维护自身权益。<br />\r\n<br />\r\n　　据悉，市、区妇联组织将定期安排妇联领导、律师志愿者接听12338热线。为提高12338妇女儿童维权公益服务热线咨询员和综治联系点维权骨干的业务素质，11月22日至23日，市妇联举办培训班，市、区妇联分管主席、维权干部、热线咨询员等近50位人员参加。<br />\r\n<br />\r\n　　妇女儿童易成家暴受害者<br />\r\n<br />\r\n　　今天是国际反家庭暴力日，专家称传统的“棒子出孝子”观念要改变。<br />\r\n<br />\r\n　　不久前“李阳打妻”事件使“反对家庭暴力”再次成为全社会关注话题。近日，记者在采访中获悉，家庭暴力的主客体并不局限于夫妻之间，受“棒打出孝子”传统观念影响，少年儿童也成为家庭暴力受害者。<br />\r\n<br />\r\n　　日前，市政协与市广电集团联合举办“政协论坛”，邀请市妇联副主席原丽萍、罗湖区妇联主席罗安娜和市律师协会民事法律业务委员会主任邓香花，共同探讨中.国家暴的特点并为遏制家庭暴力支招。<br />\r\n<br />\r\n　　原丽萍说，以前的妇女在家庭暴力面前选择“忍气吞声”，现在越来越多的女性走上用法律为自己维权的道路，但却发现现行法律对家暴受害者的保护非常有限，受害者难以得到有效救济，也难以对施暴者做到及时惩治。<br />\r\n<br />\r\n　　邓香花说，我国《儿童权益保护法》和《妇女权益保护法》都只是宣誓性的法律，《婚姻法》对家庭暴力只作了保护性界定，其保护力度还急需加强。《治安管理处罚条例》规定，施暴者对受害者造成轻微伤，将处以200元以下罚款，3日以上15日以下拘留。如若上升到这一层面，作为受害者一方的家庭成员亦有所顾忌。可喜的是，根据我国最高法院有关精神，已有部分地方法院试点“人身保护令”，利用法律威慑力对可能遭遇家庭暴力的人提供人身保护。<br />\r\n<br />\r\n　　邓香花说，受“棒打出孝子”传统观念的影响，少年儿童往往也成为家庭暴力的受害者。此外，家庭中经济责任比较大的人往往更容易成为施暴者，他们往往把作为社会角色的压力对家里的弱者宣泄。<br />\r\n<br />\r\n　　据悉，罗湖区在2004年成立区一级家庭暴力保护中心，该中心由公安、妇联、检察院等10个分工明确的部门组成。该区每个街道都设一个反家庭暴力中心，每个社区设一个报案点。家庭暴力中心聘请志愿者作为“千里眼”和“顺风耳”，在社区出现家庭暴力时能第一时间赶到现场调解纠纷或报案。<br />\r\n<br />\r\n目前，国内已经有众多的具有数据库应用软件{如MIS系统或ERP系统或OA系统或GIS系统或网站等C/S结构或B/S结构或C/S与B/S相结合结构的数据库应用程序}开发力量但不了解呼叫中心工作原理的企业（最终用户、经销商、IT/网络/电子/通讯企业等）/政府机关单位采用博域通讯一体化呼叫中心平台产品BYICC2.0开发成功了他们的具有个性化数据库应用（CRM）功能的呼叫中心系统。<br />\r\n<br />\r\n凭借创新的设计、领先的技术优势、软硬件平台一体化、高度的产品化、电信级的稳定性、丰富的规模商用经验、快速便捷的安装实施、简单人性化的维护管理、功能的强大性、系统平滑升级的方便性、软件二次开发的高度&quot;平民化&quot;以及优良的性价比，博域通讯一体化呼叫中心平台产品BYICC2.0赢得了越来越多的系统集成商/合作伙伴/最终用户的信赖和认可，并成为其呼叫中心系统领域最重要的合作伙伴。<br />\r\n<br />\r\n作为业界先进成熟的高度集成的呼叫中心系统基础平台(一体化语音交换平台)和产品化程度非常高的通用呼叫中心系统(呼叫中心一体机)，博域通讯一体化呼叫中心平台产品BYICC2.0广泛适用于：各类企业/商业机构/呼叫中心外包运营商建设客户服务中心（呼叫中心，CALL&nbsp;CENTER）系统/商务流程外包（BPO）呼叫中心系统，政府部门/公共事业机构建设呼叫中心（Call&nbsp;Center）系统/电话语音服务系统/便民服务热线系统{如95598电力客户服务中心系统/12398电力监管投诉举报热线系统，12360海关统一服务热线系统，12316新农村服务热线系统/农业科技“110”信息服务热线系统/12316“三农”服务热线系统，12338妇女维权服务热线系统，12333劳动和社会保障电话服务中心系统，12371党员咨询服务热线系统，12355青少年服务台系统，12366纳税服务热线系统，12365质监热线系统，12369环保投诉热线系统，12319城建热线系统，12348法律服务热线系统，12315消费者投诉热线系统，12345政府热线系统，12350安全生产举报投诉服务热线系统，12320公共卫生电话服务热线系统，110/119/122三台合一指挥调度系统或城市应急联动系统或城市公共安全指挥中心系统，96520交通运输信息服务热线系统，12388纪检监察举报热线系统，12301旅游资讯公益服务电话平台/12301旅游服务热线系统，12356人口计生阳光热线服务系统，96319住房公积金服务热线系统，12312商务综合执法投诉服务热线系统，12322防震减灾公益服务热线系统，检察机关12309职务犯罪举报热线系统，统计局12340社情民意调查服务热线系统，12368司法信息公益服务系统，12309检察院投诉举报热线系统，12349社区服务热线系统，居家养老服务系统，残联呼叫中心系统，家政服务网络中心呼叫中心系统，中.国和谐服务工程等}。<br />\r\n<br />\r\n<br />\r\n<br />\r\n深圳市博域信源通讯有限公司&nbsp;版权所有?；&nbsp;网址:&nbsp;www.boyucom.com&nbsp;电子邮件:&nbsp;boyucom2006@163.com&nbsp;电话：0755-86172837,86172940','boyucom2006','陈小艺','','boyucom2006@163.com','0755-86172837','0','1','1','','14.103.237.143','广东省深圳市鹏博士长城宽带','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('641','浙江电解富氢水机品牌,浙江电解富氢水机图片,广州健益环保','136','1497339393','365','1528875393','浙江电解富氢水机品牌,浙江电解富氢水机图片,广州健益环保&nbsp;|&nbsp;广州市健益环保科技有限公司<br />\r\n	广州健益环保,浙江电解富氢水机工厂,浙江电解富氢水机报价<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	央视广告词：健康好生活，健宜陪伴我！&nbsp;<br />\r\n	央视上榜家用电解水机宣传片视频：http://www.gzjianyi.cn/video.html&nbsp;<br />\r\n	联系人：曹先生&nbsp;<br />\r\n	手机：13751831987&nbsp;<br />\r\n	QQ：2850613130&nbsp;<br />\r\n	公司网址：http://www.gzjianyi.cn&nbsp;<br />\r\n	地址：广州市黄埔区南湾工业区6栋3楼&nbsp;<br />\r\n	主营：电解水机，生态仪，负离子空气净化器，车载空气净化器&nbsp;<br />\r\n&nbsp;<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	健宜电解水机的选择安装位置&nbsp;<br />\r\n	a、确定安装位置:以使用方便美观为原则，一般在水槽上方，距离火源处&nbsp;至1.0米，距离电磁炉或微波炉至少1米，要避免阳光直射。&nbsp;<br />\r\n	b、检测水源的TDS、pH值，确认水源----市政合格自来水。&nbsp;<br />\r\n	C、检查水压:水压过小建议用户安装增压泵，正常水压0.1-0.4MPa。&nbsp;<br />\r\n	d、检查电源:电源插座接触是否良好，电压是否稳定，插座是否接有地线确保接地安全。机器电源插座醉好单独使用。&nbsp;<br />\r\n	e、检查冷水管是否有老化现象。&nbsp;<br />\r\n	<br />\r\n	电解水对人体有什么好处？<br />\r\n1）离子水是小分子团水，具有活性，能快速被人体所吸收，及时补充人体水分。<br />\r\n2）离子水是碱性水，能中和人体的酸性废物，清除自由基，饮用初期对亚健康人群和一些慢性疾病具有较明显的改善作用。<br />\r\n3）运输营养：水将充分溶解的营养素运至细胞，水还转运折各种生<br />\r\n物活性物质，如：激素、酶、血小板、血细胞等。水使细胞的代谢过程后化学功能顺利进行。<br />\r\n4）平衡体温：水在吸收热量后，自身温度变化相对较小，由于这种<br />\r\n溶热能力，水通过吸收热量，产生和蒸发汗液释放热量以帮助机体调<br />\r\n节体温，保持体温正常。<br />\r\n5）维护细胞：水是人体结构的重要成分。它促进细胞的新陈代谢，<br />\r\n参与维持细胞的正常形态和完整细胞膜的组成。它还通过其缓冲作用<br />\r\n保持整个脏，，器。机体结构的维持也需要它的帮助，保持皮肤的润滑和<br />\r\n弹性，细胞的水合状态和机体的调节对于维护细胞正常功能具有关键<br />\r\n作用。','hgsyt359','曹','2850613130','gzjianyi6@163.com','020-82088760','0','1','1','','116.23.93.128','广东省广州市电信','1','/attachment/information/201706/pre_1497339393ox7e8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
