INSERT INTO my_information VALUES ('649','夏洛莱牛的育肥管理','136','1497355935','365','1528891935','夏洛莱牛的育肥管理&nbsp;|&nbsp;山东盛强牧业<br />\r\n1：每百头肉牛需1―1.5亩<br />\r\n2：牛粪可以用来做沼气，种植蘑菇等菌类。<br />\r\n四：养牛成本<br />\r\n1：短期育肥：如进400―500斤肉牛，饲养5―6个月。每头牛需成本2800―3500元牛款。（肉牛）<br />\r\n2：长期催肥：如进250―350斤小肉牛，饲养7―8个月。每头牛需成本1400―2000元肉牛款。（肉牛）<br />\r\n五：饲料分析<br />\r\n1：粗饲料&nbsp;每头牛每天需干草6―10斤，如果鲜草12―20斤，小牛均减。<br />\r\n2：精料&nbsp;肉牛斤料，也就是说500斤的牛每天两次共计5斤精料。800斤的牛每天两次共计8斤精料。<br />\r\n3：精料的配比&nbsp;60%玉米面，25%麸皮，15%棉豆簸或菜籽饼，5%豆簸。每斤精料预计0.8元左右。<br />\r\n4：每30头肉牛每天使用食盐1斤，如使用酒糟需加少量苏打粉、酵母粉。<br />\r\n六：人工、水电<br />\r\n每百头小肉牛2名饲养员，1名管理员月工资每人在600元左右。水电因地适宜。','lsdjxsqmy','范经理','510571666','sdjxwjmy@126.com','0537-13793793711','0','1','1','','39.68.236.141','山东省联通','1','/attachment/information/201706/pre_1497355935hxrgg.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
