INSERT INTO my_information VALUES ('673','衡水桥闸,甘肃板式橡胶支座,板式橡胶支座','136','1497434088','365','1528970088','板式橡胶支座<br />\r\n&nbsp;<br />\r\n	橡胶支座是由多层薄钢板与多层橡胶片硫化粘合而成一种普通橡胶支座产品,这种产品具有足够的竖向刚度,能够将支座上部构造的反力可靠的传递给墩台,支座具有良好的弹性,以应对桥梁的梁端的转动；又有较大的剪切变形能力，以满足上部构造的水平位移。具有构造简单、安装方便、节省钢材、价格低廉、养护简便、易于更换等特点。在板式支座表面粘复一层1.5mm-3mm厚的聚四氟乙烯板,就能制作成聚四氟乙烯滑板式橡胶支座它除了竖向钢度与弹性变形,能承受垂直荷载及适应梁端转动外,因聚四氟乙烯板的低摩擦系数,可使梁端在四氟板表面自由滑动,水平位移不受限制,特别适宜中、小荷载,大位移量的桥梁使用。<br />\r\n	产品划分：<br />\r\n	一、矩形（圆形）板式橡胶支座（GYZ、GJZ）<br />\r\n	（一）性能：本产品由多层橡胶片与薄钢板镶嵌、粘合压制而发。有足够的竖向刚度以承压垂直荷载，能将&nbsp;上部构造的反力可靠地传递给墩台，有良好的弹性，以适应梁端的转动；又有较大的剪切变形以满足上部&nbsp;构造的水平位移。<br />\r\n	（二）特点：本产品在桥梁建筑、水电工程、房屋抗震设施上已广泛应用，与原用的钢支座相比，有构造&nbsp;简单，安装方便；节约钢材，价格低廉；养护简便，易于更换等优点，且本品建筑高度低，对桥梁设计与降低造价有益；有良好的隔震作用，可减少活载与地震力对建筑物的冲击作用。<br />\r\n	二、四氟乙烯滑板板式橡胶支座(GYZF4、GJZF4)<br />\r\n	（一）特点：本产品是于普通板式橡胶支座上粘接一层厚1.5-3mm的聚四氟乙烯板而成。除具有普通板式橡&nbsp;胶支座的竖向刚度与弹性变形，能承受垂直荷载及适应梁端转动外，因四氟乙烯与梁底不锈钢板间的低摩擦系数（μ≤0.03）可使桥梁上部构造的水平位移不受限制。<br />\r\n	适用范围：<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;板式橡胶支座是公路中小型桥梁中比较常用的产品，它分为普通板式橡胶支座、四氟板式橡胶支座。对于普通型桥梁支座适用于跨度小于30m、位移量较小的桥梁.不同的平面形状适用于不同的桥跨结构,正交桥梁用矩形支座;曲线桥、斜交桥及圆柱墩桥用圆形支座。<br />\r\n	对于四氟乙烯板式橡胶支座适用于大跨度、多跨连续、简支梁连续板等结构的大位移量桥梁.它还可用作连续梁顶推及T型梁横移中的滑块.矩形、圆形四氟板式橡胶支座的应用分别与矩形、圆形普通板式橡胶支座相同。<br />\r\n	电话：0318-2209900，李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','121.17.85.113','河北省衡水市武邑县联通','1','/attachment/information/201706/pre_14974340888nqpx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
