INSERT INTO my_information VALUES ('693','南昌暑期网页设计速成班,师大高端,南昌网页设计培训速成班','136','1497519065','365','1529055065','南昌暑期网页设计速成班,师大高端,南昌网页设计培训速成班&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	师大高端,南昌暑期网页设计速成班,南昌最好的网页设计培训班<br />\r\n	南昌暑期网页设计速成班&nbsp;课程设置：<br />\r\n【1】Photoshop初中级图像处理课程。<br />\r\n具备图像编辑、图像合成、校色调色及特效制作等强大功能的图像处理软件，集图像输入与输出于一体，深受广大平面设计人员和电脑美术爱好者的欢迎。<br />\r\n【2】Dream&nbsp;weaver网页设计<br />\r\n集网页制作和管理网站于一身的所见即所得网页编辑器，利用它可以轻而易举地制作出跨越平台限制和跨越浏览器限制的充满动感的网页。&nbsp;<br />\r\n【3】Flash动画设计<br />\r\n是一种动画创作与应用程序开发于一身的创作软件，通过添加图片、声音、视频和特殊效果，构建包含丰富媒体的Flash应用程序。<br />\r\n【4】后台程序+数据库开发：（ASP.NET或PHP课程二选一学习）<br />\r\n1、PHP动态网站开发+My&nbsp;SQL数据库开发（参与实站B2C电子商务网站开发）。<br />\r\n2、ASP.NET动态网站开发+SQL数据库开发（web&nbsp;service技术，熟悉MVC三层架构技、B/S架构的网站开发（参与实战B2C电子商务网站开发）。<br />\r\n【5】SEO网站优化技术<br />\r\n1、对网站进行优化，提高排名，更容易搜索网站（搜索引擎蜘蛛跟踪分析，页面最佳SEO布局，内部链接优化布局操作等）<br />\r\n2、综合实践＋实际项目开发（B2C电子商务网站实践开发）。<br />\r\n【6】商务礼仪与就业指导课程（免费赠送课程）<br />\r\n1、求职技巧与就业岗位选择技巧；<br />\r\n2、面试技巧与礼仪，掌握面试仪容仪表、着装、姿势仪态的注意要点；<br />\r\n3、商务场合中待人接物、语言艺术的技能；<br />\r\n4、掌握拜访客人时的礼仪――公司推销的成功砝码。<br />\r\n南昌暑期网页设计速成班就业方向：网页设计师、网页美工设计师、网站开发工程师、游戏开发工程师。<br />\r\n	&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	师大高端,南昌暑期网页设计速成班,南昌最好的网页设计培训班高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。<br />\r\n	另外我校还开设：&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	&nbsp;<br />\r\n	联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.33.61','江西省南昌市电信','1','/attachment/information/201706/pre_1497519065dhqbr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('694','桥闸_天津GPZ(KZ)抗震盆式橡胶支座_山西GPZ(KZ)','136','1497520062','365','1529056062','GPZ(KZ)桥梁抗震盆式橡胶支座&nbsp;<br />\r\n	&nbsp;&nbsp;GPZ(KZ)抗震盆式橡胶支座简介及原理&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;GPZ(KZ)抗震盆式橡胶支座包括固定支座、单向活动支座和双向活动支座三种型式，支座规格按JT391-1999要求分为31级。支座竖向设计承载力、支座转角、支座摩擦系数及位移均按标准要求设计。仅固定支座各方向和单向活动支座非滑移方向的水平力由原支座设计承载力的10%提高至20%。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;产品符合中华人民共和国交通行业标准《公路桥梁盆式橡胶支座》（标准号JT391)及公路工程抗震设计规范（JTJ004&nbsp;)标准要求。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;目前，国内外采取的是刚性抗震法和柔性减震法，刚性抗震需增大结构（包括基础结构和抗震支座结构）尺寸，柔性减震的特点是：减震性能好而刚度较小，在较大地震波的情况下有被破坏的可能。该系列支座采取了刚、柔结合等有效抗震措施，增大了支座的耗能能力，极大的改善了支座的抗震性能，因此地震发生时可提高桥梁的抗震能力，最大限度的限制了桥梁上下部结构之间的相对位移，减小了地震力的放大系数。非地震时等同一般盆式橡胶支座使用。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;由于GPZ(KZ)抗震盆式橡胶支座设计有固定支座和单向活动支座，两种型式支座配合使用比仅在桥梁固定墩上设D抗震支座对提高全桥结构的抗震能力是更为有利的。&nbsp;<br />\r\n	二、结构特征&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;GPZ(KZ)GD(固定抗震盆式橡胶支座)，主要由上座板、消能板、密封圈、橡胶板、底盆和阻尼胶圈等组成。&nbsp;GPZ(KZ)DX单向活动抗震盆式橡胶支座还有中间钢板、四氟滑板、不锈钢滑板及侧向滑移装D等。减震原理主要是当支座水平力大于支座设计竖向承载力的20%后，消能板开始滑移，起到第一道隔振效果，然后阻尼发挥第二道阻尼效果，支座起到抗震作用。当地震冲击波超过一定极限时，该系列的刚性抗震起到了第三道抗震效果。','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','121.17.85.113','河北省衡水市武邑县联通','1','/attachment/information/201706/pre_1497520062oo4za.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('695','什么是聚合支付？云付手机pos机告诉你','136','1497520254','365','1529056254','什么是聚合支付？云付手机pos机告诉你<br />\r\n你还在带着传统的pos机出差吗？2016年5月百事易（福建）电子商务有限公司推出了云付移动支付平台，它比传统的POS机方便，只要你有一台智能手机就可以免费注册试用，0投资，0风险，费率低<br />\r\n什么是聚合支付？云付手机pos机告诉你<br />\r\n聚合支付是一些商家出于成本考虑，不再单独一家家去接微信、支付宝、银联等各个支付通道，而是直接由聚合支付服务商提供一次性对接，同时支持多个支付方式，包括了第三方支付平台，银行和其他的服务商等<br />\r\n云付手机POS机是线上快捷支付，拥有支付牌照的通道','ytl28888','谭婉玲','1838207884','1838207884@qq.com','020-4006965999','0','1','1','','116.21.144.254','广东省广州市电信','1','/attachment/information/201706/pre_1497520254jf7ig.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
