INSERT INTO my_information VALUES ('698','2017最赚钱的产品卡丝干细胞免洗面膜','136','1497527184','365','1529063184','2017年的微商越来越难做，很多人都在找方法，很多人各种培训参加学习。前提你手里要有一款竞争力小，产品质量优质，又卖得火爆，有自己的技术专利别人无法复制的产品，那么你才能2017年做微商，才能赚到大钱。<br />\r\n　　目前卡丝集团推出卡丝干细胞针剂面膜，干细胞科学是目前世界生命科学中最前沿、最尖端的科学之一，随着不断在抗衰老和医学领域的转化和应用，正在给人类带来一个崭新的时代――年轻、健康、长寿的传统概念将被重新改写。无病防病，有病防变，化衰老为年轻，化腐朽为神奇，干细胞科学已经在将人类的许多梦想转变为现实。<br />\r\n　　中.国卡丝集团与韩国全世界排名第一的干细胞研究上市公司Biostar集团正式签约...。。两家跨国集团公司用干细胞联合研发出全世界最好的护肤产品，注意没有之一。卡丝干细胞微整形面膜是首例。<br />\r\n　　同时卡丝产品通过国际最权威机构SGS认证，并由PICC中.国人保财险和CPIC太平洋保险双重承保。如任何国家认可的质检机构检验出产品不合格，卡丝承诺赔偿100万。<br />\r\n　　大家对卡丝干细胞有什么不明白的地方，可以联系卡丝联合创始人龙少(微信：398145409)，全面为您解答。<br />\r\n　　出生于贵州山村的卡丝联合创始人龙少，在互联网，电商，微商有10年的经验。如果您也在如今的21世纪互联网上创业，有梦想，请联系龙少，免费手把手教你做微商。卡丝联合创人龙少，卡丝红人团队负责人龙少微信：398145409','longtianwen1','龙少','398145409','398145409@qq.com','000-13410988775','0','1','1','','1.207.43.181','贵州省黔东南州电信','1','/attachment/information/201706/pre_1497527184xwsgv.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('699','D女郎缩阴对阴道炎有帮助微信13962067086','136','1497528763','365','1529064763','D女郎缩阴真的有效果吗微信13962067086<br />\r\nD女郎缩阴真的有效果吗微信13962067086<br />\r\nD女郎缩阴对阴道炎有帮助吗？<br />\r\nD女郎缩阴对宫颈炎有帮助吗？<br />\r\nD女郎缩阴对盆腔炎有帮助吗？<br />\r\nD女郎私密护理套装并非药物，而是消字号产品，具有消炎杀菌、抑制病菌的作用。妇科病患者长期坚持使用能达到紧致阴道、重现少女状态，清洁阴道、清除异味、杀菌排毒，解决阴道干涩，去除阴部瘙痒、白带异常，治疗各种妇科疾病，改善性冷淡、增强性快感，解决阴道老化，滋润阴部、嫩白细腻，养巢暖宫修复，促进细胞再生，排毒养颜等功效，帮助女性彻底摆脱妇科问题，做回健康、美丽、自信的女人！<br />\r\nD女郎缩阴真的有效果吗微信13962067086<br />\r\nD女郎缩阴真的有效果吗微信13962067086','akyxq548','夏小姐','','446122274@qq.com','0515-88552979','0','1','1','','223.67.149.135','江苏省盐城市移动','1','/attachment/information/201706/pre_1497528763iar6d.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
