INSERT INTO my_information VALUES ('723','防治疱疹性咽颊炎，小儿推拿护理免费公益微课','136','1497667524','365','1529203524','所有厦门人，特别是厦门家长请高度注意！手足口病和疱疹性咽峡炎这两种儿童常见病进入高发期。福建省卫计委最新发布上个月福建省有3人死于手足口病。<br />\r\n厦门金母子注意到了此新闻，并立即组织公益微课堂疱疹性咽颊炎爆发，如何防治疱疹性咽颊炎，小儿推拿护理免费公益微课？免费传授预防等知识给大家！<br />\r\n微课主题：疱疹性咽颊炎的小儿推拿护理<br />\r\n微课讲师：江颖<br />\r\n微课时间：6月26日20:00~21:00<br />\r\n金母子小儿推拿职业培训讲师<br />\r\n执业中医师<br />\r\n毕业于福建中医药大学<br />\r\n儿童保健专家<br />\r\n儿科康复治疗师<br />\r\n中.国针灸协会会员<br />\r\n先后从事小儿推拿科、康复科临床医疗工作。曾任三级甲等医院“小儿推拿学科”负责人。研究小儿推拿近十年，对小儿体质调理有独到之处。善于针药与经络推拿结合治疗小儿呼吸系统、消化系统、先后天不足、小儿脑瘫、小儿多动症等。<br />\r\n病情简介：<br />\r\n夏季是疱疹性咽颊炎爆发的季节，好多小朋友不小心感染上这类病毒，这病毒来势汹汹，会出现疱疹、高烧等症状，很多父母一下子就慌了，因为不了解就盲目地给孩子吃药、挂点滴，让孩子白白受罪不说，错误用药和护理都有可能让病情恶化，体质变差。<br />\r\n疱疹性咽颊炎，是常见一种肠道病毒引起的疾病，父母对此如果有比较深入地认知，即便有天遇到这种情况，就不会慌乱，可以给孩子正确的护理，而不会因为不懂而耽误了孩子。<br />\r\n对于疱疹性咽颊炎，如果你想深入了解其病因、小儿推拿如何护理、饮食禁忌等方面内容，就在赶快加入我们的微信群吧！6月26日20：00群里有关于疱疹性咽颊炎的小儿推拿护理讲座！<br />\r\n如何听课？<br />\r\n1、添加“金母子阎老师“微信，微信ID：15880273580，添加“金母子张老师“微信，微信ID：13850081535，直接添加，备注：听课！<br />\r\n2、转发此条微信链接到朋友圈，并注明我要报名参加听课<br />\r\n3.阎老师和张老师将在开课前24小时拉你入群！','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.136.132','福建省电信(CDMA全省共用出口)','1','/attachment/information/201706/pre_1497667524cbejf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
