INSERT INTO my_information VALUES ('725','山东盛强养殖场,肉牛批发,肉牛报价','136','1497673285','365','1529209285','山东盛强养殖场,肉牛批发,肉牛报价&nbsp;|&nbsp;山东盛强牧业<br />\r\n我牧业保证所提供牛羊良种的品种质量（签订质量合同）。若在引种过程中出现以假乱真，以劣充优的情况，客户的一切损失均由我们承担。&nbsp;选种过程中，客户在牧业内自由选购，以客户满意为宗旨。所选牛羊，全部办理种畜合格证，做到一畜一证六手续。我牧业派专业技术人员押车送货到家，路途伤亡，损失由我牧业全部承担。&nbsp;我牧业提供专用运输车辆，量大可免费送货到家。由政府部门牵头的牛羊业务量大，可货到付款并免费送货到家！对下岗职工、教师、退休干部、乡政府帮扶对象，持有关证件可优惠。免费传授科学养殖技术，培训技术人员（限1-3人），赠送养殖光盘。定期为客户所购牛羊进行防疫、技术指导等，保证牛羊健康和我牧业信誉。来牧业人员，可凭车票报销来牧业车费。<br />\r\n　　大型交易市场是中.国大规模的牛羊交易市场之一，是中.国牛羊的集散地与扩散源，日上市:2000―3000余头，日成交:1000头左右。购牛羊客商，络绎不绝，牛羊购销两旺，销售范围辐射全国，并远销国外。入世以来，每年交易肉牛6万头以上，（西门塔尔“红白花”肉牛犊、育成牛、架子牛、波尔山羊、小尾寒羊）货源充足。这里的牛羊生产起步早、改良好、品种纯，已有多年的历史，是我国首批引进良种牛羊繁育改良的定点示范地区，是经过长期严格本品种选育成的专业化大型肉用品种牛羊。','lsdjxsqmy','范经理','510571666','sdjxwjmy@126.com','0537-13793793711','0','1','1','','27.198.240.119','山东省济宁市联通','1','/attachment/information/201706/pre_14976732855lbov.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
