INSERT INTO my_information VALUES ('739','宏鑫市政 深圳沉淀池清理,人工湖清淤,广州市政道路清洗','136','1497786334','365','1529322334','服务热线：&nbsp;182-1808-6986<br />\r\n深圳市宏鑫市政工程建设有限公司是一家专业从事市政管道疏通、下水道疏通、管道清淤、河道清淤、化粪池清理、污水池清理的综合服务疏通公司，多年来在行业中留下了良好的口啤，公司有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施等设备。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n服务范围：<br />\r\n1.&nbsp;管道疏通服务<br />\r\n大型高压清洗车疏通各类&nbsp;管道；主要有市政管道疏通，污水管道疏通，工业管道疏通，下水管道疏通，雨水管道疏通，高空排污管道疏通等以及单位，学校，企业及居民小区的排污管道等。<br />\r\n2.&nbsp;管道清淤服务&nbsp;<br />\r\n公司拥有一批高素质的管道清淤及疏通管道操作人员，清淤设备齐全，多年来积累了丰富的清淤施工经验，按照客户的清淤要求和质量标准高效施工，管道清淤包括：大型市政管道、排污管道、雨水管道、工业管道、下水管道、污水管道、排水管道、道路管道、废水管道、水泥管道、高压管道、石油管道、大型下水管道、地下管道、高空管道、园区管道。<br />\r\n3.&nbsp;管道清洗服务<br />\r\n市政管道、大型管道、排污管道、雨水管道、工业管道、下水管道、污水管道、排水管道、道路管道、废水管道、大型油烟管道清洗。<br />\r\n4.&nbsp;河道河涌清淤、箱渠方涵清淤服务<br />\r\n公司长期承接河涌清淤、河道清理、河道清淤、河道清洁、河道垃圾清理，并配套专用机械施进行涵洞清淤、排污渠清淤、明暗箱涵清淤、污泥涵渠、鱼池清淤、箱渠清淤、沉淀池清淤等<br />\r\n管道的长','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','1','1','','219.134.229.179','广东省深圳市电信','1','/attachment/information/201706/pre_149778633472kvy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
