INSERT INTO my_information VALUES ('751','市政首选 上下水管道疏通 渠道清理 方涵渠清淤价格实惠','136','1497842186','365','1529378186','宏鑫市政上下水管道疏通&nbsp;渠道清理&nbsp;方涵渠清淤价格实在,规格齐全,品质上乘。<br />\r\n深圳&nbsp;疏通下水道公司_涵箱清淤_排水管网疏通182-1808-6986<br />\r\n宏鑫市政工程建设有限公司&nbsp;www.hongxingc.com&nbsp;是广东地区最具势力的市政工程建设公司，专注于政管道疏通、下水道疏通、管道清淤、河道清淤、箱渠箱涵清理、污水池清理、池塘理清、化粪池清理、污水池清理、排水沟清淤、污水道清淤、沉淀池清淤、管渠清淤、明暗管渠清淤、河涌清淤、河道清理、箱渠清淤等业务，多年来在行业中留下了良好的口杯，<br />\r\n同时公司注入过千万资金购买先进的设备，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施，公司拥有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n欢迎来电咨询：&nbsp;182-1808-6986&nbsp;&nbsp;&nbsp;&nbsp;戴经理<br />\r\nwww.hongxingc.com<br />\r\n广东省全方位施工服务；深圳、广州、东莞、中山、佛山、珠海、江门、湛江、阳江（阳江市、江城区、阳春市、阳西县、阳东县）等；遍布珠三角地区；&nbsp;&nbsp;<br />\r\n深圳宏鑫市政地址:龙华观澜环观中路28号Ａ栋首层','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','1','1','','219.134.229.179','广东省深圳市电信','1','/attachment/information/201706/pre_1497842186en7t3.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('752','衡水桥闸_广西桥梁伸缩缝供应商_广西桥梁伸缩缝价格','136','1497843166','365','1529379166','衡水桥闸_广西桥梁伸缩缝供应商_广西桥梁伸缩缝价格&nbsp;|&nbsp;衡水桥闸工程橡胶有限公司<br />\r\n	<br />\r\n	广西桥梁伸缩缝供应商|广西桥梁伸缩缝推荐|衡水桥闸<br />\r\n	模数式桥梁伸缩装置&nbsp;<br />\r\n	一、装置的结构、性能及安装方法&nbsp;<br />\r\n	1、GQF-C型、GQF-E型、GQF-L型,&nbsp;GQF-F型、GQF-MZL型模数式桥梁伸缩装置，是采用热轧整体成型的异型钢材设计的桥梁伸缩装置。GQF-C型、GQF-Z型、GQF-F型.&nbsp;GQF-L型装置适用于伸绾量80mm以下的桥梁接缝，GQF-MZL型伸缩装置是由边梁、中梁、横梁和连动结构组成的模数式桥梁伸缩装置，适用于伸缩量80-1200mm的大跨度桥梁。&nbsp;<br />\r\n	2、代号表示方法及意义&nbsp;<br />\r\n	代号表示方法与中华人民共和田交通行业标准表示方法相一致。&nbsp;<br />\r\n	&nbsp;<br />\r\n	3、胶料适用范围&nbsp;<br />\r\n	1采用氯丁橡胶(CR)的伸缩装置适用于温度-25℃-60℃地区。&nbsp;<br />\r\n	2)采用天然橡胶(NR)的伸缩装置适用于温度-40℃-60℃地区。&nbsp;<br />\r\n	4、设计制造技术条件&nbsp;<br />\r\n	1）设计荷载：采用JTJ101-88(2004)&amp;lt;公路工程技术标准&amp;gt;规定的汽车一超20级荷载进行设计。&nbsp;<br />\r\n	2）本结构使用的异型钢材质为16Mn桥梁专用钢，钢材抗拉强度应不低于480Mpa，容许弯曲应力不低于&nbsp;210Mpa。&nbsp;<br />\r\n	3）结构中支撑横梁使用16Mn或45号钢，其容许弯曲不低于210Mpa。&nbsp;<br />\r\n	4）其余配件钢材可使用不低于Q235强度钢材。&nbsp;<br />\r\n	5、结构特点&nbsp;<br />\r\n	GQF-MZL型伸缩装置的突出特点是将伸缩装置的承重结构和位移控制系统分开，二者受力时互不干扰，分工明期，这样即保证受力时安全，又保证了受力时位移均匀。&nbsp;<br />\r\n	6、伸缩装置伸缩量的确定&nbsp;<br />\r\n	桥梁伸缩量计算值直接影响对伸缩装置规格选择，若伸缩装置规格选择不合理，又直接影响伸缩装置的使用效果，同时选择伸缩装置时还应考虑梁、板间伸缩装置间隙量大小，以保证伸缩b置与梁、板两端有充分锚固，才能达到最佳使用效果。所以，在选择伸缩装置的规格时，一定要留足够余量，才能保证伸缩装置的使用效果和耐久性。&nbsp;<br />\r\n	7、伸缩装置的运输、存放与安装&nbsp;<br />\r\n	运输&nbsp;&nbsp;伸缩装置按设计要求全部组b好后，由生产厂家或用户运往施工现场。如其长度超过运输允许限度或由于其它原因不能整体运输时，可以采用分段制作的方法。&nbsp;<br />\r\n	存放&nbsp;&nbsp;伸缩装置运抵施工现场后，其存放地点应尽量接近安装位置，并应放置在最少离于地面30cm的支撑物上。&nbsp;<br />\r\n	安装&nbsp;&nbsp;&nbsp;同样优良的伸缩装置，不同的安装质量，使用效果和耐久性会有明显差别。这在我们调查研究中反映出的问题充分说明了伸缩装量施工安装质量是保证伸缩装置使用效果好坏的一个关健环节。&nbsp;<br />\r\n	1）伸缩装置的安装应尽量在路面鳟好后进行，在伸缩装置安装前，须对预留槽的宽度、浓度及预埋钢筋进行检耍使之符合安装伸缩装置的要求。&nbsp;<br />\r\n	2）清理槽口，必把所有污物、尘土及其它不需栗的东西全部予以清除。&nbsp;<br />\r\n	3）检查伸缩装置各梁之间间隙是否符合安装囟鹊囊求，如不符合必须在制造厂工程技术人员的指导下进行调整，使伸缩装置的各梁之间间隙符合设计要求，调整之后再安上夹具，以备安装。&nbsp;<br />\r\n	4）以两侧的沥青路面为标高，用起重设备将伸缩装置放在槽口内，调整伸缩装置使其顶面与路面标高相同，其纵坡、横坡应与桥梁路面相符。&nbsp;<br />\r\n	5）检查伸缩b置的位置，使伸缩装置在垂直缝的议程和顺缝方向的位置都符合设计要求，如果此时个别预埋钢筋对伸缩装置的正确安装有妨碍，可以用气割割掉。&nbsp;<br />\r\n	6）伸缩装置正确就位后，先将伸缩装置一测的锚固筋与预留槽的预埋钢筋相连并焊接，焊接时可以间隔一个焊一个，然后在将另一侧的锚固钢筋按上述步骤焊接，使伸缩装置可靠锚固。注意：严禁在伸缩装置中梁、边梁上任意施焊。&nbsp;<br />\r\n	7）伸缩装置如果是分段安装的，接缝处必须采用焊接。型钢的焊接接头在制造工厂已经备好，当两相临缝对正后，即可安装。案梁全部焊接好后再按上述步骤进行锚固。&nbsp;<br />\r\n	8）在梁端安装模板，模板按伸s装置外形尺寸和预留槽的缺口进行制作，模板应做的相当严密以防沙浆流进位移控箱或流进梁端缝隙。&nbsp;<br />\r\n	9）检查安装的模板严密无缝以后再将预留槽清洗干净，便可绕浇注混凝土，并振捣密实。混凝土至少与该处的结构混凝土具有同一强度，浇注混凝土时要保持伸缩装置的顶面清洁。&nbsp;<br />\r\n	二、伸缩量0~80mm典型结构布置A&nbsp;<br />\r\n	GQF-C型、GQF-E型.&nbsp;GQF-F型、&nbsp;GQF-L型伸缩装置均是两根边梁(C型、E型、F型、L型热轧异型钢材)和橡胶密封带组成，其结构简单，安装方便，适用于伸缩量为0-80mm的桥梁。&nbsp;<br />\r\n	公司电话：0318-2209900&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','121.17.85.113','河北省衡水市武邑县联通','1','/attachment/information/201706/pre_1497843166gy3dd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('753','咸阳立体车库最具性价比厂家推荐','136','1497843239','365','1529379239','咸阳立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201706/pre_1497843239x6dlz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
