INSERT INTO my_information VALUES ('755','资阳本安防爆磁力锁厂家上海海栌生产井田JT-3000锁最专业','136','1497843733','365','1529379733','资阳资阳上海是最专业的上海本安防爆磁力锁厂家。<br />\r\n本安防爆磁力锁用于石油化工危险区域，配合门禁控制器使用，专业厂家生产本安防爆磁力锁，价格优惠，品质高，寿命长，3年免费保修。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n外形结构和安装方式<br />\r\nJT-3000本安防爆电磁锁由安装在安全区的两个齐纳安全栅和安装在危险区的铝合金电磁锁组成，两者之间采用4×0.75mm2RVVP电缆连接。<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n资阳联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106本安防爆磁力锁厂家咨询资阳资阳','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1497843733hqgmt.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('756','南昌零基础学平面广告设计培训班,南昌暑期广告设计培训班,师大','136','1497845823','365','1529381823','南昌零基础学平面广告设计培训班,南昌暑期广告设计培训班,师大高端&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	南昌平面设计培训班|师大高端|南昌零基础学广告设计培训班<br />\r\n&nbsp;<br />\r\n	平面设计<br />\r\n	一个视觉作品的生存底线，应该看他是否具有感动他人的能量，是否顺利地传递出背后的信息，事实上她更像人际关系学，依靠魅力来征服对象，事实上平面设计者所担任的是多重角色，平面设计代表着客户的产品，客户需要你的感情去打动他人，平面设计是一种与特定目的有着密切联系的艺术。<br />\r\n	<br />\r\n	1、创意：是平面设计的第一要素，没有好的创意，就没有好的作品，创意中要考虑观众、传播媒体、文化背景三个条件。<br />\r\n	2、构图：构图就是要解决图形、色彩和文字三者之间的空间关系，做到新颖，合理和统一。<br />\r\n3、色彩：好的平面设计作品在画面色彩的运用上注意调和、对比、平衡、节奏与韵律。&nbsp;<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	南昌平面设计培训班|师大高端|南昌零基础学广告设计培训班&nbsp;&nbsp;高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。<br />\r\n	&nbsp;<br />\r\n	南昌平面设计培训班|师大高端|南昌零基础学广告设计培训班学校另外开设&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	&nbsp;<br />\r\n	联系人&nbsp;：&nbsp;张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','115.152.71.188','江西省南昌市电信','1','/attachment/information/201706/pre_1497845823sisro.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('757','淮安上海本安防爆电磁锁厂家首选上海海栌门控本安防爆磁力锁','136','1497847434','365','1529383434','淮安上海是专业的上海本安防爆电磁锁厂家。<br />\r\n国内专业的本安防爆磁力锁生产厂家，上海海栌门控科技有限公司专业生产本安防爆磁力锁，价格优惠，欢迎来电订购，021-51692106<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n4、工作原理<br />\r\nJT-3000本安防爆电磁锁由两个齐纳安全栅和铝合金电控磁力锁两部分构成。电源安全栅连接电磁锁的供电端，+12V直流电压经过安全栅后提供给电磁锁，使电磁锁产生最大240公斤的吸合力从而将门锁住。信号安全栅连接电磁锁的信号输出端，门被锁住后开关信号输出，门被打开后打开，门锁控制主机通过检测两个检测端的信号来判断门的状态从而做出正确的操作。<br />\r\n<br />\r\n<br />\r\n淮安联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海方海栌索取本安防爆电磁锁资料！<br />\r\n淮安淮安','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1497847434ohzhw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
