INSERT INTO my_information VALUES ('774','北京金诚影音_TASCAM调音台维修_TASCAM调音台售后','136','1497920093','365','1529456093','北京金诚影音_TASCAM调音台维修_TASCAM调音台售后&nbsp;|&nbsp;北京金诚锐升科技有限公司<br />\r\n&nbsp;<br />\r\n	北京市TASCAM&nbsp;CD维修中心，是北京市专业的TASCAM维修站，专业维修TASCAM&nbsp;CD机、MD机、DVD机、刻录机不读盘、跳盘、挑盘、卡盘等故障，同事提供TASCAM磁带录音机维修、TASCAM&nbsp;DAT数码录音机维修、TASCAM&nbsp;MD机维修、TASCAM&nbsp;CF卡固态录音机维修、TASCAM多轨录音机维修、TASCAM硬盘录音机维修、TASCAM数码录音机维修、TASCAM数码调音台维修。&nbsp;<br />\r\n	本公司是经工商局注册认证的专业&nbsp;维修站，本中心拥有一批技术精湛的tascam维修技师，拥有多年的维修经验，是您值得信赖的专业维修站。&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;我们的优势：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;我公司是成立十几年的专业维修站，拥有最先进的家电维修检测、维修设备，拥有技术精湛的维修技师，拥有最可靠的维修信誉保证，同时我们更拥有一颗专心为您服务的热心！我们的维修服务标准：<br />\r\n1、24小时客服值班，30分钟内做出维修回应。<br />\r\n2、维修车间及前台：节假日、周六日不休息，保证用户随到随修。<br />\r\n3、实行“先检查故障，再报所需费用，最后维修排除”的维修政策。<br />\r\n4、费用或服务不满意，用户可随时放弃维修，而且不收取费用。<br />\r\n5、在选用配件方面，严把质量关，从原厂和一级厂采购正品配件。&nbsp;<br />\r\n	6、在维修作业方面，严格按维修程序及操作规程执行，确保维修质量。<br />\r\n7、在收费方面，严格按照国家发展和改革委员会颁布的《家用电器维修服务明码标价规定》结合行业协会的规定，制定了《家电维修收费标准》，并严格执行。决不夸大故障、绝&nbsp;不乱收费。<br />\r\n8、经我公司修好的电器一律实行保修服务，保修期为三个月。在保修期内如因维修质量或配件质量问题造成电视机再次出现故障，一律由我公司负责免费维修。<br />\r\n北京市区可提供上门取送机服务，外地客户可将您的音响设备发往北京同样可享受到我们的专业维修服务。&nbsp;<br />\r\n	公司24小时服务热线400-7011-123&nbsp;<br />\r\n	010-52464366&nbsp;010-52464368&nbsp;<br />\r\n	技术支持13621218536&nbsp;微信同步&nbsp;<br />\r\n	地址：导航&nbsp;北京金诚锐升科技有限公司','jcaudio01','王学','1146724306','357591605@qq.com','010-52464366','0','1','1','','124.207.29.8','北京市电信通','1','/attachment/information/201706/pre_1497920093vaomu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('775','800竹节瓦压瓦机|甘肃竹节瓦设备价格|三科机械','136','1497920393','365','1529456393','800竹节瓦压瓦机|甘肃竹节瓦设备价格|三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n60型琉璃瓦机<br />\r\n760型琉璃瓦压瓦机一定要用高数脉冲输入功能，KDN-K306-24AR高数输入性能优良，选AB相抗干扰能力强。并用定值中断功能，保证精度。&nbsp;<br />\r\n　　压瓦机有许多参数要设定，用文本屏设定。参数设定有设备参数和用户参数设定两种。设备参数有：单脉冲长、过冲量、压型距、压型时间、切刀时间等等。用户参数有：张数、长度、首节、末节、节距、节数等等。压瓦机控制系统还能完成单板切割功能。&nbsp;<br />\r\n控制系统的特点&nbsp;<br />\r\n　　该控制系统操作简单，正常自动生产不需要先倒退，而是一次前进，压型，切割完成。精度高，每片剪切精度小于0.1mm，满足工艺要求。<br />\r\n泊头市三科冷弯机械有限公司专业生产彩钢瓦设备，单瓦机，双层压瓦机，三层压瓦机，C型钢机，无极切断C型钢设备，飞据切断C型钢机，扭断C型钢设备，角驰压瓦机，820角驰，760角驰机，470角驰压瓦机，470角驰压瓦机，楼乘板设备，750楼乘板设备，1025楼乘板设备，915楼乘板机，琉璃瓦成型设备，800竹节琉璃瓦设备，840琉璃瓦设备，828琉璃瓦机，加宽琉璃瓦设备，屋脊瓦设备，312屋脊瓦设备，450屋脊瓦成型设备，夹心板复合机，岩棉复合机，泡沫复合机，卷帘门设备，欧式卷帘门设备，抗风卷帘门，800卷帘门，250卷帘门设备，车库门设备，车库门吊柜机，卷帘门轨道机，大棚弯管，卡槽机，U型槽成型设备，汽车厢板机，集装厢板成型机，集装箱立柱设备，挡风抑尘成型设备，围挡设备，龙骨机，广告扣扳机，三维扣扳机，集成吊顶设备，货架成型设备，液压剪板机，液压折弯机，分条机，雨搭机，校平机，彩钢上料架，定做各种冷弯成型设备。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','110.252.86.149','河北省沧州市联通','1','/attachment/information/201706/pre_1497920393b2b3a.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
