INSERT INTO my_information VALUES ('777','TLFA25H2WB-7X控制盖板-泰丰专业打造控制盖板知名','136','1497920997','365','1529456997','TLFA25H2WB-7X控制盖板<br />\r\n详细说明<br />\r\n新型的山东泰丰液压TLFA泰丰控制盖板(方向控制和压力控制）有以下特征：<br />\r\n一、TLFA控制盖板进行了创新设计，在内嵌的先导控制元件中广泛采用了螺纹插装阀，使控制盖板的结构更加合理，使用和维护更加方便，具有多样化的配置可供选择。<br />\r\n二、不同形式的行程调节和控制装置，可用于方向和流量等控制。<br />\r\n三、既可以选择安装符合ISO4401-03/05的通用板式连接的电磁换向阀和叠加阀的盖板，也可以选择带螺纹插装阀的盖板。<br />\r\n四、控制盖板体除顾客特殊要求外，均进行了表面化学镀镍等处理，因此抗腐蚀性能很强<br />\r\n选型示例：TLFA016KWA-7X&nbsp;（泰丰方向控制功能控制盖板TLFA）<br />\r\n1.&nbsp;盖板代号&nbsp;TLFA--插装阀盖板&nbsp;按ISO7368<br />\r\n2.&nbsp;公称通径&nbsp;（按ISO7368）DG16&nbsp;DG25&nbsp;DG16&nbsp;DG32&nbsp;DG40&nbsp;DG50&nbsp;DG63&nbsp;DG80&nbsp;DG100&nbsp;DG125&nbsp;DG160<br />\r\n3.&nbsp;功能型号&nbsp;D--仅含遥控口、不带控制阀&nbsp;G*--带梭阀&nbsp;TGD8--带液控单向阀&nbsp;<br />\r\nH*--带行程限制机构&nbsp;H*W*--带行程限制机构和电磁阀安装面&nbsp;<br />\r\nGW*--带梭阀和电磁阀安装面&nbsp;KW*--带梭阀和电磁阀安装面&nbsp;<br />\r\nWE*--带电磁阀安装面&nbsp;E--带阀芯位置监测<br />\r\nEWA--带阀芯位置监测和电磁阀安装面&nbsp;<br />\r\nEWB--带阀芯位置监测和电磁阀安装面&nbsp;<br />\r\n4.&nbsp;设计系列&nbsp;7X--安装螺栓及先导电磁阀安装螺纹为米制&nbsp;<br />\r\n6X--安装螺栓及先导电磁阀安装螺纹为英制<br />\r\n堵头和阻尼孔螺纹&nbsp;无标记--米制螺纹用于堵头和阻尼孔&nbsp;SM--SAE用于堵头,米制螺纹用于阻尼孔&nbsp;SN-SAE用于堵头,NPT螺纹用于阻尼孔&nbsp;<br />\r\n阻尼孔尺寸&nbsp;无标记--标准阻尼孔尺寸<br />\r\n压力范围&nbsp;最大压力350bar<br />\r\n密封件材料&nbsp;无标记--丁晴橡胶&nbsp;V--氟橡胶<br />\r\n联系人：李经理<br />\r\n电话：0537-2710988&nbsp;&nbsp;&nbsp;&nbsp;手机：18254735793<br />\r\n公司地址:山东省济宁市海川路66号','teclj760','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_14979209977w4bj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
