INSERT INTO my_information VALUES ('782','河源十大防爆磁力锁品牌上海井田防爆电磁锁性价比最高','136','1497926405','365','1529462405','河源河源十大防爆磁力锁品牌数上海性价比最高。上海位列十大防爆磁力锁品牌，质量好、服务好。<br />\r\n国内专业防爆磁力锁生产厂家，上海海栌门控科技有限公司提供井田高品质JT-3000防爆磁力锁,应用于石油化工爆炸性环境：1区，2区，井田JT-3000防爆磁力锁安装简单，使用寿命长，提供3年免费质保，井田JT-3000防爆磁力锁对各种品牌的门禁控制器都可以实现完美无缝兼容<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n河源联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106性价比最高的十大防爆磁力锁品牌首选上海。河源河源','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1497926405rbslq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('783','好滋餐饮味,重庆鸡公煲味道最正中,干锅加盟那里去','136','1497927002','365','1529463002','好滋餐饮味,重庆鸡公煲味道最正中,干锅加盟那里去&nbsp;|&nbsp;沈阳好滋味餐饮管理有限公司<br />\r\n好滋味餐饮集团公司自成立以来，为方便各地学员就近学习，避免周波劳顿，现如今已在全国各地开展多个培训站，如沈阳培训站，哈尔滨培训站，长春培训站，学员可根据自身条件，多方位选择就近选择学习。好滋味始终如一坚持实战化教学，综合化指导，多方面服务。学员学习过程中，注重实践反复练习，全程师傅一对一跟踪教学指导。不限制时间学习，直至学习会为止，当期学不会，终身可以免费复习，终身免费技术更新升级。在教学过程中，我们更细致化得将配料配方进行量化标准，使学员掌握的更牢靠；学习更便捷，后期味道正宗。本公司培训项目多元化，如：拉面及各个种类和各种味道的面条。早餐及中式面点。特色烧烤，骨汤麻辣烫，砂锅米线，韩式烤肉，麻辣拌，等等所有市面能看到的时尚流行小吃技术一对一学习应有尽有。培训项目种类丰富。<br />\r\n选择好滋味优势多多：<br />\r\n优势一：先品尝，满意后在学习，解除您的学前之忧，为后期经营作保障；<br />\r\n优势二：签订学习保障协议，保障您的权益，让您无后顾之忧；<br />\r\n优势三：配方透明化，学会都能自己独立配制，而且所有材料在当地市场都能买到。<br />\r\n优势四：一对一指导，手把手教学，全程动手实际操作。<br />\r\n优势五：反复练习，制作成品能达到销售标准，使您创业无忧。<br />\r\n优势六：传授时下流行小吃，品味独占鳌头。<br />\r\n优势七：&nbsp;终身技术指导，为您创业保驾护航。<br />\r\n好滋味欢迎各位学员考察学习，详情请拨打电话：沈阳：13998816601宣经理。18940014011赵经理，吉林内蒙古：15140178540，黑龙江：15124512980，（微信同步）。<br />\r\n郑重承诺：包教包会，学会为止，一期学不会下期免费复学，收费透明，除学费以外没有任何形式收费。','wnptu821','刘经理','995734565','995734565@qq.com','024-23411016','0','1','1','','101.46.200.118','辽宁省沈阳市鹏博士长城宽带','1','/attachment/information/201706/pre_1497927002iqpg6.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('784','产后康复师培训哪家强？厦门金母子帮你忙！','136','1497928258','365','1529464258','产后康复，是指女性在生产完毕之后，常常会因为身体过于虚弱而需要一定的康复和保养，而这种康复和保养被称之为产后康复。<br />\r\n产后康复师培训哪家强？厦门金母子帮你忙！能提供如下服务：满月发汗排毒、全面调理产后亚健康状态；妊娠纹修复，还原完美肌肤；无痛剖宫产疤痕修复；产后量身减肥S塑形，腰腹收紧；产后经络调理，缓解肩颈腰腿酸痛；产后疏通乳腺，增加乳汁分泌；胸部坚挺提升。<br />\r\n全国各个城市产后康复等服务项目屈指可数，专业产后康复培训机构更是凤毛麟角，产后康复理疗师服务人员，市场缺口巨大，按照专业人士预计，产后康复的城市市场潜力逾百亿元，全国市场潜力超过600亿元。<br />\r\n中医药适宜技术职业化培训是国家中医药管理局直属机构中.国中医药科技开发交流中心开展的职业培训。参加培训合格者颁发国家中医药管理局人才交流中心证书，可在医疗卫生机构提供调理服务。<br />\r\n《全国产后康复师职业培训教材》<br />\r\n　　基础知识包括三大知识：产后恢复师职业基本概论、女性生殖系统解剖与生理、中医基础知识。<br />\r\n　　操作技能主要包括：初级产后康复师操作技能：产妇头面部恢复、&nbsp;产妇胸腹部恢复、产妇上、下肢恢复、产妇盆底恢复等;中级产后康复师操作技能：产后体质管理、产后自我保健运动、产后胸部塑形、高级产后康复师操作技能、产后高级保健运动、产后特殊护理、中医保健疗法应用、产后恢复饮食调节、产后心理调适;&nbsp;师资产后康复师操作技能等培训内容。<br />\r\n品牌优势：金母子是中.国中医药科技开发交流中心、国家中医药管理局人才交流中心《中医药适宜技术职业化培训证书》职业培训品牌的产后康复师培训机构。<br />\r\n特许优势：金母子是中.国中医药科技开发交流中心、国家中医药管理局人才交流中心在全国范围内唯一授权开展产后康复师培训及加盟推广的产后康复师培训机构。<br />\r\n技术优势：金母子拥有全国独一无二的前瞻而又实效的产后康复技术。<br />\r\n就业优势：全国唯一能彻底解决学员就业的产后康复师培训机构。<br />\r\n培训费资助优势：全国唯一能提供助学贷款的产后康复师培训机构。<br />\r\n学员持续性发展优势：全国唯一能不断推出新兴高薪职业的产后康复师培训机构<br />\r\n厦门金母子健康咨询有限公司<br />\r\n联系人：范桃连老师<br />\r\n地址：福建省厦门市湖里区嘉禾路388号永同昌大厦3A<br />\r\n手机：13720881939<br />\r\n电话：0592-5537128<br />\r\nEmail：694593018@qq.com<br />\r\n网站：www.xmjmz.cn<br />\r\n微信号：jinmuzi88','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.136.132','福建省电信(CDMA全省共用出口)','1','/attachment/information/201706/pre_1497928258ddebv.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('785','衡水桥闸_HDR(H)滑动高阻尼橡胶支座_甘肃滑动高阻尼橡胶','136','1497928574','365','1529464574','HDR滑动高阻尼隔震橡胶支座&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;HDR滑动型高阻尼橡胶支座是为了满足桥梁大位移的需求，在HDR(II)型（III）型的基础上专门设计的一种带滑动层的高阻尼隔霖橡胶支座。&nbsp;<br />\r\n	1、HDR滑动高阻尼隔震橡胶支座规格系列同HDR(II)型（III）型规格系列；&nbsp;<br />\r\n	1.1圆型支座分为35类，具体见II、III&nbsp;型支座分类。&nbsp;<br />\r\n	1.2矩型支座分为62类，具体见II、III&nbsp;型支座分类。&nbsp;<br />\r\n	2、HDR滑动型高阻尼橡胶支座设计转角θ(rad)本系列支座设计转角分为：0.006rad-0.008rad。&nbsp;<br />\r\n	3、HDR滑动型高阻尼橡胶支座设计水平力：滑动型支座可承受的设计水平力为支座竖向承载力的3%。&nbsp;<br />\r\n	4、HDR滑动型高阻尼橡胶支座设计位移：&nbsp;<br />\r\n	滑动型支座顺桥向设计位移分为±100mm和±150mm两种，横桥向设计位移为±30mm。&nbsp;<br />\r\n	当项目有特别需要时，可以根据实际情况进行特殊（定制）设计。&nbsp;<br />\r\n	5、支座设计摩擦系数：滑动型支座设计摩擦系数≤0.03。&nbsp;<br />\r\n	6、温度适用范围：设计温度适用范围-40℃～60℃&nbsp;<br />\r\n	7、设计阻尼比：HDR滑动型支座采用高阻尼橡胶，阻尼比为≥10%。&nbsp;<br />\r\n	8、滑动型支座双线性恢复力模型，见固定型II、&nbsp;III型图示。&nbsp;<br />\r\n	9、HDR滑动型支座材料性能要求：&nbsp;<br />\r\n	9.1不锈钢板应符合GB-3280的要求。&nbsp;<br />\r\n	9.2聚四氟乙烯板的物理机械性能应符合下表要求：&nbsp;<br />\r\n	&nbsp;<br />\r\n	注：球压痕硬度H132/60为荷载132N，持荷60S，试验温度23±2℃。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;聚四氟已烯滑板应符台GJB3026的相关规定，板材应用新鲜纯料模压面成，严禁使用车削板，严禁使用再生料，回头料模压加工的板材，聚四氟乙烯原料的平均粒径不可大干50μm，模压应力不可低干25MPa。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;9.3硅脂的性能指标应符台NE1337―2：2005的规定；工作锥入度26.5～29.5mm，滴点≥180℃，油离度（24h，100℃)《3％。<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','121.17.85.113','河北省衡水市武邑县联通','1','/attachment/information/201706/pre_1497928574ayntb.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('786','广州众誉|广州高空车出租|佛山高空车价格','136','1497928845','365','1529464845','广州众誉|广州高空车出租|佛山高空车价格&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州高空车价格广州佛山高空车价格&nbsp;广州高空车出租<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;联系电话;13600005563<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公司网址：http://www.gzzyjx99.com/<br />\r\n	广州众誉高空车价格：<br />\r\n广州众誉机械设备租赁有限公司设备广范应用于工程建设、外墙高空清洗、挂灯笼、园林绿化、广告招牌安装、厂房路灯维护、电力高空设备抢修、路灯维修、园林修剪养护、高速公路监控维修、冶安装监控维修、仓库设备检修、影视高空广告拍摄、高空管路的铺设、钢构内部固定、高架桥梁的建造和外墙涂装等各种需要登高作业的场合。&nbsp;<br />\r\n	我公司致力于向各级建筑施工企业和广大高空作业用户提供性能优异、安全可靠的高空作业设备和完善周到的租赁服务。从临时到长期租赁、从人员培训到设备保养维护，可根据承租方自身的实际情况量身定制高空车租赁与高空作业平台租赁方案。帮助广优的每一位客户在成功路上飞越发展。<br />\r\n	<br />\r\n		广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.129.123.12','广东省广州市电信','1','/attachment/information/201706/pre_1497928845oo9po.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('787','山东德州消防排烟风机箱专业定做','136','1497929123','365','1529465123','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.173.227','山东省德州市电信','1','/attachment/information/201706/pre_1497929123gcdih.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('788','盐城哪里有做D女郎缩阴对阴道炎有效果吗,价格多少?','136','1497929415','365','1529465415','盐城哪里有做D女郎缩阴对阴道炎有效果吗,价格多少?盐城市倾心商贸有限公司专业做D女郎缩阴对阴道炎有效果吗,价格实惠.<br />\r\nD女郎缩阴代理怎么做微信：nohappy1025<br />\r\nD女郎全国总代理夏青全国招商微信：nohappy1025<br />\r\nD女郎缩阴对阴道炎有效果吗<br />\r\nD女郎阴道炎可以用吗？D女郎宫颈炎可以用？D女郎盆腔炎可以用吗？D女郎宫颈糜烂可以用吗？D女郎盆腔积液可以用吗？D女郎囊肿可以用吗？D女郎肌瘤可以用吗？<br />\r\nD女郎私密护理套装并非药物，而是消字号产品，具有消炎杀菌、抑制病菌的作用。妇科病患者长期坚持使用能达到紧致阴道、重现少女状态，清洁阴道、清除异味、杀菌排毒，解决阴道干涩，去除阴部瘙痒、白带异常，治疗各种妇科疾病，改善性冷淡、增强性快感，解决阴道老化，滋润阴部、嫩白细腻，养巢暖宫修复，促进细胞再生，排毒养颜等功效，帮助女性彻底摆脱妇科问题，做回健康、美丽、自信的女人！<br />\r\n悦大大带你分析微商，微信：nohappy1025<br />\r\n做好微商一定要做好以下两点：<br />\r\n一、应具备的心态<br />\r\n不论做什么事，心态很重要。人们平时所说的性格决定命运，其实不然。实质上是心态决定命运。这也就解释了为什么性格不同的人，却一样可以成就一番伟业。所以说，性格可能影响命运，但最终是自己的心态，决定着自己的命运。那么问题来了，那么需要一颗什么样的心态呢？<br />\r\n当然是一颗荣辱不惊的平常心。要知道，做什么生意，只要是生意，都是有风险的，而降低这个风险的唯一办法，就是在做之前，先系统的学习一下行业知识，了解一下要做好这个生意，需要掌握那些技能和办法，这样，才能够有得放失，不管成功与否，也必不会走什么弯路。<br />\r\n网站：www.dnl1888.com<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;www.xczdl.com地址：盐城盐城市鲁艺路122号','akyxq548','夏小姐','','446122274@qq.com','0515-88552979','0','1','1','','180.126.236.129','江苏省盐城市电信','1','/attachment/information/201706/pre_149792941565n66.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('789','唐山十大本安防爆磁力锁品牌上海井田防爆电磁锁性价比最高','136','1497930237','365','1529466237','唐山唐山十大本安防爆磁力锁品牌数上海性价比最高。上海位列十大本安防爆磁力锁品牌，质量好、服务好。<br />\r\n本安防爆磁力锁用于石油化工危险区域，配合门禁控制器使用，专业厂家生产本安防爆磁力锁，价格优惠，品质高，寿命长，3年免费保修。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n外形结构和安装方式<br />\r\nJT-3000本安防爆电磁锁由安装在安全区的两个齐纳安全栅和安装在危险区的铝合金电磁锁组成，两者之间采用4×0.75mm2RVVP电缆连接。<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n唐山联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106性价比最高的十大本安防爆磁力锁品牌首选上海。<br />\r\n唐山','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1497930237kvqpm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
