INSERT INTO my_information VALUES ('792','汽车展展厅搭建_远大展览_汽车展展台设计','136','1497942697','365','1529478697','汽车展展厅搭建_远大展览_汽车展展台设计&nbsp;|&nbsp;深圳市远大展览有限公司<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	深圳市远大展览有限公司是一家集展览展示设计、装饰及空间设计、活动现场策划设计、小型园林景观设计于一体的综合性展览展示公司。自成立以来一直专注于展览展示设计与执行、会务策划与服务，主&nbsp;要服务于展厅规划设计、大中型展览展会以及活动策划执行三大领域。<br />\r\n	我们现拥有一支经验丰富，富有责任感、充满创意与活力的专业设计策划团队，擅于从市场角度出发结合视觉艺术及营销策略，以新颖的创意与精湛的工艺为客户提供完善的会展服务，帮助企业塑造品牌帮&nbsp;助行业承办展览展会及会务。我们力求为每一位客户提供最有创意的设计、最符合标准的质量、最具人性化的服务。服务海内外各类著名企业，涉及工业、金融、IT业，及事业机关的展览展示设计、会展活动策&nbsp;划。公司对于每个项目自策划、设计、执行整个流程都实施标准化模式，把握细节、精准求实。我们拥有近5000平米的制作工厂，对每一个项目从设计稿到执行制作进行全程化操控，丰富的经验，高效的管理团&nbsp;队和诚信的售后服务体系，确保展会的完美品质。<br />\r\n	因为专注，所以我们更专业！<br />\r\n我们将通过不断的进步与完善，成为客户心中最信赖的伙伴，成为会展业知名企业。<br />\r\n	官网：www.ydzl88.com','sswqb941','李小姐','179090016','lilan@ydzl88.com','0755-8672-5810','0','1','1','','183.39.155.207','广东省深圳市电信','1','/attachment/information/201706/pre_1497942697ronuw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
