INSERT INTO my_information VALUES ('798','沧州角驰压瓦机设备厂家_厂家直销角驰彩钢瓦设备_三科机械','136','1497949361','365','1529485361','沧州角驰压瓦机设备厂家_厂家直销角驰彩钢瓦设备_三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n设备总长&nbsp;8.5m&nbsp;宽度&nbsp;1m&nbsp;高度&nbsp;1.5m<br />\r\n电机功率&nbsp;4Kw&nbsp;极数&nbsp;4极&nbsp;工作电压&nbsp;380V<br />\r\n生产速度&nbsp;8~10米/分<br />\r\n压型轴径&nbsp;?70mm&nbsp;的实心轴&nbsp;立板&nbsp;12mm<br />\r\n传动方式&nbsp;1寸链条传动<br />\r\n压型轮&nbsp;表面采用硬镀铬<br />\r\n成型部分&nbsp;分为精工式车轮旋转成型，成型效果好，减少轮子和原材料之间的摩擦力，调试方便、快捷。<br />\r\n整机成型轴&nbsp;共计18排轴<br />\r\n剪切刀&nbsp;采用Cr12材质，经高温淬火而成<br />\r\n配电箱&nbsp;台达PLC,低压电器组成<br />\r\n计数器&nbsp;彩用国产光电旋转统码器，A40S6-600-2-12-ACP<br />\r\n设备底架&nbsp;350号H钢<br />\r\n压板厚度&nbsp;0.3―0.8mm<br />\r\n随机附件&nbsp;普通上料架一套<br />\r\n泊头市三科冷弯机械有限公司专业生产彩钢瓦设备，单瓦机，双层压瓦机，三层压瓦机，C型钢机，无极切断C型钢设备，飞据切断C型钢机，扭断C型钢设备，角驰压瓦机，820角驰，760角驰机，470角驰压瓦机，470角驰压瓦机，楼乘板设备，750楼乘板设备，1025楼乘板设备，915楼乘板机，琉璃瓦成型设备，800竹节琉璃瓦设备，840琉璃瓦设备，828琉璃瓦机，加宽琉璃瓦设备，屋脊瓦设备，312屋脊瓦设备，450屋脊瓦成型设备，夹心板复合机，岩棉复合机，泡沫复合机，卷帘门设备，欧式卷帘门设备，抗风卷帘门，800卷帘门，250卷帘门设备，车库门设备，车库门吊柜机，卷帘门轨道机，大棚弯管，卡槽机，U型槽成型设备，汽车厢板机，集装厢板成型机，集装箱立柱设备，挡风抑尘成型设备，围挡设备，龙骨机，广告扣扳机，三维扣扳机，集成吊顶设备，货架成型设备，液压剪板机，液压折弯机，分条机，雨搭机，校平机，彩钢上料架，定做各种冷弯成型设备。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','110.252.86.149','河北省沧州市联通','1','/attachment/information/201706/pre_1497949361uk2p2.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('799','咸阳上海专业批发各种防爆电子锁JT-3000本安防爆磁力锁','136','1497952157','365','1529488157','咸阳咸阳上海专业批发各种防爆电子锁<br />\r\n井田JT-3000防爆电子锁,安全防爆：可用于爆炸性环境：1区，2区，井田防爆电子锁专业用于石油化工场所，配合各种品牌门禁控制系统使用，井田防爆电子锁使用寿命长，产品质量稳定耐用，厂家提供3年免费质保，井田JT-3000防爆电子锁厂家批发，价格更低，欢迎来电咨询。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n咸阳联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海批发防爆电子锁。咸阳咸阳','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1497952157vmrdp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('800','廊坊森卓|隔热f防晒涂料批发|隔热f防晒涂料产地','136','1497953642','365','1529489642','廊坊森卓|隔热f防晒涂料批发|隔热f防晒涂料产地&nbsp;|&nbsp;廊坊森卓化工有限公司<br />\r\n廊坊热反射隔热涂料多少钱？廊坊森卓告诉你价格。<br />\r\n廊坊森卓告诉你廊坊热反射隔热涂料价格多少钱。要价格便宜的热反射隔热涂料请找廊坊森卓化工有限公司购买。廊坊森卓化工有限公司的热反射隔热涂料价格便宜，质量一流。<br />\r\n森卓牌热反射隔热涂料是隔热涂层通过反射太阳光的热量，<br />\r\n来达到物体隔热降温效果，廊坊森卓化工有限公司是一家专业的研究隔热涂料的大型公司，结合中.国市场的实际情况，按照国家建筑反射隔热涂料标准（JG/T235-2014）,针对性的推出了热反射隔热涂料。涂料涂层对太阳反射率可达到90%，夏天时涂层降温可以达到15℃以上，空间温度可以降低3℃-10℃，而且太阳光越来越热，涂层降温温差就越明显。ZS-222光滑自洁，长久保持涂层的高效热反射性。涂料属于水性环保涂料，各项性能指标处于国内领先水平，在石化，运输，建筑等民用与工业领域具有极高的应用领域，能够满足物体的隔热降温，节能降耗等要求。<br />\r\n　　应用领域<br />\r\n　　ZS-222热反射隔热涂料可广泛用在建筑，化工，石油，电力，冶金，船舶，轻纺，储存，交通航天等行业，涂刷的材质可以是钢铁，铸铁，镀锌。铝，铜，不锈钢，彩钢板，镁，石头，木质，水泥，混凝土，砖瓦，陶瓷。玻璃。纺织物，布匹，塑料，纸张。有机玻璃，石棉，各类纤维板，胶木板，油毡，沥青，泡沫（海绵），聚氨酯，聚丙烯涂层表面等上隔热降温。欲了解廊坊热反射隔热涂料价格多少钱，请联系廊坊森卓化工有限公司崔先生，地址：河北廊坊开发区正大街18号，联系电话：0316-2186676<br />\r\n廊坊热反射隔热涂料,热反射隔热涂料价格,热反射隔热涂料多少钱','wycta417','崔先生','59284339','714385184@qq.com','0316-2186676','0','1','1','','101.30.26.179','北京市联通','1','/attachment/information/201706/pre_1497953642gwwew.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
