INSERT INTO my_information VALUES ('804','奥野,天津木地板抛光,天津木地板刷漆厂家','136','1497965861','365','1529501861','奥野,天津木地板抛光,天津木地板刷漆厂家&nbsp;|&nbsp;天津奥野清洗保洁有限公司<br />\r\n	奥野_天津木地板刷漆_天津木地板划痕处理022-26936126-1382100563-13672193649<br />\r\n	&nbsp;<br />\r\n	1、翻新前，地板表面难看还存在其他问题。&nbsp;2、地板表面刮痕很严重，这是家中地板最常见的问题。&nbsp;3、局部的地板开裂也较常见的问题，翻新时要一起解决掉。&nbsp;4、表面出现了轻微的起拱，这也是要在翻新过程中解决的。&nbsp;5、翻新好后的地板光亮、平坦如新，很难看不出跟新地板有多大区别。&nbsp;6、地板打磨有粗有细，应先用粗砂打磨，再细打。为了保证打磨效果，打磨时要用四种不同砂纸，从四个方向逐一打磨。&nbsp;7、一般的打磨机器外形大，无法准确地对墙角、角落等地方进行处理。这时要用专门的边角打磨机来做。&nbsp;8、墙角的最里面由于面积狭小，再小的机器也很难展开操作。因此像这种地方，还得由工人手工操作。&nbsp;9、有经验的工人在对边角落进行处理，为了保证整体效果，能不手工操作的地方还是交给机器来做。&nbsp;10、整个地板打磨好的效果。这时，地板表面应该平坦、没有高低起伏的现象。如果不平，应马上再打磨。&nbsp;11、地板开裂不严重的地方，应先涂上粘胶剂，以避免地板再次开裂。&nbsp;12、地板间的裂缝太大，这时要用细木条填好、封闭住，然后再上漆。&nbsp;13、地板轻微起拱，上漆前还得用钉子固定住，以免以后再发生这种现象。<br />\r\n	022-26936126-1382100563-13672193649','tian51635323','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','1','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_14979658611u55h.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
