INSERT INTO my_information VALUES ('819','天津清洗羊毛地毯公司,奥野,天津清洗酒店地毯公司报价','136','1498009055','365','1529545055','天津清洗羊毛地毯公司,奥野,天津清洗酒店地毯公司报价&nbsp;|&nbsp;天津奥野清洗保洁有限公司<br />\r\n	天津清洗酒店地毯公司|奥野|天津清洗地毯公司品牌022-26936126-13821000563-13672193649<br />\r\n	公司清洗保洁项目：地毯清洗部：??地毯清洗、清洗化纤地毯、清洗纯毛地毯、清洗酒店地毯、清洗宾馆地毯、清洗办公室地毯、清洗台球厅地毯、清洗家庭地毯；<br />\r\n　公司已拥有一定的长期固定客户，深受客户的信赖<br />\r\n我公司对：办公室的室内装修，地面几乎都是用地毯，因为铺设地毯可以减少办公室的噪音、为室内电脑布线提供极大的方便，而且还显得比较气派。但是铺设地毯<br />\r\n也有他很不好的一面，那就是清洁卫生问题，地毯如果被弄脏以后不仅十分难看，而且还会滋生细菌或尘螨。因此每个公司都应该为自己的地毯清洗对办公室安排一<br />\r\n个的地毯清洁计划，随时保持地毯的清洁状况，阻止细菌滋生。　　多久清洗一次地毯？　　从专业的角度来讲，我们建议您的办公室地毯至少每1-2个月清洗一<br />\r\n次。如果办公室的人员较多或公司条件允许，较好每个月清洗一次。我公司使用的清洁剂介绍：我们按照地毯的不同材质使用不同的清洁剂，主要使用的清洁剂有<br />\r\n有豫阳牌高泡地毯水，3M高泡地毯香波，强力化油剂。　　<br />\r\n1、豫阳牌高泡地毯水是一款中性清洁剂，适合清洗各类地毯。其含有污渍悬浮剂和特效催干剂，泡沫丰富，去污能力强，洗后地毯清香柔软，易干燥。　　<br />\r\n2、强力化油剂主要是针对油垢性污染，能够乳化和皂化各种各种油垢。施工时按照地毯的油垢程度配合地毯清洁剂使用。　　<br />\r\n（一）&nbsp;清洗地毯的作用及目的：美观、舒适、降低噪音、吸收灰尘。延长使用寿命、保持地毯良好的外观，维护室内空气质量、减少细菌滋生条件。<br />\r\n（二）地毯的种类：天然纤维、人造纤维、纯羊毛、尼龙<br />\r\n（三）地毯较佳护理方法：预防保护、局部除污、定期清洗、全面翻新。<br />\r\n（四）工具：清洗机、吸水机、风干机、蒸汽机、喷壶、工作指示牌。<br />\r\n（五）药剂：地毯清洁剂（高泡、低泡）、地毯除渍剂、除胶剂、中性清洁剂。所需工具高（低）泡地毯水，报废牙刷，地毯扒，清洁剂及报废布巾，吸尘吸水机器<br />\r\n注：1.&nbsp;地毯至少每年清洗1次以上，长时间不清洗，地毯毛容易踩塌，清洗后很难恢复以前的面貌。减少地毯的使用寿命。2.我们清洗剂全都是环保清洗剂，不会对地毯有任何损害，请放心使用。对于酒店、宾馆、写字楼等大型场所，公司根据实际情况制订长期清洗保养计划，价格6--8折，详情来电咨询。<br />\r\n本公司服务宗旨专业、安全、高效、环保.&nbsp;消毒。022-26936126-13821000563-13672193649','tian51635323','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','1','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498009055xwyxy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('820','高空车出租,广州众誉,吊车出租','136','1498009192','365','1529545192','高空车出租,广州众誉,吊车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州众誉高空车出租热线13600005563<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.129.121.147','广东省广州市电信','1','/attachment/information/201706/pre_1498009192lbzin.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('821','辽阳上海专业批发各种本安防爆磁力锁井田JT-3000防爆磁力','136','1498009896','365','1529545896','辽阳辽阳上海专业批发各种本安防爆磁力锁<br />\r\n本安防爆磁力锁用于石油化工危险区域，配合门禁控制器使用，专业厂家生产本安防爆磁力锁，价格优惠，品质高，寿命长，3年免费保修。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n外形结构和安装方式<br />\r\nJT-3000本安防爆电磁锁由安装在安全区的两个齐纳安全栅和安装在危险区的铝合金电磁锁组成，两者之间采用4×0.75mm2RVVP电缆连接。<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n辽阳辽阳联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海批发本安防爆磁力锁。辽阳','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498009896zozul.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
