INSERT INTO my_information VALUES ('838','玉溪破碎锤供应商_玉溪破碎锤推荐_云南得亿机械','136','1498020823','365','1529556823','云南得亿工程机械设备有限公司是一家专业从事液压昆明破碎锤厂家&nbsp;破碎锤批发代理生产、销售、进出口贸易的企业。公司自成立以来一直秉承“质量为本、客户至上”的经营宗旨，致力于为客户提供质量一流、价格适中液压破碎锤及配件，并以专业、周到的服务获得了广大客户的认可。<br />\r\n液压破碎锤定义：液压破碎锤的动力来源是挖掘机或装载机的泵站提供的压力油，它能在挖掘建筑物基础的作用中更有效地清理浮动的石块和岩石缝隙中的泥土。选用液压破碎锤的原则是根据挖掘机型号、作业的环境来选择最适合的液压破碎锤。<br />\r\n液压破碎锤工作原理分类：液压破碎器分为全液压式，液气联合式与氮爆式三大类。液气联合式依靠液压油和后部压缩氮气膨胀，同时推动活塞工作，绝大多数破碎器属于此类产品；根据配流阀结构分类：液压破碎器分为内置阀式和外置阀式两种<br />\r\n公司的经营范围包括：液压破碎锤及配件进出口贸易；破碎锤生产、加工、OEM；破碎锤及配件批发；破碎锤专业安装、维修服务。本公司所经营破碎锤全部使用原装韩国进口机芯，质量稳定、打击力强，产品质量位于行业前列，深受广大客户的好评。公司同时经营韩国顺天、韩国勇士、韩国迪科等品牌破碎锤。另有破碎锤上中下缸体、活塞、换向阀、长短螺栓、钎杆、油封等破碎锤全套配件批发供应。热忱欢迎广大客户莅临参观、指导、洽谈业务。','zm280148','邹敏','1146280883','zoumin148@163.com','0871-68350058','0','1','1','','218.63.94.135','云南省昆明市电信','1','/attachment/information/201706/pre_14980208238wawl.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('839','天津木地板刷漆|木地板翻新价格|奥野','136','1498022762','365','1529558762','天津木地板刷漆|木地板翻新价格|奥野&nbsp;|&nbsp;天津奥野清洗保洁有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	奥野_天津木地板刷漆_天津木地板划痕处理022-26936126-1382100563-13672193649<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianqingxi/20170313183304.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	1、翻新前，地板表面难看还存在其他问题。&nbsp;2、地板表面刮痕很严重，这是家中地板最常见的问题。&nbsp;3、局部的地板开裂也较常见的问题，翻新时要一起解决掉。&nbsp;4、表面出现了轻微的起拱，这也是要在翻新过程中解决的。&nbsp;5、翻新好后的地板光亮、平坦如新，很难看不出跟新地板有多大区别。&nbsp;6、地板打磨有粗有细，应先用粗砂打磨，再细打。为了保证打磨效果，打磨时要用四种不同砂纸，从四个方向逐一打磨。&nbsp;7、一般的打磨机器外形大，无法准确地对墙角、角落等地方进行处理。这时要用专门的边角打磨机来做。&nbsp;8、墙角的最里面由于面积狭小，再小的机器也很难展开操作。因此像这种地方，还得由工人手工操作。&nbsp;9、有经验的工人在对边角落进行处理，为了保证整体效果，能不手工操作的地方还是交给机器来做。&nbsp;10、整个地板打磨好的效果。这时，地板表面应该平坦、没有高低起伏的现象。如果不平，应马上再打磨。&nbsp;11、地板开裂不严重的地方，应先涂上粘胶剂，以避免地板再次开裂。&nbsp;12、地板间的裂缝太大，这时要用细木条填好、封闭住，然后再上漆。&nbsp;13、地板轻微起拱，上漆前还得用钉子固定住，以免以后再发生这种现象。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;white-space:normal;&quot;&gt;022-26936126-1382100563-13672193649&lt;/span&gt;&lt;span&nbsp;style=&quot;white-space:normal;&quot;&gt;&lt;/span&gt;&nbsp;<br />\r\n&lt;/p&gt;','tian51635323','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','1','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498022762ewvur.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
