INSERT INTO my_information VALUES ('843','桑黄供应商,桑黄功效,十月细润','136','1498029276','365','1529565276','桑黄供应商,桑黄功效,十月细润&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n	&nbsp;<br />\r\n	<br />\r\n		十月细润&nbsp;桑黄大叔:十月细润桑黄宁愿放弃部分客户也坚持初心&nbsp;<br />\r\n	<br />\r\n	在这里我只发布接地气的养生方法。&nbsp;<br />\r\n	跟我学习桑黄知识，让你和家人远离肿瘤癌症。&nbsp;<br />\r\n	搜索微信号码15044500386持续关注十月细润<br />\r\n	每天读一篇养生干货，让自己为健康做主&nbsp;<br />\r\n	每天学习一点桑黄知识，让你和家人远离肿瘤癌症&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	十月细润作为国内经营桑黄的高端品牌，随着服务客户数量的增多，逐渐被民众关注与认可。这一路走来，也产生了一些现实困难摆在我们的面前。&nbsp;<br />\r\n	1.出现了很多模仿的新商家。&nbsp;<br />\r\n	前几天我突然看到一篇微信公众号文章，里面的内容99%都是转载我“桑黄教授”里的一篇微文，只是改一些品牌名，但图片依然用的我们的。后来发现类似的情况很多，朋友们知道后都给我支招――纷纷让我去投诉，后来我拒绝朋友们的好意，因为我没有时间去跟这些模仿者纠缠，有这么多时间我还不如拿去做更有价值的事情，比如寻找优质桑黄，提升自己的健康管理能力，多写一些文章帮助更多的人获得健康。&nbsp;<br />\r\n	而且我始终认为，消费者是最不能欺骗的，时间久了他们能够分辨出来真假，这一点时间会给我们最公平的判决。&nbsp;<br />\r\n	2.很多人觉得贵，想找便宜的。&nbsp;<br />\r\n	经营桑黄这些年来，我们手上有很多潜在客户，他们也知道十月细润桑黄好，也想买，但是觉得贵，下不了手。&nbsp;<br />\r\n	曾经我看到过有的同行，同时经营几种桑黄，然后根据客户的经济能力来进行发货，比如，某个客户跟他买桑黄，一直在压价格，从6000一公斤一直压到2000一公斤,该商家为了不失去这位客户应下了这个要求，可在客户觉得占了大便宜了的时候其实已经上了当。因为你要记住没有人会做不赚钱的生意，他会给你发其他树上的“类桑黄”应付你，如果你不懂辨别，可能还一直沉浸在占了便宜的愉悦中。&nbsp;<br />\r\n	我们每天都会遇到很多新客户来问，为什么别人的桑黄才几十几百一公斤，你们的要几千？目前遇到这样的问题，我都会让他们看我们公众号里的文章，当他懂得桑黄有很多种，而十月细润只做最好的长白山野生桑树桑黄的时候，他便不再问这样的问题。&nbsp;<br />\r\n	所以，在我们这里，桑黄都是统一价格，没有优惠。而也恰恰如此，我们获得了很多客户，当然也会失去了部分客户。&nbsp;<br />\r\n	&nbsp;<br />\r\n	3.十月细润桑黄坚持做高端桑黄。&nbsp;<br />\r\n	十月细润之所以要做高端是有原因的。在我们开始接触桑黄的时候，就遇到了很多客户像是哀求又像是渴望，一而再的重复说，让我们务必发正宗的桑黄，是拿来救命用的。我们是知道的，80%以上的客户会找桑黄都是用来给家里的癌症患者用的，容不得半点马虎。于是，我当时就给自己定了标准，要么不做，做就做最好的。&nbsp;<br />\r\n	所以，现在每当人来问为什么我们的桑黄最贵的时候，我们会自豪的告诉他，因为我们十月细润只做最好的。&nbsp;<br />\r\n	当然这一路走来，我们并不容易。因为要对桑黄材料的一层层挑选，花费大量的成本和精力去收购野生桑树桑黄，以至于我们的成本要高，也因此我们失去了那些想寻找性价比高的“桑黄”的客户。同时还会被一些人扣上“暴利商业”的帽子。&nbsp;<br />\r\n	其实，了解十月细润或者一直关注我微信号的朋友应该知道，我开通这个平台，并不是简单的为了销售，更多的是让想买桑黄的人不被不良商家欺骗，让更多的人知道如果你买不到正宗的桑黄还不如吃点好的灵芝，希望通过自己的文章对更多的患者和家属有帮助，同时帮助更多的人关注健康管理。&nbsp;<br />\r\n	任何一场交易的进行都是双方自愿选择的，由于我们的“专注”、“专一”、“专业”，让要寻找优质桑黄的消费者锁定了我们，所以一直以来我们都不缺高端客户，而这一部分客户也最为优质，交谈起来都比较轻松容易，很多都成为了朋友。仅凭这些客户的信任与支持，十月细润就没有理由不去做高品质的桑黄。&nbsp;<br />\r\n	最近一段时间，加我微信咨询桑黄的人非常多，而且问的问题也各不相同，由于比较繁忙，我会挑部分人的问题来回答，而很多在公众号里已经提到过的知识点我就不再过多赘述。因为我事情比较多，实在抱歉，如果我没有回答你的问题，或许你可以到微信里来找答案。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	那问题来了，&nbsp;<br />\r\n	读完过这篇文章，&nbsp;<br />\r\n	你是否已经对桑黄抗肿瘤癌症的原理有所了解了呢？&nbsp;<br />\r\n	如果对桑黄或者防癌养生感兴趣的朋友，可以加我微信：18744555735&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	导购：十月细润桑黄&nbsp;<br />\r\n	&nbsp;指定销售商：&nbsp;<br />\r\n	&nbsp;通化十月细润生物科技有限公司&nbsp;<br />\r\n	&nbsp;销售热线：&nbsp;15044500386&nbsp;&nbsp;微信：15044500386','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','123.172.234.45','吉林省白城市电信','1','/attachment/information/201706/pre_1498029276z5o03.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
