INSERT INTO my_information VALUES ('848','南昌室内装潢设计培训班,师大高端,南昌学装潢设计哪里好','136','1498030725','365','1529566725','南昌室内装潢设计培训班,师大高端,南昌学装潢设计哪里好&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	南昌室内装潢设计培训班,南昌装潢设计速成班,师大高端<br />\r\n&nbsp;<br />\r\n	室内装潢设计<br />\r\n	南昌室内装潢设计培训班课程安排：<br />\r\n	【1】Photoshop初中级图像处理课程。<br />\r\n	【2】AutoCAD初中级课程<br />\r\n	【3】手绘课程<br />\r\n	【4】Auto&nbsp;CAD高级课程<br />\r\n	【5】三维造型设计：3Ds&nbsp;Max（二维与三维造型建模、材质编辑、灯光环境设置、效果图渲染输出等）<br />\r\n	【6】三维渲染输出：3D&nbsp;V-ray(V-ray渲染器概况、V-ray&nbsp;材料编辑器、V-ray&nbsp;灯光系统、V-ray材质与灯光综合应用、V-ray&nbsp;渲染输出)+Photoshop效果图后期处理<br />\r\n	【7】专业课程：<br />\r\n	1、室内预算及造价。<br />\r\n	2、装饰材料及施工工艺（掌握水泥、石材、陶瓷、S玻璃、板材、涂料、织物、塑料、金属、灯具、洁具、胶粘剂等各种材料的性能特点和应用范围，学习施工过程中质量管理的方法）；<br />\r\n	3、谈单技巧：进行一次成功的签单需要哪些步骤，注意哪些事项，谈桌上的利益、礼仪都是我们要学习的内容<br />\r\n	4、工地实践：导师带领学员们一起实际量房实践，在工地现场，以平时的理论与工地的实践相结合，让所学的理论知识以及对材料的了解，以及材料的运用，在施工现场得到最直观的理解。&nbsp;<br />\r\n5、毕业设计：专项设计训练做方案（居住空间设计、办公空间设计案例、商业空间设计案例、餐饮酒店装修案例、展示空间设计等）&nbsp;<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	南昌室内装潢设计培训班,南昌装潢设计速成班,师大高端&nbsp;南昌高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.37.171','江西省南昌市电信','1','/attachment/information/201706/pre_1498030725syh20.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
