INSERT INTO my_information VALUES ('851','天津清洗办公地毯,奥野,天津清洗酒店地毯公司推荐','136','1498031448','365','1529567448','天津清洗办公地毯,奥野,天津清洗酒店地毯公司推荐&nbsp;|&nbsp;天津奥野清洗保洁有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	天津清洗酒店地毯公司|奥野|天津清洗地毯公司品牌022-26936126-13821000563-13672193649<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	公司清洗保洁项目：地毯清洗部：??地毯清洗、清洗化纤地毯、清洗纯毛地毯、清洗酒店地毯、清洗宾馆地毯、清洗办公室地毯、清洗台球厅地毯、清洗家庭地毯；<br />\r\n&lt;/p&gt;<br />\r\n　公司已拥有一定的长期固定客户，深受客户的信赖&lt;br&nbsp;/&gt;<br />\r\n我公司对：办公室的室内装修，地面几乎都是用地毯，因为铺设地毯可以减少办公室的噪音、为室内电脑布线提供极大的方便，而且还显得比较气派。但是铺设地毯&lt;br&nbsp;/&gt;<br />\r\n也有他很不好的一面，那就是清洁卫生问题，地毯如果被弄脏以后不仅十分难看，而且还会滋生细菌或尘螨。因此每个公司都应该为自己的地毯清洗对办公室安排一&lt;br&nbsp;/&gt;<br />\r\n个的地毯清洁计划，随时保持地毯的清洁状况，阻止细菌滋生。　　多久清洗一次地毯？　　从专业的角度来讲，我们建议您的办公室地毯至少每1-2个月清洗一&lt;br&nbsp;/&gt;<br />\r\n次。如果办公室的人员较多或公司条件允许，较好每个月清洗一次。我公司使用的清洁剂介绍：我们按照地毯的不同材质使用不同的清洁剂，主要使用的清洁剂有&lt;br&nbsp;/&gt;<br />\r\n有豫阳牌高泡地毯水，3M高泡地毯香波，强力化油剂。　　&lt;br&nbsp;/&gt;<br />\r\n1、豫阳牌高泡地毯水是一款中性清洁剂，适合清洗各类地毯。其含有污渍悬浮剂和特效催干剂，泡沫丰富，去污能力强，洗后地毯清香柔软，易干燥。　　&lt;br&nbsp;/&gt;<br />\r\n2、强力化油剂主要是针对油垢性污染，能够乳化和皂化各种各种油垢。施工时按照地毯的油垢程度配合地毯清洁剂使用。　　&lt;br&nbsp;/&gt;<br />\r\n&lt;br&nbsp;/&gt;<br />\r\n（一）&nbsp;清洗地毯的作用及目的：美观、舒适、降低噪音、吸收灰尘。延长使用寿命、保持地毯良好的外观，维护室内空气质量、减少细菌滋生条件。&lt;br&nbsp;/&gt;<br />\r\n（二）地毯的种类：天然纤维、人造纤维、纯羊毛、尼龙&lt;br&nbsp;/&gt;<br />\r\n（三）地毯较佳护理方法：预防保护、局部除污、定期清洗、全面翻新。&lt;br&nbsp;/&gt;<br />\r\n（四）工具：清洗机、吸水机、风干机、蒸汽机、喷壶、工作指示牌。&lt;br&nbsp;/&gt;<br />\r\n（五）药剂：地毯清洁剂（高泡、低泡）、地毯除渍剂、除胶剂、中性清洁剂。所需工具高（低）泡地毯水，报废牙刷，地毯扒，清洁剂及报废布巾，吸尘吸水机器&lt;br&nbsp;/&gt;<br />\r\n注：1.&nbsp;地毯至少每年清洗1次以上，长时间不清洗，地毯毛容易踩塌，清洗后很难恢复以前的面貌。减少地毯的使用寿命。2.我们清洗剂全都是环保清洗剂，不会对地毯有任何损害，请放心使用。对于酒店、宾馆、写字楼等大型场所，公司根据实际情况制订长期清洗保养计划，价格6--8折，详情来电咨询。&lt;br&nbsp;/&gt;<br />\r\n本公司服务宗旨专业、安全、高效、环保.&nbsp;消毒。&lt;span&nbsp;style=&quot;white-space:normal;&quot;&gt;022-26936126-13821000563-13672193649&lt;/span&gt;&lt;br&nbsp;/&gt;','tian51635323','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','1','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498031448fnkoa.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('852','广州众誉_高空车出租价格_萝岗高空车出租','136','1498032361','365','1529568361','广州众誉_高空车出租价格_萝岗高空车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;提供广州高空作业车、云梯车、吊篮升降车出租服务佛山<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;租赁电话：13600005563<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','218.19.99.14','广东省广州市海珠区/荔湾区电信','1','/attachment/information/201706/pre_14980323610fkrp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
