INSERT INTO my_information VALUES ('857','曲靖品牌破碎锤_破碎锤厂家_云南得亿机械','136','1498040125','365','1529576125','云南得亿工程机械设备有限公司是一家专业从事液压昆明破碎锤厂家&nbsp;破碎锤批发代理生产、销售、进出口贸易的企业。公司自成立以来一直秉承“质量为本、客户至上”的经营宗旨，致力于为客户提供质量一流、价格适中液压破碎锤及配件，并以专业、周到的服务获得了广大客户的认可。<br />\r\n液压破碎锤定义：液压破碎锤的动力来源是挖掘机或装载机的泵站提供的压力油，它能在挖掘建筑物基础的作用中更有效地清理浮动的石块和岩石缝隙中的泥土。选用液压破碎锤的原则是根据挖掘机型号、作业的环境来选择最适合的液压破碎锤。<br />\r\n公司的经营范围包括：液压破碎锤及配件进出口贸易；破碎锤生产、加工、OEM；破碎锤及配件批发；破碎锤专业安装、维修服务。本公司所经营破碎锤全部使用原装韩国进口机芯，质量稳定、打击力强，产品质量位于行业前列，深受广大客户的好评。公司同时经营韩国顺天、韩国勇士、韩国迪科等品牌破碎锤。另有破碎锤上中下缸体、活塞、换向阀、长短螺栓、钎杆、油封等破碎锤全套配件批发供应。热忱欢迎广大客户莅临参观、指导、洽谈业务。','zm280148','邹敏','1146280883','zoumin148@163.com','0871-68350058','0','1','1','','218.63.94.135','云南省昆明市电信','1','/attachment/information/201706/pre_1498040125n0qsd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('858','济宁饲料成套设备转让.正昌饲料成套设备','136','1498042144','365','1529578144','我公司转让正昌饲料成套设备，设备有制粒机型号420的，2台正昌制造，&nbsp;90KW&nbsp;.粉碎机3台75KW,牧羊制造，混合箱5立方，1台，牧羊制造&nbsp;，冷却器2台，正昌制造，破碎机2台，&nbsp;打包机机3台，提升机8台，配电柜等，初[筛1台，平面回转筛3台，料仓20个，绞龙5根共30米，刮板等，油脂添加器一台，正昌制造，磁选筒4个，正昌制造，平台电缆等，设备有八成新<br />\r\n因开发转让正昌40型成电脑套颗粒饲料机组。包括40型制粒机。先进的滴水式粉碎机。配套的高效卧式混合机。卧式蒸汽锅炉。分级振动筛。逆流式颗粒冷却器.平台支架.电缆线.控制柜。等.正在使用.急卖因开发转让正昌40型成套颗粒饲料机组。包括40型制粒机。先进的滴水式粉碎机。配套的高效卧式混合机。卧式蒸汽锅炉。分级振动筛。逆流式颗粒冷却器.平台支架.电缆线.控制柜。等.正在使用.急卖因开发转让正昌40型成套颗粒饲料机组。包括40型制粒机。先进的滴水式粉碎机。配套的高效卧式混合机。卧式蒸汽锅炉。分级振动筛。逆流式颗粒冷却器.平台支架.电缆线.控制柜。等.正在使用.急卖因开发转让正昌40型成套颗粒饲料机组。包括40型制粒机。先进的滴水式粉碎机。配套的高效卧式混合机。卧式蒸汽锅炉。分级振动筛。逆流式颗粒冷却器.平台支架.电缆线.控制柜。等.正在使用.急卖因开发转让正昌40型成套颗粒饲料机组。包括40型制粒机。先进的滴水式粉碎机。配套的高效卧式混合机。卧式蒸汽锅炉。分级振动筛。逆流式颗粒冷却器.平台支架.电缆线.控制柜','hong7602149','贾红振','565715147','565715147@qq.com','0537-7602149','0','0','1','','119.182.83.9','山东省济宁市联通','1','/attachment/information/201706/pre_1498042144goeql.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
