INSERT INTO my_information VALUES ('863','漯河专业定制弹簧除尘骨架镀锌有机硅处理','136','1498094586','365','1529630586','明辉专业专业定制弹簧除尘骨架镀锌有机硅处理。<br />\r\n&nbsp;&nbsp;&nbsp;弹簧骨架是区别常规刚性除尘骨架的说法，使用在除尘器上部空间有限，常规除尘袋笼骨架无法更换的情况下。&nbsp;因而除尘器在设计时使用了弹簧骨架或者。骨架是外滤式除尘器必备的除尘器配件。表层可镀锌解决或者是喷塑解决。&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;弹簧骨架又可分有文氏管和无文氏管两种，拉伸扩大长度主要有1.5M，2M，2.5M&nbsp;我厂制作的弹簧骨架是使用直径为4毫米的钢丝围绕而成，强度更大，主要骨架直径为小于120毫米，蔓延后为25圈/米。表层采用镀锌或者喷塑后处理，也可依据存户的不一样场合请求，表层镀其它绝缘层。&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;明辉滤袋把握领先科技，秉承“高要求、高起点、高标准”的经营理念，以最佳的质量开拓市场，以最合理的价格占领市场，以最周到的服务赢得信誉。本厂视质量为生命，把客户的实际利益和自己的长远发展视为一体。多年来，本公司踏踏实实认真做好每一项工作，在产品质量和服务上赢得了广大用户的信任。<br />\r\n&nbsp;&nbsp;更多明辉弹簧除尘骨架袋笼详情请咨询&nbsp;明辉微信：fnbhzm','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.178.144','江苏省盐城市电信','1','/attachment/information/201706/pre_1498094586s1cx8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('864','球阀22ZO-M厂家_球阀22ZO-M图片_泰丰股份','136','1498094860','365','1529630860','球阀22ZO-M厂家_球阀22ZO-M图片_泰丰股份&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	买盖板式球阀22ZO-M到泰丰液压价格实惠买盖板式球阀22ZO-M到泰丰液压价格实惠买盖板式球阀22ZO-M到泰丰液压价格实惠电磁换向阀是用电磁铁直接推动阀芯移位工作的小型方向控制阀，主要用于控制液体的通断和流动方向，也可作为先导控制阀，以控制各种大通径的液压阀，实现对大功率液压阀的先导控制','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498094860dhdec.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('865','十大螺纹插装阀块品牌泰丰股份性价比最高','136','1498094939','365','1529630939','十大螺纹插装阀块品牌数泰丰股份性价比最高。山东泰丰液压股份有限公司位列十大螺纹插装阀块品牌，质量好、服务好。<br />\r\n　&nbsp;山东泰丰液压股份有限公司成立于2000年，占地20万平方米。系中.国液气密行业重点骨干及技术创新先进企业；国家级高新技术企业；国家火炬计划重点高新技术企业；中.国机械工业管理示范企业；2014年度中.国机械工业产品“优质品牌”企业；“中.国制造2025”2015年工业转型升级强基工程项目（超高压大流量比例伺服二通插装阀的研发及产业化）承担企业；中.国首批“中.国制造业产品单项冠军企业”及液压二通插装阀国家标准主持起草和修订企业。<br />\r\n　　公司专业从事高端液压元件的研究、研发与生产。主要产品有电液比例伺服二通插装阀、比例伺服阀、高压柱塞泵、负载敏感多路阀、高压油缸及电液集成系统等。是全球二通插装阀生产规模和年产量最大的厂家，年产集成阀块7000吨，各类液压控制元件85万件，二通插装阀市场占有率在70%以上，在锻压行业高达90%。产品广泛应用于铸锻机械、汽车制造、冶金机械、船舶机械、工程机械、农业机械及石油机械等领域，批量客户达800余家。性价比最高的十大螺纹插装阀块品牌首选山东泰丰液压股份有限公司。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498094939fkuri.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('866','深圳工业管道疏通清洗 高压清洗管道清淤','136','1498095823','365','1529631823','深圳工业管道疏通清洗&nbsp;高压清洗管道清淤。<br />\r\n宏鑫市政告诉你深圳工业管道疏通清洗&nbsp;高压清洗管道清淤价格多少钱。要价格便宜的工业管道疏通清洗&nbsp;高压清洗管道清淤请找深圳宏鑫市政购买。深圳宏鑫市政的工业管道疏通清洗&nbsp;高压清洗管道清淤价格便宜，质量一流。<br />\r\n深圳&nbsp;化粪池清理_不锈钢水箱水池清洗_宏鑫市政182-1808-6986<br />\r\n宏鑫市政工程建设有限公司&nbsp;www.hongxingc.com&nbsp;是广东地区最具势力的市政工程建设公司，专注于政管道疏通、下水道疏通、管道清淤、河道清淤、箱渠箱涵清理、污水池清理、池塘理清、化粪池清理、污水池清理、排水沟清淤、污水道清淤、沉淀池清淤、管渠清淤、明暗管渠清淤、河涌清淤、河道清理、箱渠清淤等业务，多年来在行业中留下了良好的口杯，<br />\r\n同时公司注入过千万资金购买先进的设备，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施，公司拥有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n欢迎来电咨询：&nbsp;182-1808-6986&nbsp;&nbsp;&nbsp;&nbsp;戴经理<br />\r\nwww.hongxingc.com<br />\r\n广东省全方位施工服务；深圳、广州、东莞、中山、佛山、珠海、江门、湛江、阳江（阳江市、江城区、阳春市、阳西县、阳东县）等；遍布珠三角地区；&nbsp;&nbsp;<br />\r\n欲了解深圳工业管道疏通清洗&nbsp;高压清洗管道清淤价格多少钱，请联系深圳宏鑫市政戴经理，地址：广东深圳龙华观澜环观中路28号Ａ栋首层，联系电话：755-18218086<br />\r\n深圳工业管道疏通清洗&nbsp;高压清洗管道清淤,工业管道疏通清洗&nbsp;高压清洗管道清淤价格,工业管道疏通清洗&nbsp;高压清洗管道清淤多少钱','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','1','1','','219.134.7.232','广东省深圳市福田区电信','1','/attachment/information/201706/pre_1498095823mgjtm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('867','高空车租赁电话品牌_高空车租赁电话产地_广州众誉','136','1498097213','365','1529633213','高空车租赁电话品牌_高空车租赁电话产地_广州众誉&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州高空车出租电话:020-13600005<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司提供广州广州高空车出租电话售后服务。<br />\r\n广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.129.121.147','广东省广州市电信','1','/attachment/information/201706/pre_1498097213bjpyl.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('868','天津月子中心系统 月子中心的管理指南-康乐志','136','1498099154','365','1529635154','天津月子中心系统&nbsp;月子中心的管理指南-康乐志<br />\r\n月子中心系统介绍<br />\r\n康乐志月子中心系统主要有服务预约、产后母婴健康管理、专家巡诊、专业护士、月嫂管理、丰富多样的月子餐管理、产妇产后健康恢复、客房管理、会员管理、在线订餐、在线购物等功能。<br />\r\n本系统支持酒店服务式、独栋建筑园区式、医院附属式、社区家庭式四大模式月子中心的实体运营。<br />\r\n康乐志月子中心系统功能<br />\r\n?	会员管理<br />\r\n1.	会员信息管理、会员帐务体系、会员关怀服务<br />\r\n2.	提供尊享的会员奖励与优惠<br />\r\n3.	会员分析与保持<br />\r\n?	健康管理<br />\r\n1.	宝宝睡眠、喂养、免疫、疾病等数据管理&nbsp;<br />\r\n2.	妈妈生活、美容修身、食谱、心理指导护理数据管理<br />\r\n?	财务管理<br />\r\n1.	客户服务费用，房费、增值服务及商品购买<br />\r\n2.	门店运营成本，房租、员工薪资、消耗物资、商品采购、品牌宣传等<br />\r\n?	商城管理<br />\r\n1.	优惠活动及商品展示<br />\r\n2.	服务推送<br />\r\n3.	门店风采展示<br />\r\n?	企业管理<br />\r\n1.	人事管理<br />\r\n2.	工作任务管理<br />\r\n3.	销售报表与成果统计<br />\r\n4.	货品及库存管理<br />\r\n增值服务<br />\r\n?	手持作业系统<br />\r\n所有母婴用品二维码标签管理，扫码一下完成护理<br />\r\n?	客户应用<br />\r\n1．	实时掌握妈妈与宝宝健康数据<br />\r\n2．	实时账户管理<br />\r\n3．	在线购买服务或产品<br />\r\n4．	享受服务效果反馈<br />\r\n?	中心定制<br />\r\n我们拥有专业的软件开发和整体解决方案提供能力,覆盖网站开发、管理系统开发、andriod、ios、&nbsp;WP等平台APP应用开发、移动智能、二维码、微信小程序、物联网等高技术难度项目开发。可以满足客户针对现有系统进行功能加减、个性化更改,或者全新项目开发等需求。','yufongkeji1','经理','2567077317','m15168255342@163.com','40068825','0','1','1','','115.216.3.7','浙江省宁波市电信','1','/attachment/information/201706/pre_1498099154lytcp.gif','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('869','丹东上海海栌门控专业批发各种本安防爆电磁锁价格更低','136','1498100118','365','1529636118','丹东丹东上海专业批发各种本安防爆电磁锁<br />\r\n国内专业的本安防爆磁力锁生产厂家，上海海栌门控科技有限公司专业生产本安防爆磁力锁，价格优惠，欢迎来电订购，021-51692106<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n4、工作原理<br />\r\nJT-3000本安防爆电磁锁由两个齐纳安全栅和铝合金电控磁力锁两部分构成。电源安全栅连接电磁锁的供电端，+12V直流电压经过安全栅后提供给电磁锁，使电磁锁产生最大240公斤的吸合力从而将门锁住。信号安全栅连接电磁锁的信号输出端，门被锁住后开关信号输出，门被打开后打开，门锁控制主机通过检测两个检测端的信号来判断门的状态从而做出正确的操作。<br />\r\n<br />\r\n<br />\r\n丹东联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海批发本安防爆电磁锁。丹东丹东','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498100118rjl24.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('870','后视镜防雨剂 滴水不沾 尚蒙科技','136','1498100591','365','1529636591','后视镜防雨剂&nbsp;滴水不沾&nbsp;尚蒙科技<br />\r\n雨天驾车行驶时，后视镜由于雨水的影响，视线模糊，大大降低了驾驶的体验和安全性，而市场上的防雨剂都是疏水剂产品，对于后视镜而言作用不大，针对这个问题，尚蒙科技开发了专门应用于后视镜的超级防雨剂，专利产品，采用纳米技术，超疏水产品，做到真正的滴水不沾。本产品技术属国内首创，价格实惠，一瓶可用6-10次。<br />\r\n配合尚蒙防雨剂和防雾剂使用，可大大提升驾车的安全性和舒适性。<br />\r\n	咨询电话：18001518665&nbsp;杨先生','solmont168','杨得全','653576457','2636002476@qq.com','510-85386636','0','1','1','','58.214.215.72','江苏省无锡市电信','1','/attachment/information/201706/pre_14981005919qzgz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
