INSERT INTO my_information VALUES ('890','泡沫玻璃厂家直销泡沫玻璃保温板泡沫玻璃板A级防火保温板','136','1498126042','365','1529662042','泡沫玻璃厂家直销泡沫玻璃A级防火保温板<br />\r\n泡沫玻璃保温板是由碎玻璃、发泡剂、改性添加剂和发泡促进剂等，经过细粉碎和均匀混合后，再经过高温熔化，发泡、退火而制成的无机非金属玻璃材料。它是由大量直径为1～2毫米的均匀气泡结构组成。其中吸声泡沫玻璃保温板为50%以上开孔气泡，绝热泡沫玻璃为75%以上的闭孔气泡，制品密度为160-220千克/立方米，可以根据使用的要求，通过生产技术参数的变更进行调整。&nbsp;泡沫玻璃保温板因其具有重量轻、导热系数小、吸水率小、不燃烧、不霉变、强度高、耐腐蚀、无毒、物理化学性能稳定等优点被广泛应用于石油、化工、地下工程、国防军工等领域，能达到隔热、保温、保冷、吸音之效果，另外还广泛用于民用建筑外墙和屋顶的隔热保温，随着人类对环境保护的要求越来越高，泡沫玻璃将成为城市民用建筑的高级墙体绝热材料和屋面绝热材料。泡沫玻璃以其无机硅酸盐材质和独立的封闭微小气孔汇集了不透气、不燃烧、防啮防蛀、耐酸耐碱（氢氟酸除外）、无毒、无放射性、化学性能稳定、易加工而且不变形等特点，使用寿命等同于建筑物使用寿命，是一个既安全可靠又经久耐用的建筑节能环保材料。','shundebaowen','张经理','1324014675','1324014675@qq.com','0316-3281080','0','0','1','','101.75.196.102','河北省联通','1','/attachment/information/201706/pre_1498126042hlrnr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
