INSERT INTO my_information VALUES ('902','澳门小儿推拿师宝宝发烧绿色疗法全攻略，金母子推荐妈咪关注！','136','1498186251','365','1529722251','发烧只是免疫系统被调动起来对抗病毒的表现。通常情况下，腋下温度超过37.2°C，耳温超过37.8℃，口腔温度超过37.5℃，肛门温度超过38℃定义为发烧。腋温37.3℃～38℃为低热，38℃～39℃属于中度发热，39℃～40℃属于高热，40℃以上为超高热。<br />\r\n发烧也不会把孩子烧成脑膜炎，发烧是脑膜炎的症状之一，但脑膜炎常常还伴有头颈僵硬、昏迷等症状。所以发烧时，妈妈并不用过于担心。只要宝宝腋下温度38.5℃以下，表现出来的精神状态好，玩耍等活动不受影响的话，就没有必要退烧。<br />\r\n腋下温度38.5℃以上，妈妈需要根据实际情况酌情处理。如果宝宝精神好，可以观察看看。如果宝宝精神不佳、嗜睡，就要赶紧退烧<br />\r\n帮宝宝退烧时，除了常用的退烧药，有很多绿色的方法退烧效果也特别好，一用就见效：<br />\r\n1藿香正气液敷肚脐<br />\r\n取一个棉花球，吸满藿香正气液后，敷在宝宝肚脐上，直接医用胶带固定，基本一小时后退烧。这个方法是一位针灸师推荐的，操作简单，见效快，退烧效果特别好，还能治疗腹泻。<br />\r\n2清天河水+打马过天河<br />\r\n天河水位于前臂内侧正中线，自腕至肘呈一条直线。用食指和中指蘸取一些清水，由腕到肘，直推300-500次，名为清天河水。而打马过天河的方向和位置与天河水一致，不过操作手法是用食指和中指两指蘸水，然后从腕到肘方向在皮肤上敲打，发出类似小马过河，马蹄拍打水面的响声。<br />\r\n要一边敲打，一边朝同一方向吹气，天河水是人体的清凉之源，推这个穴位，就像打开了让身体清凉的开关，同时蘸有清水，本身就有清凉的感觉，吹气时又能加速水汽的蒸发，故而可以迅速带走体内的高温。<br />\r\n4退六腑300次<br />\r\n六腑是前臂靠小手指那一侧的直线，从肘推向腕。这个穴位能退五脏六腑实热，如果宝宝烧到39.5以上，妈妈可以直接推这个穴位，尤其针对高烧不退，宝宝精神不好使用，效果更是明显。<br />\r\n5蘸水捏脊<br />\r\n双手蘸水反复捏脊20遍，最后，在背部水未蒸发前，用嘴从下往上吹气，一直吹到大椎穴，把水汽吹散、吹干。这个方法也能迅速带走高温，搭配外感四大手法使用，效果更佳。<br />\r\n6葱油抹手心<br />\r\n葱一把，切成丁，捣烂后用纱布包起来拧出葱汁，然后加入少量香油和匀后。用手指蘸上葱油，分别在孩子的手心、脚心、额头、脖颈和后背处摩擦二三十下。很快，宝宝就会出汗，汗出烧即退。<br />\r\n7生姜敷手腕<br />\r\n生姜一小块(约10克)，捣成糊状，敷在手腕处的高骨上，或直接切片贴在高骨处，用医用纱布裹住后，贴上胶布固定，一般40分钟左右就可以退烧。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','59.57.235.72','福建省厦门市电信','1','/attachment/information/201706/pre_14981862517go6u.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('903','武汉月子中心系统开发功能齐全，更加人性化-康乐志','136','1498186547','365','1529722547','武汉月子中心系统开发功能齐全，更加人性化-康乐志<br />\r\n月子中心系统开发介绍<br />\r\n康乐志月子中心系统开发主要有服务预约、产后母婴健康管理、专家巡诊、专业护士、月嫂管理、丰富多样的月子餐管理、产妇产后健康恢复、客房管理、会员管理、在线订餐、在线购物等功能。<br />\r\n本系统支持酒店服务式、独栋建筑园区式、医院附属式、社区家庭式四大模式月子中心的实体运营。<br />\r\n康乐志月子中心系统开发功能<br />\r\n?	会员管理<br />\r\n1.	会员信息管理、会员帐务体系、会员关怀服务<br />\r\n2.	提供尊享的会员奖励与优惠<br />\r\n3.	会员分析与保持<br />\r\n?	健康管理<br />\r\n1.	宝宝睡眠、喂养、免疫、疾病等数据管理&nbsp;<br />\r\n2.	妈妈生活、美容修身、食谱、心理指导护理数据管理<br />\r\n?	财务管理<br />\r\n1.	客户服务费用，房费、增值服务及商品购买<br />\r\n2.	门店运营成本，房租、员工薪资、消耗物资、商品采购、品牌宣传等<br />\r\n?	商城管理<br />\r\n1.	优惠活动及商品展示<br />\r\n2.	服务推送<br />\r\n3.	门店风采展示<br />\r\n?	企业管理<br />\r\n1.	人事管理<br />\r\n2.	工作任务管理<br />\r\n3.	销售报表与成果统计<br />\r\n4.	货品及库存管理<br />\r\n增值服务<br />\r\n?	手持作业系统<br />\r\n所有母婴用品二维码标签管理，扫码一下完成护理<br />\r\n?	客户应用<br />\r\n1．	实时掌握妈妈与宝宝健康数据<br />\r\n2．	实时账户管理<br />\r\n3．	在线购买服务或产品<br />\r\n4．	享受服务效果反馈<br />\r\n?	中心定制<br />\r\n我们拥有专业的软件开发和整体解决方案提供能力,覆盖网站开发、管理系统开发、andriod、ios、&nbsp;WP等平台APP应用开发、移动智能、二维码、微信小程序、物联网等高技术难度项目开发。可以满足客户针对现有系统进行功能加减、个性化更改,或者全新项目开发等需求。','yufongkeji1','经理','2567077317','m15168255342@163.com','40068825','0','1','1','','115.216.3.7','浙江省宁波市电信','1','/attachment/information/201706/pre_14981865471ykwl.gif','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('904','TRM15多路阀价格,泰丰股份,TRM15多路阀品牌','136','1498186660','365','1529722660','TRM15多路阀价格,泰丰股份,TRM15多路阀品牌&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	TRM系列多路换向阀是目前引进、消化、吸收国内外最先进技术研制的一种液压控制元件。它可以替代目前国内外使用的各种同规格尺寸及要求的多路换向阀，适用于各种中小型工程机械、农业机械、市政机械如挖掘机、小型装载机、高空作业车等的液压系统。<br />\r\n	产品特点：通过负载压力反馈来提供工作所需的最高压力和流量。显著地节约了能源并有效地保护了整个系统和最大利用了系统的功率。差压阀的应用使得各工作油口的流量不受负载的影响，并可设定不同工作口流量，适应工况要求，而且动作反应灵敏、精确。压力补偿器的使用保证了在欠流量状态下各工作油口能顺利同时工作。紧凑片结构，可以根据不同的工况要求任意组合成相应的1~10片多路阀，显著提高功率密度。并联结构回路，保证各执行机构独立动作，互补干涉。可','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498186660qam3x.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('905','海通期货开户','136','1498186882','365','1529722882','海通期货是海通证券控股的子公司，注册资本13亿元，全国40余家营业部，下设风险管理子公司，香港子公司。<br />\r\n海通期货获得ISO9001:2008质量管理体系。首批获得期货投资咨询、资产管理、基金销售、保险机构期货经纪、股票期权经纪等业务资格，并获准进入银行间债券市场。<br />\r\n海通期货的成交量和成交额连续多年行业第一，客户规模连续6年排名行业前列，在金融期货和众多主要商品期货品种上具有极高的市场份额，各项业务指标位居行业前列。<br />\r\n在稳健发展的十余年间，以良好的企业形象受到监管部门和社会各界的充分肯定，屡获殊荣。','kpfoa296','客服','','103170202@qq.com','4008260936','0','1','1','','122.228.130.122','浙江省温州市电信','1','/attachment/information/201706/pre_1498186882kwz69.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('906','广东疏通沙井清掏淤泥 泥沙堵塞管道疏通 宏鑫市政最专业','136','1498187033','365','1529723033','深圳宏鑫市政是最专业的广东疏通沙井清掏淤泥&nbsp;泥沙堵塞管道疏通厂家。<br />\r\n深圳下水道疏通_污水池清理_河道垃圾清理公司&nbsp;&nbsp;182-1808-6986<br />\r\n宏鑫市政工程建设有限公司&nbsp;www.hongxingc.com&nbsp;是广东地区最具势力的市政工程建设公司，专注于政管道疏通、下水道疏通、管道清淤、河道清淤、箱渠箱涵清理、污水池清理、池塘理清、化粪池清理、污水池清理、排水沟清淤、污水道清淤、沉淀池清淤、管渠清淤、明暗管渠清淤、河涌清淤、河道清理、箱渠清淤等业务，多年来在行业中留下了良好的口杯，<br />\r\n同时公司注入过千万资金购买先进的设备，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施，公司拥有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n欢迎来电咨询：&nbsp;182&nbsp;1808&nbsp;6986&nbsp;&nbsp;&nbsp;&nbsp;戴经理<br />\r\nwww.hongxingc.com<br />\r\n广东省全方位施工服务；深圳、广州、东莞、中山、佛山、珠海、江门、湛江、阳江（阳江市、江城区、阳春市、阳西县、阳东县）等；遍布珠三角地区；&nbsp;&nbsp;疏通沙井清掏淤泥&nbsp;泥沙堵塞管道疏通厂家咨询电话：755-18218086','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','0','1','','219.134.229.4','广东省深圳市电信','1','/attachment/information/201706/pre_1498187033yj9m7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('907','云浮上海专业批发各种防爆电锁JT-3000本安防爆磁力锁','136','1498189773','365','1529725773','云浮云浮上海专业批发各种防爆电锁<br />\r\n井田防爆电锁是一款专业用于石油化工危险区域的电子门锁，井田防爆电锁是一种能够使用在爆炸性气体环境中采用本质安全&nbsp;防爆形式的一种防爆电锁，井田防爆电锁具有结构简单、便于安装维修、无磨损等特点，井田防爆电锁比同类产品寿命长，可靠性高，发生危险时断电解锁便于逃生，特别适用于石油化工等爆炸&nbsp;性环境现场，具有很高的安全性。厂家提供3年免费质保。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n&nbsp;<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n云浮云浮联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海批发防爆电锁。云浮','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498189773ronuw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('908','干锅鸭爪去哪学_好滋餐饮味_铁板烧学习','136','1498192377','365','1529728377','干锅鸭爪去哪学_好滋餐饮味_铁板烧学习&nbsp;|&nbsp;沈阳好滋味餐饮管理有限公司<br />\r\n沈阳铁板烧培训哈尔滨哪里教干锅鸭爪技术<br />\r\n好滋味欢迎各位学员考察学习，详情请拨打电话：沈阳：18940014011赵经理，13998816601宣经理。吉林内蒙古：15140178540，黑龙江：15124512980，（微信同步）。<br />\r\n郑重承诺：包教包会，学会为止，一期学不会下期免费复学，收费透明，除学费以外没有任何形式收费。<br />\r\n好滋味餐饮集团自成立至今已走过九个春秋，培训学员万人之多，本公司始终秉承着全方位服务大众的思想理念，全心全意为广大学员服务的宗旨，细心教学，综合指导技术，坚持诚信经营，专业教学，不断在实践与工作中总结经验，在教学过程中完善各方面的不足，以市场发展为向导，顺应小吃市场的发展潮流，不断推陈出新，革故鼎新。我们一如既往的对每一位学员负责的心态传授学员真技术，从每个学员零基础到做出成品，中间的每一个细节流程全部细心指导，配方配料毫无保留的教您，学期不限制，学会为止，满意为止。学习过程中学员亲自动手操作练习，反复练习制作成品，保证味道正宗，学成之后保证每位学员都能达到开店的水平，后续有任何问题随时可以免费回来复习，我们对您负责到底，本着互利共赢的状态为您服务，终身免费技术升级，免费技术复习，本公司承诺除了技术学费没有其他的任何收费，包教包会。','wnptu821','刘经理','995734565','995734565@qq.com','024-23411016','0','1','1','','101.46.200.118','辽宁省沈阳市鹏博士长城宽带','1','/attachment/information/201706/pre_1498192377kdyoj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('909','多旋翼巡查无人机供应商,星环航空,多旋翼巡查无人机加盟','136','1498194210','365','1529730210','多旋翼巡查无人机供应商,星环航空,多旋翼巡查无人机加盟&nbsp;|&nbsp;必扬星环（北京）航空科技有限公司<br />\r\n	星环航空BR-A-1多旋翼无人机系统，采用国际先进的控制算法和安全可靠的飞行器总体设计方案。具备续航时间长、飞行姿态稳定、载重大等优点，在业内处于先进水平。&nbsp;<br />\r\n	<br />\r\n	星环航空BR-A-1采用模块化的设计和速拆结构，简化了用户的安装调试工作，方便用户携带。系统引入了先进的总线系统，AAHRS（姿态、高度及航向参考系统）集成了加速度计、陀螺仪、磁力计、气压计、RTK&nbsp;等多种高精度传感器和卓越的控制算法设计，让使用者对飞行器的操控变得及其简单，即使操作者毫无遥控飞行的经验，也能够在很短的时间内学会安全地操控飞行，使操作者可以将精力集中于操控挂载设备，完成飞行任务。&nbsp;<br />\r\n	视频传输子系统采用全数字调制解调技术，具备多载波等技术特点，抗多径能力强，具备“非视距”、“绕射”传输特点和良好的穿透能力，能够高质量的满足无人机无线通信任务。&nbsp;<br />\r\n	任务挂载子系统包含多种任务挂载设备，根据挂载设备的不同，无人机系统可应用于公安民警、巡特警、交警、边防、消防、电力巡检、遥感测绘、数字城市、智慧城市、石油管线巡检等各种低空应用场景。&nbsp;&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	系统特性：&nbsp;<br />\r\n	2&nbsp;&nbsp;六旋翼设计，机臂上翘，重心下移,保障飞行平稳性&nbsp;<br />\r\n	2&nbsp;&nbsp;旋翼内倾设计,提供优秀的抗风能力，增加飞行平稳性&nbsp;<br />\r\n	2&nbsp;&nbsp;碳纤维机身，刚性好，重量轻&nbsp;<br />\r\n	2&nbsp;&nbsp;模块化及机臂快拆结构设计，方便携带运输，展开迅速，组装时间不超过1分钟&nbsp;<br />\r\n	2&nbsp;&nbsp;超长的续航时间及飞行距离&nbsp;<br />\r\n	2&nbsp;&nbsp;卓越的动力冗余，可在高海拔处正常工作&nbsp;<br />\r\n	2&nbsp;&nbsp;高清数字图传系统，支持图像实时传输&nbsp;<br />\r\n	2&nbsp;&nbsp;高度集成防雨云台套件设计，可雨中飞行&nbsp;<br />\r\n	2&nbsp;&nbsp;智能飞控系统，支持手动精准操控及自主飞行模式&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	飞行特性：&nbsp;<br />\r\n	?&nbsp;&nbsp;垂直起降，不受场地限制&nbsp;<br />\r\n	?&nbsp;&nbsp;传统遥控器手动精准控制&nbsp;<br />\r\n	?&nbsp;&nbsp;一键起飞，一键降落，自动返航&nbsp;<br />\r\n	?&nbsp;&nbsp;航线规划，自主飞行&nbsp;<br />\r\n	?&nbsp;&nbsp;即点即到，指点飞行&nbsp;<br />\r\n	?&nbsp;&nbsp;飞行数据实时监测&nbsp;<br />\r\n	&nbsp;<br />\r\n	环境适应性：&nbsp;<br />\r\n	?&nbsp;&nbsp;海拔5000米以下地区均可正常使用&nbsp;<br />\r\n	?&nbsp;&nbsp;环境温度低于-30°时可正常使用&nbsp;<br />\r\n	?&nbsp;&nbsp;抗风能力不低于15m/s&nbsp;<br />\r\n	?&nbsp;&nbsp;平均无故障时间350小时&nbsp;<br />\r\n	?&nbsp;&nbsp;常温下飞行续航时间长，不少于40分钟&nbsp;<br />\r\n	<br />\r\n	联系电话：18612990852；18610599267','gyodo999','黄杰琦','','biyangxinghuan@163.com','010-57487720','0','1','1','','106.38.97.162','北京市电信','1','/attachment/information/201706/pre_1498194210hlqnh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
