INSERT INTO my_information VALUES ('912','多旋翼无人机,无人机销售,星环航空','136','1498198485','365','1529734485','多旋翼无人机,无人机销售,星环航空&nbsp;|&nbsp;必扬星环（北京）航空科技有限公司<br />\r\n	星环航空BR-A-1多旋翼无人机系统，采用国际先进的控制算法和安全可靠的飞行器总体设计方案。具备续航时间长、飞行姿态稳定、载重大等优点，在业内处于先进水平。&nbsp;<br />\r\n	<br />\r\n	星环航空BR-A-1采用模块化的设计和速拆结构，简化了用户的安装调试工作，方便用户携带。系统引入了先进的总线系统，AAHRS（姿态、高度及航向参考系统）集成了加速度计、陀螺仪、磁力计、气压计、RTK&nbsp;等多种高精度传感器和卓越的控制算法设计，让使用者对飞行器的操控变得及其简单，即使操作者毫无遥控飞行的经验，也能够在很短的时间内学会安全地操控飞行，使操作者可以将精力集中于操控挂载设备，完成飞行任务。&nbsp;<br />\r\n	视频传输子系统采用全数字调制解调技术，具备多载波等技术特点，抗多径能力强，具备“非视距”、“绕射”传输特点和良好的穿透能力，能够高质量的满足无人机无线通信任务。&nbsp;<br />\r\n	任务挂载子系统包含多种任务挂载设备，根据挂载设备的不同，无人机系统可应用于公安民警、巡特警、交警、边防、消防、电力巡检、遥感测绘、数字城市、智慧城市、石油管线巡检等各种低空应用场景。&nbsp;&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	系统特性：&nbsp;<br />\r\n	2&nbsp;&nbsp;六旋翼设计，机臂上翘，重心下移,保障飞行平稳性&nbsp;<br />\r\n	2&nbsp;&nbsp;旋翼内倾设计,提供优秀的抗风能力，增加飞行平稳性&nbsp;<br />\r\n	2&nbsp;&nbsp;碳纤维机身，刚性好，重量轻&nbsp;<br />\r\n	2&nbsp;&nbsp;模块化及机臂快拆结构设计，方便携带运输，展开迅速，组装时间不超过1分钟&nbsp;<br />\r\n	2&nbsp;&nbsp;超长的续航时间及飞行距离&nbsp;<br />\r\n	2&nbsp;&nbsp;卓越的动力冗余，可在高海拔处正常工作&nbsp;<br />\r\n	2&nbsp;&nbsp;高清数字图传系统，支持图像实时传输&nbsp;<br />\r\n	2&nbsp;&nbsp;高度集成防雨云台套件设计，可雨中飞行&nbsp;<br />\r\n	2&nbsp;&nbsp;智能飞控系统，支持手动精准操控及自主飞行模式&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	飞行特性：&nbsp;<br />\r\n	?&nbsp;&nbsp;垂直起降，不受场地限制&nbsp;<br />\r\n	?&nbsp;&nbsp;传统遥控器手动精准控制&nbsp;<br />\r\n	?&nbsp;&nbsp;一键起飞，一键降落，自动返航&nbsp;<br />\r\n	?&nbsp;&nbsp;航线规划，自主飞行&nbsp;<br />\r\n	?&nbsp;&nbsp;即点即到，指点飞行&nbsp;<br />\r\n	?&nbsp;&nbsp;飞行数据实时监测&nbsp;<br />\r\n	&nbsp;<br />\r\n	环境适应性：&nbsp;<br />\r\n	?&nbsp;&nbsp;海拔5000米以下地区均可正常使用&nbsp;<br />\r\n	?&nbsp;&nbsp;环境温度低于-30°时可正常使用&nbsp;<br />\r\n	?&nbsp;&nbsp;抗风能力不低于15m/s&nbsp;<br />\r\n	?&nbsp;&nbsp;平均无故障时间350小时&nbsp;<br />\r\n	?&nbsp;&nbsp;常温下飞行续航时间长，不少于40分钟&nbsp;<br />\r\n	<br />\r\n	联系方式：18612990852；18610599267','gyodo999','黄杰琦','','biyangxinghuan@163.com','010-57487720','0','1','1','','106.38.97.162','北京市电信','1','/attachment/information/201706/pre_1498198485o2k9y.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('913','焦作老社长知青火锅加盟特色火锅加盟火锅店加盟','136','1498199018','365','1529735018','老社长知青火锅加盟重庆特色火锅加盟火锅店加盟<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;老社长知青火锅，产品特征鲜明，装修独特，备受消费者的推崇。在原资料选取上，选用时令新鲜菜蔬，现切营养肉品，不添加任何化学添加剂、色素，呈现出麻辣鲜香的火锅滋味。老社长知青火锅加盟以新鲜优质的菜品，贴心热情的服务，专业的态度博得赞誉。除此之外，老社长知青火锅管理方面统一规范，给消费者提供了美味的同时还保证了饮食的健康，所以有很多的老社长知青火锅加盟店在开业以后就是人气爆满。<br />\r\n<br />\r\n　　老社长知青火锅加盟品牌自成立以来，跟随着市场的需求不时更新和完善，生意肯定火爆。老社长知青火锅加盟特征显著，口味共同，锅底品种多，因而具有广阔的大众根底和喜欢吃火锅的稳定消费群体。此外，老社长总部还有专用火锅底料、干锅底料、专用火锅调味剂等几大系列产品，保证了旗下的各个加盟店的正常运营需求，局部产品曾经入市流通，同时为将来开展打下坚实的根底。树立了一个高知名度和良好名誉的品牌形象，得到了社会各界的普遍赞扬。<br />\r\n<br />\r\n　　老社长知青火锅对加盟商的扶持政策极具诱惑力。老社长知青火锅采用中央厨房模式，每一包料均采用工厂化、流程化、标准化生产，做到让单店去大厨师化，厨房最小化，利润最大化。为了让加盟商更好的发展，老社长知青火锅加盟将把整套的运营形式与珍贵经历提供应加盟商，营销方案更是因地制宜，反复推敲，数据佐证，即使是没有经历的加盟商，亦可很快上手。其中包括了从店面选址、形象设计、开业筹备、烹饪技术培训，再到管理营销筹划、广告宣传指导、店面管理指导，以及物流配送保证、产品更新支持等等，各方面都有专人担任，让加盟商再无后顾之忧，轻松致富不是梦。<br />\r\n<br />\r\n老社长知青火锅店加盟电话：023-60362400;1832318772<br />\r\n网址：www.laoshezhanghg.com','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.191.207','重庆市电信','1','/attachment/information/201706/pre_1498199018i2onh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('914','哈尔滨手擀面培训沈阳兰州拉面培训','136','1498203204','365','1529739204','好滋味餐饮集团公司自成立以来，为方便各地学员就近学习，避免周波劳顿，现如今已在全国各地开展多个培训站，如沈阳培训站，哈尔滨培训站，长春培训站，学员可根据自身条件，多方位选择就近选择学习。好滋味始终如一坚持实战化教学，综合化指导，多方面服务。学员学习过程中，注重实践反复练习，全程师傅一对一跟踪教学指导。不限制时间学习，直至学习会为止，当期学不会，终身可以免费复习，终身免费技术更新升级。在教学过程中，我们更细致化得将配料配方进行量化标准，使学员掌握的更牢靠；学习更便捷，后期味道正宗。本公司培训项目多元化，如：拉面及各个种类和各种味道的面条。早餐及中式面点。特色烧烤，骨汤麻辣烫，砂锅米线，韩式烤肉，麻辣拌，等等所有市面能看到的时尚流行小吃技术一对一学习应有尽有。培训项目种类丰富。<br />\r\n选择好滋味优势多多：<br />\r\n优势一：先品尝，满意后在学习，解除您的学前之忧，为后期经营作保障；<br />\r\n优势二：签订学习保障协议，保障您的权益，让您无后顾之忧；<br />\r\n优势三：配方透明化，学会都能自己独立配制，而且所有材料在当地市场都能买到。<br />\r\n优势四：一对一指导，手把手教学，全程动手实际操作。<br />\r\n优势五：反复练习，制作成品能达到销售标准，使您创业无忧。<br />\r\n优势六：传授时下流行小吃，品味独占鳌头。<br />\r\n优势七：&nbsp;终身技术指导，为您创业保驾护航。<br />\r\n好滋味欢迎各位学员考察学习，详情请拨打电话：沈阳：13998816601宣经理。18940014011赵经理，吉林内蒙古：15140178540，黑龙江：15124512980，（微信同步）。<br />\r\n郑重承诺：包教包会，学会为止，一期学不会下期免费复学，收费透明，除学费以外没有任何形式收费。','wnptu821','刘经理','995734565','995734565@qq.com','024-23411016','0','1','1','','101.46.200.118','辽宁省沈阳市鹏博士长城宽带','1','/attachment/information/201706/pre_1498203204qphsc.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
