INSERT INTO my_information VALUES ('917','淄博老社长知青火锅重庆老火锅加盟火锅店加盟','136','1498207657','365','1529743657','重庆老社长知青火锅重庆老火锅加盟火锅店加盟<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;重庆老火锅知名加盟品牌-重庆老社长火锅是一家集“连锁经营、特色餐饮文化开发、人才储备培训、菜品研发推广、食品加工生产、物流配送”为一体的全国性餐饮连锁企业。<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;自1994年在重庆渝北创办第一家直营店以来，重庆老社长知青火锅发展迅猛，至今加盟店已遍布重庆主城区及周边主要城市，经营规范，生意火爆。研究表明：餐饮行业很多新开店面理论存活周期为三到五年，但重庆老社长知青火锅的存活时间近10年之久，一次投入，回报长久。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;为保证火锅的口感统一，纯正，老社长知青火锅采用中央厨房模式，每一包料均采用工厂化、流程化、标准化生产，做到让单店去大厨师化，厨房最小化，利润最大化，为各加盟店省钱省时省人力，方便各店进行最简单的操作，特别为从未做过餐饮的人士提供了最简单的操作方式&nbsp;。<br />\r\n<br />\r\n火锅店加盟电话：023-60362400;1832318772<br />\r\n网址：www.laoshezhanghg.com','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.191.207','重庆市电信','1','/attachment/information/201706/pre_1498207657ublkx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('918','三科机械_门市专用压瓦机多少钱_高腿压瓦机费用是多少','136','1498208347','365','1529744347','三科机械_门市专用压瓦机多少钱_高腿压瓦机费用是多少&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n门市专用高腿压瓦机设备产品简介：<br />\r\n设备总长&nbsp;6m&nbsp;宽度&nbsp;1.2m&nbsp;高度&nbsp;1.5m<br />\r\n电机功率&nbsp;3Kw+3Kw&nbsp;工作电压&nbsp;380V<br />\r\n生产速度&nbsp;8--10米/分&nbsp;<br />\r\n传动方式&nbsp;链条传动<br />\r\n整机成型轴&nbsp;上层9排&nbsp;下层11排。大架：250H型钢，立板14mm<br />\r\n调整套&nbsp;彩用45#钢无缝钢管精加工<br />\r\n轮材质&nbsp;45#钢硬镀铬<br />\r\n轴材质&nbsp;45#钢&nbsp;轴径：70mm<br />\r\n成型部分&nbsp;分为精工式车轮旋转成型，成型效果好，减少轮子和原材料之间的摩擦力，调试方便、快捷。<br />\r\n数控系统&nbsp;PLC面板,&nbsp;KEL-320显示器<br />\r\n计数器&nbsp;采用国产光电旋转编码器,&nbsp;A40S6-600-2-12-ACP<br />\r\n剪切&nbsp;3Kw泵站、剪切设备&nbsp;剪切刀材质：12<br />\r\n压板厚度&nbsp;0.3―0.8mm<br />\r\n泊头市三科冷弯机械有限公司专业生产彩钢瓦设备，单瓦机，双层压瓦机，三层压瓦机，C型钢机，无极切断C型钢设备，飞据切断C型钢机，扭断C型钢设备，角驰压瓦机，820角驰，760角驰机，470角驰压瓦机，470角驰压瓦机，楼乘板设备，750楼乘板设备，1025楼乘板设备，915楼乘板机，琉璃瓦成型设备，800竹节琉璃瓦设备，840琉璃瓦设备，828琉璃瓦机，加宽琉璃瓦设备，屋脊瓦设备，312屋脊瓦设备，450屋脊瓦成型设备，夹心板复合机，岩棉复合机，泡沫复合机，卷帘门设备，欧式卷帘门设备，抗风卷帘门，800卷帘门，250卷帘门设备，车库门设备，车库门吊柜机，卷帘门轨道机，大棚弯管，卡槽机，U型槽成型设备，汽车厢板机，集装厢板成型机，集装箱立柱设备，挡风抑尘成型设备，围挡设备，龙骨机，广告扣扳机，三维扣扳机，集成吊顶设备，货架成型设备，液压剪板机，液压折弯机，分条机，雨搭机，校平机，彩钢上料架，定做各种冷弯成型设备。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','110.244.19.193','河北省沧州市联通','1','/attachment/information/201706/pre_1498208347hpuid.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('919','深圳哪里的深圳安防展设计搭建价格便宜？','136','1498210604','365','1529746604','深圳市远大展览有限公司的深圳安防展设计搭建价格最便宜。<br />\r\n远大展览专注于展馆展厅设计施工、展台设计搭建、主场策划执行、商场包装设计施工、专卖店设计施工、活动策划制作为一体的营销型展览展示公司，在北京、上海、深圳、广州、东莞、武汉、湖南、厦门、福州等地成功完成了600多个大型展位；最大的展团施工面积达2万多平方米。在香港、澳门、柏林、汉诺威、芝加哥、澳大利亚、拉斯维加斯、迪拜等地完成了十数个海外展。&nbsp;<br />\r\n主场服务及招商，2016年9月成为中.国四大展会中.国国际-东盟展的招商及主场搭建服务，2016年12月成功招商主办深圳首届美酒节，从策划、审批，招商，主场及特装布置，一条龙服务。得到深圳市葡萄酒行业协会领导们的嘉奖及肯定。<br />\r\n我们现拥有一支经验丰富，富有责任感、充满创意与活力的专业设计策划团队，擅于从市场角度出发，结合视觉艺术及营销策略，以新颖的创意与精湛的工艺为客户提供完善的会展服务，帮助企业塑造品牌，帮助行业承办展览展会及会务。我们力求为每一位客户提供最有创意的设计、最符合标准的质量、最具人性化的服务。服务海内外各类著名企业，涉及工业、金融、IT业及事业机关的展览展示设计、会展活动策划。公司对于每个项目从策划、设计、执行整个流程都实施标准化模式，把握细节、精准求实。我们拥有近5000平米的制作工厂，公司拥有一流的加工设备，水帘式喷油房，对每一个项目从设计到制作执行进行全程化操控，十年丰富展览展示经验，高效的管理团队和诚信的售后服务体系，确保展会的完美品质。&nbsp;<br />\r\n因为专注，所以我们更专业！&nbsp;<br />\r\n深圳安防展设计搭建价格咨询：0755-8672','sswqb941','李小姐','179090016','lilan@ydzl88.com','0755-8672-5810','0','1','1','','61.144.175.11','广东省深圳市南山区/福田区电信','1','/attachment/information/201706/pre_1498210604wnxbp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('920','中山上海防爆锁厂家上海最专业JT-3000本安防爆磁力锁','136','1498211355','365','1529747355','中山中山上海是最专业的上海防爆锁厂家。<br />\r\n防爆锁推荐井田JT-3000防爆电磁锁，井田防爆锁采用12v供电，适合于各种门禁系统完美集成，防爆电磁锁专业生产厂家，井田防爆锁提供3年免费保修，防爆锁质量好，价格优，才是真的好。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n中山联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆锁厂家咨询中山','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498211355ebooe.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
