INSERT INTO my_information VALUES ('931','厦门生锈灯箱、仿古锈字复古LED灯箱、复古灯箱厂家定制金顶峰','136','1498274971','365','1529810971','厦门金顶峰文化传播有限公司服务项目：本厂生产各种生锈灯箱.仿古锈字复古LED灯箱.复古灯箱厂家定制按客户的不同需求设计生产出令人满意的产品。<br />\r\n客户须知<br />\r\n1亲们如果确定制作，请把设计好的矢量图发给我们（格式：cdr、cad，ai，eps或者pdf等），最好在图上标注出尺寸、材质、颜色等特征，方便制作不出差错；如果亲们没有矢量图，一些简单的字，我们可以帮亲们免费设计字体。如果图形比较复杂，我们不予设计。但可以找广告公司设计好矢量图提供给我们。<br />\r\n客户需要的报价，实际价格需根据客户提供所用材料、尺寸、数量进行具体的报价，具体价格可以联系我们客服.量多从优。<br />\r\n具体计算方法如下：字的长边*字的个数*单价<br />\r\n一米以下按照最长的尺寸进行核算<br />\r\n例如：40cm*30cm的字就是0．4米*单价*数量<br />\r\n超过一米的按照平方算<br />\r\n例如：1．2米*1．3米的字价格就是：1．2*1．3*单价*数量<br />\r\n特别说明<br />\r\n1我们的产品属于定制产品所以制作周期一般在5天左右<br />\r\n3关于产品运输，我们都是钉木箱发物流或者顺丰快递的，都是有保价的，如果提货的时候发现木箱有破损请先验货后签收，一旦签收，发现货物有问题，我们概不负责<br />\r\n4因为产品都是定制产品；如果因为贵方原因造成产品的大小制作不对或者颜色不喜欢我们不予退货的。产品制作之前关于字体大小颜色和样式我这边都会出效果图给贵方确认一旦确认中途不予修改，不予退款。<br />\r\n厦门生锈灯箱.仿古锈字复古LED灯箱.复古灯箱厂家定制：<br />\r\n厦门金顶峰文化传播有限公司，是一家大型专业从事广告字、发光字、吸塑灯箱、LED吸塑字、LED显示屏、吸塑标识、广告灯箱、广告标识、新型广告产品的设计、开发、制作和安装，一条龙服务的专业综合性广告传媒公司。<br />\r\n公司自创立以来，始终秉承“协同、创新、卓越”&nbsp;的经营理念，致力于广告标识标牌的设计、制作、安装，技术领域涵盖户外广告、吸塑灯箱、亚克力工艺品、大型钢结构架、LED夜景工程、标识广告系统工程、平面发光字工程、导示系统工程。在政府、电信、商场、金融、院校、宾馆、等领域取得了良好成绩。<br />\r\n金顶峰拥有一批高素质的员工队伍，技术人员都到达多年以上广告制作经验，设备是根据最新厂家订做。拥有吸塑机、雕刻机、激光机等设备。制作的吸塑字和吸塑灯箱规格齐全，工艺可根据客户的要求订做。<br />\r\n欢迎广大用户咨询了解，<br />\r\n电话：1855666676&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;彭立峰经理。<br />\r\n官网：www.xmggzz.com','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','1','1','','120.41.22.180','福建省厦门市电信','1','/attachment/information/201706/pre_1498274971x2lhu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('932','衡水桥闸_广西伸缩缝安装_甘肃伸缩缝安装','136','1498275368','365','1529811368','桥梁伸缩缝安装&nbsp;&nbsp;&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;同样优良的伸缩缝，不同的安装质量，使用效果和耐久性会有明显差别。这在我们调查研究中反映出的问题充分说明了伸缩装量施工安装质量是保证伸缩装置使用效果好坏的一个关健环节。<br />\r\n	1）桥梁伸缩缝安装应尽量在路面鳟好后进行，在伸缩装置安装前，须对预留槽的宽度、浓度及预埋钢筋进行检耍使之符合安装伸缩装置的要求。<br />\r\n	2）清理槽口，必把所有污物、尘土及其它不需栗的东西全部予以清除。<br />\r\n	3）检查伸缩装置各梁之间间隙是否符合安装囟鹊囊求，如不符合必须在制造厂工程技术人员的指导下进行调整，使伸缩装置的各梁之间间隙符合设计要求，调整之后再安上夹具，以备安装。<br />\r\n	4）以两侧的沥青路面为标高，用起重设备将伸缩装置放在槽口内，调整伸缩装置使其顶面与路面标高相同，其纵坡、横坡应与桥梁路面相符。<br />\r\n	5）检查伸缩缝的位置，使伸缩装置在垂直缝的议程和顺缝方向的位置都符合设计要求，如果此时个别预埋钢筋对伸缩装置的正确安装有妨碍，可以用气割割掉。<br />\r\n	6）伸缩缝正确就位后，先将伸缩装置一测的锚固筋与预留槽的预埋钢筋相连并焊接，焊接时可以间隔一个焊一个，然后在将另一侧的锚固钢筋按上述步骤焊接，使伸缩装置可靠锚固。注意：严禁在伸缩装置中梁、边梁上任意施焊。<br />\r\n	7）伸缩缝如果是分段安装的，接缝处必须采用焊接。型钢的焊接接头在制造工厂已经备好，当两相临缝对正后，即可安装。案梁全部焊接好后再按上述步骤进行锚固。<br />\r\n	8）在梁端安装模板，模板按伸s装置外形尺寸和预留槽的缺口进行制作，模板应做的相当严密以防沙浆流进位移控箱或流进梁端缝隙。<br />\r\n	9）检查安装的模板严密无缝以后再将预留槽清洗干净，便可绕浇注混凝土，并振捣密实。混凝土至少与该处的结构混凝土具有同一强度，浇注混凝土时要保持伸缩装置的顶面清洁。<br />\r\n	公司电话：0318-2209900&nbsp;李经理&nbsp;&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498275368vdcps.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('933','行政单位本安防爆电磁锁厂家上海海栌最专业JT-3000本安防','136','1498279784','365','1529815784','行政单位行政单位上海是最专业的上海本安防爆电磁锁厂家。<br />\r\n国内专业的本安防爆磁力锁生产厂家，上海海栌门控科技有限公司专业生产本安防爆磁力锁，价格优惠，欢迎来电订购，021-51692106<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n4、工作原理<br />\r\nJT-3000本安防爆电磁锁由两个齐纳安全栅和铝合金电控磁力锁两部分构成。电源安全栅连接电磁锁的供电端，+12V直流电压经过安全栅后提供给电磁锁，使电磁锁产生最大240公斤的吸合力从而将门锁住。信号安全栅连接电磁锁的信号输出端，门被锁住后开关信号输出，门被打开后打开，门锁控制主机通过检测两个检测端的信号来判断门的状态从而做出正确的操作。<br />\r\n<br />\r\n<br />\r\n行政单位行政单位联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106本安防爆电磁锁厂家咨询行政单位','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498279784anmiu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
