INSERT INTO my_information VALUES ('935','师大高端_九江室内设计培训中心_九江室内建筑设计培训班','136','1498283133','365','1529819133','师大高端_九江室内设计培训中心_九江室内建筑设计培训班&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	九江学室内设计哪里好_师大高端_九江室内建筑设计培训班<br />\r\n	九江室内建筑设计培训班课程安排：<br />\r\n	autoCAD+3ds&nbsp;MAX实例建模、3ds&nbsp;MAX家具建模与贴图坐标技术、灯光与材质基础、灯光阵列渲染技术渲染与Ps后期知识、vary渲染器基础以及工程设计的一般程序、常见材料的种类与属性、人体工程学与设计的关系、设计图纸与施工现场的关系、工程报价与方案设计、施工工艺流程等。<br />\r\n培训目标：<br />\r\n了解设计理论常识；能够应用软件绘制设计图纸；&nbsp;学习材料与施工的相关知识；通过绘制多种有代表性的室内设计案例，快速掌握AutoCAD；&nbsp;掌握各种三维设计软件；制作出真实阴影和效果细腻的渲染效果图；掌握效果图后期处理；&nbsp;案例项目：办公环境、家居环境、住宅、别墅小型居住环境、高层住宅、小区大型居住环境、商厦特殊环境表现、著名工程实例的欣赏与制作.<br />\r\n室内设计专业适合人群：<br />\r\n有一定计算机基础；对室内设计感兴趣；从事或欲从事室内装饰设计工作的社会各界人士；想通过学习掌握室内装饰行业的操作技能及设计理念。<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	九江学室内设计哪里好_师大高端_九江室内建筑设计培训班&nbsp;高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。<br />\r\n	&nbsp;<br />\r\n	九江学室内设计哪里好_师大高端_九江室内建筑设计培训班另外学校开设：&nbsp;南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	&nbsp;<br />\r\n	联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','182.108.27.28','江西省南昌市电信','1','/attachment/information/201706/pre_1498283133di570.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('936','榆林上海门禁专用防爆电磁锁厂家上海海栌门控科技最专业','136','1498286876','365','1529822876','榆林榆林上海是最专业的上海门禁专用防爆电磁锁厂家。<br />\r\n上海海栌门控科技有限公司生产门禁专用防爆电磁锁井田JT-3000门禁专用防爆电磁锁,适用于各种品牌门禁控制系统使用，接受12电压或开关信号控制，井田JT-3000门禁专用防爆电磁锁配合专用支架安装，井田门禁专用防爆电磁锁适合于各种门体安装，使用寿命长，安全耐用，3年免费质保，用于爆炸性环境：1区，2区<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n榆林联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106门禁专用防爆电磁锁厂家咨询榆林榆林','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498286876cz0za.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('937','zx系列螺旋输送机排名_曲阜兴运_zx系列螺旋输送机批发','136','1498288089','365','1529824089','zx系列螺旋输送机排名_曲阜兴运_zx系列螺旋输送机批发&nbsp;|&nbsp;曲阜兴运输送机械设备有限公司<br />\r\n	曲阜兴运,zx系列螺旋输送机价格,zx系列螺旋输送机排名<br />\r\n	zx系列螺旋输送机<br />\r\n（左旋或右旋）是在消化吸收国内外先进技术的基础上结合本国国情而生产的新一代产品。它是利用螺旋叶片的旋转推动散装物料来完成输送的设备，宜水平或倾斜（倾斜角小于20°）输送粉状、颗粒状或小块物料，不宜输送大块的腐蚀性强的、易碎或易粘结成块的纤维物料。<br />\r\n根据螺旋叶片在轴上盘绕的方向不同，螺旋体可分为左旋或右旋两种。叶片在轴上按反时针方向盘绕的叫左旋；按顺时针方向盘绕的叫右旋。同一种盘绕方向，如果轴的旋转方向不同，则输送方向也不同。如果在一根轴的两端分别盘绕左旋和右旋两种叶片，则轴旋转时，可使物料从两端向中间输送或从中间向两端输送。<br />\r\n二、特点<br />\r\n1、结构简单，横截面尺寸小，密封性能好；<br />\r\n2、在整个长度上都可以装料和卸料；<br />\r\n3、在同一机槽内还可作两种方向的输送；<br />\r\n4、操作安全方便，制造成本较低；<br />\r\n5、在输送过程中同时兼有搅拌和松散物料的作用；<br />\r\n6、根据用户要求可配备脱底清扫门，防堵门及电气控制系统等辅助机构。<br />\r\n三、使用与维护<br />\r\n1、开机前应对各润滑点加注润滑油；<br />\r\n2、中间挂脚材料为耐磨油尼龙，运转过程中不必加油润滑，避免物料污染；<br />\r\n3、点动观察旋向是否正确，并确定螺旋体是否擦边；<br />\r\n4、使用过程中严禁往输送机内伸手和往输送机内投送硬性物体，以防对输送机和人身造成危害和伤害；<br />\r\n5、不得随便撤除输送机盖板。<br />\r\n6、定期清除缠绕在螺旋叶片上的杂物；定期对吊瓦加注润滑油；<br />\r\n7、定期检查减速机运行状况，并及时补充润滑油。<br />\r\n四、主要技术参数如表所示<br />\r\nzx系列螺旋输送机主要技术参数<br />\r\n项目型号zx20&nbsp;&nbsp;zx25&nbsp;&nbsp;zx32&nbsp;&nbsp;zx40&nbsp;&nbsp;zx63<br />\r\n输送量(m3/h)&nbsp;15&nbsp;&nbsp;24&nbsp;&nbsp;50&nbsp;&nbsp;78&nbsp;&nbsp;120～150<br />\r\n&nbsp;最大转速(r/min)130&nbsp;&nbsp;110&nbsp;&nbsp;&nbsp;110&nbsp;&nbsp;90&nbsp;&nbsp;85<br />\r\n&nbsp;轴功率(kw/m)&nbsp;0.09～0.06&nbsp;&nbsp;&nbsp;0.15～0.08&nbsp;&nbsp;&nbsp;0.3～0.18&nbsp;&nbsp;&nbsp;0.5～0.28&nbsp;&nbsp;&nbsp;0.73～0.424<br />\r\n&nbsp;五、润滑<br />\r\n1、摆线针轮减速机的润滑<br />\r\n⑴、减速机主要采用油脂或油浴式润滑，油面高度保持油标位置即可。<br />\r\n⑵、润滑油牌号EP150#机械油，或减速机专用润滑脂牌号为0#或00#。<br />\r\n⑶、润滑油可以用40#~50#机械油代替。<br />\r\n⑷、减速机经试车出厂不存有机油，用户加油后方能开车。<br />\r\n⑸、第一次加油运行36小时后需换新油，并将内部冲洗干净，以后工作半年换油一次，机架的轴承用油为油脂润滑，至少每年换一次。<br />\r\n螺旋提升机&nbsp;输送机{不含电机价格}<br />\r\n型号	管径（mm）	输送量(m3/h)	每米动力(KW)（参考）	3米价格	每增加1米(元)	每减少一米（元）	标配<br />\r\nTL10	108	0.5-2	0.2	1000	+260	-200	材质为碳钢，叶片厚度2mm管壁厚度为3mm<br />\r\nTL16	159	2-6	0.5	1260	+380	-320&nbsp;<br />\r\nTL18	180	4-8	0.5	1700	+500	-420&nbsp;<br />\r\nTL20	219	6-10	0.75	1800	+520	-480&nbsp;<br />\r\nTL28	275	12-16	1.5	3500	+1100	-1000	材质为碳钢，叶片厚度4mm，管壁厚度5mm<br />\r\nTL30	325	15-20	2.2	4600	+1500	-1400&nbsp;<br />\r\nTL50	500	30-40	3	6800	+2100	-1900&nbsp;<br />\r\n在线客服QQ1191498134，手机18953730486，联系人：张经理<br />\r\n注<br />\r\n1.叶片厚度每增加1mm价格增加15%，管壁厚度每增加1mm价格增加15%。以此类推。<br />\r\n3.不锈钢材质【201&nbsp;202】价格为碳钢价格的2.4倍。不锈钢材质304类为碳钢价格的3倍.。不锈钢材质316类为碳钢价格的3.8倍<br />\r\n4.U型螺旋提升机、垂直螺旋提升机、无轴螺旋输送机这三种价格与以上螺旋输送机相同。<br />\r\n5.以上螺旋提升机/输送机价格不包含电机。<br />\r\n在线客服QQ1429093960在线客服QQ1191498134电话0537-3195311，手机（/微信）18953730486&nbsp;<br />\r\n订货说明：&nbsp;<br />\r\n　　定做螺杆送料机需客户提供以下数据：&nbsp;<br />\r\n　　1、落料斗（储料斗）离地面高度；&nbsp;<br />\r\n　　2、是粉状物料还是颗粒状物料（2立方毫米以下为粉料，以上则为粒料）；&nbsp;<br />\r\n　　3、是否需要加做料斗&nbsp;<br />\r\n　　我们可迎合客户的需要提供量身定做服务，以更好地配搭客户工厂的设备；本机适用于塑料、化工、食品、饲料、医药等块状、颗粒状、粉状的物料。）<br />\r\n可根据用户需要设计制造特殊型号，规格尺寸及材质的提升机、输送机<br />\r\n[公司联系信息：咨询电话：0537-3195311;;手机号码：18953730486在线QQ：1191498134；；qq:1429093960；;;邮箱：1191498134@qq.com&nbsp;联系人：张经理','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','39.85.138.120','山东省联通','1','/attachment/information/201706/pre_1498288089dcbm5.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('938','蓝天鸿业环保|天津水泥固化剂厂家|天津混凝土固化剂施工','136','1498289211','365','1529825211','蓝天鸿业环保|天津水泥固化剂厂家|天津混凝土固化剂施工&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n	蓝天鸿业环保,天津水泥固化剂,天津水泥固化剂厂家13821000563--13672193649<br />\r\n&nbsp;<br />\r\n	纳米级粒径,超强渗透,色彩均匀,密封抗渗、抗油污、耐腐蚀；提高混凝土表面强度接近钻石，永不起尘起砂。&nbsp;<br />\r\n&nbsp;<br />\r\n	1、&nbsp;&nbsp;更易渗透、渗透更深；&nbsp;<br />\r\n	2、&nbsp;&nbsp;无毒、绿色环保；&nbsp;<br />\r\n	3、抗紫外线，可避免褪色；&nbsp;<br />\r\n	4、色彩丰富，染色牢固、不会发生褪色；&nbsp;<br />\r\n	5、可以达到美化地面或分区作业的效果。&nbsp;<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	适用场所：&nbsp;<br />\r\n&nbsp;<br />\r\n	适用于各种室内、外结构牢固的旧混凝土或新浇筑混凝土表面装饰效果的制作，例如：展厅、商场、体育场馆、公园、停车场、园林、小区和文化设施等地面场所。&nbsp;<br />\r\n	&nbsp;<br />\r\n	施工特点：&nbsp;<br />\r\n	1、施工方法：喷涂、滚涂、简便&nbsp;<br />\r\n	2、工期：混凝土养护7-14天进行，每天约500O，缩短工期&nbsp;<br />\r\n	3、养护期：施工完毕2小时可使用&nbsp;<br />\r\n	4、安全性、环保性：符合所有VOC规则，无毒，不燃，环保&nbsp;<br />\r\n	5、基本要求：新旧地坪均可，无防水要求&nbsp;<br />\r\n	022-26936126&nbsp;&nbsp;13821000563王经理','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498289211yxmee.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('939','室外泳池长藻,游泳池长藻怎么办,河南冰峰','136','1498289541','365','1529825541','本品用于取代硫酸铜。硫酸铜易引起水体变色，池体染色，对人体有毒害，且引起泳客的皮肤及头发不适。本品不会导致水体变色，池体染色，对人体无毒害，且无不适感。●本品无腐蚀性，对操作人员更安全。●灭藻效果较上一代产品提升18%。●使用成本较上一代产品降低34%。<br />\r\n	用法及用量；有循环系统长藻时灭藻:反冲洗过滤器，开启过滤循环系统，按每吨水5mL添加量将本品稀释100倍后均匀泼洒于池面，投加本品半小时后，再投放万消灵牌消毒片将自由余氯调节至3ppm以上。循环过滤12～24小时或2～3个循环周期，即可完全杀灭藻类。可视池水藻类生长严重程度酌情增减用量。无循环系统长藻时灭藻：按每吨水5mL添加量将本品稀释100倍后均匀泼洒于池面，投加本品半小时后，再投放万消灵牌消毒片将自由余氯调节至3ppm以上，12～24小时即可完全杀灭藻类。可视池水藻类生长严重程度酌情增减用量，并根据池水实际情况加聚合氯化铝进行沉淀吸底。日常防藻维护：建议按每吨水3mL添加量将本品稀释100倍后均匀泼洒于池面，每月投加2～4次可预防池水藻类生长。配合万消灵消毒片或万消灵SWIMdone臭氧粉等强氧化型杀菌剂使用，防藻效果更佳。','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','1','1','','125.40.56.154','河南省郑州市联通','1','/attachment/information/201706/pre_1498289541avdmp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('940','多型号地槽机厂家_销售地槽机_三科机械','136','1498289817','365','1529825817','多型号地槽机厂家_销售地槽机_三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n泊头市三科冷弯机械有限公司专业生产彩钢瓦设备，单瓦机，双层压瓦机，三层压瓦机，C型钢机，无极切断C型钢设备，飞据切断C型钢机，扭断C型钢设备，角驰压瓦机，820角驰，760角驰机，470角驰压瓦机，470角驰压瓦机，楼乘板设备，750楼乘板设备，1025楼乘板设备，915楼乘板机，琉璃瓦成型设备，800竹节琉璃瓦设备，840琉璃瓦设备，828琉璃瓦机，加宽琉璃瓦设备，屋脊瓦设备，312屋脊瓦设备，450屋脊瓦成型设备，夹心板复合机，岩棉复合机，泡沫复合机，卷帘门设备，欧式卷帘门设备，抗风卷帘门，800卷帘门，250卷帘门设备，车库门设备，车库门吊柜机，卷帘门轨道机，大棚弯管，卡槽机，U型槽成型设备，汽车厢板机，集装厢板成型机，集装箱立柱设备，挡风抑尘成型设备，围挡设备，龙骨机，广告扣扳机，三维扣扳机，集成吊顶设备，货架成型设备，液压剪板机，液压折弯机，分条机，雨搭机，校平机，彩钢上料架，定做各种冷弯成型设备。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','120.11.177.115','河北省沧州市联通','1','/attachment/information/201706/pre_1498289817vmp4z.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
