INSERT INTO my_information VALUES ('945','金母子公益三伏贴活动现在启动预约 价值580元大礼相送','136','1498294179','365','1529830179','好消息！为回馈广大朋友们对金母子的支持和厚爱，将在金母子举办“三伏贴”公益活动，免费贴三伏贴啦。<br />\r\n参与方式：<br />\r\n1、转发此链接到朋友圈，注明金母子公益三伏贴活动现在启动预约&nbsp;价值580元大礼相送开始预约啦！<br />\r\n2、推荐15位宝妈和孕妈添加下列微信二维码：<br />\r\n除免费贴三伏贴外，还可获得价值：580元（乳腺疏通、卵巢保养、盆底肌修复、产后全能修复、妊娠纹修复）项目，每人仅限一次，任选其中一项，提前预约。<br />\r\n3、请备注推荐者微信名<br />\r\n注：此活动不上门，需亲自到金母子母婴健康中心<br />\r\n金母子简介：<br />\r\n金母子拥有国家中医药管理局，中.国中医药科技开发交流中心授权培训中心，福建省正规权威培训中心。拥有职业培训四大项目，中医催乳师、中医小儿推拿保健师、中医产后康复师、中医母婴保健师。在金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n时间：7月12号&nbsp;&nbsp;&nbsp;星期五<br />\r\n地点：厦门市嘉禾路永同昌大厦3A<br />\r\n上期三伏贴培训回顾<br />\r\n由厦门金母子主办、乔治良老师主讲，进行了一场三伏贴免费公益讲座，来自各地区热爱学习的妈妈们近60多人共同参加了此次公益性讲座。<br />\r\n学员们在学习和实际操作中都非常认真细致，各队学员们很快掌握了物料制作与穴位敷贴的方法，大家感觉非常受用，受益匪浅！<br />\r\n三伏贴适应症<br />\r\n1、肺系：呼吸系统疾病，其适应症主要有慢性支气管炎、支气管哮喘、肺气肿、慢性阻塞性肺疾病、过敏性鼻炎、变异性咳嗽等中医辨证属阳虚为主，或寒热错杂以寒为主的患者，尤其是脾肺气虚的鼻炎；也适用于怕冷、怕风、平素易感冒或冬季反复感冒的虚寒体质的患者。<br />\r\n2、脾胃：脾虚的人群（孩子、老人更适合），尤其是脾气（脾阳）不足的。面色淡黄、眼袋暗、食欲不振、四肢乏力、手脚冰冷、大便不成形、黏腻、先干后溏。<br />\r\n3、肾系：遗尿。孩子尿床，多为肾阳不足，阳气固摄不足。借助夏季天地阳气旺盛的时机，补充孩子的亏少的肾阳。<br />\r\n4、妇科：女性痛经、产后疼痛、月子病等。<br />\r\n关于三伏贴详细介绍内容：《冬病夏治就这一次，错过再等一年（附三伏贴使用全攻略》<br />\r\n厦门金母子荣誉：<br />\r\n2016年获得最美家政人创业全国百强的荣誉称号！<br />\r\n2017年，厦门金母子母婴健康咨询有限公司成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位。<br />\r\n2017年加入厦门市婴童产业协会员单位，<br />\r\n2017年成为湖南电视台打造出《白蛇传》《花木兰》的《小戏骨》栏目新剧《方世玉》福建地区海选专场官方合作机构。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','121.204.251.89','福建省厦门市电信','1','/attachment/information/201706/pre_1498294179wwycc.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('946','衡水桥闸_天津桥检车租赁_甘肃桥梁检测车租赁','136','1498294815','365','1529830815','桥梁检测车租赁<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;桥梁检测车是一种可以为桥梁检测人员在检测过程中提供作业平台，装备有桥梁检测仪器,用于流动检测和(或)维修作业的专用汽车。&nbsp;&nbsp;<br />\r\n	桥梁检测车工作原理是由液压系统将工作臂弯曲深入到桥底对桥梁进行检测。是由汽车底盘和工作臂组成。有东风底盘桥梁检测车。欧曼底盘桥梁检测车，进口桥梁检测车。&nbsp;<br />\r\n	衡水桥闸公司有多部桥梁检测车，常年为北京、天津、新疆、西藏、青海等广大用户做租赁服务，北京桥检车租赁找桥闸','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_14982948152c2hr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('947','天津水磨石制作公司价格_蓝天鸿业环保_天津水磨石制作公司排名','136','1498295050','365','1529831050','天津水磨石制作公司价格_蓝天鸿业环保_天津水磨石制作公司排名&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n	天津水磨石制作公司报价_蓝天鸿业环保_天津水磨石制作公司排名&nbsp;<br />\r\n	天津现浇水磨石制作、天津制作水磨石价格、天津水磨石铺设施工、天津铺设现浇水磨石等――――联系电话：13821000563――――水磨石面层是属于较**的建筑地面工程**，也是目前工业与民用建筑中采用较广泛的楼面与地面面层的类型，其特点是：表面平整光滑、外观美、不起灰，又可按设计和使用要求做成各种彩色图案，因此应用范围较广。（2)水磨石面层适用于有一定防潮(防水)要求的地段和较高防尘、清洁等建筑地面工程，如工业建筑中的一般装配车间、恒温恒湿车间。而在民用建筑和公共建筑中，使用得也更广泛，如机场候机楼、宾馆门厅和医院、宿舍走道、卫生间、饭厅、会议室、办公室等等。水磨石面层可做成单一本色和各种彩色的面层;根据使用功能要求又分为普通水磨石和**水磨石面层。专业水磨石施工队，承包大小水磨石工程，施工经验丰富，高质量、低价格赢得了各界人士的好评，工程均可达到行业验收标准。公司秉承“保证**质量，保持一级信誉”的经营理念，坚持“客户**”的原则为广大客户提供优质的服务。欢迎来电洽谈业务！联系人：王先生&nbsp;&nbsp;&nbsp;&nbsp;联系电话：13821000563&nbsp;&nbsp;&nbsp;&nbsp;022-26936126','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498295050anlpd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('948','十大D女郎缩阴对霉菌阴道炎有效果吗15961930560品牌','136','1498296510','365','1529832510','十大D女郎缩阴对霉菌阴道炎有效果吗15961930560品牌数D女郎性价比最高。盐城市倾心商贸有限公司位列十大D女郎缩阴对霉菌阴道炎有效果吗15961930560品牌，质量好、服务好。<br />\r\nD女郎缩阴真的有效果吗微信15961930560<br />\r\nD女郎缩阴真的有效果吗微信15961930560<br />\r\nD女郎缩阴对阴道炎有帮助吗？<br />\r\nD女郎缩阴对宫颈炎有帮助吗？<br />\r\nD女郎缩阴对盆腔炎有帮助吗？<br />\r\nD女郎私密护理套装并非药物，而是消字号产品，具有消炎杀菌、抑制病菌的作用。妇科病患者长期坚持使用能达到紧致阴道、重现少女状态，清洁阴道、清除异味、杀菌排毒，解决阴道干涩，去除阴部瘙痒、白带异常，治疗各种妇科疾病，改善性冷淡、增强性快感，解决阴道老化，滋润阴部、嫩白细腻，养巢暖宫修复，促进细胞再生，排毒养颜等功效，帮助女性彻底摆脱妇科问题，做回健康、美丽、自信的女人！<br />\r\nD女郎缩阴真的有效果吗微信15961930560<br />\r\nD女郎缩阴真的有效果吗微信15961930560<br />\r\n公司网址&nbsp;&nbsp;www.dnlwy.com性价比最高的十大D女郎缩阴对霉菌阴道炎有效果吗15961930560品牌首选盐城市倾心商贸有限公司。','akyxq548','夏小姐','','446122274@qq.com','0515-88552979','0','1','1','','114.236.127.194','江苏省盐城市电信','1','/attachment/information/201706/pre_1498296510kjxlr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('949','铜陵上海防爆磁力锁厂家井田JT-3000防爆磁力锁最专业','136','1498297857','365','1529833857','铜陵铜陵上海是最专业的上海防爆磁力锁厂家。<br />\r\n国内专业防爆磁力锁生产厂家，上海海栌门控科技有限公司提供井田高品质JT-3000防爆磁力锁,应用于石油化工爆炸性环境：1区，2区，井田JT-3000防爆磁力锁安装简单，使用寿命长，提供3年免费质保，井田JT-3000防爆磁力锁对各种品牌的门禁控制器都可以实现完美无缝兼容<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n铜陵联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆磁力锁厂家咨询铜陵','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498297857suali.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('950','宁波盐城亚克力除尘滤袋什么牌子好 江苏东方环保','136','1498299881','365','1529835881','盐城亚克力除尘滤袋什么牌子好?江苏东方环保。<br />\r\n亚克力除尘滤袋均聚丙烯腈纤维(亚克力)对有机溶剂、氧化剂、无机及有机酸具有良好的抵抗力，且不会水解，在低温高化学腐蚀性及潮湿的场合可广泛应用于垃圾焚烧、沥青、煤磨、电厂等烟气收尘。按照不同使用要求，可对亚克力针刺毡做各种功能性处理，如拒水防水防油、PTFE浸渍、涂层、覆膜等。亚克力滤袋具有以下特性：<br />\r\n产品名称：&nbsp;　　亚克力针刺过滤毡&nbsp;<br />\r\n材&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;质：&nbsp;　　均聚丙烯腈&nbsp;<br />\r\n厚&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;度：&nbsp;　　2.0-2.2mm&nbsp;<br />\r\n克&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;重：&nbsp;　　500-550g/m2&nbsp;<br />\r\n透&nbsp;气&nbsp;&nbsp;量：&nbsp;　　13-16m3/m2。min<br />\r\n径向拉力&nbsp;:&nbsp;　　&nbsp;&gt;1200(N/5×20cm）&nbsp;<br />\r\n纬向拉力：&nbsp;　　&gt;1300(5/5×20cm）&nbsp;<br />\r\n径向拉长：&nbsp;　　&gt;30%&nbsp;<br />\r\n纬向拉长：&nbsp;　　&lt;50%&nbsp;<br />\r\n工作温度：&nbsp;　　125℃&nbsp;瞬间150℃&nbsp;&nbsp;<br />\r\n特&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;点：&nbsp;　　耐酸、耐碱、抗水解&nbsp;<br />\r\n亚克力除尘滤袋广泛适用于粉尘颗粒细,空气湿度大,过滤要求高的复杂工况,化工、垃圾发电、建材、有色、医药、食品饲料等。还广泛用于湿法过滤领A。亚克力除尘滤袋牌子就选江苏东方环保。江苏东方滤袋股份有限公司是新三板上市公司，国家火炬计划重点高新技术企业。公司生产的氟美斯、PPS滤袋、PTFE滤袋、P84滤袋、亚克力针刺毡、芳纶针刺毡滤袋、美塔斯滤袋、四斯美滤袋、拒水防油针刺毡、涤纶针刺毡等部分产品曾荣获第9届中.国国际环保展览会金奖、江苏省高新技术产品、列入科技部国家火炬计划项目和国家重点新产品项目。拥有授权发明、实用新型专利10项，承担省部级项目12项。公司先后荣获：全国百强示范企业、国家级高新技术企业、江苏省创新型企业、江苏省新型滤材开发及结构设计工程技术研究中心、产品荣获：江苏省名牌产品、江苏省著名商标称号。&nbsp;公司拥有德国&nbsp;意大利的奥特法针刺&nbsp;卡尔麦伊经编、阿斯兰2500梳理等世界顶级针刺滤料生产线。&nbsp;数字化智能成套进口设备为生产优质滤料提供了强有力的保障。超前的产能是国内一般企业无可比拟的。','vedpa080','郭乃铨','623368591','fneast@126.com','0515-87733911','0','0','1','','112.21.246.7','江苏省盐城市移动','1','/attachment/information/201706/pre_14982998815m6rp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('951','天津彩色水磨石制作公司批发|蓝天鸿业环保|天津彩色水磨石制作','136','1498300310','365','1529836310','天津彩色水磨石制作公司批发|蓝天鸿业环保|天津彩色水磨石制作公司厂家&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#404040;font-family:\'Century&nbsp;Gothic\',&nbsp;\'microsoft&nbsp;yahei\',&nbsp;\'hiragino&nbsp;sans&nbsp;GB\',&nbsp;\'Helvetica&nbsp;Neue\',&nbsp;Helvetica,&nbsp;Arial,&nbsp;sans-serif;font-size:16px;line-height:34px;white-space:normal;background-color:#FFFFFF;&quot;&gt;天津水磨石制作公司报价_蓝天鸿业环保_天津水磨石制作公司排名&lt;/span&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#404040;font-family:\'Century&nbsp;Gothic\',&nbsp;\'microsoft&nbsp;yahei\',&nbsp;\'hiragino&nbsp;sans&nbsp;GB\',&nbsp;\'Helvetica&nbsp;Neue\',&nbsp;Helvetica,&nbsp;Arial,&nbsp;sans-serif;font-size:16px;line-height:34px;white-space:normal;background-color:#FFFFFF;&quot;&gt;天津现浇水磨石制作、天津制作水磨石价格、天津水磨石铺设施工、天津铺设现浇水磨石等――――联系电话：13821000563――――水磨石面层是属于较**的建筑地面工程**，也是目前工业与民用建筑中采用较广泛的楼面与地面面层的类型，其特点是：表面平整光滑、外观美、不起灰，又可按设计和使用要求做成各种彩色图案，因此应用范围较广。（2)水磨石面层适用于有一定防潮(防水)要求的地段和较高防尘、清洁等建筑地面工程，如工业建筑中的一般装配车间、恒温恒湿车间。而在民用建筑和公共建筑中，使用得也更广泛，如机场候机楼、宾馆门厅和医院、宿舍走道、卫生间、饭厅、会议室、办公室等等。水磨石面层可做成单一本色和各种彩色的面层;根据使用功能要求又分为普通水磨石和**水磨石面层。专业水磨石施工队，承包大小水磨石工程，施工经验丰富，高质量、低价格赢得了各界人士的好评，工程均可达到行业验收标准。公司秉承“保证**质量，保持一级信誉”的经营理念，坚持“客户**”的原则为广大客户提供优质的服务。欢迎来电洽谈业务！联系人：王先生&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;联系电话：13821000563&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;022-26936126&lt;/span&gt;&nbsp;<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498300310vogx7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
