INSERT INTO my_information VALUES ('958','东丽混凝土起沙治理|天津混凝土起沙治理公司|蓝天鸿业环保','136','1498353443','365','1529889443','东丽混凝土起沙治理|天津混凝土起沙治理公司|蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n	塘沽混凝土固化抛光_天津混凝土起沙治理公司_蓝天鸿业环保<br />\r\n	天津蓝天鸿业环保科技有限公司是不是天津混凝土固化十大品牌？天津蓝天鸿业环保科技有限公司是混凝土固化十大品牌之一，排名靠前，价格好、服务好。<br />\r\n地坪厚度：&nbsp;渗透5.0mm以上<br />\r\n表面形态：&nbsp;亮光型<br />\r\n使用年限：&nbsp;20年<br />\r\n适用范围&nbsp;五金机械厂、模具厂、生产设备厂、物流仓库、大型超市等。<br />\r\n产品特性&nbsp;：<br />\r\n渗透性密封硬化剂是一特种胶体二氧化硅组成的环保水性液体硬化剂，能够有效渗透混凝土表面，与混凝土中的化学媒介发生化学反应、结晶，从而产生一种密固的表面，可有效防止水和油污的渗透，抗化学腐蚀、无味、无毒，适用于新旧混凝土地面及干撒硬化剂耐磨地面，渗透性强，快干易用，抗磨损，防尘，环保安全，易清洁易保养，使用区域广。<br />\r\n施工工艺：<br />\r\n1、素地处理：&nbsp;在施工之前，清洗、清理混凝土地面的杂物、油污。采用水泥基聚合物填缝剂修补地面大的裂缝以减少原材料的损耗。若地面比较粗糙，需刮一道细水泥浆。<br />\r\n2、&nbsp;打磨地面：&nbsp;用50目磨片水磨地面&nbsp;2&nbsp;遍，然后再用100、200、800、1000目磨片以同样的工序分别水磨地面&nbsp;4&nbsp;遍，直到地面光滑。磨完地面后，用水清洗地面干净。<br />\r\n3、硬&nbsp;化&nbsp;剂：&nbsp;待地面清洗干净后，让地表风干&nbsp;30-60&nbsp;分钟，表面无明水后可进行硬化剂的施工。用喷雾器将硬化剂均匀喷洒于地面上，在喷洒同时用胶扫把紧跟着扫均匀。持续往表干的地面上喷洒硬化剂，保持地面湿润&nbsp;30&nbsp;分钟，但不能有积水现象。施工后&nbsp;6&nbsp;小时可上人作业，但地面不能有明水、积水现象。<br />\r\n4、保&nbsp;护&nbsp;剂：&nbsp;硬化剂施工完&nbsp;24&nbsp;小时后，进行保护剂的施工。在把地面尘土清理干净后，用喷雾器将保护剂均匀喷洒于地面上，在喷洒同时用&nbsp;100%&nbsp;涤纶拖把紧跟着拖均匀，并以高速抛光机抛光至表面光滑，发亮。<br />\r\n5、施工完成&nbsp;24小时后方可上人，72小时后方可重压，14&nbsp;天内完成结晶期形成坚固的面层。（以25℃为准，低温开放时间需适度延长，养护期间地坪不可沾水）天津购买混凝土固化就选十大品牌-天津蓝天鸿业环保科技有限公司。<br />\r\n	联系电话13821000563','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498353443tiv5z.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
