INSERT INTO my_information VALUES ('960','随车吊出租图片_广州众誉_广州随车吊出租','136','1498354601','365','1529890601','随车吊出租图片_广州众誉_广州随车吊出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州高空车、吊车叉车出租、高空作业车随车吊租赁<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;随车吊出租电话13600005563<br />\r\n	&nbsp;广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.129.123.29','广东省广州市电信','1','/attachment/information/201706/pre_1498354601ikk4e.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('961','天津混凝土固化公司_蓝天鸿业环保_天津混凝土固化价格','136','1498355446','365','1529891446','天津混凝土固化公司_蓝天鸿业环保_天津混凝土固化价格&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n	<br />\r\n	天津混凝土翻新_天津混凝土打磨_蓝天鸿业环保<br />\r\n	1.超硬化耐磨<br />\r\n可承受大量车辆的高频率使用，以及人&nbsp;流经常使用。用混凝土密封固化剂处理后的混凝土强度提高，提高了地面的耐磨性，地面不会受损。<br />\r\n2.密封及防渗透、防霉、仿佛、防冻腐、耐高温、防止风化<br />\r\n可密封混凝土、水泥砌体。使之成为坚固的实体，防止其他物质渗透。<br />\r\n3.防尘、净化、环境好、永不起灰、永不起砂、没有任何污染<br />\r\n混凝土中的盐分是造成混凝土地面起尘的通常原因，混凝土密封固化剂与混凝土中的盐分作用，构成混凝土整体的一部分。将其永久密封，从而使地面彻底达到永不起砂、不起灰、无尘、净化的效果。<br />\r\n4.减少污染、容易清洁、光泽度好、漂亮、彰显品位<br />\r\n密封地面后，诸如车辆轮胎等印痕减少，且即使出现印痕，也能轻易被清除。固化后的地面在磨擦作用后，地面会逐渐产生迷人的光泽，并且这种光泽会越来越亮。能营造出非常好的、令人舒服的，高品位的环境。<br />\r\n	5.使用寿命长处理后的混凝土地面仅需日常的清洗保养即可。寿命长达100年以上<br />\r\n	联系人：13821000563','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498355446eclxd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('962','1200集装箱压瓦机价格_1200集装箱板设备_三科机械','136','1498356943','365','1529892943','1200集装箱压瓦机价格_1200集装箱板设备_三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n集装箱板机产品介绍<br />\r\n1.设备总长：8.5m&nbsp;宽度&nbsp;1.5m&nbsp;高度&nbsp;1.2m<br />\r\n2.电机功率：15kw&nbsp;工作电压&nbsp;380V<br />\r\n3.生产速度：5--8米/分<br />\r\n4.传动方式：2寸链条传动<br />\r\n5.整机成型轴：共计13排轴&nbsp;大架：&nbsp;400H型钢，立板16mm<br />\r\n6.轮材质&nbsp;：轴承钢淬火，精车磨光，表面硬镀铬<br />\r\n7.轴材质&nbsp;45#钢&nbsp;：&nbsp;轴径：90mm实心轴<br />\r\n8.剪切刀&nbsp;：采用Cr12材质，经高温淬火而成，由三片刀组成<br />\r\n9.成型部分&nbsp;：分为精工式车轮旋转成型，成型效果好，减少轮子和原材料之间的摩擦力，调试方便、快捷。<br />\r\n10.数控系统&nbsp;：采用台湾台达PLC面板,&nbsp;KEL-320显示器&nbsp;台湾台达变频器，能实现整机自动化生产，可设定批次、工件长度、数量等。<br />\r\n11.操作方式：输入屏+按钮，编码器计数，且有计数及记长功能。<br />\r\n12.工作流程：（送毛坯料）开卷―导向进料―辊压成―定长切断―成品出板，人工点固定好工件，人工上卷，进入PL操作页面―按“启动”钮―板材自动进入―开始按设定的程序进行―达到设定的尺寸后自行切断，此设备的自动压板成型完成。<br />\r\n13.进料导向平台&nbsp;主机进料口处设置左右导向装置。工作时，原材料板材两侧经左右向导进入主机，使原材料板材与辊压成型系统保持正确的位置。可通过手动螺杆机构调节导向位置，且左右独立可调。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','221.193.64.111','河北省沧州市任丘市联通','1','/attachment/information/201706/pre_14983569437tscx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('963','北辰区环氧地坪漆厂家|蓝天鸿业环保|北辰区环氧地坪漆价格','136','1498357656','365','1529893656','北辰区环氧地坪漆厂家|蓝天鸿业环保|北辰区环氧地坪漆价格&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n北辰区环氧地坪漆、环氧地坪漆厂家、<br />\r\n蓝天鸿业是一家致力于地坪漆材料研发、&nbsp;销售和施工服务于一体化的专业公司。服务项目有：环氧地坪漆、环氧薄涂地坪、环氧自流平、环氧水性地坪、&nbsp;环氧耐压砂浆地坪、防静电地坪、防尘地坪、防腐地坪工程、PV&nbsp;防静C地坪、金刚砂耐磨地坪、硬化地坪、水泥地板漆、PU球场、丙烯酸球场、机房抗静电地板、停车场地坪工程、混凝土密封固化剂地坪等各种地坪工程服务并为各行业同仁提供地坪工程的咨询、设计等全方位服务，适用于各类停车场地坪工程,仓库地坪工程，厂房地坪工程，医院地坪工程，商城地坪工程，室内地坪工程，户外地坪工程旧地面翻新等各种地坪工程服务。深圳市蓝强电子有限公司以“专业、诚信、严谨、高效”为企业精神，秉承一流产品、一流工程、一流服务的品质观不断创新为原则，在不断引进行业先进技术的同时，自主创新，以地坪漆销售施工为主体。','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_14983576560nhwy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
