INSERT INTO my_information VALUES ('965','汉沽环氧地坪公司|蓝天鸿业环保|天津环氧地坪施工公司厂家','136','1498359922','365','1529895922','汉沽环氧地坪公司|蓝天鸿业环保|天津环氧地坪施工公司厂家&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n武清环氧地坪公司,东丽环氧地坪公司,蓝天鸿业环保<br />\r\n环氧薄涂地坪以聚氨酯组分为固化剂的环氧薄涂涂料，具有防尘防潮、高耐磨、施工快捷、维护方便等特点，性价比高，是一般车间首选涂装体系。<br />\r\n性能特点：<br />\r\n1.防尘、防潮、耐磨，容易清洗<br />\r\n2.附着力强，柔韧性好<br />\r\n3.具有一定的防腐性能<br />\r\n4.施工快捷，造价低廉<br />\r\n5.厚度：0.3-0.5MM<br />\r\n适应范围：<br />\r\n电器、电子、食品、医药、化工、机械等行业的制造车间和办公室、商场、仓库等场所的水泥或水磨石地面。<br />\r\n工艺配套：<br />\r\n1.基面处理<br />\r\n2.涂刷封闭底漆<br />\r\n3.批刮腻子<br />\r\n4.打磨，吸尘<br />\r\n5.涂刷色漆<br />\r\n6.涂刷罩面清漆<br />\r\n注意事项：<br />\r\n每到工序必须待前一道涂层达到实干程度才能进行，不能仓促强行施工；<br />\r\n施工温度5~35℃，在温度过高或者过低请咨询厂方；<br />\r\n施工环境湿度范围30~80%；<br />\r\n甲乙组分配比按甲组分：乙组分=1：2配料。<br />\r\n使用年限：一般为5~10年。天津环氧地坪公司厂家咨询电话：022-26936126','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_14983599226n6wx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('966','蓝天鸿业环保_天津混凝土固化施工_天津混凝土固化推荐','136','1498362035','365','1529898035','蓝天鸿业环保_天津混凝土固化施工_天津混凝土固化推荐&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司<br />\r\n	蓝天鸿业环保_天津混凝土固化施工_空港混凝土固化施工<br />\r\n	经机械俊光后的混凝土蓝天鸿业环保_天津混凝土固化施工_空港混凝土固化施工地面使用菲斯达混凝土密封固化剂施工后会出现打蜡的光泽，硬度随时间增加而增长，是原先地坪的3-5倍。永远无需打蜡，为您节约大量的维护费用。<br />\r\n&nbsp;<br />\r\n	1,地面怎么碾压都不会起灰尘；<br />\r\n	2,地面感光效果好,光亮无比；　<br />\r\n	3,地面坚硬耐磨,地面不会有轮胎印；　<br />\r\n	4,地面抗渗效果好,有郊的防止化学物质的侵蚀；<br />\r\n	5,地面使用寿命可以长达20年。','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498362035ancgt.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('967','430压瓦机图片_430铝镁锰板压瓦机_三科机械','136','1498362424','365','1529898424','430压瓦机图片_430铝镁锰板压瓦机_三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n泊头市三科冷弯机械有限公司专业生产彩钢瓦设备，单瓦机，双层压瓦机，三层压瓦机，C型钢机，无极切断C型钢设备，飞据切断C型钢机，扭断C型钢设备，角驰压瓦机，820角驰，760角驰机，470角驰压瓦机，470角驰压瓦机，楼乘板设备，750楼乘板设备，1025楼乘板设备，915楼乘板机，琉璃瓦成型设备，800竹节琉璃瓦设备，840琉璃瓦设备，828琉璃瓦机，加宽琉璃瓦设备，屋脊瓦设备，312屋脊瓦设备，450屋脊瓦成型设备，夹心板复合机，岩棉复合机，泡沫复合机，卷帘门设备，欧式卷帘门设备，抗风卷帘门，800卷帘门，250卷帘门设备，车库门设备，车库门吊柜机，卷帘门轨道机，大棚弯管，卡槽机，U型槽成型设备，汽车厢板机，集装厢板成型机，集装箱立柱设备，挡风抑尘成型设备，围挡设备，龙骨机，广告扣扳机，三维扣扳机，集成吊顶设备，货架成型设备，液压剪板机，液压折弯机，分条机，雨搭机，校平机，彩钢上料架，定做各种冷弯成型设备。<br />\r\n销售电话：15373365336微信同号<br />\r\n联系人：刘经理<br />\r\nQQ：3314322143<br />\r\n24售后电话：15373365336','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','221.193.64.111','河北省沧州市任丘市联通','1','/attachment/information/201706/pre_1498362424dlmny.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('968','镇江本安防爆电磁锁生产厂家批发井田JT-3000本安防爆电磁','136','1498362821','365','1529898821','镇江镇江镇江上海供应上海本安防爆电磁锁<br />\r\n国内专业的本安防爆磁力锁生产厂家，上海海栌门控科技有限公司专业生产本安防爆磁力锁，价格优惠，欢迎来电订购，021-51692106<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n4、工作原理<br />\r\nJT-3000本安防爆电磁锁由两个齐纳安全栅和铝合金电控磁力锁两部分构成。电源安全栅连接电磁锁的供电端，+12V直流电压经过安全栅后提供给电磁锁，使电磁锁产生最大240公斤的吸合力从而将门锁住。信号安全栅连接电磁锁的信号输出端，门被锁住后开关信号输出，门被打开后打开，门锁控制主机通过检测两个检测端的信号来判断门的状态从而做出正确的操作。<br />\r\n<br />\r\n<br />\r\n镇江联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106本公司地址:上海上海漕河泾开发区漕宝路1243号镇江镇江','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498362821xdoce.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('969','天津环氧地坪排名|天津环氧地坪价格|蓝天鸿业环保','136','1498364245','365','1529900245','天津环氧地坪排名|天津环氧地坪价格|蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	大港环氧地坪施工|蓝天鸿业环保|天津环氧地坪加盟<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;适用范围<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆要求高度清洁、美观、无尘、无菌的电子、微电子行业、实行&nbsp;GMP&nbsp;标准的制药行业、血液制品行业，也可用于学校、办公室、家庭等地坪。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;性能特点&lt;br&nbsp;/&gt;<br />\r\n环氧树脂自流平地板漆选用无溶剂高级环氧树脂加优质固化剂制成；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	表面平滑、美观、达镜面效果；&lt;br&nbsp;/&gt;<br />\r\n耐酸、碱、盐、油类介质腐蚀，特别耐强碱性能好；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	耐磨、耐压、耐冲击，有一定弹性。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;施工工艺&lt;br&nbsp;/&gt;<br />\r\n1.1&nbsp;基面处理&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.2&nbsp;涂刷环氧树脂自流平地板封闭底漆&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.3&nbsp;刮涂环氧树脂自流平地板中层漆；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	1.4&nbsp;打磨，吸尘；&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.5&nbsp;用环氧树脂自流平地板色漆镘涂。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;项目指标&lt;br&nbsp;/&gt;<br />\r\n干燥时间，&nbsp;表干&nbsp;≤6&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;干燥时间，&nbsp;实干&nbsp;≤24&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;拉伸强度&nbsp;≥9&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;弯曲强度&nbsp;≥7&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n抗压强度&nbsp;≥8.5&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;邵氏硬度&nbsp;≥75&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;流平性&nbsp;≥5min&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐磨性(750g/500r,失重)&nbsp;≤0.02&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n耐60%硫酸&nbsp;30天允许轻微变色&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐25%氢氧化钠&nbsp;30天无异常&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐31%盐水&nbsp;30天无异常&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n耐汽油,120#&nbsp;耐&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;粘接强度&nbsp;≥2<br />\r\n&lt;/p&gt;<br />\r\n&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313195454.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498364245crtn6.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('970','天津环氧地坪厂家,天津环氧地坪图片,蓝天鸿业环保','136','1498366565','365','1529902565','天津环氧地坪厂家,天津环氧地坪图片,蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	天津环氧地坪排名|天津环氧地坪图片|蓝天鸿业环保<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	产&nbsp;品&nbsp;说&nbsp;明&nbsp;&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n环氧树脂自流平地板漆&nbsp;适用范围<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆要求高度清洁、美&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313195456.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;观、无尘、无菌的电子、微电子行业、实行&nbsp;GMP&nbsp;标准的制药行业、血液制品行业，也可用于学校、办公室、家庭等地坪。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;性能特点&lt;br&nbsp;/&gt;<br />\r\n环氧树脂自流平地板漆选用无溶剂高级环氧树脂加优质固化剂制成；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	表面平滑、美观、达镜面效果；&lt;br&nbsp;/&gt;<br />\r\n耐酸、碱、盐、油类介质腐蚀，特别耐强碱性能好；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	耐磨、耐压、耐冲击，有一定弹性。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;施工工艺&lt;br&nbsp;/&gt;<br />\r\n1.1&nbsp;基面处理&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.2&nbsp;涂刷环氧树脂自流平地板封闭底漆&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.3&nbsp;刮涂环氧树脂自流平地板中层漆；<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	1.4&nbsp;打磨，吸尘；&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;1.5&nbsp;用环氧树脂自流平地板色漆镘涂。&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:10px;margin-bottom:10px;font-family:Arial,&nbsp;Helvetica,&nbsp;sans-serif;line-height:25px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	环氧树脂自流平地板漆&nbsp;项目指标&lt;br&nbsp;/&gt;<br />\r\n干燥时间，&nbsp;表干&nbsp;≤6&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;干燥时间，&nbsp;实干&nbsp;≤24&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;拉伸强度&nbsp;≥9&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;弯曲强度&nbsp;≥7&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n抗压强度&nbsp;≥8.5&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;邵氏硬度&nbsp;≥75&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;流平性&nbsp;≥5min&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐磨性(750g/500r,失重)&nbsp;≤0.02&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n耐60%硫酸&nbsp;30天允许轻微变色&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐25%氢氧化钠&nbsp;30天无异常&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;耐31%盐水&nbsp;30天无异常&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n耐汽油,120#&nbsp;耐&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&nbsp;粘接强度&nbsp;≥2<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498366565k7fiz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('971','天津地坪漆施工,蓝天鸿业环保,天津地坪漆公司','136','1498371239','365','1529907239','天津地坪漆施工,蓝天鸿业环保,天津地坪漆公司&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313195456.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;<br />\r\n&lt;p&gt;<br />\r\n	天津地坪漆批发,天津地坪漆公司,蓝天鸿业环保<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	蓝天鸿业是一家致力于地坪漆材料研发、&nbsp;销售和施工服务于一体化的专业公司。服务项目有：环氧地坪漆、环氧薄涂地坪、环氧自流平、环氧水性地坪、&nbsp;环氧耐压砂浆地坪、防静电地坪、防尘地坪、防腐地坪工程、PV&nbsp;防静C地坪、金刚砂耐磨地坪、硬化地坪、水泥地板漆、PU球场、丙烯酸球场、机房抗静电地板、停车场地坪工程、混凝土密封固化剂地坪等各种地坪工程服务并为各行业同仁提供地坪工程的咨询、设计等全方位服务，适用于各类停车场地坪工程,仓库地坪工程，厂房地坪工程，医院地坪工程，商城地坪工程，室内地坪工程，户外地坪工程旧地面翻新等各种地坪工程服务。深圳市蓝强电子有限公司以“专业、诚信、严谨、高效”为企业精神，秉承一流产品、一流工程、一流服务的品质观不断创新为原则，在不断引进行业先进技术的同时，自主创新，以地坪漆销售施工为主体。<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498371239zelnm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('972','天津水泥自流平施工|南开水泥自流平|蓝天鸿业环保','136','1498372868','365','1529908868','天津水泥自流平施工|南开水泥自流平|蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:small;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;南开水泥自流平施工_蓝天鸿业环保_天津水泥自流平&lt;br&nbsp;/&gt;<br />\r\n&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:small;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;天津水泥自流平----&lt;/span&gt;&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;自流平找平是利用自流平水泥的优异流动性来进行找平的一项作业，做出的地面光滑、细腻。自流平找平的前提是基础地面起伏不能太大，否则找平效果一般，原因在于其填坑效果非常好，但对于显著高出平均地面高度的区域没有任何效果。如果对最终地面平整度要求不是很高而且本身地面高低差不太多的话，可以考虑自流平找平。若对平整度要求严格，则推荐采用磨平找平。022-26936126&nbsp;&amp;nbsp;&nbsp;13821000563&lt;/span&gt;&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170319100013.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_14983728688zmbw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('973','天津环氧自流平_蓝天鸿业环保_天津环氧地坪漆','136','1498374400','365','1529910400','天津环氧自流平_蓝天鸿业环保_天津环氧地坪漆&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;天津环氧地坪漆施工,天津环氧地坪,蓝天鸿业环保022-26936126&nbsp;&amp;nbsp;13821000563&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170319101618.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;主要工程服务项目如下：&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;1、环氧(EPOXY)树脂防尘、防潮、防腐、防静电、耐磨地坪。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;2、PVC防尘、防静电地板及高架活动地板&nbsp;。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;3、各种槽、罐、池的内衬外帖防腐工程。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;4、金刚砂硬化耐磨地板、彩砂耐磨地坪、耐磨地坪。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;5、100级-10万级室内净化工程。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;6、PU运动场、球场、跑道地坪工程。&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;br&nbsp;style=&quot;margin:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&nbsp;/&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧地坪漆用途：&lt;/strong&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;o:p&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;/o:p&gt;&lt;/b&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;br&nbsp;style=&quot;margin:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&nbsp;/&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧地坪漆&lt;/strong&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;开始是用于功能性地坪：如&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;防腐，耐磨，防滑&lt;/strong&gt;，发展到通用的普通&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;工业地坪&lt;/strong&gt;；除了具有功能性的要求，还具有装饰性的效果。在工业地坪获得广泛应用的基础上，随着人们生活水平的不断提高，现已在家庭装璜中得以应用。环氧地坪已成为我国发展速度最快的产业之一，引起众人的注意。即在保护地面的同时又美观了地面&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;br&nbsp;style=&quot;margin:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&nbsp;/&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:宋体;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧树脂地坪漆优点&amp;nbsp;&lt;/strong&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;/b&gt;&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧树脂地坪漆&lt;/strong&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;是一种高强度、耐磨损、美观的地板，具有无接缝、质地坚实、耐药品性佳、防腐、防尘、保养方便、维护费用低廉等优点。可根据不同的用途要求设计多种方案，如&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧树脂薄涂地坪漆、环氧树脂自流平地坪漆、防滑耐磨地坪漆、环氧树脂砂浆型地坪漆、环氧树脂防静电地坪漆&lt;/strong&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;、&lt;/b&gt;&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;防腐蚀地坪漆等&lt;/strong&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;。&lt;/b&gt;&lt;/span&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;/b&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;环氧地坪漆施工工艺&lt;/span&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;/b&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;1、素地处理&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;基础素地以水泥粉光面或磨石地为准；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;素地需养生28天以上，水份需8%以下方可施工素地如有不平或空鼓需加以除去；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;用环氧砂浆补平地面；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;素地之油污需澈底清洗干净；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工前需保持施工素地之干燥和清洁；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;2、底涂层&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工前需保持干净如有杂物粘附需清除依照正确比例将主剂及硬化剂混合，充分搅拌；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;需视地面情况调整适当粘度混合完成材料需4小时以内施工完成；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;底涂层养生硬化时间约8小时以上。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;3、中涂层&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工前需要保持干净如有杂物粘附需清除依照正确&nbsp;比例将主剂及硬化剂混合，充分搅拌；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;将混合完成的树脂适量加入石英砂；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;使用镘刀将材料均匀涂布；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;混合完成材料需30分钟以内施工完成；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工交接处做好交接处理；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;中涂层养生硬化时间约8小时以上。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;4、批土层&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;依照正确比例将主剂及硬化剂混合，充分搅拌；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;使用批刀将材料涂布均匀；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;混合完成材料需30分钟内施工完成；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;批土养生硬化时间约8小时以上；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;视实际需要施工数道要求达到平整无孔洞，无批刀印及砂磨印为准。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;5、面涂层&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工前需保持干净如有杂物粘附需清除；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;使用前主剂先搅拌均匀；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;依照正确比例将主剂及硬化剂混合，充分搅拌；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;使用滚筒或镘刀将材料均匀涂布混合完成材料需30分钟以内施工完成；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工交接处需做好交接处理；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;施工完成后，24小时后方可上人，72小时后方可重压（以250C为准，低温时开放时间需适度延长）&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧地坪漆验收标准　&lt;/strong&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;　&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;1&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、环境温度为25℃时，施工后2-3天应达到实干，即硬度达到完成固化的80%左右；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;2&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、表面不能出现发粘现象；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;3&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、气泡：平涂型、砂浆型无气泡，自流平允许1个小气泡/10平方米；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;4&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、流平性好，无镘刀痕，大面积接口处基本平整&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n5、无浮色发花，颜色均匀一致，大面积接口处允许有极不明显的色差；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;6&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、无粗杂质，但允许有空气中的浮尘掉落在造成的极小缺陷；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;7&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、地坪表面应平整平滑，光泽度应达到设计要求（高光泽≥90、有光≥70、半光50～70），平涂型为有光、水性为半光～无光；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;8&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、桔皮、砂浆防滑面效果应很明显。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;strong&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;环氧树脂地坪漆施工时环境要求及保养维护&lt;/strong&gt;&lt;b&nbsp;style=&quot;margin:0px;padding:0px;&quot;&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;/b&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;1、环氧树脂地坪漆施工时的环境要求：A、基面含水率：在6%以上时不能施工非水性环氧地坪；B、空气中湿度：在85%以上应停止施工；C、施工温度：低于5℃应选用特殊配方。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;2&lt;/span&gt;&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;、环氧树脂地坪漆保养维护：环氧地坪漆是高价值、高质量、高要求的产品，需要细心的保养与维护，正确的使用方法可使地面常保如新，并且可以延长使用年限，措施如下：&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;凡进入车间人员需换鞋（以免将外面泥砂带入车间而划伤地面）；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;凡是硬件，须将其脚用软质塑料或橡胶包裹以免在使用过程中划伤地面；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;拖拉栈板需充分将栈板升离地面，转弯时要特别注意栈板角切勿刮伤地面；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;清洁地面时需用软质拖把或干湿两用吸尘器，可用清水或清洁剂清洗，但要注意地面湿滑；&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;若因使用时间较长而造成磨损或刮花，小面积可进行局部修补，若面积较大则建议重新滚涂或镘涂一次。&lt;/span&gt;&lt;br&nbsp;style=&quot;margin:0px;padding:0px;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;margin:0px;padding:0px;font-family:宋体;&quot;&gt;推车、板车之车轮请用硬质或弹性胶轮，并厂房内外分开使用。&lt;/span&gt;<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498374400yaunz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('974','沧州混凝土抛光_沧州混凝土硬化_蓝天鸿业环保','136','1498375975','365','1529911975','沧州混凝土抛光_沧州混凝土硬化_蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	蓝天鸿业环保|沧州混凝土打磨|沧州混凝土硬化<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	渗透密封固化剂就是混凝土固化剂，它们的施工工艺是一样的，只是说法不同。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	混凝土固化剂地面又称耐磨硬化地坪或者混凝土硬化地坪，它的耐磨度可达莫氏8级，相当于刚玉硬度，适用于各种工业场合，如车间、仓库、车库、厂房等，混凝土固化剂地面施工简单，与建筑物寿命，具有永不起尘不起砂、防滑抗渗、越用越光亮，终生免维护等特点。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	渗透密封固化剂施工工艺新地面和旧地面的工艺不尽相同，差别主要在于基础地面处理，旧地面要先做清洁修补，如地面有旧的环氧涂料，要先用机器打磨除去后才可进行后续施工，新地面则不用，可以直接施工。&lt;a&nbsp;href=&quot;http://www.ningyicn.com&quot;&nbsp;target=&quot;_blank&quot;&nbsp;title=&quot;&quot;&nbsp;data-wise-href=&quot;http://www.ningyicn.com&quot;&nbsp;title2=&quot;超链&quot;&nbsp;style=&quot;color:#3F88BF;text-decoration:none;&quot;&gt;详情请点击&lt;/a&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	建议找有经验有实力的施工企业先设计适合您地面的施工方案，正确施工，可以有效延长使用年限。也可联系13821000563<br />\r\n&lt;/p&gt;<br />\r\n&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313193627.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;&nbsp;<br />\r\n&lt;p&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498375975rpwx7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('975','天津水泥地做旧_天津水泥地做旧公司_蓝天鸿业环保','136','1498377727','365','1529913727','天津水泥地做旧_天津水泥地做旧公司_蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;蓝天鸿业环保|和平区水泥地做旧|和平区水泥地做旧公司&lt;br&nbsp;/&gt;<br />\r\n&lt;/span&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;水泥地面做旧，是指在水泥地面上用特种工艺装饰混凝土，将地面做旧，看起来是旧而不厌，浑然天成，返璞归真，古补而浑厚，不失自然纯真的一种美。&lt;/span&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;无论新旧水泥地面都是可以做旧，最好是比较平整的混凝土地面做出来美观而自然，就象人的化妆一样，实则有妆，看似无妆的境界。&lt;/span&gt;&lt;br&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&nbsp;/&gt;<br />\r\n&lt;span&nbsp;style=&quot;color:#2F2F2F;font-family:\'Times&nbsp;New&nbsp;Roman\';font-size:medium;line-height:20px;white-space:normal;background-color:#FFFFFF;&quot;&gt;要是混凝土地面有点老化或不平，一种方法是打磨，一种方法是做水泥自流平，然后再进行表面著色处理，不同的手法做出不同工艺的地面，本产品有20种主色，做成不同的花色纹理，令人想象不到的艺术魅力，是现在卖场，商场，别墅，私人花园等最热门的一种艺术手法。做出来的地面有高光、亮光、半亮光、亚光等。根据不同艺术设计，做出不同的感观效果。022-26936126&nbsp;&amp;nbsp;13821000563&lt;/span&gt;&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170319100652.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498377727el3nd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('976','混凝土固化_水泥地固化_蓝天鸿业环保','136','1498379432','365','1529915432','混凝土固化_水泥地固化_蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	蓝天鸿业环保,青县混凝土固化剂,青县混凝土固化剂施工<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313193627.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;地坪厚度：&nbsp;&nbsp;渗透5.0mm以上<br />\r\n&lt;/p&gt;<br />\r\n表面形态：&nbsp;&nbsp;亮光型&lt;br&nbsp;/&gt;<br />\r\n使用年限：&nbsp;&nbsp;20年&lt;br&nbsp;/&gt;<br />\r\n适用范围&nbsp;&nbsp;五金机械厂、模具厂、生产设备厂、物流仓库、大型超市等。&lt;br&nbsp;/&gt;<br />\r\n产品特性&nbsp;：&lt;br&nbsp;/&gt;<br />\r\n渗透性密封硬化剂是一特种胶体二氧化硅组成的环保水性液体硬化剂，能够有效渗透混凝土表面，与混凝土中的化学媒介发生化学反应、结晶，从而产生一种密固的表面，可有效防止水和油污的渗透，抗化学腐蚀、无味、无毒，适用于新旧混凝土地面及干撒硬化剂耐磨地面，渗透性强，快干易用，抗磨损，防尘，环保安全，易清洁易保养，使用区域广。&lt;br&nbsp;/&gt;<br />\r\n施工工艺：&lt;br&nbsp;/&gt;<br />\r\n1、素地处理：&nbsp;在施工之前，清洗、清理混凝土地面的杂物、油污。采用水泥基聚合物填缝剂修补地面大的裂缝以减少原材料的损耗。若地面比较粗糙，需刮一道细水泥浆。&lt;br&nbsp;/&gt;<br />\r\n2、&nbsp;打磨地面：&nbsp;用50目磨片水磨地面&nbsp;2&nbsp;遍，然后再用100、200、800、1000目磨片以同样的工序分别水磨地面&nbsp;4&nbsp;遍，直到地面光滑。磨完地面后，用水清洗地面干净。&lt;br&nbsp;/&gt;<br />\r\n3、硬&nbsp;化&nbsp;剂：&nbsp;待地面清洗干净后，让地表风干&nbsp;30-60&nbsp;分钟，表面无明水后可进行硬化剂的施工。用喷雾器将硬化剂均匀喷洒于地面上，在喷洒同时用胶扫把紧跟着扫均匀。持续往表干的地面上喷洒硬化剂，保持地面湿润&nbsp;30&nbsp;分钟，但不能有积水现象。施工后&nbsp;6&nbsp;小时可上人作业，但地面不能有明水、积水现象。&lt;br&nbsp;/&gt;<br />\r\n4、保&nbsp;护&nbsp;剂：&nbsp;硬化剂施工完&nbsp;24&nbsp;小时后，进行保护剂的施工。在把地面尘土清理干净后，用喷雾器将保护剂均匀喷洒于地面上，在喷洒同时用&nbsp;100%&nbsp;涤纶拖把紧跟着拖均匀，并以高速抛光机抛光至表面光滑，发亮。&lt;br&nbsp;/&gt;<br />\r\n5、施工完成&nbsp;24小时后方可上人，72小时后方可重压，14&nbsp;天内完成结晶期形成坚固的面层。（以25℃为准，低温开放时间需适度延长，养护期间地坪不可沾水）13821000563','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498379432vvdbj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
