INSERT INTO my_information VALUES ('980','天津混凝土地固化剂施工,天津混凝土硬化,蓝天鸿业环保','136','1498382841','365','1529918841','天津混凝土地固化剂施工,天津混凝土硬化,蓝天鸿业环保&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&gt;<br />\r\n	天津金刚砂抛光,蓝天鸿业环保,天津混凝土抛光<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	渗透密封固化剂就是混凝土固化剂，它们的施工工艺是一样的，只是说法不同。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	混凝土固化剂地面又称耐磨硬化地坪或者混凝土硬化地坪，它的耐磨度可达莫氏8级，相当于刚玉硬度，适用于各种工业场合，如车间、仓库、车库、厂房等，混凝土固化剂地面施工简单，与建筑物寿命，具有永不起尘不起砂、防滑抗渗、越用越光亮，终生免维护等特点。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	渗透密封固化剂施工工艺新地面和旧地面的工艺不尽相同，差别主要在于基础地面处理，旧地面要先做清洁修补，如地面有旧的环氧涂料，要先用机器打磨除去后才可进行后续施工，新地面则不用，可以直接施工。&lt;a&nbsp;href=&quot;http://www.ningyicn.com&quot;&nbsp;target=&quot;_blank&quot;&nbsp;title=&quot;&quot;&nbsp;data-wise-href=&quot;http://www.ningyicn.com&quot;&nbsp;title2=&quot;超链&quot;&nbsp;style=&quot;color:#3F88BF;text-decoration:none;&quot;&gt;详情请点击&lt;/a&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:\'Microsoft&nbsp;YaHei\';font-size:16px;line-height:29px;text-indent:32px;white-space:normal;background-color:#FFFFFF;&quot;&gt;<br />\r\n	建议找有经验有实力的施工企业先设计适合您地面的施工方案，正确施工，可以有效延长使用年限。也可联系13821000563<br />\r\n&lt;/p&gt;<br />\r\n&lt;img&nbsp;src=&quot;http://sx.18100.cn/ProductImages/2017/03/lantianhongye/20170313193627.jpg&quot;&nbsp;alt=&quot;&quot;&nbsp;/&gt;&nbsp;<br />\r\n&lt;p&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498382841m7qxf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('981','衡水桥闸,吉林钢边橡胶止水带,甘肃钢边橡胶止水带','136','1498383793','365','1529919793','钢边橡胶止水带<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;钢边橡胶止水带的断面采用非等厚结构，分强力区和防水区，使各部分受力均匀，合理。伸缩孔久壁为平面，施工时板模夹制接触面大，不易脱位;钢板增设安装孔与钢筋相连接，固定牢靠不易位移。镀锌钢板与混凝土的良好粘接，使防水性能更佳。钢边橡胶止水带它的特点是采用断面采用非等厚结构，分强力区和防水区的一种止水产品，它使各部分受力均匀，合理。钢边橡胶止水带,钢板增设安装孔与钢筋相连接，固定牢靠不易位移,使各部分受力均匀，合理。伸缩孔久壁为平面，止水带在施工时板模夹制接触面大，不易脱位;钢板增设安装孔与钢筋相连接，固定牢靠不易位移。镀锌钢板与混凝土的良好粘接，钢边橡胶止水带使防水性能更佳。我厂生产的中埋式钢边止水带是以镀锌钢带和天然橡胶原料所组成的组合而成的一种防水产品，它采用的橡胶主体材料为耐老化性能优良的天然橡胶及各种防老剂，具有特强的自粘性；具有夏季高温不流淌,冬季低温不发脆;并具有优异的耐水、耐酸碱和耐老化性能；使用寿命长，产品本身无毒，对环境良好的特点。<br />\r\n	钢边橡胶止水带表示方法及适用范围<br />\r\n	钢边橡胶止水带所有胶种列表：&nbsp;(NR)表示天然胶;(CR)表示氯丁胶;(NBR)表示丁腈胶。<br />\r\n	BFGB型(NBR)350-表示采用某公司生产的橡胶止水带，宽度为350毫米，材料为丁腈胶。适用于含石油基油类的污水防渗工程，适用温度-35～60℃。<br />\r\n	BFGB型(NR)-450表示采用某公司生产的钢边橡胶止水带，宽度为450毫米，材料为天然橡胶。适用于淡水防渗工程，适用温度-40～60℃。<br />\r\n	BFGB型(CR)-380表示采用某公司生产的橡胶止水带，宽度为380毫米，材料为氯丁橡胶。适用于含酸碱等污水防渗工程，适用温度－35～60℃。<br />\r\n	公司电话：0318-2209900&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498383793zme8z.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('982','蓝天鸿业环保,北辰区复古地坪施工,西青区复古地坪漆','136','1498384379','365','1529920379','蓝天鸿业环保,北辰区复古地坪施工,西青区复古地坪漆&nbsp;|&nbsp;天津蓝天鸿业环保科技有限公司&lt;br&nbsp;/&gt;&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	天津复古地坪漆|蓝天鸿业环保|天津复古地坪公司<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	水泥地复古做旧<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	怀旧，寻一份坦然。无论是生活在繁华虚无的明媚里，还是于远山远水中淡然处世，我们都要为生命注入了属于自己的血液与灵魂，让人生的锋芒毕露。&lt;br&nbsp;/&gt;<br />\r\n022-26936126&nbsp;&amp;nbsp;&nbsp;13821000563&lt;br&nbsp;/&gt;<br />\r\n　愿风载尘，愿雨柔情。怀旧，寻一份坦然，碎碎念念的时光，偶尔糊涂，明知山路漫漫，水路迢迢，却偏执一念向前，上下求索，义无反顾全心沉入其中，随其哀乐而哀乐，伴起喜怒而喜怒；但也许就是人生的一个象征、一个缩影、一个说明，告诉我们，好好享受那些幸运与苦难，好好珍惜那一份超脱的坦然。&lt;br&nbsp;/&gt;<br />\r\n　&lt;br&nbsp;/&gt;<br />\r\n　怀旧，寻一份坦然。时光，慈悲为怀，博爱无边，念情悠悠，爱长长，静静流淌在岁月的小河里，与清水合欢，与睡莲长眠。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	复古室内装饰设计风格相比于现代主义的设计风格，往往更受高端业主青睐。“怀旧装修风格代表的是一种沉稳的厚重感，其内敛的表现虽没有现代风格的光鲜张扬，却更恰如其分地表达了丰富的内涵。”&lt;br&nbsp;/&gt;<br />\r\n&amp;nbsp;装修复古早已成为一种风潮，深得业主欢迎。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	1、水泥地坪：&nbsp;易破、起灰尘、粗糙不光亮、易脏、不易清洗，适用于道路地坪，不适用于工业地坪。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;padding:0px;margin-top:0px;margin-bottom:0px;color:#003366;font-family:宋体,&nbsp;\'Arial&nbsp;Narrow\';font-size:14px;letter-spacing:1px;line-height:28px;white-space:normal;&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n2、石地坪：&nbsp;易起灰尘、春季回潮、水份不易散发、行走声音大、油脂易渗入不易清洗，必须做打蜡保养。&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n3、瓷砖地坪：&nbsp;声音大、重车行走时易破裂、有线沟、回潮、水份难散发、易滑，不适合工业地坪，适用于办公楼或人行走道。&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n4、木板地坪：&nbsp;易发霉、粗糙性太强、行走有阻脚的感觉、怕水、易腐坏、不易保养、适用于家居地面。&amp;nbsp;&lt;br&nbsp;/&gt;<br />\r\n5、聚脂涂料地坪：&nbsp;吸水性太强、易变色、易消退、附着力不强、耐磨性差、不耐压、耐溶剂性差，适用于装修、涂装，不适用于工业地坪。<br />\r\n&lt;/p&gt;','ftdrg627','王芹岭','1010743713','lantianhongye@126.com','022-26936126','0','0','1','','218.69.186.138','天津市联通','1','/attachment/information/201706/pre_1498384379lsp2h.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('983','图木舒克图木舒克上海哪里有做防爆锁和防爆电磁锁价格多少?','136','1498384395','365','1529920395','图木舒克图木舒克上海哪里有做防爆锁,价格多少?上海专业做防爆锁,价格实惠.<br />\r\n防爆锁推荐井田JT-3000防爆电磁锁，井田防爆锁采用12v供电，适合于各种门禁系统完美集成，防爆电磁锁专业生产厂家，井田防爆锁提供3年免费保修，防爆锁质量好，价格优，才是真的好。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n图木舒克联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106地址：上海漕河泾开发区漕宝路1243号图木舒克','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498384395z8gm0.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
