INSERT INTO my_information VALUES ('990','黄埔高空车出租报价|黄埔高空车出租价格|广州众誉','136','1498441577','365','1529977577','黄埔高空车出租报价|黄埔高空车出租价格|广州众誉&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;黄埔随车吊、吊车、高空车出租欢迎来电13600005563<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.gzzyjx99.com<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.129.123.29','广东省广州市电信','1','/attachment/information/201706/pre_1498441577164g9.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('991','衡水桥闸_网架橡胶支座_天津网架橡胶支座','136','1498441682','365','1529977682','网架支座&nbsp;<br />\r\n	网架橡胶支座简介：<br />\r\n网架节点减震橡胶支座，由橡胶和金属骨架硫化而成。它一般分为三类：其一，是普通橡胶支座；其二，是轴向减震橡胶支座；其三，是拉压橡胶支座。<br />\r\n普通橡胶支座，往往用于无抗拨需要的节点，它具有竖向承载和在外力作用下竖向转角、抗水平剪切的功能。一般直接<br />\r\n采用普通桥梁橡胶支座，或由生产企业根据工程需要另行设计。<br />\r\n就适用性而言，橡胶支座具有构造简单，组装高度低，易于安装的特点，且价格低廉，生产周期短，供货比较及时，故在复合受力不甚大的情况下，一般被优先采用。<br />\r\n橡胶属非线性高分子的弹性材料，在密闭情况下，几乎是不可压缩的，只有在变形较小时，才可近似地作为线性体，其<br />\r\n弹性模量与硬度及支座的外形有着密切的关联。只有合理的设计，才有良好的功用。网架橡胶支座其设计参数、设计要求、验算方法及加工工艺是按照GB20688.4-2007《橡胶支座第四部分：普通橡胶支座》的标准严格执行。&nbsp;<br />\r\n	网架橡胶支座性能选用：<br />\r\n网架建筑节点减震橡胶支座，按其材质和适用温度分为常温型和耐寒型两种。常温型采用氯丁橡胶（CR），适于-25℃&nbsp;―60℃；耐寒型采用天然橡胶（NR），适用于-40℃&nbsp;―&nbsp;60℃气候的地区，选用橡胶支座，节点底板倾斜度不可大于1%，支座最大承载力应与节点反力吻合，其容许偏差宜为±1%之内。&nbsp;<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_14984416827l6tr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
