INSERT INTO my_information VALUES ('997','抚州抚州上海专业批发各种门禁专用防爆电磁锁','136','1498445566','365','1529981566','抚州抚州上海专业批发各种门禁专用防爆电磁锁<br />\r\n上海海栌门控科技有限公司生产门禁专用防爆电磁锁井田JT-3000门禁专用防爆电磁锁,适用于各种品牌门禁控制系统使用，接受12电压或开关信号控制，井田JT-3000门禁专用防爆电磁锁配合专用支架安装，井田门禁专用防爆电磁锁适合于各种门体安装，使用寿命长，安全耐用，3年免费质保，用于爆炸性环境：1区，2区<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n抚州联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106欢迎联系上海批发门禁专用防爆电磁锁。抚州抚州','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498445566ijq0h.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('998','曲阜兴运_化工原料提升机排名_化工原料提升机价格','136','1498447178','365','1529983178','曲阜兴运_化工原料提升机排名_化工原料提升机价格<br />\r\n&nbsp;不锈钢螺旋上料机，<br />\r\n〖在线客服QQ1191498134,&nbsp;QQ1429093960；电话0537-3195311,手机（/微信）18953730486〗<br />\r\n食品专用不锈钢螺旋提升机，药品专用不锈钢螺旋提升机，塑料螺旋上料机<br />\r\n不锈钢螺旋螺旋提升机主要用于输送粉状、颗粒状和小块状物料，如农药、兽药、调味品、添加剂、化工品等，螺旋提升机不适宜输送易变质、粘性大的和易结块的物料。<br />\r\n不锈钢螺旋提升机工作时旋转的螺旋叶片将物料推移而进行输送，使物料不与螺旋提升机叶片一起旋转的力是物料自身重量和螺旋提升机机壳对物料的摩擦阻力。螺旋提升机旋转轴上焊有螺旋叶片，叶片的面型根据输送物料的不同有实体面型、带式面型、叶片面型等型式。螺旋提升机的螺旋轴在物料运动方向的终端有止推轴承，在螺旋管较长时，应加中间吊挂轴承。<br />\r\n不锈钢螺旋输送机分为水平式螺旋输送机和垂直式螺旋输送机两大类型，主要用于对各种粉状、颗粒状和小块状等松散物料的水平输送和垂直提升，该机不适宜输送易变质、粘性大、易结块或高温、怕压、有较大腐蚀性的特殊物料。<br />\r\n不锈钢螺旋输送机广泛应用于各行业，如食品、调味品、农药、兽药、建材、化工、电力、冶金、煤矿炭、粮食等行业，适用于水平或倾斜输送粉状、粒状和小块状物料，如食品、调味食品、农药、饲料、煤矿、灰、渣、水泥、粮食等。螺旋机不适于输送易变质的、粘性大的、易结块的物料。<br />\r\n螺旋提升机&nbsp;输送机{不含电机价格}<br />\r\n型号	管径（mm）	输送量(m3/h)	每米动力(KW)（参考）	3米价格	每增加1米(元)	每减少一米（元）	标配<br />\r\nTL10	108	0.5-2	0.2	1000	+260	-200	材质为碳钢，叶片厚度2mm管壁厚度为3mm<br />\r\nTL16	159	2-6	0.5	1260	+380	-320&nbsp;<br />\r\nTL18	180	4-8	0.5	1700	+500	-420&nbsp;<br />\r\nTL20	219	6-10	0.75	1800	+520	-480&nbsp;<br />\r\nTL28	275	12-16	1.5	3500	+1100	-1000	材质为碳钢，叶片厚度4mm，管壁厚度5mm<br />\r\nTL30	325	15-20	2.2	4600	+1500	-1400&nbsp;<br />\r\nTL50	500	30-40	3	6800	+2100	-1900&nbsp;<br />\r\n在线客服QQ1191498134，手机18953730486，联系人：张经理<br />\r\n注<br />\r\n1.叶片厚度每增加1mm价格增加15%，管壁厚度每增加1mm价格增加15%。以此类推。<br />\r\n3.不锈钢材质【201&nbsp;202】价格为碳钢价格的2.4倍。不锈钢材质304类为碳钢价格的3倍.。不锈钢材质316类为碳钢价格的3.8倍<br />\r\n4.U型螺旋提升机、垂直螺旋提升机、无轴螺旋输送机这三种价格与以上螺旋输送机相同。<br />\r\n5.以上螺旋提升机/输送机价格不包含电机。<br />\r\n〖在线客服QQ1191498134,&nbsp;QQ1429093960；电话0537-3195311,手机（/微信）18953730486〗','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','27.198.162.74','山东省济宁市联通','1','/attachment/information/201706/pre_149844717863xig.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
