INSERT INTO my_information VALUES ('1000','山南地区山南地区上海哪里有做防爆磁力锁,价格多少?','136','1498452934','365','1529988934','山南地区山南地区上海哪里有做防爆磁力锁,价格多少?上海专业做防爆磁力锁,价格实惠.<br />\r\n国内专业防爆磁力锁生产厂家，上海海栌门控科技有限公司提供井田高品质JT-3000防爆磁力锁,应用于石油化工爆炸性环境：1区，2区，井田JT-3000防爆磁力锁安装简单，使用寿命长，提供3年免费质保，井田JT-3000防爆磁力锁对各种品牌的门禁控制器都可以实现完美无缝兼容<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n山南地区联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106地址：上海漕河泾开发区漕宝路1243号山南地区','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498452934dto1j.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1001','衡水桥闸|天津水平分散型橡胶支座|水平分散型橡胶支座','136','1498456972','365','1529992972','LNR系列水平力分散型橡胶支座<br />\r\n	LNR系列水平力分散型橡胶支座说明:&nbsp;<br />\r\n	LNR系列水平力分散型橡胶支座是按照现行国家标准及相关行业规范，同时参照欧洲标准研制的桥梁构件系列产品，属国家专利技术成果，推荐用于7度（0.10g）及以下地震烈度区的各类公路及市政桥梁。该产品是在充分调研多个系列普通板式橡胶支座及使用现状的基础上，借鉴了“水平力分散”的工作原理而开发的新产品，主要解决了普通板式橡胶支座剪切位移小和抗滑能力差，无可靠连接以及质量管控难度大等问题，是常规桥梁工程的新选择！<br />\r\n	&nbsp;LNR水平力分散型橡胶支座结构固定型和滑动型<br />\r\n	&nbsp;LNR水平力分散型橡胶支座产品特点&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	具有良好的适应梁体自由伸缩和转动的能力；<br />\r\n	能满足温度变化、地震等作用下的较大剪切位移要求，支座整体性能好；<br />\r\n	支座与主梁、桥墩有效地连接，各墩协同受力，尤其对于曲线桥梁，水平力分散效果好；<br />\r\n	恢复能力强，大位移剪切变形后没有残余变形；<br />\r\n	蠕变特性良好，性能稳定；<br />\r\n	支座表面被橡胶层覆盖，保护内部橡胶不受臭氧、紫外线等影响，具有更好地耐老化性能；<br />\r\n	安装、养护、维修、更换方便。<br />\r\n	&nbsp;LNR水平力分散型橡胶支座产品分类&nbsp;&nbsp;&nbsp;<br />\r\n	&nbsp;依据支座本体与锚固件（或预埋件）之间的连接形式以及支座与梁、墩的锚固（连接）形式，划分为如下两种类型<br />\r\n	LNR固定型<br />\r\n	支座位移通过橡胶剪切变形实现，橡胶的水平剪切能承受较大的水平力，通过橡胶在水平方向的大位移剪切变形实现水平力分散的功能；支座与墩、梁体之间采用套筒、锚杆连接，支座底面不设预埋钢板，上、下封层钢板和套筒之间采用锚固螺栓连接，上预埋钢板和套筒之间采用配合焊接。<br />\r\n	LNR滑动型<br />\r\n	支座位移通过顶面设置的聚四氟乙烯滑板与不锈钢板组成的滑移摩擦副实现，低摩擦系数使支座承受较小的摩擦力；支座与梁体之间采用预埋锚固钢筋连接，支座底面设下预埋钢板，上预埋钢板和预埋锚固钢筋采用焊接，上支座钢板和上预埋钢板采用焊接连接。<br />\r\n	感谢您关注我们的产品,若您希望获得进一步的了解，如LNR系列水平力分散型橡胶支座价格、LNR系列水平力分散型橡胶支座规格型号等更多信息，欢迎您随时联络我们，诚邀为您提供最满意的服务!<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498456972zfzrz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1002','郑州水处理设备_河南水处理设备_河南冰峰','136','1498457507','365','1529993507','TS系列侧出式玻璃钎维过滤沙缸<br />\r\n	缸头多向阀材料为进口ABS工程塑料制成，增加了材料的弹性、强度以及耐热、耐腐蚀性、而且表面光滑、亮度好、硬度高；<br />\r\n	玻璃钎维沙缸过滤器使用高品质不饱和聚酯树脂制作内胆，弹性及防腐蚀性能强；玻璃钎维缠绕加固缸体更结实；结合手工和进口的专业树脂、纤维混合喷枪和喷射制作，坚固耐用、不易破裂、生产效率更高‘<br />\r\n	整体纤维缠绕之后外表喷涂防紫外线的聚氨酯保护层，美观、耐用、防紫外线能力强，在日照雨淋等多种工作和气候环境下能长时间使用。','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','1','1','','221.14.188.32','河南省郑州市联通','1','/attachment/information/201706/pre_14984575071i9cz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1003','师大高端,南昌暑期办公软件培训班,南昌暑期办公软件速成班','136','1498457779','365','1529993779','师大高端,南昌暑期办公软件培训班,南昌暑期办公软件速成班&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	师大高端_南昌暑期办公软件速成班_南昌学办公软件哪里好<br />\r\n&nbsp;<br />\r\n	办公软件<br />\r\n	办公软件指可以进行文字处理、表格制作、幻灯片制作、图形图像处理、简单数据库的处理等方面工作的软件。包括微软Office系列、金山WPS系列、永中Office系列、红旗2000RedOffice等。目前办公软件的应用范围很广，大到社会统计，小到会议记录，数字化的办公，离不开办公软件的鼎力协助。目前办公软件朝着操作简单化，功能细化等方向发展。讲究大而全的office系列和专注与某些功能深化的小软件并驾齐驱。另外，政府用的电子政务，税务用的税务系统，企业用的协同办公软件，这些都叫，不在限制是传统的打打字，做做表格之类的软件。<br />\r\n	&nbsp;<br />\r\n	师大高端_南昌暑期办公软件速成班_南昌学办公软件哪里好另外学校开设：南昌室内设计培训&nbsp;南昌平面设计培训南昌园林景观设计培训&nbsp;南昌网页设计培训&nbsp;南昌办公软件培训&nbsp;南昌网络营销培训<br />\r\n	&nbsp;<br />\r\n	联系人：张老师&nbsp;&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','182.108.1.131','江西省南昌市电信','1','/attachment/information/201706/pre_14984577796ilai.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1004','SCF充液阀排名|SCF充液阀供应商|泰丰股份','136','1498460644','365','1529996644','SCF充液阀排名|SCF充液阀供应商|泰丰股份&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	本系列充液阀包含CF型、TCF和TRCF型等，主要用于液动传动中各类液压设备活塞腔的大量充液或排液，以提高其空程速度。其中CF型连接尺寸符合德国力士乐公司的标准，故可替代进口产品。本系列充液阀为常闭式，其工作原理与液控单向阀相似，流向A?B可自游流动，而流向&nbsp;B?A是可控的，当X口有控制压力时，单向阀打开，B?A通，当X口泄压时，单向阀关闭，B?A不通。<br />\r\n	特点：开启压力低，自吸性能好；流道设计通畅，流阻小；控制压力低，复位可靠；具有多种变形和安装连接形式，使用方便；结果紧凑，外形尺寸较小。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498460644ciepb.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1005','红心柚子三红蜜柚保花保果技术福建满园丰最专业','136','1498461124','365','1529997124','春季红肉蜜柚，抽梢、现蕾、开花，受自然条件影响较大，特别是开花期，阴雨、高温、干旱对开花、座果有危害，必须采取一些有效技术措施，才能达到保花保果，夺取丰产优质。&nbsp;　　<br />\r\n1、培养健壮春梢结果母枝<br />\r\n主要是培养健壮的一、二年春梢和二年秋梢，春梢嫩叶期树冠内嫩春梢和树冠外围短嫩梢是来年结果母枝，有健壮春梢，为来年座果率的提高创造良好条件。&nbsp;　　<br />\r\n2、喷射微量元素<br />\r\n适时适当喷射微量元素，是行之有效的达到壮梢、壮花、提高座果率的技术。春嫩梢花开前和谢花幼果初期各喷1-2次0.2%硼砂或0.1%硼酸+0.2%磷酸＝氢钾+0.3%尿素液，就能达到保花保果目的。<br />\r\n　　<br />\r\n3、花期、幼果期适量肥水和温度<br />\r\n春梢抽吐、花蕾、花穗，开花授粉需要适量肥料、水分和适宜温度。如果在花蕾期和开花期缺肥、长时间高温干旱，会直接影响花壮，不育花多，座果率低。在花蕾期和开花期，有自来水果园，柚树地面适当喷水，不能喷在树上，如果把水喷在树上，增加幼嫩叶和柚花的湿度，会使春梢嫩叶、柚花、初结的小果感染病虫害，引起落果。喷在地上的水分，能使开花期补充足够水分，达到提高座果率和减少病害发生。&nbsp;<br />\r\n　　<br />\r\n4、二次环割<br />\r\n柚树花期和幼果初期，经常出现恶劣的气候，如高温干旱、阴雨低温等不良气候因素，会给开花授粉和座果不利的影响，必须采取有效技术措施，提高座果量。二次环割是有效促进保花保果的有效措施。对肥水管理好的柚园，初结果树、旺壮树，如遇阴雨连绵等不良气候，要施行二次环割来保果；盛结果树，退弱树不要采用二次环割。环割方法：在分枝低位部施行环割一刀，留一小枝不环割，环割要一刀通达，达到保根保树势，达到保果增产目的。施行环割必须根据花量树势，花量多在花谢90%时施行环割；花量少在谢花60%时施行环割。树势衰弱不许环割，防止柚树衰退或死亡。<br />\r\n平和县满园丰苗木有限公司<br />\r\n联系人：周朝明<br />\r\n电&nbsp;&nbsp;&nbsp;话：13850463261<br />\r\nQ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Q：67020365<br />\r\n微&nbsp;&nbsp;&nbsp;信：13850463261<br />\r\n地&nbsp;&nbsp;&nbsp;址：福建省漳州市平和县霞寨镇寨里村','alimen998','欧先生','','alimen@242526.com','0592-3366206','0','1','1','','120.41.23.57','福建省厦门市电信','1','/attachment/information/201706/pre_1498461124alnqr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
