INSERT INTO my_information VALUES ('1008','昆明651橡胶止水带_衡水桥闸_云南651橡胶止水带','136','1498468672','365','1530004672','651橡胶止水带<br />\r\n	651橡胶止水带是止水带的一种常用型号，属于中埋式止水带，中心孔两侧各有3个突起的楞，651型橡胶止水带是止水带产品里使用最广泛的，常用的中埋式止水带还有652型、653型等。<br />\r\n	651橡胶止水带是我公司专业生产的橡胶止水带，是利用橡胶的高弹性，在各种荷载下产生弹性变形，从而起到坚固密封，有效地防止建筑构造的漏水，渗水并起到减震缓冲作用。在许多工程建筑设计中，土建、水土结构之间都有一定的伸缩要求，并存在防水防震等问题，因此采用和安装橡胶止水带是有效地解决以上种种问题的手段。本产品主要用于混凝土现浇时设在施工缝及变形缝内，与混凝土结构成为一体的基础工程、地下设施、隧道涵洞、输水渡槽、&nbsp;铛水坝等，确保工程建设的使用寿命。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;651型橡胶止水带是一种常用的橡胶止水带产品，如果我们按施工组织设计中的橡胶止水带安装质量保证体系运作程序和检酥贫龋严格进行事前预防、过程控制。防水专业施工队成立现场质重保证机构，由防水公司项目经理、施工质量员、技术安全员组成。这种止水带在每道工序施工前，责任工长应向施工班组做好技术交底，并明确操作方法和质量标准。施工人员应持有建设行政主管部门或其指定单位颁发的执业资格证书。每道工序施工过程中管理人员应进行过程监督，施工完后由专职质量检嗽薄⒓嗬斫行检搜槭蘸细窈螅方可进行下道工序。质重通病的预防与控制橡胶止水带应铺压严实，将空气排除干净，使橡胶止水带粘贴牢固；橡胶止水带胶粘剂涂刷应均匀，不露底，&nbsp;不堆积，控制胶粘剂蛩⒂胂鸾褐顾带铺贴的间隔时间，粘合时不得用力拉伸橡胶止水带，管道等细部橡胶止水带附加层，裁剪时应与构造形状相符合，并粘贴压实、严密。<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498468672flxi9.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1009','达州上海哪里的防爆电锁价格便宜？','136','1498478026','365','1530014026','达州达州上海的防爆电锁价格最便宜。<br />\r\n井田防爆电锁是一款专业用于石油化工危险区域的电子门锁，井田防爆电锁是一种能够使用在爆炸性气体环境中采用本质安全&nbsp;防爆形式的一种防爆电锁，井田防爆电锁具有结构简单、便于安装维修、无磨损等特点，井田防爆电锁比同类产品寿命长，可靠性高，发生危险时断电解锁便于逃生，特别适用于石油化工等爆炸&nbsp;性环境现场，具有很高的安全性。厂家提供3年免费质保。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n&nbsp;<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n达州联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆电锁价格咨询达州','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498478026sizu2.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
