INSERT INTO my_information VALUES ('1012','济宁数控油缸什么牌子好 泰丰股份','136','1498525419','365','1530061419','济宁数控油缸什么牌子好?泰丰股份。<br />\r\n　&nbsp;山东泰丰液压股份有限公司成立于2000年，占地20万平方米。系中.国液气密行业重点骨干及技术创新先进企业；国家级高新技术企业；国家火炬计划重点高新技术企业；中.国机械工业管理示范企业；2014年度中.国机械工业产品“优质品牌”企业；“中.国制造2025”2015年工业转型升级强基工程项目（超高压大流量比例伺服二通插装阀的研发及产业化）承担企业；中.国首批“中.国制造业产品单项冠军企业”及液压二通插装阀国家标准主持起草和修订企业。<br />\r\n　　公司专业从事高端液压元件的研究、研发与生产。主要产品有电液比例伺服二通插装阀、比例伺服阀、高压柱塞泵、负载敏感多路阀、高压油缸及电液集成系统等。是全球二通插装阀生产规模和年产量最大的厂家，年产集成阀块7000吨，各类液压控制元件85万件，二通插装阀市场占有率在70%以上，在锻压行业高达90%。产品广泛应用于铸锻机械、汽车制造、冶金机械、船舶机械、工程机械、农业机械及石油机械等领域，批量客户达800余家。数控油缸牌子就选泰丰股份。山东泰丰液压股份有限公司成立于2000年，占地20万平方米。系中.国液气密行业重点骨干企业，国家级高新技术企业、国家火炬计划重点高新技术企业、中.国机械工业管理示范企业、中.国液气密行业技术创新先进单位、泰丰产品荣获国家“2014年度中.国机械工业优质品牌”。公司专业从事高端液压控制技术与元件的研发和生产，拥有已授权各项专利技术72项（其中发明专利9项），技术水平国内领先、国际先进。现公司多项产品填补了国内空白，并可替代进口，其中二通插装阀、机械反馈插装式比例节流阀系统、大流量双主动电液比例插装式节流阀等产品被列入了国家重点新产品计划，并多次承担国家、省、市级科技项目，公司研发的超高压大流量比例伺服二通插装阀中标“中.国制造2025”&nbsp;2015年工业转型升级强基工程项目。主要产品有电液比例高性能二通插装阀、比例伺服阀、电液集成系统、高压油缸、高压柱塞泵、负载敏感多路阀及工程机械用变量液压集成系统等，产品广泛应用于锻压机械、铝型材挤压机、注塑机、棉花打包机、挖掘机、抓草抓木机、起重机、液压桩机、石油修井机、岩芯钻机、压缩垃圾站、拖拉机、收割机、收获机及甘蔗装载机等机械设备，拥有批量客户500余家。公司始终坚持“为全球客户提供液压整体解决方案”的发展目标，遵循“以市场为导向、以质量求生存、以创新求发展、以服务求信誉”的经营方针，不断引入精益管理、智能化制造和学习型组织等先进的管理模式，努力将泰丰打造成为“为中.国装备制造业提供高端液压元件和液压集成控制技术的知名企业”。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498525419dzzqg.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
