INSERT INTO my_information VALUES ('1014','广州众誉|高空作业车租赁报价|深圳高空作业车租赁','136','1498527889','365','1530063889','广州众誉|高空作业车租赁报价|深圳高空作业车租赁&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;清远高空作业车出租电话13600005563<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.gzzyjx99.com<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','61.144.117.137','广东省广州市海珠区/荔湾区电信','1','/attachment/information/201706/pre_1498527889mbc44.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1015','哈尔滨防爆门禁锁厂家最专业井田防爆门禁锁适合所有门禁使用','136','1498528225','365','1530064225','哈尔滨哈尔滨上海是最专业的上海防爆门禁锁厂家。<br />\r\n防爆门禁锁就找上海海栌门控科技有限公司，专业防爆门禁锁生产厂家，本公司防爆门禁锁能和各种品牌门禁系统兼容，提供门状态信号输出，高品质防爆门禁锁，提供3年免费保修，征全国地区代理经销商，电话021-51692106<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n哈尔滨联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆门禁锁厂家咨询哈尔滨哈尔滨','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498528225susjy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1016','济宁哪里的移动式螺旋提升机 不锈钢食盐提升机 徐价格便宜？','136','1498528322','365','1530064322','曲阜兴运输送机械设备有限公司的移动式螺旋提升机&nbsp;不锈钢食盐提升机&nbsp;徐价格最便宜。<br />\r\n移动式螺旋提升机&nbsp;不锈钢食盐提升机&nbsp;徐<br />\r\n联系0537-3125063&nbsp;&nbsp;手机；18954096589&nbsp;<br />\r\n	物料提升机图片|小型提升机|饲料提升机|不锈钢提升机|粉末提升机|垂直提升机|斗士提升机&nbsp;粮食提升机&nbsp;多功能提升机&nbsp;<br />\r\n属于特种螺旋输送机。前者的机壳为圆管，螺旋带动物料高速旋转后产生的离心力把物料推向管壁，而后被叶片向上推动。<br />\r\n它的提升高度在20米以内。后者的机壳也是圆管，管内沿内螺旋线装有叶片，机壳支承在辊子上作低速转动，<br />\r\n物料沿叶片向前移动，装料、卸料在两端进行。它可微倾斜输送物料，不会出现卡料现象。<br />\r\n直径由100mm～1250mm，共十二种规格,分为单驱动和双驱动两种形式，单驱动螺旋机最大长度可达40m(特大型30m)，<br />\r\n双驱动螺旋机采用中间断开轴结构，最大长度可达80m(特大型60m)，螺旋机长度每&nbsp;0.5m&nbsp;一档，<br />\r\n可根据需要选定，螺旋机头部轴承、尾部轴承置于壳体外部减少了灰尘对轴承室的侵入提高了螺旋机关键件的使用寿命。<br />\r\n中间吊轴承采用滚动、滑动可互换的两种结构，阻力小、密封性强、耐磨性好吊轴承机外侧置式油杯,便于集中加油润滑。<br />\r\n进出料口位置布置灵活,并增设电动型出料口。<br />\r\n适宜输送粉状、颗粒状、小块状物料,如水泥、煤粉、粮食、化肥、灰渣、沙子、焦炭等.不宜输送易变质、粘性大、易结块的物料。<br />\r\n型号&nbsp;&nbsp;输送量（m3/h）动力（kw/m）3米价格（元）<br />\r\n型号	管径（mm）	输送量(m3/h)	每米动力(KW)&nbsp;<br />\r\nTL10	108	0.5-2	0.2	1000&nbsp;<br />\r\nTL16	159	2-6	0.5	1260&nbsp;<br />\r\nTL18	180	4-8	0.5	1700&nbsp;<br />\r\nTL20	219	6-10	0.75	1800&nbsp;<br />\r\nTL28	275	12-16	1.5	3500&nbsp;<br />\r\nTL30	325	15-20	2.2	4600&nbsp;<br />\r\nTL50	500	30-40	3	6800	移动式螺旋提升机&nbsp;不锈钢食盐提升机&nbsp;徐价格咨询：0537-3125063','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','112.236.156.124','山东省济宁市联通','1','/attachment/information/201706/pre_1498528322vx4gk.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1017','双主动型比例二通插装阀，TLCF-2WRCD比例二通插装阀','136','1498528947','365','1530064947','一般来说，二通插装阀用于较大的流量，目的在于更高效、更快和更紧凑的液压系统。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀升级、插装式连接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品安装连接尺寸符合ISO&nbsp;&nbsp;7368、DIN&nbsp;&nbsp;24342和GB2877。如今的机械需要成本效应和能量效益都特别高的控制，泰丰插装阀满足了这些需要。<br />\r\n	二通插装阀的优点<br />\r\n	1、设计灵活<br />\r\n	2、安装成本低<br />\r\n	3、外形尺寸较小<br />\r\n	4、性能和控制更好<br />\r\n	5、可靠性提高<br />\r\n	6、压力能力提高<br />\r\n	7、工作效率提高<br />\r\n	8、消除了外泄漏并减少了内泄漏<br />\r\n	9、污染耐受力更大<br />\r\n	10、循环时间更快<br />\r\n	二通插装阀的应用<br />\r\n	二通插装阀一般用于流量大于150L/min的中压至高压液压系统，以便在各种用途中提供传动与运动控制。<br />\r\n	油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机和其他金属一次加工设备、行走车辆、船舶<br />\r\n	&nbsp;<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498528947tqizv.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1018','上饶明辉滤袋厂家生产过滤净化PM2.5除尘布袋','136','1498529929','365','1530065929','明辉滤袋厂家生产过滤净化PM2.5除尘布袋。<br />\r\n&nbsp;&nbsp;&nbsp;环保除尘行业越来越社会关注，这都是由于雾霾的产生，雾霾的产生破坏了自然环境和人身健康，但也加大了民众的环保意识。雾霾的主要成分是可吸入颗粒、氮氧化物以及二氧化硫，其中可吸入颗粒物是指直径小于等于2.5微米的颗粒，这种颗粒是一种有毒污染物，会严重危害人类健康，所以国家加大了环保除尘的力度。经实践证明，除尘滤袋能过滤小于1微米的微粒，所以雾霾之后，除尘滤袋成为了防止PM2.5的主力军。<br />\r\n&nbsp;&nbsp;&nbsp;除尘滤袋是滤袋除尘器的重要除尘工具，当含尘烟气通过除尘滤袋时，就会因惯力的作用与除尘滤袋纤维发生碰撞而被其捕捉，从而使被放出的烟气得到了净化。PM2.5的“最”主要来源是燃煤锅炉，在我国燃煤电站的废气排放量占总量的50%，其烟气中就含有吸入颗粒物等有害物质，若不严控，就会再次造成雾霾的出现，从而带动PM2.5的卷土从来，所以对于燃煤锅炉等烟气排放大的工业，都应该使用在作业时使用除尘滤袋相关设备来辅助除尘，这样才能严控排放，从而保证除尘净化达标。雾霾之后，国家完善了相关环保政策，例如《大气污染防治行动计划》、《锅炉大气污染物排放标准》。这些政策在助力环保的同时，更推进了除尘滤袋<br />\r\n相关设备的发展，所以不难看出，未来除尘滤袋是PM2.5的主力军。<br />\r\n&nbsp;&nbsp;明辉滤袋专业生产供应除尘滤袋的厂家，明辉滤袋是能有效过滤PM2.5，为保护环境，保护人们的省心健康做出自己的贡献！<br />\r\n&nbsp;&nbsp;更多明辉除尘滤袋请咨询&nbsp;微信：fnbhzm','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.64.230','江苏省盐城市电信','1','/attachment/information/201706/pre_1498529929xviz4.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1019','植保无人机报价,植保无人机排名,星环航空','136','1498530261','365','1530066261','植保无人机报价,植保无人机排名,星环航空&nbsp;|&nbsp;必扬星环（北京）航空科技有限公司<br />\r\n	植保无人机厂家_植保无人机品牌_星环航空&nbsp;<br />\r\n	植保无人机推荐星环航空&nbsp;<br />\r\n	电话：18610599267、18612990852&nbsp;<br />\r\n	<br />\r\n	星环航空植保无人机产品参数&nbsp;<br />\r\n	自重：9KG&nbsp;<br />\r\n	有效载荷：10KG&nbsp;<br />\r\n	起飞全重：25KG&nbsp;<br />\r\n	作业高度：1-5m&nbsp;<br />\r\n	作业精度：&nbsp;<br />\r\n	水平±0.03m&nbsp;&nbsp;垂直±0.05m（RTK）&nbsp;<br />\r\n	水平±0.8m&nbsp;&nbsp;&nbsp;垂直±0.5m（GPS）&nbsp;<br />\r\n	动力：高性能智能电池，支持快速插拔&nbsp;<br />\r\n	作业飞行速度：3-10m/s&nbsp;<br />\r\n	最大飞行速度：15m/s&nbsp;<br />\r\n	作业时间：5-15min&nbsp;<br />\r\n	抗风能力：12m/s（6级）&nbsp;<br />\r\n	最大作业海拔：3500m&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	星环航空植保无人机产品优势&nbsp;<br />\r\n	折叠快拆，高效使用――&nbsp;<br />\r\n	星环植保无人机采用快速插拔设计，便于运输，拆装时间≤3分钟，机身各主要部件即插即用，避免一处损坏，全机维修的高额损失；&nbsp;<br />\r\n	智能动力，高效飞行――&nbsp;<br />\r\n	星环植保无人机采用高性能快速插拔电池，电量直观显示，可视化充电进程，便于更换，减少作业时间浪费，下置电池，重心降低，飞行更平稳；&nbsp;<br />\r\n	先进设计，高效运营――&nbsp;<br />\r\n	星环植保无人机整机结构设置快拆设计，有效载荷高达10KG，飞行时间与装药量最大化匹配，防止浪费；&nbsp;<br />\r\n	作业精确，高效喷洒――&nbsp;<br />\r\n	星环植保无人机标配美国进口喷洒系统，雾化更均匀，扇形面积覆盖更广，可选配多种喷头系统，适用多种农作物；&nbsp;<br />\r\n	操作简便，高效作业――&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;星环植保无人机支持AB点模式，傻瓜操作，快速上手，采用植保专用飞控，适应各类农田地形，可选配RTK定位，精度高达厘米级。','gyodo999','黄杰琦','','biyangxinghuan@163.com','010-57487720','0','1','1','','106.38.97.162','北京市电信','1','/attachment/information/201706/pre_1498530261kdnqr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1020','武汉月子中心系统助您成为月子中心行业的标杆-康乐志','136','1498530743','365','1530066743','武汉月子中心系统助您成为月子中心行业的标杆-康乐志<br />\r\n月子中心系统介绍<br />\r\n康乐志月子中心系统主要有服务预约、产后母婴健康管理、专家巡诊、专业护士、月嫂管理、丰富多样的月子餐管理、产妇产后健康恢复、客房管理、会员管理、在线订餐、在线购物等功能。<br />\r\n本系统支持酒店服务式、独栋建筑园区式、医院附属式、社区家庭式四大模式月子中心的实体运营。<br />\r\n康乐志月子中心系统功能<br />\r\n?	会员管理<br />\r\n1.	会员信息管理、会员帐务体系、会员关怀服务<br />\r\n2.	提供尊享的会员奖励与优惠<br />\r\n3.	会员分析与保持<br />\r\n?	健康管理<br />\r\n1.	宝宝睡眠、喂养、免疫、疾病等数据管理&nbsp;<br />\r\n2.	妈妈生活、美容修身、食谱、心理指导护理数据管理<br />\r\n?	财务管理<br />\r\n1.	客户服务费用，房费、增值服务及商品购买<br />\r\n2.	门店运营成本，房租、员工薪资、消耗物资、商品采购、品牌宣传等<br />\r\n?	商城管理<br />\r\n1.	优惠活动及商品展示<br />\r\n2.	服务推送<br />\r\n3.	门店风采展示<br />\r\n?	企业管理<br />\r\n1.	人事管理<br />\r\n2.	工作任务管理<br />\r\n3.	销售报表与成果统计<br />\r\n4.	货品及库存管理<br />\r\n增值服务<br />\r\n?	手持作业系统<br />\r\n所有母婴用品二维码标签管理，扫码一下完成护理<br />\r\n?	客户应用<br />\r\n1．	实时掌握妈妈与宝宝健康数据<br />\r\n2．	实时账户管理<br />\r\n3．	在线购买服务或产品<br />\r\n4．	享受服务效果反馈<br />\r\n?	中心定制<br />\r\n我们拥有专业的软件开发和整体解决方案提供能力,覆盖网站开发、管理系统开发、andriod、ios、&nbsp;WP等平台APP应用开发、移动智能、二维码、微信小程序、物联网等高技术难度项目开发。可以满足客户针对现有系统进行功能加减、个性化更改,或者全新项目开发等需求。','yufongkeji1','经理','2567077317','m15168255342@163.com','40068825','0','1','1','','115.196.182.111','浙江省杭州市余杭区电信','1','/attachment/information/201706/pre_1498530743kfj9m.gif','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
