INSERT INTO my_information VALUES ('1022','延安重庆老火锅加盟味道最佳的老社长知青火锅','136','1498531046','365','1530067046','重庆老火锅加盟味道最佳的老社长知青火锅<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;现在的重庆火锅店在全国越开越多，当然也是有亏有赚，亏是什么原因？赚又是为什么？作为重庆火锅的起源，在重庆你可以得到答案！重庆人会告诉你，味道一定是重庆火锅的核心！<br />\r\n<br />\r\n重庆火锅店加盟味道怎么样<br />\r\n<br />\r\n重庆火锅加盟店遍布全国，大到北上广，小到一个小县城，都有一个通病，那就是装修，装修得很华丽，很时尚，尤其是大城市，这个问题很明显。但是味道却只能算将就。装修花了大量资金，味道无法留住顾客，那么就只有亏钱了。对于重庆火锅来说，味道不能将就，必须是好吃！解放碑老火锅以多年经验告诉大家，重庆火锅一定要好吃，美味！才能够留住顾客。<br />\r\n重庆火锅店加盟味道怎么样<br />\r\n<br />\r\n老社长知青火锅在重庆经验了很多年，以重庆人刁钻的味蕾，也没能打垮老社长知青火锅！而靠着口碑和人气的积累，多年的开店经验，老社长知青火锅加盟也做得风生水起，全国各地的加盟店生意都非常不错，有好几个店长期保持排队的状态，成为加盟店当地当之无愧的餐饮中心！<br />\r\n<br />\r\n&nbsp;<br />\r\n加盟电话：023-60362400;1832318772<br />\r\n网址：www.laoshezhanghg.com<br />\r\n<br />\r\n1.电话咨询<br />\r\n2.实地考察<br />\r\n3.寻找门面<br />\r\n4.签订房租协议<br />\r\n5.签订加盟协议<br />\r\n6.开始图纸设计和工程施工<br />\r\n7.确定大物件的配件及人员培训<br />\r\n8.订购相关物资→&nbsp;装修完工→&nbsp;试营业<br />\r\n9.正式开业','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.187.231','重庆市电信','1','/attachment/information/201706/pre_1498531046m4xxr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1023','长春GPZ盆式橡胶支座|衡水桥闸|GPZ盆式橡胶支座','136','1498532071','365','1530068071','GPZ(II)盆式橡胶支座&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;GPZ(II)盆式支座的工作原理是利用半封闭钢制盆腔内的弹性橡胶体，在三向受力状态下具有流体的性质的特点，来实现上部结构的转动；同时依靠中间钢板上的聚四氟乙烯板与上座板上的不锈钢板之间的低磨擦系数来实现上部结构的水平位移。从试验的数据来看，橡胶体处于三向约束状态时的抗压弹性模量为5x103MPa，比无侧向约束的抗压弹性模呈增大近20倍，因而支座承载能力大大提高，解决了普通橡胶支座承载能力的局限性。所以盆式支座是能满足大的支承反力，大的水平位移，大的转角要求的新型产品。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;GPZ&nbsp;(&nbsp;II&nbsp;)盆式橡胶支座是按中华人民共和国交通部新近颁布的交通行业标准JT391标准实施生产的。本系列产品具有结构合理、承载能力大、变形小、水平位移量大、转动灵活等特点。&nbsp;<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498532071esv2p.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
