INSERT INTO my_information VALUES ('1026','从化高空车出租品牌|广州众誉|从化高空车出租报价','136','1498534690','365','1530070690','从化高空车出租品牌|广州众誉|从化高空车出租报价&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;从化高空车出租高空车出租高空车电话13600005563<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','61.144.117.137','广东省广州市海珠区/荔湾区电信','1','/attachment/information/201706/pre_1498534690ia5qn.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1027','廊坊森卓,除垢剂产地,除垢剂报价','136','1498534962','365','1530070962','廊坊森卓,除垢剂产地,除垢剂报价&nbsp;|&nbsp;廊坊森卓化工有限公司<br />\r\n	【速效除垢剂成分】&nbsp;<br />\r\n	　　是由具有螯合、清洗、分散作用的药剂复合而成，可以溶解清除碳酸钙、碳酸镁、硫酸钙、硅酸钙及氧化铁等附着在锅炉内壁的水垢成份。具有清洗和缓蚀的双重作用，对锅炉炉体及附件的损害小，不会因为加药量多或清洗时间长而造成过洗。可适用于锅炉钢、不锈钢、黄铜、紫铜等多种金属及合金材质，缓蚀率达99.7%，比盐酸类除垢剂要高几十倍到几百倍。&nbsp;<br />\r\n	　　【速效除垢剂用途】适用于各种工业锅炉除垢，可用于电站锅炉除垢、工业锅炉除垢、排灰管线除垢、循环冷却水系统、船舶、啤酒厂、食品设备等，对硅酸盐先采用脱脂剂转变垢型，再用除垢剂效果更佳。&nbsp;<br />\r\n	　　【速效除垢剂用量】在使用时候一般用60度水溶化后，在将溶液加入到锅炉系统内，具体用量视垢的厚度而定，除垢方法可采用浸泡或强制循环法，时间24-36小时。&nbsp;<br />\r\n	　　【速效除垢剂技术参数】&nbsp;<br />\r\n	　　外观：白色粉末&nbsp;<br />\r\n	　　密度（20℃）,g/cm3：1.30±0.5&nbsp;<br />\r\n	　　活性组分：≥20.0&nbsp;<br />\r\n	　　pH值（1%水溶液）：2.5～4.5&nbsp;<br />\r\n	　　欢迎各大客户与我们联系，厂家直销，品质保证！','wycta417','崔先生','59284339','714385184@qq.com','0316-2186676','0','1','1','','101.75.193.144','河北省联通','1','/attachment/information/201706/pre_1498534962ve8he.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1028','汕头上海哪里的防爆电子锁价格便宜？井田JT-3000防爆电子','136','1498535505','365','1530071505','汕头汕头上海的防爆电子锁价格最便宜。<br />\r\n井田JT-3000防爆电子锁,安全防爆：可用于爆炸性环境：1区，2区，井田防爆电子锁专业用于石油化工场所，配合各种品牌门禁控制系统使用，井田防爆电子锁使用寿命长，产品质量稳定耐用，厂家提供3年免费质保，井田JT-3000防爆电子锁厂家批发，价格更低，欢迎来电咨询。<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n汕头联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆电子锁价格咨询汕头','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.196.188','上海市徐汇区电信','1','/attachment/information/201706/pre_1498535505xfm1u.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1029','汉中立体车库最具性价比厂家推荐','136','1498535906','365','1530071906','汉中立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201706/pre_1498535906vznvw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1030','代加工片剂_长白山桑黄品牌_十月细润','136','1498540749','365','1530076749','代加工片剂_长白山桑黄品牌_十月细润&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;OEM贴牌加工爆款产品！！！<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为各类型会销、直销运营商、电商微商商团队、400销售平台、广播电视叫做销售平台量身订制加工各品类爆款OEM产品。并提供产品包装设计、产品营养配方、营销及推广等全方位一站式服务。<br />\r\n加工品类:粉剂类（固体饮料、代餐粉、冲剂）；片剂类（泡腾片剂、糖果压片）；代用茶（果茶、减肥茶、养生茶）<br />\r\nOEM是社会化大生产、大协作趋势下的一种必由之路，也是资源合理化的有效途径之一，是社会化大生产的结果。<br />\r\noem贴牌加工的好处：<br />\r\n1，减少厂房和设备等固定资产投资；<br />\r\n2，不需要很多资金，就可以有自己的产品；<br />\r\n3，集中精力从事设计，研发，销售，节约时间及成本投入；<br />\r\n4，可以发挥自己的优势，把生产相关的技术和工作交给专业企业，可以提高产品质量，缩短生产周期。<br />\r\n合作方式<br />\r\n1．客户可用您的品牌我来加工；<br />\r\n2．可按您的样品我来加工；<br />\r\n3．可按您的配方我来加工。<br />\r\n品级：保健食品级&nbsp;药品&nbsp;洗化&nbsp;日化等等<br />\r\n配方：根据客户要求定制调配<br />\r\n规格：定制<br />\r\n单价：面议<br />\r\n一、公司生产优势<br />\r\n1.采用GMP认证的标准化生产管理、标准，确保产品品质；<br />\r\n2.采用行业标准的百级净化标准灌装车间，安全无菌；<br />\r\n3.产品从配料完成安全封闭；<br />\r\n4.生产过程中采用行业工艺标准纯化水，高于食品行业标准；<br />\r\n5.采用最新制备技术，最大程度保留营养成分，保持口感醇正，不让产品失活；<br />\r\n6.先进的实验仪器和实验设备，确保产品品质；<br />\r\n7.优秀的技术优势和完善的售后服务。<br />\r\n二、我们的承诺：<br />\r\n1、100%足料投产：完全遵照合同规定的标准足量、实料投产，保证产品货真价实。<br />\r\n2、100%贴心服务：有关客户的报批资料、生产批文、标签、商标、商品名等严格在授权范围内使用。<br />\r\n3、100%资料保密：对客户的单位名称、加工品种、数量、工艺、配方等信息绝对保密。<br />\r\n三、与客户交流市场及产品技术要求：<br />\r\n1、根据客户要求提供部分产品配方样版<br />\r\n2、客户体验产品配方样版并反馈意见给改进，直至双方达成一致<br />\r\n3、客户选择OEM方案并签订加工合同<br />\r\n4、客户按合同要求预付加工款<br />\r\n5、生产提货付余款&nbsp;<br />\r\n	详情咨询电话：13664353525我公司以诚信为准则、以客户为根本、同行业性价比最高!期待与您携手共创辉煌！','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','123.172.233.216','吉林省白城市电信','1','/attachment/information/201706/pre_1498540749ykhbi.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1031','桑黄多少钱一斤|桑黄价格|十月细润','136','1498541398','365','1530077398','桑黄多少钱一斤|桑黄价格|十月细润&nbsp;|&nbsp;通化十月细润生物科技有限公司<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		桑黄的功效与作用&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n			桑黄，是一种真菌，因寄生于桑树而得名。子实体无柄，菌盖扁半球形或马蹄形，木质，浅肝褐色至暗灰色或黑色。桑黄又名桑寄生、桑黄菇、猢狲眼、桑耳、桑臣，是一种真菌。<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		桑黄Phellinus&nbsp;igniarius（L.&nbsp;ex&nbsp;Fr.），是一种真菌，因寄生于桑树而得名。子实体无柄，菌盖扁半球形或马蹄形，木质，浅肝褐色至暗灰色或黑色。桑黄又名桑寄生、桑黄菇、猢狲眼、桑耳、桑臣，是一种真菌，因寄生于桑树而得名。因其外形与灵芝相似，因此也有人称之为桑黄灵芝。它分布在中.国东北、华北、西北以及四川、云南等地，在日本、韩国、朝鲜等东亚国家也有分布。在杨、柳、桦、栎等树干上也有生长。分布中.国东北、华北、西北及四川、云南等地，在日本、韩国、朝鲜等东亚国家也有分布。陇南康县仿野生栽培桑黄已获得成功。<br />\r\n	<br />\r\n	<br />\r\n		桑黄是一种名贵中药，能利五脏、软坚、排毒、止血、活血、和胃止泻。有助于治淋病，崩漏带下，症瘕积聚，癖饮，脾虚泄泻。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n		导购：桑黄<br />\r\n	<br />\r\n	<br />\r\n		每盒：498元<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;（全国统一零售价）<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;指定销售商：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;通化十月细润生物科技有限公司<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;销售热线：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;15044500386<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		咨询电话：&nbsp;15044500386&nbsp;&nbsp;微信：15044500386','syxrswkj','周先生','2177827702','2177827702@qq.com','0435-8886888','0','1','1','','36.49.147.0','吉林省吉林市电信','1','/attachment/information/201706/pre_1498541398safuu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1032','深圳下水道疏通清洗 鱼塘清淤 泥浆泵清淤型号宏鑫市政最全','136','1498542143','365','1530078143','深圳下水道疏通清洗&nbsp;鱼塘清淤&nbsp;泥浆泵清淤型号宏鑫市政最全。深圳宏鑫市政专业生产销售各种型号下水道疏通清洗&nbsp;鱼塘清淤&nbsp;泥浆泵清淤。<br />\r\n深圳&nbsp;大型下水管道疏通&nbsp;市政管道清淤&nbsp;下水道清洗&nbsp;182-1808-6986<br />\r\n宏鑫市政工程建设有限公司&nbsp;www.hongxingc.com&nbsp;是广东地区最具势力的市政工程建设公司，专注于政管道疏通、下水道疏通、管道清淤、河道清淤、箱渠箱涵清理、污水池清理、池塘理清、化粪池清理、污水池清理、排水沟清淤、污水道清淤、沉淀池清淤、管渠清淤、明暗管渠清淤、河涌清淤、河道清理、箱渠清淤等业务，多年来在行业中留下了良好的口杯，<br />\r\n同时公司注入过千万资金购买先进的设备，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施，公司拥有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n欢迎来电咨询：&nbsp;182-1808-6986&nbsp;&nbsp;&nbsp;&nbsp;戴经理<br />\r\nwww.hongxingc.com<br />\r\n广东省全方位施工服务；深圳、广州、东莞、中山、佛山、珠海、江门、湛江、阳江（阳江市、江城区、阳春市、阳西县、阳东县）等；遍布珠三角地区；&nbsp;&nbsp;<br />\r\n深圳下水道疏通清洗&nbsp;鱼塘清淤&nbsp;泥浆泵清淤型号深圳宏鑫市政最全。','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','1','1','','219.134.7.102','广东省深圳市福田区电信','1','/attachment/information/201706/pre_1498542143wtdy8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1033','吕梁火锅加盟重庆老社长知青火锅介绍','136','1498544387','365','1530080387','火锅加盟重庆老社长知青火锅介绍<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;重庆特色火锅――重庆老社长知青火锅是重庆顶傲餐饮文化有限公司的主打火锅加盟品牌，公司集“火锅餐饮、特许连锁经营、特色餐饮文化开发、人才储备培训、菜品研发推广、食品加工生产、物流全面配送”为一体，是一家全国性餐饮连锁企业<br />\r\n<br />\r\n火锅加盟重庆老社长知青火锅介绍<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;自2004年在重庆渝北创办第一家直营店以来，【重庆老社长知青火锅】发展迅猛，历经13年的发展，加盟店已遍布全国，经营规范，生意火爆。13年来，“老社长知青火锅”始终坚持“让加盟商赚钱”的持续任务，秉承把公司作为平台，公司员工同步发展的企业理念，老社长知青火锅经历13年的沉淀发展、不断创新，更是开创了“先加盟，后付费”的加盟合作模式！13年，公司在取得辉煌成就的同时更是奠定了持续发展的坚实基础。&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<br />\r\n火锅加盟重庆老社长知青火锅介绍<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;为保证火锅的口感统一，纯正，老社长火锅www.laoshezhanghg.com采用中央厨房模式，每一包料均采用工厂化、流程化、标准化生产，做到让单店去大厨师化，厨房最小化，利润最大化，为各加盟店省钱省时省人力，方便各店进行最简单的操作，特别为从未做过餐饮的人士提供了最简单的操作方式&nbsp;。<br />\r\n<br />\r\n加盟电话：023-60362400;1832318772','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.187.231','重庆市电信','1','/attachment/information/201706/pre_1498544387xlju0.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1034','河南冰峰,泳池水质处理公司在哪,郑州泳池水质','136','1498544632','365','1530080632','砂缸工作原理<br />\r\n	<br />\r\n		池水经过过滤器，微小的污物被沙床捕集滤除掉。过滤后的清水由过滤器底部经控制开关再由管道返回水池。这一整套程序都是连续自动的，且为过滤器和管道系统提供了完整的循环过程。<br />\r\n	<br />\r\n	<br />\r\n		砂缸经过一段时间的使用，积存的污物阻碍水流使其减弱。这时就要对过滤器进行清洁。例如，当控制开关打到&quot;BACKWASH&quot;位置，这时水流就变成了反方向流动，水流直接到达过滤器腔体的底部，再经过沙层反冲上来，将以前捕集的污物，残渣冲起从排污口排出，每次反冲洗后，应将控制开关打到”RINSE&quot;位置，开启水泵0.5至1分钟后关闭，然后打到“FILTER”位置，重新开始正常的过滤。<br />\r\n	<br />\r\n	砂缸性能特点<br />\r\n	<br />\r\n		1.增强型聚酯无缝壳体，玻璃纤维缠绕球形结构使沙缸更加坚固，表面经过无毒处理。<br />\r\n	<br />\r\n	<br />\r\n		2.抗腐蚀，抗磨损，抗紫外UV，抗氧化O3，防晒，海淡水通用。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;3.独特的布水器与集水器形成均衡水力的水流，暗渠排水系统效<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n		<br />\r\n		<br />\r\n			率高。<br />\r\n		<br />\r\n		<br />\r\n			&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.过滤精度高，出水质量好，出水浊度&amp;lt;20um.<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		5.过滤流速高，滤速可达10～50m3/h/m2.<br />\r\n	<br />\r\n	<br />\r\n		6.多向阀操作方便简单，设有透明排污管以便观察冲洗水的清澈程度。<br />\r\n	<br />\r\n	<br />\r\n		7.配有气压计，手动通气阀及排水阀。<br />\r\n	<br />\r\n	<br />\r\n		8.螺栓，螺帽及各种紧固件均采用不锈钢材质。<br />\r\n	<br />\r\n	<br />\r\n		9.清洗快，滤料不流失，操作维护简便，缸体十年不坏。','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','0','1','','221.14.188.32','河南省郑州市联通','1','/attachment/information/201706/pre_14985446321sszi.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1035','平凉恭贺金皇朝娱乐平台主管意外中得1.6亿美元巨奖 www.','136','1498546245','365','1530082245','恭贺金皇朝娱乐平台主管意外中得1.6亿美元巨奖&nbsp;www.jhc899.com<br />\r\n金皇朝娱乐平台（www.jhc899.com）06月22日讯：世上本来就有些事是“有心栽花花不成，无心插柳柳成荫”！在以前的新闻里，小编就讲过好几起关于打错票而意外中奖的事件。今天我们要讲的主人公是一对来自纽约的夫妻，他们也是这样歪打正着而中奖的。<br />\r\n大家还记得年初的时候，正是美国强力球火热的时候。因其奖池奖金不断高涨，所以有很多人纷纷加入到了强力球的购彩大军中。而南希也正是看好这一时机，所以叫丈夫维托去买一张强力球彩票，希望能在9亿美金的奖池中分到一杯羹。但是维托却没有听妻子的话，他最终买了一张超级百万的彩票，金皇朝平台。<br />\r\n第二天，南希听说维托买彩票的地方中出了一个大奖，于是她开始核对这张彩票。当她发现所有号码都匹配时，她说她自己“就像得了心脏病！太难以置信了，我感觉受到了惊吓”！金皇朝登陆。<br />\r\n南希和维托保守这个秘密长达好几个月，直到3月10日，这对夫妻才领取了这个大奖。南希表示：“我们没有告诉任何人，一直保守着这个秘密。虽然沉默很艰难，但是我们现在感到很兴奋！”<br />\r\n金皇朝主管领奖<br />\r\n6月30日，南希在接受巨大支票和采访时表示，丈夫买错彩票“是件好事”。当被问及将如何使用这笔奖金时，南希表示，他们成立了一个基金会，将从中兑取支票。同时，南希希望全家人的心情都可以慢慢平复下来。她表示未来有无限可能，他们或许会买一辆敞篷车，或许会买一座豪宅。但是一切都还说不准，毕竟这是一笔巨款。而今年37岁的维托，已经在计划着要提前退休了。<br />\r\n虽然两夫妻中奖过程有些戏剧化，但最终也是得到了一个比较圆满的结果！所以有时候买错了不一定是坏事，说不定会有意外的收获，相信家和万事兴！<br />\r\n金皇朝娱乐平台-国际金融财团巨资打造的新生代在线娱乐网站,致力于打造世界顶级的网上娱乐平台。本站提供金皇朝娱乐注册、登录以及客户端下载等服务，承诺配备最优质的投注方法,并辅以最先进的网络资源。欢迎您的加入!平台创建至今，一直致力于为广大彩民提供安全可靠的在线娱乐平台和优质的服务。k彩直营平台实力雄厚,技术强硬,服务热情，多种玩法体验。<br />\r\n标签:&nbsp;&nbsp;&nbsp;金皇朝注册&nbsp;金皇朝登陆&nbsp;金皇朝主管&nbsp;金皇朝娱乐&nbsp;金皇朝平台','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','1','1','','120.41.23.57','福建省厦门市电信','1','/attachment/information/201706/pre_1498546245tkov9.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1036','哈尔滨桥梁检测车租赁,衡水桥闸,桥梁检测车租赁','136','1498546818','365','1530082818','桥梁检测车租赁&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;桥梁检测车是一种可以为桥梁检测人员在检测过程中提供作业平台，装备有桥梁检测仪器,用于流动检测和(或)维修作业的专用汽车。&nbsp;&nbsp;<br />\r\n	桥梁检测车工作原理是由液压系统将工作臂弯曲深入到桥底对桥梁进行检测。是由汽车底盘和工作臂组成。有东风底盘桥梁检测车。欧曼底盘桥梁检测车，进口桥梁检测车。&nbsp;<br />\r\n	衡水桥闸公司有多部桥梁检测车，常年为北京、天津、新疆、西藏、青海等广大用户做租赁服务，北京桥检车租赁找桥闸<br />\r\n	公司电话：0318-2209900&nbsp;李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498546818x7agx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1037','师大高端|景德镇最好的淘宝网店培训班|景德镇暑期淘宝网店培训','136','1498547043','365','1530083043','师大高端|景德镇最好的淘宝网店培训班|景德镇暑期淘宝网店培训班&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	师大高端_景德镇暑期淘宝网店培训班_景德镇最好的淘宝网店培训班<br />\r\n&nbsp;<br />\r\n	景德镇暑期淘宝网店培训班课程安排：<br />\r\n一、美工实践课程<br />\r\n1、Photoshop应用技能<br />\r\n2、利用Dreamweaver手工书写淘宝代码技能&nbsp;<br />\r\n3、美工实践应用技能（淘宝整体店铺装修综合实例讲解）<br />\r\n二、店铺实践<br />\r\n1、淘宝后台操作<br />\r\n直接打开淘宝店铺后台，讲解淘宝网店装修规则，现场演示网店首页、详情页、活动专题页的装修流程，轻松掌握淘宝网店装修技巧。<br />\r\n2、店铺整体装修<br />\r\n三、淘宝运营阶段<br />\r\n以推广店铺、提升流量、提高转化率为核心来进行的，具体内容包括优化宝贝标题、提升宝贝排名、设计宝贝文案等相关的方式方法，以及直通车、淘宝客、联盟推广的使用技巧。<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n师大高端_景德镇暑期淘宝网店培训班_景德镇最好的淘宝网店培训班&nbsp;高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。&nbsp;<br />\r\n	&nbsp;<br />\r\n	师大高端_景德镇暑期淘宝网店培训班_景德镇最好的淘宝网店培训班另外学校开设：景德镇室内设计培训&nbsp;&nbsp;景德镇平面设计培训&nbsp;&nbsp;&nbsp;景德镇园林景观设计培训&nbsp;&nbsp;&nbsp;景德镇网页设计培训&nbsp;&nbsp;景德镇办公软件培训&nbsp;&nbsp;景德镇网络营销培训<br />\r\n	&nbsp;联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','182.108.1.131','江西省南昌市电信','1','/attachment/information/201706/pre_1498547043l3sh7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1038','东营东营上海哪里有做门禁专用防爆电磁锁,价格多少?','136','1498549642','365','1530085642','东营上海哪里有做门禁专用防爆电磁锁,价格多少?上海专业做门禁专用防爆电磁锁,价格实惠.<br />\r\n上海海栌门控科技有限公司生产门禁专用防爆电磁锁井田JT-3000门禁专用防爆电磁锁,适用于各种品牌门禁控制系统使用，接受12电压或开关信号控制，井田JT-3000门禁专用防爆电磁锁配合专用支架安装，井田门禁专用防爆电磁锁适合于各种门体安装，使用寿命长，安全耐用，3年免费质保，用于爆炸性环境：1区，2区<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n东营联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106地址：上海漕河泾开发区漕宝路1243号东营','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.199.88','上海市徐汇区电信','1','/attachment/information/201706/pre_149854964272qbo.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
