INSERT INTO my_information VALUES ('1041','哈尔滨GPZ（II）盆式橡胶支座|衡水桥闸|GPZ（II）盆','136','1498550640','365','1530086640','GPZ(II)盆式橡胶支座&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GPZ(&nbsp;II&nbsp;)盆式橡胶支座分为固定支座（GD)、单向活动支座（DX)、双向活动支座（SX)。这三种型式支座各有各的特性。固定支座限制梁在任意方向的水平位移，允许梁在该处产生竖向移动。双向活动支座可以适应任意方向的位移；而单向活动支座只能适应与两根导向块平行方向上的水平位移，其它方向的水平位移则受到导向块的限制。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GPZ(&nbsp;II&nbsp;)固定支座，概念明确，这种支座的选用不成问题。问题是活动支座如何选择。选择的依据是横向水平力的大小。经过计算后，如果上部构造在支座摩擦阻力作用下，能保证横桥向有足够的滑移稳定系数，以选用双向活动支座为宜。当上述条件不能满足时，选用单向活动支座也可解决桥梁上部构造的横向滑移问题。公路桥涵设计规范所列的各项荷载，作用在桥梁上部构造的横向水平力项目少、且往往数值不大，因此，活动支座大部分都可选用双向活动支座。当桥梁位于平曲线上，汽车离心力较大或桥的横向受力过大时，则产生的水平力有可能使桥梁上部构造横向滑动稳定不能满足，这时须选用单向活动支座。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;在GPZ（II）盆式橡胶支座中每一级盆式橡胶支座都表明了它的最小承载力原因之一是因为聚四氟板与不锈钢板之间的摩擦系数与作用的正压力成反比，即正压力越大，所得的摩擦系数越小；正压力越小，所得的摩擦系数越大。摩擦系数小对桥梁下部结构设计是有利的。其次是考虑了大中跨径桥梁承载与设计荷载相比，荷载占的比例较大，而恒载可达总荷载的70-80%。为避免用户在选用支座时自行加大安全值，将支座选的过大，因此给出支座最小承载力，而从安全使用的角度出发又给出它的最大承载。','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','101.26.160.69','河北省衡水市联通','1','/attachment/information/201706/pre_1498550640o9x0f.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1042','外贸托管一站式服务','136','1498550787','365','1530086787','外贸现状及中小企业开展外贸遇到的问题<br />\r\n企业外贸发展艰难，信息闭塞，订单少；<br />\r\n90%企业不了解外贸，不能有效监管<br />\r\n70%企业外贸部不能达到预期业绩<br />\r\n40%企业外贸部形同虚设，处于瘫痪状态<br />\r\n30%企业外贸部门废弃<br />\r\n外贸部筹建门槛高，收效差<br />\r\n小微型外贸部组建成本30万+<br />\r\n业务员成长期1年+<br />\r\n见效2年+<br />\r\n多闻外贸拥有多年外贸销售、操作以及外贸团队管理经验，持有丰富的国际资源和行业途径。为了助力中小企业“走出去”，帮助中小企业在短时间内迅速开展国际贸易。<br />\r\n“零费用”让企业享受“私人订制”<br />\r\n用订单说话，无订单无费用！<br />\r\n多年外贸服务经验，客户资源瞬时调拨<br />\r\n专业一线团队，爆发式签单，百无一疏<br />\r\n外贸管理体系完善成熟，无后顾之忧','guanglian','高昌宁','770869911','770869911@qq.com','0633-8563999','0','1','1','','119.183.114.151','山东省日照市联通','1','/attachment/information/201706/pre_1498550787hyhwo.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
