INSERT INTO my_information VALUES ('1050','长春上海井田防爆磁力锁招商|防爆磁力锁加盟欢迎来电咨询','136','1498611108','365','1530147108','长春井田防爆磁力锁面向全国火热招商。<br />\r\n国内专业防爆磁力锁生产厂家，上海海栌门控科技有限公司提供井田高品质JT-3000防爆磁力锁,应用于石油化工爆炸性环境：1区，2区，井田JT-3000防爆磁力锁安装简单，使用寿命长，提供3年免费质保，井田JT-3000防爆磁力锁对各种品牌的门禁控制器都可以实现完美无缝兼容<br />\r\n<br />\r\nJT-3000本安防爆磁力锁，专业用于防爆门禁系统配套使用，JT-3000本安防爆磁力锁是有防爆磁力锁和防爆箱构成，具有结构简单，安装维修方便，使用无磨损，使用寿命更长，可靠性更高，发生危险时断电解锁便于逃生，JT-3000本安防爆磁力锁是一种能够在爆炸性气体环境中采用本质安全防爆形式的一种电磁锁，特别适用于石油化工等爆炸环境现场，具有很高的安全性。<br />\r\n本产品的设计符合国家标准GB3836.1-2010(爆炸性环境第1部分&nbsp;设备&nbsp;通用要求）和GB3836.4-2010(爆炸性环境&nbsp;第4部分&nbsp;由本质安全型“i”保护的设备）中的有关规定，产品经过国家制定的防爆产品检测机构检定合格。<br />\r\n<br />\r\n防爆合格证编号：GYB16.1384<br />\r\n品牌：井田<br />\r\n名称：防爆电磁锁<br />\r\n型号：JT-3000<br />\r\n防爆标志：EX&nbsp;ib&nbsp;IIB&nbsp;T4&nbsp;GB<br />\r\n产品标准：Q/HL001-2016<br />\r\n制造商：上海海栌门控科技有限公司<br />\r\n地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n电话：021-51692106&nbsp;/&nbsp;51294790&nbsp;/&nbsp;51294780<br />\r\n<br />\r\n<br />\r\n功能特点：<br />\r\n开门方式：断电开门，具有很高的安全性<br />\r\n适用范围：洁净区门，木门，防火门，玻璃门，钢质门<br />\r\n状态监测：具有门状态开关信号输出<br />\r\n防水设计：可用于室外全天候环境，室内潮湿区域<br />\r\n标准吸力：280KG<br />\r\n安全防爆：可用于爆炸性环境：1区，2区<br />\r\n<br />\r\n<br />\r\n<br />\r\n电气参数<br />\r\n输入电压+12VDC<br />\r\n最大电流340mA<br />\r\n最大功率1.3W<br />\r\n<br />\r\n<br />\r\n长春联系方式<br />\r\n公司名称：上海海栌门控科技有限公司<br />\r\n公司地址：上海市徐汇区宜山路515号1号楼20层C座<br />\r\n邮编：200233<br />\r\n电话：021-51692106防爆磁力锁加盟项目就找上海。井田防爆磁力锁招商热线：021-51294790<br />\r\n长春长春','fangbaomenjinXw8','方海栌','706357228','0355189@sohu.com','021-51692106','0','1','1','','116.232.199.88','上海市徐汇区电信','1','/attachment/information/201706/pre_14986111080elfb.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1051','高低压切换阀品牌泰丰股份性价比最高','136','1498611737','365','1530147737','山东泰丰液压股份有限公司成立于2000年，占地20万平方米。系中.国液气密行业重点骨干及技术创新先进企业；国家级高新技术企业；国家火炬计划重点高新技术企业；中.国机械工业管理示范企业；2014年度中.国机械工业产品“优质品牌”企业；“中.国制造2025”2015年工业转型升级强基工程项目（超高压大流量比例伺服二通插装阀的研发及产业化）承担企业；中.国首批“中.国制造业产品单项冠军企业”及液压二通插装阀国家标准主持起草和修订企业。详情咨询0537-2718365','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498611737l7olc.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1052','十大生产厂家输送机价格输送机厂家吸粮机品牌性价比最高','136','1498612436','365','1530148436','十大生产厂家输送机价格输送机厂家吸粮机品牌性价比最高十大生产厂家输送机价格输送机厂家吸粮机品牌性价比最高十大生产厂家输送机价格输送机厂家吸粮机品牌性价比最高&nbsp;<br />\r\n	手机/QQ/微信：175-6205-1097&nbsp;0537-4552097&nbsp;销售经理：孔儒&nbsp;<br />\r\n气力输送机,气力吸粮机,粉煤灰上料机,气力输送机大型多功能移动式气力吸粮机粮食移仓用气力吸粮机农场用气力输送机高效率型软管吸粮机供应食品气力输送机粮食输送机玉米大米吸粮机吸粮机价格矿粉沙子气力输送机粮食储备气力吸粮机粉体气力输送价格<br />\r\n气力输送机价格/供应谷吸粮机大米吸粮机小麦吸粮输送机气力&nbsp;输送机，是一种先进的物料搬运机械。机器小巧灵活、装配快捷方便，经简单组合后即可用来单独压送、单独吸送、或吸送、压送混合使用。可以水平、倾斜、垂直&nbsp;输送诸如稻谷、小麦、大米、玉米、高粮、大麦芽、塑料及树脂等颗粒状物料，适用于粮库、农场、车站、码头、粮油加工和酿造行业在仓储或生产工艺中的散装、&nbsp;散运、散卸、翻仓、倒垛、补仓、出仓等机械化作业。本机在输送谷物时，对谷物有粗略的清选和脱水作用.<br />\r\n　　小型吸粮机，是我厂研制生产的一种气体输送设备。特别适用于面粉厂或粮食储备库进行散粮倒仓、清仓、装车、倒车等。<br />\r\n吸粮机批发&nbsp;全自动吸粮机&nbsp;抽粮机&nbsp;特点：<br />\r\n　　※&nbsp;体积小、重量轻、移动灵活、操作方便<br />\r\n　　※&nbsp;可输送稻谷、小麦、大米、玉米、高粱、豌豆、塑料、树脂等物料<br />\r\n　　※&nbsp;可吸送、压送、吸压混合输送，可水平、倾斜、垂直输送<br />\r\n　　※&nbsp;风压大、扬程高、输送距离长<br />\r\n　　&nbsp;可以为企业节约人力降低成本、减轻劳动强度、优化环境.<br />\r\n	　　吸粮机稻谷吸粮机大米吸粮机小麦吸粮输送机气力&nbsp;输送机，是一种先进的物料搬运机械。机器小巧灵活、装配快捷方便，经简单组合后即可用来单独压送、单独吸送、或吸送、压送混合使用。可以水平、倾斜、垂直&nbsp;输送诸如稻谷、小麦、大米、玉米、高粮、大麦芽、塑料及树脂等颗粒状物料，适用于粮库、农场、车站、码头、粮油加工和酿造行业在仓储或生产工艺中的散装、&nbsp;散运、散卸、翻仓、倒垛、补仓、出仓等机械化作业。本机在输送谷物时，对谷物有粗略的清选和脱水作用.','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','112.236.156.124','山东省济宁市联通','1','/attachment/information/201706/pre_1498612436mkgx1.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1053','100吨折弯机阀组排名_100吨折弯机阀组批发_泰丰股份','136','1498613934','365','1530149934','100吨折弯机阀组排名_100吨折弯机阀组批发_泰丰股份&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	B46.3-4B-JH&nbsp;100吨折弯机阀组，泰丰股份，厂家专业生产销售<br />\r\n	<br />\r\n		液压系统发展中的改进已经导致油路集成块结构的更多采用。油路集成块系统消除了元件之间众多的链接管路，从而实际上消除了潜在的泄漏点以及连带的油液浪费。把插装阀的主动要素插入油路集成块的标准腔孔中，并用被动块（盖板）盖住此插件，这样就完成了插装阀概念。<br />\r\n	<br />\r\n	<br />\r\n		一般来说，二通插装阀用于较大流量的液压系统，目的在于使其更高效、更快捷和更紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主级、插装式链接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品链接、安装尺寸符合ISO7368、DIN24342和GB2877。如今的机械需要成本效益和能量效益都特别高的控制，泰丰插装件满足了这些需要。<br />\r\n	<br />\r\n	<br />\r\n		插装阀的优点：*设计灵活*成本较低*尺寸较小*可控性更好*可靠性更高*压力更高*工作效率更高*消除了外泄漏并减少了内泄漏*污染耐受力更大*使用寿命更长，便于维护<br />\r\n	<br />\r\n	<br />\r\n		插装阀的应用：一般用于流量大于80L/MIN的中压至高压液压系统，广泛应用于这种液压系统的集成控制，油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机及其它金属一次加工设备、行走车辆、船舶等等。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司主营：二通插装阀、电磁阀、充液阀、各种规格剪板机/折弯机油缸、三大类滑阀元件<br />\r\n	<br />\r\n	<br />\r\n		经营范围：液压元件、液压成套系统；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司可供产品品种：&nbsp;<br />\r\n一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&nbsp;L/min-15000L/min&nbsp;<br />\r\n二、充液阀：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min&nbsp;<br />\r\n三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n四、液压缸:&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.40T-1200T液压折弯机主油缸及充液阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.各类冶金设备用油缸及工程缸&nbsp;<br />\r\n五、三大类传统板式滑阀：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.溢流阀&nbsp;2.顺序阀3.单向阀&nbsp;4.电磁换向阀&nbsp;5.液控单向阀&nbsp;6.节流阀&nbsp;7.流量控制阀&nbsp;<br />\r\n六、螺纹插装阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;二通插装阀集成系统：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、500-50000KN铝型材挤压机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5、1600-30000克注塑机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6、2500-20000KN压铸机二通插装阀集成系统&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	<br />\r\n	<br />\r\n		厂家优势：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商&nbsp;.欢迎您来电咨询，来厂参观。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','0','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498613934cj8fe.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1054','集装厢板机价格_三科机械_定做集装箱板设备尺寸','136','1498615079','365','1530151079','集装厢板机价格_三科机械_定做集装箱板设备尺寸&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n三科机械_集装厢板机价格_哪里卖集装厢板机<br />\r\n	车厢板机-顶板机<br />\r\n	技术参数：<br />\r\n	设备长度7600mm，宽950mm，高1000mm;<br />\r\n	设备动力11千瓦，液压站动力7.5千瓦;<br />\r\n	轧辊采用轴承钢(GR15)，锻打后退火;精车后淬火而成<br />\r\n	底座采用350H钢;<br />\r\n	采用下五上四道校平，确保平整;<br />\r\n	采用二次成型方式，保证产品的方正和直角，上边大小都可制作;<br />\r\n	轧制材料厚度1.5mm-3mm(也可根据用户要求设计厚度);<br />\r\n	轧制速度8-9m/min;<br />\r\n	采用新式对接式调节钢套，简便、快捷、牢固;<br />\r\n	设备和产的C型钢方正，是同行业中调节速度快、冲孔快、切断快等优点。设备总长&nbsp;7.8m&nbsp;宽度&nbsp;1.5m&nbsp;高度&nbsp;1.2m<br />\r\n	工作电压&nbsp;380V&nbsp;电压：三相电<br />\r\n	生产速度&nbsp;5--8米/分<br />\r\n	传动方式&nbsp;链条传动<br />\r\n	整机成型轴&nbsp;共计14排轴　立板20mm<br />\r\n	轴材质&nbsp;45#钢　　&nbsp;轴径：100mm实心轴<br />\r\n	数控系统&nbsp;PLC面板,&nbsp;KEL-320显示器<br />\r\n	计数器&nbsp;采用国产光电旋转编码器,&nbsp;A40S6-600-2-12-ACP<br />\r\n	设备包括配电箱，泵站、剪切等配件<br />\r\n	整机重量&nbsp;7.5吨<br />\r\n	&nbsp;<br />\r\n	厂家咨询电话;15373365336微信同<br />\r\n	联系人：刘经理<br />\r\n	qq:3314322143<br />\r\n泊头三科机械设备有限公司提供三科机械_集装厢板机价格_哪里卖集装厢板机','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','120.11.178.153','河北省沧州市联通','1','/attachment/information/201706/pre_1498615079foaou.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1055','济宁黑山羊羊仔 波尔山羊山东盛强养殖场告诉你价格','136','1498615918','365','1530151918','山东盛强养殖场告诉你济宁黑山羊羊仔&nbsp;波尔山羊&nbsp;白山羊&nbsp;杜泊绵羊价格多少钱。要价格便宜的黑山羊羊仔&nbsp;波尔山羊&nbsp;白山羊&nbsp;杜泊绵羊请找山东盛强牧业购买。山东盛强牧业的黑山羊羊仔&nbsp;波尔山羊&nbsp;白山羊&nbsp;杜泊绵羊价格便宜，质量一流。<br />\r\n俗话说，做一行就要了解一行，养黑山羊也一样，养殖户应了解当地的饲料资源情况。黑山羊是以粗饲料为主的草食家畜，为保持羊只的生长，还需要定量的精饲料。黑山羊采食量大，对饲料方面特别是粗饲料和糟粕料都有需求，由于体积大，为节省运输费用，最好就地取材。因此，要了解当地或附近能否种植牧草和青饲玉米；有无野青草资源和农作物秸秆可以利用；有无粮食或其它作物加工的副产品（如麸皮、玉米皮、大豆皮、豆饼、棉子饼、菜子饼）可以利用。此外，在调查当地饲料资源的同时，还要了解各种饲料的价格','lsdjxsqmy','范经理','510571666','sdjxwjmy@126.com','0537-13793793711','0','1','1','','119.181.104.188','山东省济宁市联通','1','/attachment/information/201706/pre_1498615918rsszo.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1056','泰丰股份|500T单泵系统排名|500T单泵系统厂家','136','1498616988','365','1530152988','泰丰股份|500T单泵系统排名|500T单泵系统厂家&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	天锻压机专用阀块YT32-500CV-DB系列泰丰500T单泵一般来说，二通插装阀用于较大流量的液压系统，目的在于使其高效、更快捷和紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主极、插装式连接的模块化、可配组的集成化液压控制元件，可广泛用于各种固定和移动液压系统的集成控制。产品安装连接尺寸符合ISO&nbsp;7368，&nbsp;DIN&nbsp;24342和GB2877.如今的机械需要成本效益都特别','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498616988spa5j.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1057','电动柴油铲运机修河筑坝黄土铲运机厂家输送机械最专业','136','1498618032','365','1530154032','山东大小型号铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业山东大小型号铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业山东大小型号铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业山东大小型号铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业电动柴油铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业电动柴油铲运机&nbsp;修河筑坝黄土铲运机厂家输送机械最专业<br />\r\n	手机/QQ/微信：175-6205-1097&nbsp;&nbsp;0537-4552097&nbsp;&nbsp;&nbsp;销售经理：孔儒&nbsp;<br />\r\n	曲阜六九重工机械设备有限公司是专业的济宁大小型号颗粒状铲运机&nbsp;修河筑坝黄土铲运机厂家。&nbsp;<br />\r\n铲运机<br />\r\n属于一种铲、装；运一体化机械。主要用来铲、装、卸、运土和石料一类等物料，可对岩石、硬土进行铲掘作业。铲掘宽度1.2--3.0米&nbsp;铲掘深度200--800CM之间可调&nbsp;装车高度3米--7米任意调节&nbsp;输送长度10--8000米动力18---2600马力。是一种广泛用于公路、铁路、建筑、水电、港口、矿山等建设工程的土石方施工机械，它主要用于铲装土壤、砂石、石灰、煤炭等物料，。在道路、特别是在高等级公路施工中，用于路基工程的填挖、沥青混合料和水泥混凝土料场的集料与装料等作业。此外还可进行推运土壤、刮平地面和牵引其他机械等作业。由于铲运机具有作业速度快、效率高、机动性好、操作轻便等优点，因此它成为工程建设中土石方施工的主要机种之一。是工程施工中挖机掘；装载机；大型施工车辆的理想替代工具&nbsp;。<br />\r\n	欢迎联系曲阜六九重工机械设备有限公司孔儒索取大小型号颗粒状铲运机&nbsp;修河筑坝黄土铲运机资料！','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','112.236.156.124','山东省济宁市联通','1','/attachment/information/201706/pre_1498618032h3kgd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1058','湘潭金皇朝平台主管获悉已中得1亿美元大奖','136','1498618290','365','1530154290','金皇朝娱乐平台（www.jhc899.com）06月22日讯：世上本来就有些事是“有心栽花花不成，无心插柳柳成荫”！在以前的新闻里，小编就讲过好几起关于打错票而意外中奖的事件。今天我们要讲的主人公是一对来自纽约的夫妻，他们也是这样歪打正着而中奖的。<br />\r\n大家还记得年初的时候，正是美国强力球火热的时候。因其奖池奖金不断高涨，所以有很多人纷纷加入到了强力球的购彩大军中。而南希也正是看好这一时机，所以叫丈夫维托去买一张强力球彩票，希望能在9亿美金的奖池中分到一杯羹。但是维托却没有听妻子的话，他最终买了一张超级百万的彩票，金皇朝平台。<br />\r\n第二天，南希听说维托买彩票的地方中出了一个大奖，于是她开始核对这张彩票。当她发现所有号码都匹配时，她说她自己“就像得了心脏病！太难以置信了，我感觉受到了惊吓”！金皇朝登陆。<br />\r\n南希和维托保守这个秘密长达好几个月，直到3月10日，这对夫妻才领取了这个大奖。南希表示：“我们没有告诉任何人，一直保守着这个秘密。虽然沉默很艰难，但是我们现在感到很兴奋！”<br />\r\n金皇朝主管领奖<br />\r\n6月30日，南希在接受巨大支票和采访时表示，丈夫买错彩票“是件好事”。当被问及将如何使用这笔奖金时，南希表示，他们成立了一个基金会，将从中兑取支票。同时，南希希望全家人的心情都可以慢慢平复下来。她表示未来有无限可能，他们或许会买一辆敞篷车，或许会买一座豪宅。但是一切都还说不准，毕竟这是一笔巨款。而今年37岁的维托，已经在计划着要提前退休了。<br />\r\n金皇朝娱乐平台-国际金融财团巨资打造的新生代在线娱乐网站,致力于打造世界顶级的网上娱乐平台。本站提供金皇朝娱乐注册、登录以及客户端下载等服务，承诺配备最优质的投注方法,并辅以最先进的网络资源。欢迎您的加入!平台创建至今，一直致力于为广大彩民提供安全可靠的在线娱乐平台和优质的服务。k彩直营平台实力雄厚,技术强硬,服务热情，多种玩法体验。<br />\r\n想玩最新的游戏么?想获得超级汇报么，请上金皇朝娱乐平台官网-金皇朝注册登陆开户唯一指定网站www.jhc899.com&nbsp;<br />\r\n标签:&nbsp;&nbsp;&nbsp;金皇朝注册&nbsp;金皇朝登陆&nbsp;金皇朝主管&nbsp;金皇朝娱乐&nbsp;金皇朝平台','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','1','1','','120.41.23.57','福建省厦门市电信','1','/attachment/information/201706/pre_1498618290p1skf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1059','厂家直销CF型充液阀，充液阀，泰丰充液阀','136','1498618404','365','1530154404','厂家直销CF型充液阀&nbsp;充液阀&nbsp;泰丰充液阀<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709<br />\r\n	<br />\r\n	充液阀，主要用于高压回路与低压回路的无泄露隔离。只用于防气腐蚀功能和冲夜，安装维修都非常方便，可替代进口产品，该系列产品通经32用于螺纹连接，通经40以上用于法兰连接，带或不带预卸压功能可选择，产品具有压力低，复位可靠，可直接安装于液压缸上，结构紧凑，外形尺寸较小等优点。&nbsp;<br />\r\n	简介&nbsp;<br />\r\n	充液阀是一种液控单向阀，一个方向止流，另一个方向自由流通，先导动作是由油口供压的控制阀芯用液压实现的，由此而直接打开主阀。这种阀是为叠加系统而设计的，即在一个基础件上可以叠加各种各样的其它类别的液压阀。&nbsp;<br />\r\n	结构特点&nbsp;<br />\r\n	充液阀采用弹簧加载式盘式截止结构，能使活塞在压力作用下快速充放，充液阀也可以设置预开启压力，具有可靠的密封性能。加工精良，精密高度，无泄漏，保压性能良好。&nbsp;自身带缓动阀芯，能有效减少动声和振动。&nbsp;<br />\r\n	用途及原理&nbsp;<br />\r\n	广泛应用于锻压机械、高速度冲床、压力机、注塑机等机器。在锻压机械中能使压机油缸起到快速充油和排油的作用。在高压与大流量时，能起到卸荷作用，并避免卸荷冲击。充液阀一般作为液压和油箱间的吸排油阀使用。大型压力机在快速行进时，油缸要大量补充油液，自动向油箱吸油；慢进加压时要防止油液从油缸反窜油箱。反向时油液可从油缸排回油箱。&nbsp;<br />\r\n	典型型号列举&nbsp;<br />\r\n	产品名称&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;型号&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;规格<br />\r\n	TCF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TCF1(2)-H**B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;40-100<br />\r\n	CF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;CF1(2)-DG24-H***B-NX&nbsp;&nbsp;100-400<br />\r\n	TRCF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TRCF1(2)-***A1-10&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100-300<br />\r\n	STF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;STF-H40NX-V&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;25-160<br />\r\n	CFK型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;CFK-H25B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;25-40','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201706/pre_1498618404xcrpl.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
