INSERT INTO my_information VALUES ('1061','太原立体车库最具性价比厂家推荐','136','1498620485','365','1530156485','太原立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201706/pre_1498620485dkfbm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1062','北京月子护理中心软件 商机无限【康乐志】','136','1498621787','365','1530157787','北京月子护理中心软件&nbsp;商机无限【康乐志】月子护理中心软件介绍<br />\r\n随着国民生活水准与消费能力大幅提高,传统生育观念已悄然发生改变。新一代的妈妈们讲究科学坐月子,追求更佳的产后调养质量和更专业的婴儿照护服务,提供产后专业护理的月子中心应运而生。&nbsp;&nbsp;<br />\r\n月子护理中心软件作为母婴市场的极佳切入点,蕴含的利润巨大,吸引内行外行投资者纷纷涌入。&nbsp;但只有专业化、科学化管理的月子中心,才能在这个收益与风险并存的行业生存下&nbsp;来,使社会大众从中受益。&nbsp;<br />\r\n康乐志月子护理中心软件整体解决方案，根据多家顶级月子中心的实际需求而精心研发。通过系统和平台服务能帮助月子中心实现总店与分店的一切日常事务有效运作，有效管理妈妈和宝宝健康状况及护理，系统化管理提升住房率，提高月子中心管理绩效与市场竞争力、增加销售机会和收入。<br />\r\n标准版&nbsp;康乐志月子中心综合管理系统<br />\r\n采用全球领先ERP技术，主要功能：月子房管理与预定、日常护理管理、标签管理、服务管理、销售管理、员工管理、提醒功能、多分店管理。&nbsp;<br />\r\n康乐志月子护理中心软件更多增值系统服务：<br />\r\n会员卡系统：“预发卡”吸引新客户,“预存卡”留住老客户&nbsp;<br />\r\n客户反馈系统：客户随时查看妈咪或宝宝的护理数据,&nbsp;服务记录,账户消费等。客户可以反馈服务满意度,查看和购买中心的增值服务和商品等,也可呼叫服务人员。&nbsp;<br />\r\n微信服务：粉丝可以通过微信查看护理数据、服务记录、账户余额等信息。中心可以推荐商品。<br />\r\n我们拥有专业的软件开发和整体解决方案提供能力,覆盖网站开发、管理系统开发、andriod、ios、&nbsp;WP等平台APP应用开发、移动智能、微信小程序、二维码、物联网等高技术难度项目开发。可以满足客户针对现有系统进行功能加减、个性化更改,或者全新项目开发等需求。','yufongkeji1','经理','2567077317','m15168255342@163.com','40068825','0','1','1','','115.196.182.111','浙江省杭州市余杭区电信','1','/attachment/information/201706/pre_1498621787hudkd.gif','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1063','粮库专用气力吸粮机 沙土进仓用吸送机 除尘装置风力输送机','136','1498629187','365','1530165187','粮库专用气力吸粮机&nbsp;沙土进仓用吸送机&nbsp;除尘装置风力输送机粮库专用气力吸粮机&nbsp;沙土进仓用吸送机&nbsp;除尘装置风力输送机粮库专用气力吸粮机&nbsp;沙土进仓用吸送机&nbsp;除尘装置风力输送机粮库专用气力吸粮机&nbsp;沙土进仓用吸送机&nbsp;除尘装置风力输送机粮库专用气力吸粮机&nbsp;沙土进仓用吸送机&nbsp;除尘装置风力输送机<br />\r\n	<br />\r\n		手机/QQ/微信：175-6205-1097&nbsp;0537-4552097&nbsp;销售经理：孔儒<br />\r\n	<br />\r\n气力输送机,气力吸粮机,粉煤灰上料机,气力输送机大型多功能移动式气力吸粮机粮食移仓用气力吸粮机农场用气力输送机高效率型软管吸粮机供应食品气力输送机粮食输送机玉米大米吸粮机吸粮机价格矿粉沙子气力输送机粮食储备气力吸粮机粉体气力输送价格<br />\r\n气力输送机价格/供应谷吸粮机大米吸粮机小麦吸粮输送机气力&nbsp;输送机，是一种先进的物料搬运机械。机器小巧灵活、装配快捷方便，经简单组合后即可用来单独压送、单独吸送、或吸送、压送混合使用。可以水平、倾斜、垂直&nbsp;输送诸如稻谷、小麦、大米、玉米、高粮、大麦芽、塑料及树脂等颗粒状物料，适用于粮库、农场、车站、码头、粮油加工和酿造行业在仓储或生产工艺中的散装、&nbsp;散运、散卸、翻仓、倒垛、补仓、出仓等机械化作业。本机在输送谷物时，对谷物有粗略的清选和脱水作用.<br />\r\n　　小型吸粮机，是我厂研制生产的一种气体输送设备。特别适用于面粉厂或粮食储备库进行散粮倒仓、清仓、装车、倒车等。<br />\r\n吸粮机批发&nbsp;全自动吸粮机&nbsp;抽粮机&nbsp;特点：<br />\r\n　　※&nbsp;体积小、重量轻、移动灵活、操作方便<br />\r\n　　※&nbsp;可输送稻谷、小麦、大米、玉米、高粱、豌豆、塑料、树脂等物料<br />\r\n　　※&nbsp;可吸送、压送、吸压混合输送，可水平、倾斜、垂直输送<br />\r\n　　※&nbsp;风压大、扬程高、输送距离长<br />\r\n　　&nbsp;可以为企业节约人力降低成本、减轻劳动强度、优化环境.<br />\r\n	<br />\r\n		　　吸粮机稻谷吸粮机大米吸粮机小麦吸粮输送机气力&nbsp;输送机，是一种先进的物料搬运机械。机器小巧灵活、装配快捷方便，经简单组合后即可用来单独压送、单独吸送、或吸送、压送混合使用。可以水平、倾斜、垂直&nbsp;输送诸如稻谷、小麦、大米、玉米、高粮、大麦芽、塑料及树脂等颗粒状物料，适用于粮库、农场、车站、码头、粮油加工和酿造行业在仓储或生产工艺中的散装、&nbsp;散运、散卸、翻仓、倒垛、补仓、出仓等机械化作业。本机在输送谷物时，对谷物有粗略的清选和脱水作用.','qfxyjx01','孙经理','1429093960','1429093960@qq.com','0537-3195311','0','1','1','','112.236.156.124','山东省济宁市联通','1','/attachment/information/201706/pre_14986291870hpmq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1064','泳池水面产生泡沫怎么办_泳池水面产生油脂怎么办_河南冰峰','136','1498630079','365','1530166079','游泳池的泡i是在泳客游泳时，身后所漂浮著经过打水所产生的泡沫，它是会破灭的，只是时间的长短，浮i和泡i形成的原因大略相同，持久不破灭的泡i是因为池水表面有油脂（人脂、口红、发油等）的存在，在池水的表面回收量不足或溢水量不够，使得油脂无法漂浮出去，或者是水面清洁器的挡浮板损坏，收集在水面清洁器内的漂浮油脂又重新回到池内所产生。水疗按摩池的水质控制除了氯臭问题以外，泡i累积情形更是令人困扰，由於泡i的形成原因，是以人体油脂经水力气泡冲击后而脱落，其产生量远比游泳池多；当水疗按摩池脂质累积后，池水会有微黄至墨绿的情形产生，此时水面的脂质累积后会因为超音波微气泡的附著导致浮沫堆叠，产生不雅外观；<br />\r\n	解决方法：万消灵浮沫降解剂<br />\r\n	本品1、有效纳米活性油脂吸附力，解决水面浮沫堆积及浮油反光问题<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、预防水位线污染和滤材油泥产生<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、不影响水池PH值，兼容消毒剂','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','1','1','','125.40.58.248','河南省郑州市联通','1','/attachment/information/201706/pre_1498630079ydr1m.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1065','株洲邀请函：厦门金母子携手湖南电视台小戏骨评选活动盛大开启','136','1498631655','365','1530167655','金母子携手湖南电视台小戏骨方世玉现场评选活动<br />\r\n（期待您的加入）<br />\r\n“小戏骨”是湖南电视台电视剧频道推出的儿童品牌栏目，这一栏目在全国首创“小孩演大人剧”、“演经典、学经典”的节目模式。小戏骨系列全网总点击量破3亿。如今小戏骨再放大招，筹拍《小戏骨之方世玉》正火热地在福建地区召集演员！通过呈现小孩演大戏的极大反差，让小戏骨演出的经典影片成为经典中的经典。<br />\r\n金母子简介：<br />\r\n厦门金母子拥有国家中医药管理局，中.国中医药科技开发交流中心授权培训中心，福建省正规权威培训中心。拥有职业培训四大项目，中医催乳师、中医小儿推拿保健师、中医产后康复师、中医母婴保健师。在金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n评选时间：7月2号<br />\r\n地点：厦门市悦享中心<br />\r\n活动流程<br />\r\n1、金母子乔迁开业活动<br />\r\n2、湖南电视台《小戏骨》之方世玉现场评选活动<br />\r\n3、小戏骨现场精彩才艺演<br />\r\n4、权威人士现场评选出前十名小戏骨，保送进入海选<br />\r\n5、金母子新课程面市<br />\r\n6、现场抽奖活动：大礼包等着大家来拿<br />\r\n7、到场媒体：东南网，厦门小鱼网、腾讯网、新浪、搜狐、厦门电视台等。<br />\r\n主持人毛晓奕简介：<br />\r\n厦门电视台主持人<br />\r\n厦门晚高峰FM94.0《奔跑吧私家车》<br />\r\n酷6网王牌综艺节目《明星驾到》《夜唱夜开心》<br />\r\n中.国金鸡百花奖特别节目《今夜星光灿烂》主持人<br />\r\n新媒体第一选秀节目《加油校园天使》<br />\r\n厦门卫视《海海新闻榜》<br />\r\n主办方：小戏骨组委会、厦门傻袍子公司<br />\r\n承办方：厦门金母子健康咨询有限公司&nbsp;&nbsp;&nbsp;厦门小巨星教育咨询有限公司<br />\r\n厦门金母子荣誉：<br />\r\n2016年获得最美家政人创业全国百强的荣誉称号！<br />\r\n2017年，厦门金母子母婴健康咨询有限公司成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位。<br />\r\n2017年加入厦门市婴童产业协会员单位，<br />\r\n2017年成为湖南电视台打造出《白蛇传》《花木兰》的《小戏骨》栏目新剧《方世玉》福建地区海选专场官方合作机构。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','121.204.253.230','福建省厦门市电信','1','/attachment/information/201706/pre_1498631655cwlv2.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
