INSERT INTO my_information VALUES ('1098','56乡鸡王招商|大地鸿运餐饮管理|56乡鸡王加盟','136','1498700159','365','1530236159','56乡鸡王招商|大地鸿运餐饮管理|56乡鸡王加盟&nbsp;|&nbsp;大地鸿运餐饮管理（湖北）有限公司<br />\r\n大地鸿运餐饮管理56乡鸡王面向全国火热招商。<br />\r\n大地鸿运餐饮管理（湖北）有限公司于2017年初成立于湖北武汉。公司秉承“良心，用心，放心，舒心”的发展理念，以挖掘开发湖北地方特色菜为己任，着力打造一批叫得响的湖北特色菜品牌。<br />\r\n公司现有高级厨师5名，旗下有大地毛家、大地刘厨、大地青云农庄、大地56乡鸡王4家直营店，有君山亮庄等5家托管店，主营餐饮、住宿，农家乐开发经营，酒店整体托管和特色菜品招商加盟等业务。<br />\r\n公司依托湖北各地方烹饪协会、厨师协会、餐饮协会等行业组织和湖北新东方烹饪学校等专业院校，拥有丰富的餐饮行业人员信息资源，形成了标准化、规范化的、专业化的科学管理体系，利用自身优势，实施整店管理输出和地方特色菜品输出等计划，争取用1――3年的时间，扶持打造100家以湖北特色菜为主的餐饮企业（从业者）做大做强，争做湖北餐饮管理行业的龙头企业。<br />\r\n56乡鸡王品牌是由大地鸿运餐饮管理（湖北）有限公司厨师团队合作研发的一款经济实惠，好吃不贵，适合老百姓消费的特色地方菜。<br />\r\n56乡鸡王加盟，投资小，见效快，多样的盈利渠道，丰厚的营业利润，为您开店保驾护航！<br />\r\n56乡鸡王加盟咨询电话：13197389980<br />\r\n?&nbsp;?&nbsp;?&nbsp;?&nbsp;?&nbsp;联&nbsp;系&nbsp;人：余先生<br />\r\n56乡鸡王供应商：大地鸿运餐饮管理（湖北）有限公司?56乡鸡王加盟项目就找大地鸿运餐饮管理。大地鸿运餐饮管理56乡鸡王招商热线：0712-4780777','dadihoyu16','袁德生','','yudesh@163.com','0712-4780777','0','1','1','','27.29.212.193','湖北省电信','1','/attachment/information/201706/pre_1498700159aj1p7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1099','植保无人机品牌_植保无人机批发_星环航空','136','1498701662','365','1530237662','植保无人机品牌_植保无人机批发_星环航空&nbsp;|&nbsp;必扬星环（北京）航空科技有限公司<br />\r\n	星环航空,植保无人机加盟,植保无人机批发&nbsp;<br />\r\n	植保无人机推荐星环航空&nbsp;<br />\r\n	电话：18610599267、18612990852、18600155418<br />\r\n	<br />\r\n	星环航空植保无人机产品参数&nbsp;<br />\r\n	自重：9KG&nbsp;<br />\r\n	有效载荷：10KG&nbsp;<br />\r\n	起飞全重：25KG&nbsp;<br />\r\n	作业高度：1-5m&nbsp;<br />\r\n	作业精度：&nbsp;<br />\r\n	水平±0.03m&nbsp;&nbsp;垂直±0.05m（RTK）&nbsp;<br />\r\n	水平±0.8m&nbsp;&nbsp;&nbsp;垂直±0.5m（GPS）&nbsp;<br />\r\n	动力：高性能智能电池，支持快速插拔&nbsp;<br />\r\n	作业飞行速度：3-10m/s&nbsp;<br />\r\n	最大飞行速度：15m/s&nbsp;<br />\r\n	作业时间：5-15min&nbsp;<br />\r\n	抗风能力：12m/s（6级）&nbsp;<br />\r\n	最大作业海拔：3500m&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	星环航空植保无人机产品优势&nbsp;<br />\r\n	折叠快拆，高效使用――&nbsp;<br />\r\n	星环植保无人机采用快速插拔设计，便于运输，拆装时间≤3分钟，机身各主要部件即插即用，避免一处损坏，全机维修的高额损失；&nbsp;<br />\r\n	智能动力，高效飞行――&nbsp;<br />\r\n	星环植保无人机采用高性能快速插拔电池，电量直观显示，可视化充电进程，便于更换，减少作业时间浪费，下置电池，重心降低，飞行更平稳；&nbsp;<br />\r\n	先进设计，高效运营――&nbsp;<br />\r\n	星环植保无人机整机结构设置快拆设计，有效载荷高达10KG，飞行时间与装药量最大化匹配，防止浪费；&nbsp;<br />\r\n	作业精确，高效喷洒――&nbsp;<br />\r\n	星环植保无人机标配美国进口喷洒系统，雾化更均匀，扇形面积覆盖更广，可选配多种喷头系统，适用多种农作物；&nbsp;<br />\r\n	操作简便，高效作业――&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;星环植保无人机支持AB点模式，傻瓜操作，快速上手，采用植保专用飞控，适应各类农田地形，可选配RTK定位，精度高达厘米级。','gyodo999','黄杰琦','','biyangxinghuan@163.com','010-57487720','0','1','1','','106.38.97.162','北京市电信','1','/attachment/information/201706/pre_1498701662pbumb.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1100','牛元帅棋牌游戏代理有多少人在玩  白银','136','1498702122','365','1530238122','牛元帅游戏先正处于火热的内测时段，玩家通过创建与搜索房间进行好友房间游戏，微信登录，方便玩家拉好友玩家通过主界面右上角的代理中填入牛元帅官方邀请码即可获得免费钻石与优惠购买特权。<br />\r\n<br />\r\n在游戏界面代理那里输入官方原始邀请码【80999】<br />\r\n通过牛元帅代理申请微信及电话【13187210249】进行人工申请<br />\r\n<br />\r\n具体资料表格：<br />\r\n姓名：<br />\r\n微信：<br />\r\n电话<br />\r\n游戏id<br />\r\n地址：<br />\r\n资料填写完毕后，一般官方会在一个工作日内申请处理下来。之后你就可以成为代理了。','q13187210249','芸姐','1346084734','1346084734@qq.com','0731-0731-13187210','0','1','1','','223.156.183.252','湖南省电信','1','/attachment/information/201706/pre_1498702122tzw0h.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1101','广州高空车价格|广州众誉|广州高空车出租','136','1498703336','365','1530239336','广州高空车价格|广州众誉|广州高空车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;番禺高空车出租|高空车佛山|广州众誉<br />\r\n	广州高空车出租&nbsp;高空车价格&nbsp;高空车电话&nbsp;13600005563http://www.gzzyjx99.com<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.131.107.230','广东省广州市电信','1','/attachment/information/201706/pre_1498703336qd3j3.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
