INSERT INTO my_information VALUES ('1110','河南冰峰|河南水处理设备公司|水处理设备公司','136','1498717053','365','1530253053','多介质过滤器即采用两种或两种以上的介质作为滤层的介质过滤器，在工业循环水处理系统中，用以去除污水中杂质、吸附油等，使水质符合循环使用的要求。一般用于生活用水预处理，工业用水处理，游泳池用水处理等。<br />\r\n	多介质过滤器所使用的滤料都必须有足够的机械强度，以免在反冲洗过程中很快地磨损和破碎;化学稳定性要好;不含有对人体健康有害及有毒物质，不含有对生产有害、影响生产的物质;滤料的选择，应尽量采用吸附能力、截污能力大、产水量高、出水水质好的滤料。','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','1','1','','125.40.56.162','河南省郑州市联通','1','/attachment/information/201706/pre_1498717053f2r3g.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
