INSERT INTO my_information VALUES ('1122','河北智能密集柜厂家|河北华鼎柜业|河北智能密集柜推荐','136','1498727867','365','1530263867','河北智能密集柜厂家|河北华鼎柜业|河北智能密集柜推荐&nbsp;|&nbsp;河北华鼎柜业有限公司<br />\r\n	<br />\r\n		河北智能密集柜｜智能密集柜厂｜智能密集柜生产厂家&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		详细介绍&nbsp;<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	<br />\r\n		智能密集柜（架）功能概述<br />\r\n1．手动、电动、电脑控制功能于一体：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;智能型密集架可以做到电动开关每一列架体，在每列架体的面板上都装有电机启动按钮，当管理人员需要打开任何一列架体，只要轻按开启按钮，架体就可自动打开。如果停电的时候，也可以用手摇动摇把，手动开启密集架。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;最为方便的是智能密集架安装有我公司自主研发的智能软件，软件程序可安装于档案管理计算机中，在档案存放时就在计算机中建立档案管理的数据库，在以后的管理过程中，只要在计算机管理界面输入需要查询的档案，该档案所在的密集架架体即可自动打开。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n2．三重安全保护系统：<br />\r\n&nbsp;&nbsp;（1）灯光保护：在两列密集架之间都有专业的照明灯光，在架体开启时，灯光自动亮灯，既有照明作用，又有保护作用。当灯光开启时，架体自动启动保护机制，其他任意一列密集架都无法开启，以防止在架体之间的工作人员被夹伤，当架体合上之后，灯光自动熄灭。<br />\r\n&nbsp;&nbsp;（2）红外线感应保护：智能型密集架的架体之间都安装有红外感应系统。当密集架被打开时，红外感应自动启动，工作人员在架体间工作时，密集架无论是电脑还是电机按钮都无法启动合架，这样防止其他工作人员不知其中有人随意开合架体而夹伤工作人员，起到保护作用。<br />\r\n&nbsp;&nbsp;&nbsp;（3）电磁保护：智能型密集架还安装有电磁感应系统，如红外感<br />\r\n应一样，当架体间有人时，不能随意开合其他架体，保护工作人员的安全。<br />\r\n3．自动定位功能：&nbsp;&nbsp;&nbsp;<br />\r\n为了方便工作人员管理和存取档案方便，智能型密集架装有LED灯光定位系统。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;当工作人员需要查询一份档案时，只要在计算机中输入需要查询的档案编号或名称，该档案所在密集架自动打开，所在列指示灯闪烁，告知所在列，层指示灯闪烁，告知所在层，档案盒下方指示灯闪烁，确定档案位置，管理人员只需要按照指示直接取用即可，极大的减少了档案管理人员的工作量，档案管理更加安全、快捷、方便。<br />\r\n4．档案保护功能：<br />\r\n（1）自动温度计：<br />\r\n为了确保档案干燥的保存环境，智能型密集架有温湿度显示仪，工作人员可根据档案室内的温度和湿度来确定档案资料的安全性。<br />\r\n（2）智能通风管理：<br />\r\n智能型密集架提供多组通风接口，工作人员可根据智能温度计的显示温湿度，单击&nbsp;“通风”按扭，各通风接口即自动工作，维护密集架整体的保存环境。<br />\r\n5．远程控制系统：<br />\r\n在档案管理的计算机界面上可开启或关闭密集架电源，不用工作人员来回奔忙，而管理计算机可设置于客户需要的任何地方，通过密码权限对档案密集架进行操作。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		山西密集柜,安徽密集柜,河北密集柜,河南密集柜&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					<br />\r\n						&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;