INSERT INTO my_information VALUES ('1152','郑州水处理公司,河南水处理公司,河南冰峰','136','1498806930','365','1530342930','SCF侧出法兰式缠绕砂缸&nbsp;<br />\r\n	&nbsp;&nbsp;防紫外线保护层玻璃钎维缠绕加固的缸体，通过增大滤床表面到布水头的距离，从而提高过滤阶段的布水效果，亦更好的避免在反冲洗时砂粒落入布水管道内。&nbsp;<br />\r\n	&nbsp;&nbsp;侧出法兰式过滤器可满足各种水处理工程的需求，包括海洋馆、公共泳池、水疗中心、大型喷泉和污水处理。&nbsp;<br />\r\n	特点&nbsp;<br />\r\n	1、采用优质的玻璃钎维和树脂制造而成&nbsp;<br />\r\n	2、缸身及表面经过防晒处理&nbsp;<br />\r\n	3、顶部设计可轻易地排出过滤过程中导入的空气&nbsp;<br />\r\n	4、检修人孔设置可供选择','njijm242','韩兵','244010375','514796253@qq.com','0371-66987751','0','1','1','','221.14.190.4','河南省郑州市联通','1','/attachment/information/201706/pre_1498806930ngioj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
