INSERT INTO my_information VALUES ('1191','双主动比例节流阀，泰丰比例节流阀，ATOS双比例阀','136','1498871660','365','1530407660','供应泰丰双主动比例节流阀双主动比例节流阀价格双主动比例节流阀厂家<br />\r\n	双主动型比例二通节流阀,&nbsp;(以下简称比例节流广泛应用于重型机械的液压控制系统中,尤其是液压机、压铸机、注塑机等系统,比例节流阀成为提高..<br />\r\n	高性能液压元件是影响现代化重型机械发展的一个重要因素。插装式比例节流阀就是根据重型机械发展需要而研发的新型液压元件。插装式比例节流阀具有流量大、响应快、耐高压、使用寿命长等有优点<br />\r\n	山东泰丰液压股份有限公司<br />\r\n	主营：二通插装阀、电磁阀、充液阀、各种规剪板机、折弯机油缸、三大类滑阀元件<br />\r\n	经营范围：液压元件、液压成套系统、；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	山东泰丰液压股份有限公司可供产品品种：&nbsp;<br />\r\n	一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&nbsp;L/min-15000L/min&nbsp;<br />\r\n	二、充液阀：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min&nbsp;<br />\r\n	三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n	四、液压缸:&nbsp;<br />\r\n	&nbsp;&nbsp;1.40T-1200T液压折弯机主油缸及充液阀&nbsp;<br />\r\n	&nbsp;&nbsp;2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n	&nbsp;&nbsp;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n	&nbsp;&nbsp;4.各类冶金设备用油缸及工程缸&nbsp;<br />\r\n	五、三大类传统板式滑阀：&nbsp;<br />\r\n	&nbsp;&nbsp;1.溢流阀&nbsp;<br />\r\n	&nbsp;&nbsp;2.顺序阀&nbsp;<br />\r\n	&nbsp;&nbsp;3.单向阀&nbsp;<br />\r\n	&nbsp;联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_14988716603pbgg.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
