INSERT INTO my_information VALUES ('1221','广州吊车电话,广州众誉,广州吊车出租','136','1498962853','365','1530498853','广州吊车电话,广州众誉,广州吊车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州吊车电话|广州众誉|吊车出租13600005563<br />\r\n	广州吊车电话|广州众誉|吊车出租13600005563<br />\r\n	<br />\r\n		&nbsp;&nbsp;广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。&nbsp;&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;（1）起重量指示器（角度盘，也叫重量限位器）<br />\r\n　　装在臂杆根部接近驾驶位置的角度指示，它随着臂杆仰角而变化，反映出臂杆对地面的夹角，知道了臂杆不同位置的仰角，根据起重机的性能表和性能曲线，就可知在某仰角时的幅度值、起重量、起升高度等各项参考数值。<br />\r\n（2）过卷扬限制器（也称超高限位器）<br />\r\n　　装在臂杆端部滑轮组上限制钩头起升高度，防止发生过卷扬事故的安全装置。它保证吊钩起升到极限位置时，能自动发出报警信号或切断动力源停止起升，以防过卷。<br />\r\n（3）力矩限制器<br />\r\n　　力矩限制器是当荷载力矩达到额定起重力矩时就自动切断起升或变幅动力源，并发出禁止性报警信号的安全装置，是防止超载造成起重机失稳的限制器。<br />\r\n（4）防臂杆后仰装置和防背杆支架<br />\r\n　　防臂杆后仰装置和防背杆支架，是当臂杆起升到最大额定仰角时，不再提升的安全装置，它防止臂杆仰角过大时造成后倾。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','61.144.118.30','广东省广州市越秀区/海珠区电信','1','/attachment/information/201707/pre_14989628531ad4f.jpg','1','1','0','1','0','0','