INSERT INTO my_information VALUES ('1223','曲靖GPZ（II）盆式橡胶支座|衡水桥闸|GPZ盆式橡胶支座','136','1498966000','365','1530502000','GPZ(II)盆式橡胶支座&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GPZ(&nbsp;II&nbsp;)盆式橡胶支座分为固定支座（GD)、单向活动支座（DX)、双向活动支座（SX)。这三种型式支座各有各的特性。固定支座限制梁在任意方向的水平位移，允许梁在该处产生竖向移动。双向活动支座可以适应任意方向的位移；而单向活动支座只能适应与两根导向块平行方向上的水平位移，其它方向的水平位移则受到导向块的限制。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GPZ(&nbsp;II&nbsp;)固定支座，概念明确，这种支座的选用不成问题。问题是活动支座如何选择。选择的依据是横向水平力的大小。经过计算后，如果上部构造在支座摩擦阻力作用下，能保证横桥向有足够的滑移稳定系数，以选用双向活动支座为宜。当上述条件不能满足时，选用单向活动支座也可解决桥梁上部构造的横向滑移问题。公路桥涵设计规范所列的各项荷载，作用在桥梁上部构造的横向水平力项目少、且往往数值不大，因此，活动支座大部分都可选用双向活动支座。当桥梁位于平曲线上，汽车离心力较大或桥的横向受力过大时，则产生的水平力有可能使桥梁上部构造横向滑动稳定不能满足，这时须选用单向活动支座。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;在GPZ（II）盆式橡胶支座中每一级盆式橡胶支座都表明了它的最小承载力原因之一是因为聚四氟板与不锈钢板之间的摩擦系数与作用的正压力成反比，即正压力越大，所得的摩擦系数越小；正压力越小，所得的摩擦系数越大。摩擦系数小对桥梁下部结构设计是有利的。其次是考虑了大中跨径桥梁承载与设计荷载相比，荷载占的比例较大，而恒载可达总荷载的70-80%。为避免用户在选用支座时自行加大安全值，将支座选的过大，因此给出支座最小承载力，而从安全使用的角度出发又给出它的最大承载。','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','60.9.140.71','河北省衡水市联通','1','/attachment/information/201707/pre_1498966000s4c2b.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
