INSERT INTO my_information VALUES ('1231','衡水桥闸_曲靖651橡胶止水带_651橡胶止水带','136','1498982349','365','1530518349','651橡胶止水带&nbsp;<br />\r\n	651橡胶止水带是止水带的一种常用型号，属于中埋式止水带，中心孔两侧各有3个突起的楞，651型橡胶止水带是止水带产品里使用最广泛的，常用的中埋式止水带还有652型、653型等。&nbsp;<br />\r\n	651橡胶止水带是我公司专业生产的橡胶止水带，是利用橡胶的高弹性，在各种荷载下产生弹性变形，从而起到坚固密封，有效地防止建筑构造的漏水，渗水并起到减震缓冲作用。在许多工程建筑设计中，土建、水土结构之间都有一定的伸缩要求，并存在防水防震等问题，因此采用和安装橡胶止水带是有效地解决以上种种问题的手段。本产品主要用于混凝土现浇时设在施工缝及变形缝内，与混凝土结构成为一体的基础工程、地下设施、隧道涵洞、输水渡槽、&nbsp;铛水坝等，确保工程建设的使用寿命。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;651型橡胶止水带是一种常用的橡胶止水带产品，如果我们按施工组织设计中的橡胶止水带安装质量保证体系运作程序和检酥贫龋严格进行事前预防、过程控制。防水专业施工队成立现场质重保证机构，由防水公司项目经理、施工质量员、技术安全员组成。这种止水带在每道工序施工前，责任工长应向施工班组做好技术交底，并明确操作方法和质量标准。施工人员应持有建设行政主管部门或其指定单位颁发的执业资格证书。每道工序施工过程中管理人员应进行过程监督，施工完后由专职质量检嗽薄⒓嗬斫行检搜槭蘸细窈螅方可进行下道工序。质重通病的预防与控制橡胶止水带应铺压严实，将空气排除干净，使橡胶止水带粘贴牢固；橡胶止水带胶粘剂涂刷应均匀，不露底，&nbsp;不堆积，控制胶粘剂蛩⒂胂鸾褐顾带铺贴的间隔时间，粘合时不得用力拉伸橡胶止水带，管道等细部橡胶止水带附加层，裁剪时应与构造形状相符合，并粘贴压实、严密。&nbsp;<br />\r\n	公司电话：0318-2209900&nbsp;&nbsp;李经理&nbsp;&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','60.9.140.71','河北省衡水市联通','1','/attachment/information/201707/pre_1498982349vgkln.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1232','曲靖板式橡胶支座_衡水桥闸_板式橡胶支座合格','136','1498985962','365','1530521962','板式橡胶支座&nbsp;<br />\r\n&nbsp;<br />\r\n	橡胶支座是由多层薄钢板与多层橡胶片硫化粘合而成一种普通橡胶支座产品,这种产品具有足够的竖向刚度,能够将支座上部构造的反力可靠的传递给墩台,支座具有良好的弹性,以应对桥梁的梁端的转动；又有较大的剪切变形能力，以满足上部构造的水平位移。具有构造简单、安装方便、节省钢材、价格低廉、养护简便、易于更换等特点。在板式支座表面粘复一层1.5mm-3mm厚的聚四氟乙烯板,就能制作成聚四氟乙烯滑板式橡胶支座它除了竖向钢度与弹性变形,能承受垂直荷载及适应梁端转动外,因聚四氟乙烯板的低摩擦系数,可使梁端在四氟板表面自由滑动,水平位移不受限制,特别适宜中、小荷载,大位移量的桥梁使用。&nbsp;<br />\r\n	产品划分：&nbsp;<br />\r\n	一、矩形（圆形）板式橡胶支座（GYZ、GJZ）&nbsp;<br />\r\n	（一）性能：本产品由多层橡胶片与薄钢板镶嵌、粘合压制而发。有足够的竖向刚度以承压垂直荷载，能将&nbsp;上部构造的反力可靠地传递给墩台，有良好的弹性，以适应梁端的转动；又有较大的剪切变形以满足上部&nbsp;构造的水平位移。&nbsp;<br />\r\n	（二）特点：本产品在桥梁建筑、水电工程、房屋抗震设施上已广泛应用，与原用的钢支座相比，有构造&nbsp;简单，安装方便；节约钢材，价格低廉；养护简便，易于更换等优点，且本品建筑高度低，对桥梁设计与降低造价有益；有良好的隔震作用，可减少活载与地震力对建筑物的冲击作用。&nbsp;<br />\r\n	二、四氟乙烯滑板板式橡胶支座(GYZF4、GJZF4)&nbsp;<br />\r\n	（一）特点：本产品是于普通板式橡胶支座上粘接一层厚1.5-3mm的聚四氟乙烯板而成。除具有普通板式橡&nbsp;胶支座的竖向刚度与弹性变形，能承受垂直荷载及适应梁端转动外，因四氟乙烯与梁底不锈钢板间的低摩擦系数（μ≤0.03）可使桥梁上部构造的水平位移不受限制。&nbsp;<br />\r\n	适用范围：&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;板式橡胶支座是公路中小型桥梁中比较常用的产品，它分为普通板式橡胶支座、四氟板式橡胶支座。对于普通型桥梁支座适用于跨度小于30m、位移量较小的桥梁.不同的平面形状适用于不同的桥跨结构,正交桥梁用矩形支座;曲线桥、斜交桥及圆柱墩桥用圆形支座。&nbsp;<br />\r\n	对于四氟乙烯板式橡胶支座适用于大跨度、多跨连续、简支梁连续板等结构的大位移量桥梁.它还可用作连续梁顶推及T型梁横移中的滑块.矩形、圆形四氟板式橡胶支座的应用分别与矩形、圆形普通板式橡胶支座相同。&nbsp;<br />\r\n	电话：0318-2209900，李经理&nbsp;15503230260','hsqiaozha','李丽娟','563276059','563276059@qq.com','0318-2209900','0','1','1','','60.9.140.71','河北省衡水市联通','1','/attachment/information/201707/pre_1498985962g3gue.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
