INSERT INTO my_information VALUES ('1252','多路阀品牌,多路阀价格,泰丰股份','136','1499054771','365','1530590771','多路阀品牌,多路阀价格,泰丰股份&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	多路阀TRM15-BX-08-HT-01，负载敏感多路换向阀，泰丰股份<br />\r\n	<br />\r\n		液压系统发展中的改进已经导致油路集成块结构的更多采用。油路集成块系统消除了元件之间众多的链接管路，从而实际上消除了潜在的泄漏点以及连带的油液浪费。把插装阀的主动要素插入油路集成块的标准腔孔中，并用被动块（盖板）盖住此插件，这样就完成了插装阀概念。<br />\r\n	<br />\r\n	<br />\r\n		一般来说，二通插装阀用于较大流量的液压系统，目的在于使其更高效、更快捷和更紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主级、插装式链接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品链接、安装尺寸符合ISO7368、DIN24342和GB2877。如今的机械需要成本效益和能量效益都特别高的控制，泰丰插装件满足了这些需要。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		插装阀的优点：*设计灵活*成本较低*尺寸较小*可控性更好*可靠性更高*压力更高*工作效率更高*消除了外泄漏并减少了内泄漏*污染耐受力更大*使用寿命更长，便于维护&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		插装阀的应用：一般用于流量大于80L/MIN的中压至高压液压系统，广泛应用于这种液压系统的集成控制，油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机及其它金属一次加工设备、行走车辆、船舶等等。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司主营：二通插装阀、电磁阀、充液阀、各种规格剪板机/折弯机油缸、三大类滑阀元件<br />\r\n	<br />\r\n	<br />\r\n		经营范围：液压元件、液压成套系统；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司可供产品品种：&nbsp;<br />\r\n一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&nbsp;L/min-15000L/min&nbsp;<br />\r\n二、充液阀：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min&nbsp;<br />\r\n三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n四、液压缸:&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.40T-1200T液压折弯机主油缸及充液阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.各类冶金设备用油缸及工程缸&nbsp;<br />\r\n五、三大类传统板式滑阀：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.溢流阀&nbsp;2.顺序阀3.单向阀&nbsp;4.电磁换向阀&nbsp;5.液控单向阀&nbsp;6.节流阀&nbsp;7.流量控制阀&nbsp;<br />\r\n六、螺纹插装阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;二通插装阀集成系统：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、500-50000KN铝型材挤压机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5、1600-30000克注塑机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6、2500-20000KN压铸机二通插装阀集成系统&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	<br />\r\n	<br />\r\n		厂家优势：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商&nbsp;.欢迎您来电咨询，来厂参观。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		欢迎来电垂询,竭诚为您服务!&nbsp;可根据客户需求订制.&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		联系人：张经理&nbsp;TEL/微信：15154727695&nbsp;QQ：939262916&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		电话：0537-2718355传真：0537-2718308&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		公司地址:山东省济宁市高新区海川路66号','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','2','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499054771grm3i.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1253','白灰窑袋式除尘器耐高温耐腐蚀除尘布袋','136','1499059064','365','1530595064','白灰窑袋式除尘器耐高温耐腐蚀除尘布袋。<br />\r\n&nbsp;&nbsp;&nbsp;白灰窑袋式除尘器耐高温耐腐蚀除尘布袋。盐城市明辉滤袋有限公司专业生产销售各种型号富平县白灰窑除尘滤袋。<br />\r\n&nbsp;富平县石灰矿产丰富，有很多生产石灰的窑厂，明辉滤袋发现在白灰窑除尘设备使用过程中经常发生滤袋破损的情况，为此对设备经行现场勘察，发现如下问题：<br />\r\n&nbsp;&nbsp;1.滤袋底部和下部破损痕迹明显，滤袋纤维层表面破损，局部露出滤料基布或者完全破损。滤袋底部磨损部分的缝纫线断裂，未磨损位置强力良好。这些破损的原因具体有：卸灰系统出现问题，卸灰慢，灰斗体积狭小造成二次扬尘冲击磨损滤袋底部；导流板安装角度不对，造成灰斗内粉尘形成涡流磨损滤袋底部；除尘器气流分布不均，除尘器箱体过滤风速较高，滤袋随气流摆动幅度增大，造成滤袋件摩擦加剧；还有就是花板孔严重变形，袋笼变形、脱焊、锈蚀造成滤袋与滤袋之间的摩擦损坏。<br />\r\n&nbsp;&nbsp;2.滤袋头部破损发生在滤袋袋口向下10cm-15cm处，滤袋破损初期由内向外磨损，随着破洞被烟气冲刷得越来越大，破损对角位置也被粉尘冲刷的越来越薄，最终造成滤袋头部环状破损。造成此种损坏的原因有系会系统喷吹管没有垂直滤袋中心、花板孔变形、喷吹管喷嘴歪斜，造成喷吹气流和滤袋中心线不同轴，在压缩空气不断冲刷下造成滤袋磨损。<br />\r\n&nbsp;&nbsp;此二类均为除尘器的设计缺陷，需对除尘设备进行整改，除此之外明辉滤袋根据白灰窑布袋除尘器的使用现状对白灰窑除尘器的除尘布袋改进，白灰窑烟尘清水性高，腐蚀性强，碱性高，对滤袋材质选择上要求更高，既要考虑耐高温，也要考虑耐腐蚀性，明辉根据经济性、耐高温、耐腐蚀可用覆膜美塔斯或者氟美斯为厂家定制其中一类产品。<br />\r\n&nbsp;&nbsp;明辉滤袋在白灰窑滤袋头部内壁增加300mm的加强层，袋底除了做双层外，在外壁增加300mm长的加强层，制造除尘滤袋的缝纫线均用耐腐蚀的ptfe缝纫线，在滤袋袋口经常破损的位置，笼架增加文氏管。<br />\r\n&nbsp;&nbsp;&nbsp;白灰窑袋式除尘器耐高温耐腐蚀除尘布袋。','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.178.68','江苏省盐城市电信','1','/attachment/information/201707/pre_1499059064zkvrd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
