INSERT INTO my_information VALUES ('1256','板式顺序阀批发_泰丰股份_板式顺序阀加盟','136','1499064973','365','1530600973','板式顺序阀批发_泰丰股份_板式顺序阀加盟&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	顺序阀是控制液压系统中执行元件（液压缸或液压马达）顺序动作的压力控制阀门。顺序阀和单向顺序阀，只需改变其上下盖的方位，即可组成七种不同作用的阀门，无需改变结构。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499064973h4uwh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
