INSERT INTO my_information VALUES ('1264','赣州全钢空心网络地板|江苏良峰网络|江苏全钢空心网络地板','136','1499085809','365','1530621809','常州新梦想网络科技有限公司的全钢空心网络地板价格最便宜。<br />\r\n全钢空心网络地板（LF507/LF508）<br />\r\n空心网络地板的发明是活动地板技术上的一项突破。它是“良峰”系列产品家族中一颗闪耀的明星，并且代表著一个新的发展趋势。它不仅继承了传统地板在承载能力方面的优势，而且满足了现代办公室和学校的普遍要求：超低结构，超轻重量，不燃，绿色环，使用和安装方便。同时也是城市旧楼现代化的的完美选择。<br />\r\n地板组成：<br />\r\n地板采用优质镀锌钢板经拉伸后柳合成形，或冷轧钢板拉伸铆合成形后进行静电喷塑或电泳处理，支架镀锌，高度可调。<br />\r\n产品特点：<br />\r\n1、方便布线和改换线路，不需要找专门人员就可以进行基本的日常维护，同时可以节省维护费用；<br />\r\n2、绿色材料，无任何有客物质，100%可以再循环和使用；<br />\r\n3、全钢结构.不燃；<br />\r\n4、自身重量只有传统地板的1/2，每块基座地板有四个脚座，皆独立站立，如遇地震或极特殊外力时，不致产生整体崩塌现象；<br />\r\n5、卓越的均布荷载；<br />\r\n6、铆合处理.连接牢度更高；<br />\r\n7、能够快速安装，节约安装费用。<br />\r\n江苏良峰活动地板有限公司是专业从事设计、开发、生产、销售防静电地板和网络地板的企业。公司位于江苏省常州市横林镇北工业园区，占地面积20000平方米，建有现代化办公楼和功能完善的生产车间。公司在产品开发设计领域，实现了先锋性、突破性，并以丰富多元化的产品直接与国际性产品接驳，让客户享用到更高级、更贴心、更便利的使用环境。公司产生的影响不仅仅局限于在本行业，更重要的是它强大的辐射力，能够带动和引领更积极、明智的产品购买模式。使客户能够更清楚的辨别和使用到最合适的产品。全钢空心网络地板价格咨询：<br />\r\n公司名称：江苏良峰活动地板有限公司<br />\r\n地&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;址：江苏省常州市横林镇北工业园区<br />\r\n电&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;话：0519-88491066&nbsp;88491055<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;88491500<br />\r\n传&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;真：0519-88491033&nbsp;&nbsp;88491200<br />\r\n总&nbsp;&nbsp;经&nbsp;&nbsp;理：任先生<br />\r\n手&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;机：13961248099<br />\r\n邮&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;编：213101<br />\r\n网&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;址：www.cnliangfeng.com<br />\r\n邮&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;箱：info@cnliangfeng.com','zyhzyh027','周先生','1518280388','1518280388@qq.com','0519-88506763','0','1','1','','117.63.132.190','江苏省常州市电信','1','/attachment/information/201707/pre_14990858092v6dd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.000000