INSERT INTO my_information VALUES ('1304','二通插装阀应用，插装阀供应，二通插装阀销售冠军','136','1499219809','365','1530755809','基本参数<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					材质：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					碳钢<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					产品别名：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					四柱液压机用插装阀<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					工作温度：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					常温<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					公称压力：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					3.15&nbsp;Mpa<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					介质温度：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					-20~80&nbsp;℃<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					连接形式：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					插装<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					适用范围：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					各种锻压机械，挤压机械，粉碎机械，打包机，注塑机<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					行程：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					待定<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					品牌：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					山东泰丰<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					型号：<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					YZ32-100CV-00R<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n	<br />\r\n	详细说明<br />\r\n	&nbsp;<br />\r\n	泰丰新设计<br />\r\n	一般来说，二通插装阀用于较大的流量，目的在于更高效、更快和更紧凑的液压系统。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀升级、插装式连接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品安装连接尺寸符合ISO&nbsp;&nbsp;7368、DIN&nbsp;&nbsp;24342和GB2877。如今的机械需要成本效应和能量效益都特别高的控制，泰丰插装阀满足了这些需要。<br />\r\n	二通插装阀的优点<br />\r\n	1、设计灵活<br />\r\n	2、安装成本低<br />\r\n	3、外形尺寸较小<br />\r\n	4、性能和控制更好<br />\r\n	5、可靠性提高<br />\r\n	6、压力能力提高<br />\r\n	7、工作效率提高<br />\r\n	8、消除了外泄漏并减少了内泄漏<br />\r\n	9、污染耐受力更大<br />\r\n	10、循环时间更快<br />\r\n	二通插装阀的应用<br />\r\n	二通插装阀一般用于流量大于150L/min的中压至高压液压系统，以便在各种用途中提供传动与运动控制。<br />\r\n	油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机和其他金属一次加工设备、行走车辆、船舶<br />\r\n	&nbsp;<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499219809y5voz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1305','高空车出租价格,出租高空车,广州众誉','136','1499222017','365','1530758017','高空车出租价格,出租高空车,广州众誉&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	广州高空车出租公司|高空车出租价格电话|广州众誉机械设备租赁有限公司<br />\r\n	http://www.gzzyjx99.com&nbsp;<br />\r\n	&nbsp;<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','113.67.227.55','广东省广州市电信','1','/attachment/information/201707/pre_1499222017n6qze.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
