INSERT INTO my_information VALUES ('1324','渭南SF智能型电机调速控制仪价格实惠 品质上乘','136','1499299744','365','1530835744','枣阳有发机械SF智能型电机调速控制仪价格实在,规格齐全,品质上乘。<br />\r\nSF智能型电机调速控制制仪使用说明<br />\r\n智能型电机调速控制仪&nbsp;由湖北枣阳市有发机械有限公司生产制造。<br />\r\n智能型电机高速控制仪采用智能控制技术，对串接式电机实现无级调速。应用数字PID技术，控制精度高，系统结构简单，稳定可靠。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;控制系统和电机（机械部分）相互分开，二部分通过五芯电缆连接。机箱后板为五芯插座和输入输出保险丝，五芯插座各引脚定义：1、2、3一连接光电传感器：4、5-连接串接式电机。五芯电缆的另一头为光电传感器。线缆连接时，将与光电传感器同一端的二根空引线与电机引线连接，插上机箱后板五芯插座接通电源即可正常用。<br />\r\n操作使用说明：<br />\r\n1、接通供电电源，打开电源开关，电源开关上的指示灯点亮：<br />\r\n2、系统自检，显示窗口自“9”到“0”递减计数显示。自检正常后，可按动面板上的二个操作调节电机转速。<br />\r\n3、按动“↑”或“↓”键，窗口显示设置转速值，<br />\r\n电机转随值实时改变。当设置值达到所需要的电机转速时，停止操作键盘，2秒后窗口显示实测的电机转速值：<br />\r\n4、当试验完成需要停机时，可按动“↓”键将设置转速值逐渐减为“0”，电机将缓慢停止运行，也可直接关闭电源开关。<br />\r\n注意：控制器后面的五芯插座，应在关闭电源后插拔。<br />\r\n渭南SF智能型电机调速控制仪价格实惠&nbsp;品质上乘<br />\r\n常见故障及排除：<br />\r\n1、面板无显示：如电机开关指示灯不亮，请检查供电电源是否正常。<br />\r\n2、电机不转：输出保险丝（5A）断，请自行更换：如输出保险丝频繁烧断，请检查电机负载是否过重，转动部件有无卡阻现象并排除。<br />\r\n湖北枣阳有发机械有限公司地址:兴隆镇杨楼教育大道','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','1','1','','111.177.100.214','湖北省襄阳市电信','1','/attachment/information/201707/pre_1499299744p6z9c.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
