INSERT INTO my_information VALUES ('1354','泰丰液压件，液压插装阀，锻压机械用阀组','136','1499391459','365','1530927459','供应泰丰TLC系列插件二通插装阀、控制盖板、插件<br />\r\n	插件分为基本插件Z1A(B)-H*&nbsp;&nbsp;&nbsp;TLC…A(AA)（B）(BB)&nbsp;单向插件Z11A(B)-H&nbsp;&nbsp;&nbsp;阀芯内钻孔&nbsp;、带阻尼插件、带缓冲头插件、减压插件、常开型插件<br />\r\n	新型的TLC具有以下特征：&nbsp;<br />\r\n	压差流量特性较老系列产品有明显提高&nbsp;<br />\r\n	插装件的阀芯、阀套等具有多样化的配置性能，可满足客户各种不同需要&nbsp;<br />\r\n	可提供多种面积比&nbsp;<br />\r\n	可提供具有缓冲尾部和不同节流槽的阀芯&nbsp;<br />\r\n	可提供不同的开启压力&nbsp;<br />\r\n	可提供带柔性密封的阀芯&nbsp;<br />\r\n	山东泰丰液压股份有限公司可供产品品种<br />\r\n	一、二通插装阀流量范围为：63L/min-15000L/min<br />\r\n	二、充液阀：Dg40-Dg400通径流量范围为300L/min-35000L/min<br />\r\n	三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8-20<br />\r\n	四、液压缸:1.40T-1200T液压折弯机主油缸及充液阀2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸;4.各类冶金设备用油缸及工程缸<br />\r\n	五、三大类传统板式滑阀1.溢流阀;2.顺序阀3.单向阀4.电磁方向阀5.液控单向阀6.节流阀7.流量控制阀<br />\r\n	六、螺纹插装阀&amp;lt;br/&amp;gt;<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499391459uvkq4.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1355','100吨锻压机插装阀加盟,泰丰股份,100吨锻压机插装阀供应','136','1499392696','365','1530928696','100吨锻压机插装阀加盟,泰丰股份,100吨锻压机插装阀供应商&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	YN32-100GSBCV标准带快速缸100吨主缸系统，主保压，无顶缸<br />\r\n	<br />\r\n		液压系统发展中的改进已经导致油路集成块结构的更多采用。油路集成块系统消除了元件之间众多的链接管路，从而实际上消除了潜在的泄漏点以及连带的油液浪费。把插装阀的主动要素插入油路集成块的标准腔孔中，并用被动块（盖板）盖住此插件，这样就完成了插装阀概念。<br />\r\n	<br />\r\n	<br />\r\n		一般来说，二通插装阀用于较大流量的液压系统，目的在于使其更高效、更快捷和更紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主级、插装式链接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品链接、安装尺寸符合ISO7368、DIN24342和GB2877。如今的机械需要成本效益和能量效益都特别高的控制，泰丰插装件满足了这些需要。<br />\r\n	<br />\r\n	<br />\r\n		插装阀的优点：*设计灵活*成本较低*尺寸较小*可控性更好*可靠性更高*压力更高*工作效率更高*消除了外泄漏并减少了内泄漏*污染耐受力更大*使用寿命更长，便于维护<br />\r\n	<br />\r\n	<br />\r\n		插装阀的应用：一般用于流量大于80L/MIN的中压至高压液压系统，广泛应用于这种液压系统的集成控制，油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机及其它金属一次加工设备、行走车辆、船舶等等。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司主营：二通插装阀、电磁阀、充液阀、各种规格剪板机/折弯机油缸、三大类滑阀元件<br />\r\n	<br />\r\n	<br />\r\n		经营范围：液压元件、液压成套系统；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司可供产品品种：&nbsp;<br />\r\n一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&nbsp;L/min-15000L/min&nbsp;<br />\r\n二、充液阀：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min&nbsp;<br />\r\n三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n四、液压缸:&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.40T-1200T液压折弯机主油缸及充液阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.各类冶金设备用油缸及工程缸&nbsp;<br />\r\n五、三大类传统板式滑阀：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.溢流阀&nbsp;2.顺序阀3.单向阀&nbsp;4.电磁换向阀&nbsp;5.液控单向阀&nbsp;6.节流阀&nbsp;7.流量控制阀&nbsp;<br />\r\n六、螺纹插装阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;二通插装阀集成系统：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、500-50000KN铝型材挤压机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5、1600-30000克注塑机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6、2500-20000KN压铸机二通插装阀集成系统&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	<br />\r\n	<br />\r\n		厂家优势：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商&nbsp;.欢迎您来电咨询，来厂参观。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499392696bkeip.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1356','湖南烘干机网带批发_湖南烘干机网带产地_陵县阳光输送设备','136','1499392736','365','1530928736','湖南烘干机网带批发_湖南烘干机网带产地_陵县阳光输送设备&nbsp;|&nbsp;陵县阳光输送设备有限公司<br />\r\n	湖南烘干机网带价格|陵县阳光输送设备|湖南烘干机网带报价<br />\r\n烘干机网带主要烘干机上用的一种不锈网输送带，特点具有耐高温800℃以上，耐酸碱，耐磨等，耐腐蚀、抗拉强度好特点，使用寿命长等特点。广泛应用于电子工业、隧道，热处理、烧结炉、粉末冶金、物流输送等行业。烘干机网带通常以链条传动网带的变形和延伸，很好的提高的输送的稳定性。<br />\r\n烘干机网带主要用在烘干设备上使用，烘干的产品很广，一般的烘干机网带都采用不锈钢材质两边由链条带动，螺距、节距、尺寸、多种多样。<br />\r\n产品主要用于∶玻璃瓶罐、食品、灯泡、金属、器皿、化纤、印染、医药、电子、粉末冶金、热处理、木材、物流输送等各行业自动装置和自动流水线的使用；天然气、焦炉煤气及电子红外线等各种窑炉系统的传动使用等食品机械，玻璃机械，输送机械等。<br />\r\n烘干机网带具有网面平整、强硬度高、抗腐蚀性强、抗拉性强度大、透气性能好、不易变形、经久耐用等特殊功能。','pbsjo981','王经理','1260842873','1260842873@qq.com','0534-8892643','0','1','1','','27.221.254.115','山东省联通','1','/attachment/information/201707/pre_149939273651jbj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1357','D女郎胸部天生小扁平用D女郎有用吗15961930560价格','136','1499394684','365','1530930684','D女郎胸部天生小扁平用D女郎有用吗15961930560价格实在,规格齐全,品质上乘。<br />\r\nD女郎总代吴悦给你讲解丰胸&nbsp;做代理找吴悦15961930560<br />\r\nD女郎丰胸真的可以变大变挺吗微信；15961930560<br />\r\n我们丰胸产品分为：丰韵美乳精华（30ML）+丰韵美乳霜（30G）<br />\r\n丰韵美乳精华的<br />\r\n成分：水&nbsp;硬脂酸PCA钠&nbsp;EDTA二钠&nbsp;尿囊素&nbsp;甘油&nbsp;玫瑰籽油&nbsp;生育粉（维生素E）&nbsp;玻璃苣籽油&nbsp;月见草油&nbsp;茴香油&nbsp;茉莉花花油&nbsp;依兰花油&nbsp;还有葛根提取物<br />\r\n功效：本品蕴含植物萃取配方，不添加任何人造急速及重金属&nbsp;<br />\r\n采用葛根提取物&nbsp;有效调理舒胸养护&nbsp;&nbsp;<br />\r\n依兰提取物可以增加乳房组织营养&nbsp;<br />\r\n生育粉（维生素E）令乳房皮肤更滋润<br />\r\n长期使用可令女性胸型更饱满美丽！<br />\r\n使用方法：洁肤后用毛巾热敷，然后取适量的精华涂抹于胸部，轻柔按摩至吸收（丰韵美乳精华）<br />\r\n每天早晚各一次，每天取适量均匀涂抹于两侧乳房，由外向内打圈按摩乳房，并由下往上轻拍至完全吸收（丰韵美乳霜）<br />\r\n丰韵美乳霜：<br />\r\n成分：水&nbsp;辛酸/葵酸甘油三脂&nbsp;鲸蜡硬脂醇&nbsp;丙二酵&nbsp;啤酒花提取物&nbsp;聚二甲基硅氧烷&nbsp;人参根提取物&nbsp;硬脂醇聚醚-21&nbsp;水解小麦蛋白&nbsp;硬脂醇聚醚-2&nbsp;角鲨烷&nbsp;香精&nbsp;黄原胶&nbsp;羟苯丙酯&nbsp;羟苯甲酯&nbsp;<br />\r\n功效:本品能增强胸部弹性，有助于胸部健美!<br />\r\nD女郎丰胸真的可以变大变挺吗微信；15961930560盐城市倾心商贸有限公司地址:盐城市鲁艺路122号','akyxq548','夏小姐','','446122274@qq.com','0515-88552979','0','1','1','','180.126.231.157','江苏省盐城市电信','1','/attachment/information/201707/pre_1499394684dgp1t.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1358','山东泰丰供应TLCF25-ZCV型动态阀','136','1499395736','365','1530931736','泰丰TLCF25-ZCV型动态阀动态阀价格批发采购商机&nbsp;动态阀是针对需要开启和关闭时间很快及保证阀芯可靠归座的用途开发的，动态阀的阀芯从阀块中凸出延伸到控制盖板中，由盖板中的控制油口来控制阀芯的开关给出动态特征，动态阀可以应用于需要此新产品特征的任何系统油路块中，既可用于方向控制功能又可用于单向控制功能&nbsp;动态阀具有以下特点&nbsp;1.&nbsp;开启和关闭时间响应快&nbsp;2.&nbsp;开启和关闭与A和B油口压力无关&nbsp;3.&nbsp;安装阀孔符合ISO7368&nbsp;4.&nbsp;外形尺寸小&nbsp;5.&nbsp;可实现平稳而准确地操作（不守住流量的影响）&nbsp;6.&nbsp;控制程度和可靠性高&nbsp;7.&nbsp;可以替代以下阀使用；液控单向阀、充液阀、释压阀','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_149939573693jre.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
