INSERT INTO my_information VALUES ('1379','泰丰股份CF系列充液阀专业生产供应价格实惠 品质上乘','136','1499476471','365','1531012471','泰丰股份CF系列充液阀专业生产供应价格实在,规格齐全,品质上乘。<br />\r\n	充液阀是一种液控单向阀，一个方向止流，另一个方向自由流通，先导动作是由油口供压的控制阀芯用液压实现的，由此而直接打开主阀。充液阀采用弹簧加载式盘式截止结构，能使活塞在压力作用下快速充放，充液阀也可以设置预开启压力，具有可靠的密封性能。加工精良，精密高度，无泄漏，保压性能良好。&nbsp;自身带缓动阀芯，能有效减少动声和振动。广泛应用于锻压机械、高速度冲床、压力机、注塑机等机器。在锻压机械中能使压机油缸起到快速充油和排油的作用。在高压与大流量时，能起到卸荷作用，并避免卸荷冲击。充液阀一般作为液压和油箱间的吸排油阀使用。大型压力机在快速行进时，油缸要大量补充油液，自动向油箱吸油;慢进加压时要防止油液从油缸反窜油箱。反向时油液可从油缸排回油箱。<br />\r\n	山东泰丰液压股份有限公司地址:山东省济宁市高新区海川路66号<br />\r\n	联系电话：0537-2718329','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499476471zdnqm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1380','四川辣椒烘干机厂家,四川辣椒烘干机供应商,陵县阳光输送设备','136','1499478094','365','1531014094','四川辣椒烘干机厂家,四川辣椒烘干机供应商,陵县阳光输送设备<br />\r\n	烘干机特点：&nbsp;<br />\r\n◆针对物料特点设计的带搅拌料仓及独特布料器机构，使块状物料很容易分散，且不致影响物料特性，料层厚度方便可调，在网带纵向、横向都布料均匀；<br />\r\n◆每一个可控单元，有独立的新风补风口、加热器、循环风机、风道过滤器、排湿口等；<br />\r\n◆加热器、循环风机设置在带机底部，带机两侧均装有快开门，方便清理、检修；<br />\r\n◆采用合理的斜向导风板,使得网带横向布风均匀,温差小，并使清料更容易；<br />\r\n◆带机采用8公分的硅酸铝保温，密封良好，使工作环境良好；<br />\r\n◆带机共分五段五个单元，使能耗利用更合理、更低；<br />\r\n◆带机低层网带底部做成倾斜面,便于收集、清理物料。<br />\r\n&nbsp;适用范围：<br />\r\n阳光带式干燥机是成批生产用的连续式干燥设备，用于透气性较好的片状、条状、颗粒料物料的干燥。对于脱水蔬菜、中药饮片等含水率高，而承受温度不允许高的物料尤为合适。该系列干燥机具有速度快，蒸发强度高，产品质量好的优点，滤饼类的膏状物料，湿法造粒料亦可干燥。','pbsjo981','王经理','1260842873','1260842873@qq.com','0534-8892643','0','1','1','','27.221.254.115','山东省联通','1','/attachment/information/201707/pre_1499478094mre4c.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1381','100吨锻压机插装阀加盟|100吨锻压机插装阀报价|泰丰股份','136','1499478251','365','1531014251','100吨锻压机插装阀加盟|100吨锻压机插装阀报价|泰丰股份&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	YZ32-100CV-00R差动100吨锻压机阀块，泰丰液压，厂家直销<br />\r\n	<br />\r\n		液压系统发展中的改进已经导致油路集成块结构的更多采用。油路集成块系统消除了元件之间众多的链接管路，从而实际上消除了潜在的泄漏点以及连带的油液浪费。把插装阀的主动要素插入油路集成块的标准腔孔中，并用被动块（盖板）盖住此插件，这样就完成了插装阀概念。<br />\r\n	<br />\r\n	<br />\r\n		一般来说，二通插装阀用于较大流量的液压系统，目的在于使其更高效、更快捷和更紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主级、插装式链接的模块化、可配组的集成化液压控制元件，可广泛应用于各种固定和移动液压系统的集成控制。产品链接、安装尺寸符合ISO7368、DIN24342和GB2877。如今的机械需要成本效益和能量效益都特别高的控制，泰丰插装件满足了这些需要。<br />\r\n	<br />\r\n	<br />\r\n		插装阀的优点：*设计灵活*成本较低*尺寸较小*可控性更好*可靠性更高*压力更高*工作效率更高*消除了外泄漏并减少了内泄漏*污染耐受力更大*使用寿命更长，便于维护<br />\r\n	<br />\r\n	<br />\r\n		插装阀的应用：一般用于流量大于80L/MIN的中压至高压液压系统，广泛应用于这种液压系统的集成控制，油压机、塑料成型机、剪切和打包机、机床和金属成型机械、轧钢机及其它金属一次加工设备、行走车辆、船舶等等。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司主营：二通插装阀、电磁阀、充液阀、各种规格剪板机/折弯机油缸、三大类滑阀元件<br />\r\n	<br />\r\n	<br />\r\n		经营范围：液压元件、液压成套系统；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压股份有限公司可供产品品种：&nbsp;<br />\r\n一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&nbsp;L/min-15000L/min&nbsp;<br />\r\n二、充液阀：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min&nbsp;<br />\r\n三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n四、液压缸:&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.40T-1200T液压折弯机主油缸及充液阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.各类冶金设备用油缸及工程缸&nbsp;<br />\r\n五、三大类传统板式滑阀：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.溢流阀&nbsp;2.顺序阀3.单向阀&nbsp;4.电磁换向阀&nbsp;5.液控单向阀&nbsp;6.节流阀&nbsp;7.流量控制阀&nbsp;<br />\r\n六、螺纹插装阀&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;二通插装阀集成系统：&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、500-50000KN铝型材挤压机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5、1600-30000克注塑机二通插装阀集成系统&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6、2500-20000KN压铸机二通插装阀集成系统&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	<br />\r\n	<br />\r\n		厂家优势：<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商&nbsp;.欢迎您来电咨询，来厂参观。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499478251vj72u.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
