INSERT INTO my_information VALUES ('1383','D女郎专业批发各种D女郎丰胸几盒能变大15961930560','136','1499479178','365','1531015178','盐城市倾心商贸有限公司专业批发各种D女郎丰胸几盒能变大15961930560<br />\r\nD女郎总代吴悦给你讲解丰胸&nbsp;做代理找吴悦15961930560<br />\r\nD女郎丰胸真的可以变大变挺吗微信；15961930560<br />\r\n我们丰胸产品分为：丰韵美乳精华（30ML）+丰韵美乳霜（30G）<br />\r\n丰韵美乳精华的<br />\r\n成分：水&nbsp;硬脂酸PCA钠&nbsp;EDTA二钠&nbsp;尿囊素&nbsp;甘油&nbsp;玫瑰籽油&nbsp;生育粉（维生素E）&nbsp;玻璃苣籽油&nbsp;月见草油&nbsp;茴香油&nbsp;茉莉花花油&nbsp;依兰花油&nbsp;还有葛根提取物<br />\r\n功效：本品蕴含植物萃取配方，不添加任何人造急速及重金属&nbsp;<br />\r\n采用葛根提取物&nbsp;有效调理舒胸养护&nbsp;&nbsp;<br />\r\n依兰提取物可以增加乳房组织营养&nbsp;<br />\r\n生育粉（维生素E）令乳房皮肤更滋润<br />\r\n长期使用可令女性胸型更饱满美丽！<br />\r\n使用方法：洁肤后用毛巾热敷，然后取适量的精华涂抹于胸部，轻柔按摩至吸收（丰韵美乳精华）<br />\r\n每天早晚各一次，每天取适量均匀涂抹于两侧乳房，由外向内打圈按摩乳房，并由下往上轻拍至完全吸收（丰韵美乳霜）<br />\r\n丰韵美乳霜：<br />\r\n成分：水&nbsp;辛酸/葵酸甘油三脂&nbsp;鲸蜡硬脂醇&nbsp;丙二酵&nbsp;啤酒花提取物&nbsp;聚二甲基硅氧烷&nbsp;人参根提取物&nbsp;硬脂醇聚醚-21&nbsp;水解小麦蛋白&nbsp;硬脂醇聚醚-2&nbsp;角鲨烷&nbsp;香精&nbsp;黄原胶&nbsp;羟苯丙酯&nbsp;羟苯甲酯&nbsp;<br />\r\n功效:本品能增强胸部弹性，有助于胸部健美!<br />\r\nD女郎丰胸真的可以变大变挺吗微信；15961930560欢迎联系盐城市倾心商贸有限公司批发D女郎丰胸几盒能变大15961930560。','akyxq548','夏小姐','','446122274@qq.com','0515-88552979','0','1','1','','180.126.229.203','江苏省盐城市电信','1','/attachment/information/201707/pre_1499479178acowy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
