INSERT INTO my_information VALUES ('1387','湖南电解水机加盟|广州健益环保|湖南电解水机工厂','136','1499483315','365','1531019315','湖南电解水机加盟|广州健益环保|湖南电解水机工厂&nbsp;|&nbsp;广州市健益环保科技有限公司<br />\r\n	湖南电解水机_湖南电解水机品牌_广州健益环保<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	广州市健益环保科技有限公司创立于2002年，是一家致力于研发、生产家用多功能制水机和全功能生态仪和负离子空气净化器的高新科技企业。<br />\r\n&nbsp;&nbsp;广州健益由国家卫生部公共卫生医学权威专家潘习龙博士及中.国多家重点大学教授领衔的技术团队进行产品研发工作，产品技术真正与国际接轨，核心技术直接从国外重点实验室导入，占据了国内多功能制水机、生态仪的技术醉高点，主导着制水机、生态仪\\空气净化器行业的发展方向。<br />\r\n&nbsp;&nbsp;健宜牌系列产品多次登陆中央电视台和部分地方电视台，是各大媒体推介的行业内著名品牌。健宜多次荣获国家相关权威部门授予的《中.国著名品牌》、《全国消费者信得过商品》等荣誉称号，是中.国健康产业的诚信单位，取得了广大用户、代理商、经销商的支持和信赖，受到广大消费者的一致好评！<br />\r\n&nbsp;&nbsp;然而，全球日益严重的环境、食品污染导致人们在饮用水、日常饮食方面长期存在的严重问题一直在损害着大众的身心健康。严峻的现实让健益人深感忧虑，感受到自己肩上沉重的历史使命。作为行业内的领航者，健益人责无旁贷地担起保障大众喝上健康的水、吃上放心食品的责任。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;健益人愿与有识之士共同努力，不断开拓创新，开发更多更好的优质产品，为改善人类健康饮水、保障家庭饮食安全、缔造人类健康生活、为社会创造更多的价值而奋斗！<br />\r\n	<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	厂家批发&nbsp;询价专线广州健益曹经理&nbsp;13751831987<br />\r\n　　厂家网站&nbsp;www.gzjianyi.cn&nbsp;&nbsp;Q&nbsp;2850613130<br />\r\n	主营：电解水机，生态仪，负离子空气净化器，车载空气净化器<br />\r\n　　地址:广州市黄埔区南湾工业区6栋<br />\r\n	<br />\r\n&nbsp;<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	&nbsp;<br />\r\n	健益牌多功能制水机&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;其它牌多功能制水机<br />\r\n	1、待机耗电量小2-3W：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、一般都是4-5W：<br />\r\n	2、功率大、可达到170W：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、一般在120-140左右：<br />\r\n	3、三套不同电路，适合各地区水质：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3、很多在北方不能用：<br />\r\n	4、电路中的发热元件，采用优质的铝材&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4、采用普通散热铝材，易烧坏元件<br />\r\n	做散热板对元件起到保护作用：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;引起机不正常工作或不工作：<br />\r\n	5、水压到2.25公斤水机自动提示，保护&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5、没有、不稳定时高时底：<br />\r\n	电解槽的寿命与水质的保障：<br />\r\n	6、连续工作60分钟后，自动停机保护：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6、有的在15分钟就停，顾客不方便<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;麻烦：<br />\r\n	7、每次开机5秒自动反清洗，可保护极板&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7、很多没有着个功能：<br />\r\n	的寿命与水的质量：因各地水质不一样设<br />\r\n	有强制清洗档，这样更有效保护极板的寿<br />\r\n	命与水的质量：<br />\r\n	8、更换滤芯提示，以每天30分钟，1公斤水&nbsp;&nbsp;8、很多不稳定或没有着个功能：<br />\r\n	压每分钟2.5升来记，一年就会提示（我们是<br />\r\n	以流量与时间一起记）<br />\r\n	9、变压器：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9、大多采用方形变压器性能比较<br />\r\n	较大环型变压器输出电压稳定，输出功率&nbsp;&nbsp;&nbsp;&nbsp;差易发热发烫易漏，采用小的环型<br />\r\n	稳定不会发生漏电、发烫，采用优质绝缘&nbsp;&nbsp;&nbsp;&nbsp;变压器输出功率不稳定：<br />\r\n	材料：不易发生漏电<br />\r\n	10、在变压器前装有整机保护比方说：常　　10、很多没有这个装置，或装在变<br />\r\n	用电突然升高或短路，变压器前的保险丝　　压器之后。装在变压器后的，只起<br />\r\n	会断开，从而起到整机的保护作用．　　　　保护电路，但因电流是瞬间的，所<br />\r\n	　　　　　　　　　　　　　　　　　　　　以都有可能烧坏电器中的元件．<br />\r\n&nbsp;<br />\r\n	<br />\r\n	<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	现诚招全国各地区经销、代理商。提供贴牌加工服务<br />\r\n加盟健益公司，健益公司提供支持：<br />\r\n1.宣传支持：公司品牌定期在央视及地方电视台，各大网站等方式提高品牌知名度；<br />\r\n2.市场支持：全国市场实行一区一代，有很好市场保护，不会出现窜货情况，当地有资讯一律转交代理；<br />\r\n3.售后支持：三个月包换，一年保修，终生维护；<br />\r\n4.品牌支持：公司品牌绝不会出现网上销售情况，确保经销利益；<br />\r\n5.专家支持：有专家团队支持市场，只要提前预约即可；员工培训，资料或者视频培训，专人培训。<br />\r\n6.物料支持：提供产品宣传物料设计，产品资料配套完善，画册、单页、光碟；<br />\r\n7.模式支持：市场模式，会综合各地好的模式提供；<br />\r\n8.设计支持：POV,帐篷，展架等。','hgsyt359','曹','2850613130','gzjianyi6@163.com','020-82088760','0','1','1','','116.23.94.33','广东省广州市海珠区电信','1','/attachment/information/201707/pre_1499483315kmwqc.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
