INSERT INTO my_information VALUES ('1389','太原平和满园丰三红蜜柚苗红心蜜柚苗黄心柚子苗的种植和管理','136','1499484001','365','1531020001','三红蜜柚苗红心蜜柚苗黄心柚子苗木的种植和管理<br />\r\ng溪蜜柚苗木种植分假植和定植两个阶段：<br />\r\n（一）假植<br />\r\n假植也就是将苗木，移到以后要定植的土地旁边，采用66厘米×100厘米的株行距，暂时种植一段时间。其目的是为了提高土地利用率，便于管理，使苗木适应环境，提高定植成活率。高密度假植还便于保持适宜的温湿度。假植苗高50―60厘米时摘心，以促侧枝萌发。一般，经过一年的假植，苗木就可以到大田里正式定植了。<br />\r\n（二）定植<br />\r\n定植就是将假植后的苗木移到事先选定的固定园地进行栽培。定植的时间以9―10月最好。<br />\r\n1、定植方法<br />\r\n挖一个长、宽、深各1米的定植坑。挖掘坑时要将表土和心土分别堆放。在坑底放入杂草等绿肥25-50千克作基肥，用脚踏实，先回填表土。再放杂草，上面撒生石灰1千克，石灰的作用是杀灭绿肥中有害病菌、加速绿肥腐烂和改善土壤的酸性环境。后回填心土，耙平，然后用有机肥１千克，与心土搅拌均匀后，挖好定植穴。适当修剪柚树苗过长的根系。将柚树苗种在定植穴的中间，在盖土的过程中轻轻向上抖动树苗，使树苗根部舒展开来，根颈部与地面持平，再用心土覆盖根部，然后从四周用脚踩实，在踩实时，再次向上轻轻提拉树苗后，继续踩实，以保持根部舒展，并与土壤充分接触；最后的覆土略高出地面。要保持苗木直立。并注意嫁接口应露出地面10～15厘米。定植后马上剪去顶部叶片，以免柚树苗中的水份蒸发过多。浇足定根水。在主干的周围用杂草做覆盖物，以保持土壤湿润。<br />\r\n2、定植密度：<br />\r\n定植距离，幼树采用株行距6米×3米，以便于到初果期可以隔行移走，将株行距调整到6×6米。<br />\r\n平和县满园丰苗木有限公司，公司目前是以培育：大三红蜜柚苗（红皮红肉蜜柚苗）、金桔蜜柚苗(红皮黄肉蜜柚苗)、黄肉蜜柚苗(黄金蜜柚苗)，红心蜜柚苗，且经营各系列品种蜜柚嫁接枝条的批发以及柚子种子小苗销售,并专注于国内外蜜柚新品种研发，和选育、培养，公司目前发展蜜柚产业种植示范基地300多亩，总投资500多万元年培育果苗300万株，年产水果280多万斤，形成了完整三红蜜柚产业链：种植―苗木培育-推广―市场销售，公司以科学管理育苗为原则，为广大种植户提供高品质、价格实在、品种优良的蜜柚苗木，同时还树立完善的售后体系，为广大果农提供的技术上指点与协助。<br />\r\n平和县满园丰苗木有限公司<br />\r\n联系人：周朝明<br />\r\n电&nbsp;&nbsp;&nbsp;话：13850463261<br />\r\nQ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Q：67020365<br />\r\n微&nbsp;&nbsp;&nbsp;信：13850463261<br />\r\nwww.myfmym.com<br />\r\n地&nbsp;&nbsp;&nbsp;址：福建省漳州市平和县霞寨镇寨里村','alimen998','欧先生','','alimen@242526.com','0592-3366206','0','1','1','','125.77.220.93','福建省厦门市电信','1','/attachment/information/201707/pre_14994840013v7j8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
