INSERT INTO my_information VALUES ('1458','山东泰丰节流阀专业制造供应','136','1499649858','365','1531185858','节流阀是通过改变节流截面或节流长度以控制流体流量的阀门。将节流阀和单向阀并联则可组合成单向节流阀。节流阀和单向节流阀是简易的流量控制阀，在定量泵液压系统中，节流阀和溢流阀配合，可组成三种节流调速系统，即进油路节流调速系统、回油路节流调速系统和旁路节流调速系统。节流阀没有流量负反馈功能，不能补偿由负载变化所造成的速度不稳定，一般仅用于负载变化不大或对速度稳定性要求不高的场合','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499649858be6hl.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1459','德州消防排烟风机箱质量可靠','136','1499655570','365','1531191570','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','182.32.132.88','山东省济南市电信','1','/attachment/information/201707/pre_1499655570zhim5.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1460','朔州立体车库最具性价比厂家推荐','136','1499667056','365','1531203056','朔州立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.+','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201707/pre_1499667056eyjhu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1461','朝鲜拌菜培训|好滋餐饮味|排骨米饭培训','136','1499669744','365','1531205744','朝鲜拌菜培训|好滋餐饮味|排骨米饭培训&nbsp;|&nbsp;沈阳好滋味餐饮管理有限公司<br />\r\n	沈阳朝鲜拌菜培训排骨米饭培训<br />\r\n&nbsp;<br />\r\n	好滋味餐饮集团经营以来一直秉承&quot;诚信、专业、务实、创新&quot;的经营理念，聘请国内外多位资深顶级厨师，搜集世界各地千余种名吃，专心致力于小吃饮食文化的传播与推广，帮助餐饮业创业者成就事业梦想。目前本公司主要培训各种流行小吃技术，餐饮咨询服务，小吃连锁加盟，餐饮咨询管理等。全方位的为广大客户学员、青年创业者经营者提供经营指导服务。小吃品种齐全丰富，口味独特正宗鲜美。技术学费价格优惠，老师一对一辅导，保教保会。不限制时间学习，在本公司学习的学员，学成之后后续如果有什么问题终身可以随时免费回来复习升级。保证您在这学成之后可以自己独立经营。本公司另有加盟特色，主打品牌友利佳好滋味羊杂面，一次性加盟，终身优惠，免费技术升级更新，免费商标牌匾使用。赠予您商标授权许可。沈阳好滋味餐饮管理有限公司始终坚持顾客的利益为首要因素，全心全意为广大顾客服务，衷心欢迎您实地考察与学习。<br />\r\n	&nbsp;<br />\r\n	详情请拨打电话：沈阳：18940014011赵老师，13998816601宣老师。吉林内蒙古：15140178540，黑龙江：15124512980，（微信同步）。郑重承诺：包教包会，学会为止，一期学不会下期免费复学，收费透明，除学费以外没有任何形式收费。','wnptu821','刘经理','995734565','995734565@qq.com','024-23411016','0','1','1','','101.46.200.118','辽宁省沈阳市鹏博士长城宽带','1','/attachment/information/201707/pre_1499669744jokft.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1462','山东滚筒输送机报价|陵县阳光输送设备|山东滚筒输送机选购','136','1499670143','365','1531206143','山东滚筒输送机报价|陵县阳光输送设备|山东滚筒输送机选购&nbsp;|&nbsp;陵县阳光输送设备有限公司<br />\r\n	山东滚筒输送机批发,陵县阳光输送设备,山东滚筒输送机产地&nbsp;<br />\r\n	滚筒输送机适用于各类箱、包、托盘等件货的输送，散料、小件物品或不规则的物品需放在托盘上或周转箱内输送。能够输送单件重量很大的物料，或承受较大的冲击载荷，滚筒线之间易于衔接过滤，可用多条滚筒线及其它输送机或专机组成复杂的物流输送系统，完成多方面的工艺需要。可采用积放滚筒实现物料的堆积输送。滚筒输送机结构简单，可靠性高，使用维护方便。<br />\r\n滚筒输送机结构形式：按驱动方式可分为动力滚筒线和无动力滚筒线，按布置形式可分为水平输送滚筒线、倾斜输送滚筒&nbsp;线和转弯滚筒线。还可按客户要求特殊设计，以满足各类客户的要求。标准规滚筒线内宽度为200、300、400、500、1200mm等。也可按客户需求&nbsp;采用其它特殊规格。转弯滚筒线标准转弯内半径为600、900、1200mm等，也可按客户需求采用其它特殊规格。直段滚筒所用的滚筒直径有38、50、&nbsp;60、76、89mm等。<br />\r\n滚筒输送机之间易于衔接过滤，可用多条滚筒线及其它输送设备或专机组成复杂的物流输送系统。<br />\r\n滚筒输送机适用于底部是平面的物品输送，主要由传动滚筒、机架、支架、驱动部等部分组成。具有输送量大，速度快，运转轻快，能够实现多品种共线分流输送的特点。&nbsp;<br />\r\n结构形式：从驱动形式上分为有动力、无动力、电动滚筒等，按布局形式分为水平输送，倾斜输送和转弯输送。<br />\r\n尺寸规格：滚筒输送机内宽度由客户指定，可按客户需求制作，转弯滚线标准转弯内半径为300、600、900、1200mm等，也可按客户需求采用其它特殊规格。直段滚筒所用的滚筒直&nbsp;径有38、50、60、76、89mm等。转弯滚筒的锥度我们会根据输送物体的重量、外形尺寸、线速度等来设计。<br />\r\n机架材质：碳钢喷塑，不锈钢，铝型材。&nbsp;<br />\r\n动力方式：减速电机驱动，电动滚筒驱动等形式。<br />\r\n传动方式：单链轮、双链轮、O型皮带、平面摩擦传动带、同步带等。<br />\r\n调速方式：变频调速，无级变速等。<br />\r\n设备特点：滚筒输送机之间易于衔接过滤，可用多条滚筒线及其它输送设备或专机组成复杂的物流输送系统以及分流合流系统，完成多方面的工艺需要。可采用积放滚筒实现物料的堆积输送。滚筒输送机结构简单，可靠性高，使用维护方便，动力滚筒线考虑链条抗拉强度，最长单线长度一般不超过20米。','pbsjo981','王经理','1260842873','1260842873@qq.com','0534-8892643','0','1','1','','27.221.254.115','山东省联通','1','/attachment/information/201707/pre_1499670143eimyh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
