INSERT INTO my_information VALUES ('1478','ZDR10DP叠加减压阀山东泰丰','136','1499735097','365','1531271097','减压阀是通过调节，将进口压力减至某一需要的出口压力，并依靠介质本身的能量，使出口压力自动保持稳定的阀门。从流体力学的观点看，减压阀是一个局部阻力可以变化的节流元件，即通过改变节流面积，使流速及流体的动能改变，造成不同的压力损失，从而达到减压的目的。然后依靠控制与调节系统的调节，使阀后压力的波动与弹簧力相平衡，使阀后压力在一定的误差范围内保持恒定。<br />\r\n	联系电话：0537-2718329','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499735097cuvf5.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
