INSERT INTO my_information VALUES ('1486','厦门金母子母婴品牌专场湖南电视台小戏骨之方世玉海选','136','1499745272','365','1531281272','7月8日下午，筹备多时的“小戏骨”系列之《方世玉》小童星评选活动在厦门悦享中心正式开始，小朋友们翘首以待中。来自厦门电视台，海峡导报的评委老师们宣布了本次评选活动的宗旨和意义，并向大家讲述了评分细则。<br />\r\n此次活动为厦门金母子专场，金母子作为母婴培训行业领导者，对小戏骨节目鼎力支持！<br />\r\n现在许多小孩子沉迷于电脑网络、手机游戏，对传统文化知之甚少，甚至有抵触情绪，让小孩子乐于接受优秀传统文化教育是件令人头痛的事。湖南广播电视台原创推出的《小戏骨》用小演员“演经典、学经典，演偶像、学偶像”巧妙地用“00后”小戏骨挑大梁，“小孩演大人”、“小孩演大剧”，充分表现了“萌娃新萌态”。小孩与小孩之间有天然亲近感，以“小孩影响小孩”最有效，小戏骨对传统文化的精彩表演，直接影响、带动了小观众。金母子作为母婴培训行业，这正是我们想要看到的优秀教育！<br />\r\n小戏骨栏目也吸引着媒体的关注，厦门电视台炫彩生活全程跟踪报道，更有东南网，厦门小鱼网、腾讯网、新浪、搜狐、等媒体持续报道！<br />\r\n评选现场，小朋友们的才艺那是相当多啊，你们瞧，这些小朋友落落大方，有唱歌的，也有讲故事的。别看她们小小的年纪，不论是节奏明快的说唱，还是柔美温婉的舞蹈，&nbsp;亦或愤慨激昂的歌曲，都能轻松HOLD住场，让大家赞叹不已。<br />\r\n评委老师们认真的评选着，经过几个环节的选拔，最终决出3名小朋友入围，并由金母子负责保送进入海选！没入围的小朋友也不要气馁，继续加油！期待下一次的海选。让我们共同期待这部“小戏骨之方世玉吧！<br />\r\n金母子在现场宣布，将和熹优家庭服务有限公司进行合作。<br />\r\n金母子母婴培训项目介绍：<br />\r\n金母子拥有国家中医药管理局，中.国中医药科技开发交流中心授权培训中心，福建省正规权威培训中心。拥有职业培训四大项目，中医催乳师、中医小儿推拿保健师、中医产后康复师、中医母婴保健师。<br />\r\n1.催奶师，又称催乳师、是指运用生理、中医、营养等相关知识，通过饮食、按摩、心理等技术和方法，帮助产妇解决无乳，乳少，乳汁淤积等问题并进行母乳喂养指导的从业人员。<br />\r\n2.小儿推拿师通过运用各种手法刺激穴位，使经络通畅、气血流通，以达到调整脏腑功能、治病保健的从业人员。<br />\r\n3.产后康复师是帮助产妇产后的体形恢复、产后的子宫恢复、产后的骨骼恢复和产后的心理恢复等专业人员<br />\r\n4.母婴保健师是从事孕妇、产妇、哺乳期妇女、新生儿健康管理、保健服务和心里调试的专业人员。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.189.156','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1499745272jzovz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1487','东莞 管道疏通清洗 排污渠清淤 清理泥浆 油管清淤 宏鑫首选','136','1499745600','365','1531281600','深圳&nbsp;大型下水管道疏通&nbsp;市政管道清淤&nbsp;下水道清洗&nbsp;182-1808-6986<br />\r\n宏鑫市政工程建设有限公司&nbsp;www.hongxingc.com&nbsp;是广东地区最具势力的市政工程建设公司，专注于政管道疏通、下水道疏通、管道清淤、河道清淤、箱渠箱涵清理、污水池清理、池塘理清、化粪池清理、污水池清理、排水沟清淤、污水道清淤、沉淀池清淤、管渠清淤、明暗管渠清淤、河涌清淤、河道清理、箱渠清淤等业务，多年来在行业中留下了良好的口杯，<br />\r\n同时公司注入过千万资金购买先进的设备，配有各种疏通清洁设备包括管道疏通车、吸污车、强力吸沙车、高压清洗车、吸粪车、专业淤泥垃圾抓斗车及清淤设施，公司拥有一支强大的、专业的管道疏通清洁队伍及管道方面的技术人员，。长期为市政环卫、物业小区、工矿企业、商场酒店、事业单位等提供疏通管道等服务。<br />\r\n专业技术团队服务，设备齐全，价格合理，服务有保障，免费勘察现场!<br />\r\n欢迎来电咨询：&nbsp;182-1808-6986&nbsp;&nbsp;&nbsp;&nbsp;戴经理<br />\r\nwww.hongxingc.com<br />\r\n广东省全方位施工服务；深圳、广州、东莞、中山、佛山、珠海、江门、湛江、阳江（阳江市、江城区、阳春市、阳西县、阳东县）等；遍布珠三角地区；&nbsp;&nbsp;<br />\r\n欲了解深圳管道疏通清洗排污渠清淤清理泥浆油管清淤价格多少钱，请联系深圳宏鑫市政戴经理，地址：广东深圳龙华观澜环观中路28号Ａ栋首层，联系电话：755-18218086<br />\r\n深圳管道疏通清洗排污渠清淤清理泥浆油管清淤,管道疏通清洗排污渠清淤清理泥浆油管清淤价格,管道疏通清洗排污渠清淤清理泥浆油管清淤多少钱','hongxin2016','戴经理','1449072728','1449072728@qq.com','755-18218086-986','0','2','1','','219.134.25.199','广东省深圳市龙岗区电信','1','/attachment/information/201707/pre_1499745600dxoie.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1488','弱碱电解水机,广州健益环保,品牌电解水机','136','1499755513','365','1531291513','弱碱电解水机,广州健益环保,品牌电解水机&nbsp;|&nbsp;广州市健益环保科技有限公司<br />\r\n	品牌电解水机|广州健益环保|弱碱电解水机<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	水污染事件层出不穷。水源地污染、水厂处理不达标、城市管网二次污染、自来水不合格、桶装水污染等新闻的不断曝光，让人饮水安全问题终于被摆上了台面，也让越来越多的家庭意识到，饮水安全的重要性。而自来水本身存在的余氯、重金属、二次污染等不可回避的问题，以及桶装水市场良莠不齐、缺乏标准等问题，使得人们逐步开始寻找一种更安全、更健康的饮水方式。而电解水机，作为高端净水设备的代表，不仅能解决饮水安全为题，全方位净化自来水、去除余氯、重金属的威胁。还能将自来水进行优化，经电解、活化、矿化后的自来水完全达到了直饮标准，更接近人体的需要，不仅纯净而且健康。<br />\r\n我国约60%的城市人口饮用自来水，约23%的城人口正使用桶装水，而剩下近17%的城市人口已开始使用净水设备(净水机器、电解水机)作为日常饮水工具。<br />\r\n	健宜电解水机的好处<br />\r\n1.碱性电解水非常贴近原生态的山泉水.可以补充人体内的微量元素.<br />\r\n人的体液也是呈弱碱性的.所以比较容易吸收<br />\r\n健宜电解水机即使龙头直饮机，有是富氢电解水机<br />\r\n电解水机的工作原理<br />\r\n如何取得这种好水呢？1931年，日本人研制出世界上一台改水机，这种机器生产出来的水被称为碱性钙离子水。用它进行种子浸泡，结果发芽率和成活率大为提高；用于畜牧业，发现牛的产奶率、鸡的产蛋率也明显提高。60年代初，日本应用于临床，66年离子水机被日本厚生省（相当于我国的卫生部）指定为医疗器机。74年传入美国，76年传入韩国。目前日本已有近百家离子水机生产厂家。东芝、松下、三洋等知名大公司都有各自品牌的离子水机。只因为这种机器价格较高（1万多元，因为品牌厂家所要求的制水器正常使用寿命为5年以上，主要是电解槽板采用的是贵的铂金、钛金、合成板材，不是用不锈钢或其它材料），以往在我国一些城市的商场偶有销售，却很少能引起我们普通百姓的关注。不过富裕起来的中.国人是一群精明的人，亦会计算出每月只是花几十元，能使全家人健康有了保障，减少了疾病。1994年前后，国内一些有识之士开始向这个水课题进行挑战，并取得初步成功。<br />\r\n那么，电解水机是怎样将普通的自来水改造成为离子水的，首先强调的一点是：它不同于以往我们所看到的任何一种净水器、矿泉壶、磁化壶等净水设备。市场上出售的各种的净水设备都围绕一个“净”字做文章，而离子水机神奇功能不仅是对水进行净化、矿化，更主要是通过电解水改变水的结构与成份，是一种功能水。<br />\r\n离子水机的基本原理是：自来水通过高品质的过滤系统，去除水中的氯，有害菌类及铁锈等杂质，再经过电解生成碱性离子水和酸性离子水，并把大水分子团分割成小水分子团，增强了水的活性、渗透力及溶解力。<br />\r\n也正是基于此，越来越多的家庭开始关注电解水机，关注自身的饮水健康，被誉为具市场前景的必备水家电。<br />\r\n	&nbsp;<br />\r\n	广州健益董事长电话一三七五一八三一九八七&nbsp;&nbsp;实力厂家，主营电解水机，生态仪，负离子空气净化器，车载空气净化器，现面向全国火爆招商！！！<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	健宜电解水机的特点<br />\r\n1、安全可靠:还原水采用自来水管网之水直接电解而成，不添加任何物质，无任何隐患。<br />\r\n2、抗氧化:呈负电位，含有丰富的活性氢，可消除人体内过剩的自由基。<br />\r\n3、代谢速度快:小分子团，溶解力强，易于吸收和排泄。<br />\r\n4、呈弱碱性:符合人体弱碱性的内环境<br />\r\n这些特征大大减少了人体患病的几率，能够将人体内长期堆积的体锈进行清除，还原到健康的状态。','hgsyt359','曹','2850613130','gzjianyi6@163.com','020-82088760','0','1','1','','116.23.95.142','广东省广州市电信','1','/attachment/information/201707/pre_14997555132vmaz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1489','苏州 膜包机什么牌子好 恒光包装机械','136','1499755578','365','1531291578','苏州&nbsp;膜包机什么牌子好?恒光包装机械。<br />\r\n张家港市恒光包装机械有限公司http://www.hgshrink.com/膜包机<br />\r\n膜包机适合货品集装化贮存、运送及机械化装卸工作。广泛应用于外贸出口、食品饮料、制灌、造纸、染料、塑胶化工、玻璃陶瓷等商品的包装。膜包机既提高了出产功率，又能避免货品在搬运过程的损坏，并起到防尘，防潮及保洁效果。下面是膜包机多见的故障、故障因素、解决办法:<br />\r\n一、膜包机出现转盘不转的现象：<br />\r\n1.变频器烧坏，现象是无显现，需要替换新的；<br />\r\n2.变频器参数设错，要从新依照说明设定；<br />\r\n3.转盘链条断裂，调整大小链轮之间的间隔，衔接链条，假如链条损坏则需要替换链条；<br />\r\n4.转盘电机自身故障，使用万用表或摇表检查电机是否缺项或击穿，假如现场不能维修，则需要替换电机；<br />\r\n6.旋钮损坏，底盘不转，需要替换；<br />\r\n8.转盘减速机与链轮衔接不正常，换衔接平键。<br />\r\n二、膜包机转盘需人推才能发动&nbsp;：<br />\r\n1.变频器和发动装置的起动时刻太长，需要从新设定；<br />\r\n2.拨码开关损坏&nbsp;维修拨码开关。<br />\r\n三、膜包机http://www.hgshrink.com/如果转盘不能缓起、缓停：<br />\r\n1.变频器参数设置错误，需要从新设置；<br />\r\n四、膜包机转盘启动后有杂音：<br />\r\n1.场地不平，要求使用者整理或替换放置地点;<br />\r\n2.有些托轮磨损比较严重，需要替换托轮。<br />\r\n　　&nbsp;膜包机牌子就选恒光包装机械。张家港市恒光包装机械有限公司专业生产膜包机,塑包机,全自动膜包机,全自动塑包机,热收缩包装机,纸箱热收缩包装机,纸箱膜包机,袖口式热收缩包装机,袖口式膜包机,彩膜包装机,彩膜塑包机设备等热收缩包装机系列设备，覆盖饮料、矿泉水、服装、木地板、电子产品等行业的绿色环保包装。公司座落在饮料机械设备生产基地-----张家港市。公司引进国、内外先进技术，对产品质量不断总结，升级。并获着欧美CE认证、ISO9001：2008质量体系认证。其中出口比例占年销售量的2/3，已成为包装行业的骨干企业。','wvapp437','熊芳益','','408534014@qq.com','512-58977357','0','1','1','','117.80.141.125','江苏省苏州市张家港市电信','1','/attachment/information/201707/pre_1499755578va3vq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
