INSERT INTO my_information VALUES ('1511','阀芯，带阻尼插件，插入元件，通径16-160插件','136','1499823110','365','1531359110','供应泰丰TLC系列插件二通插装阀、控制盖板、插件<br />\r\n	插件分为基本插件Z1A(B)-H*&nbsp;&nbsp;&nbsp;TLC…A(AA)（B）(BB)&nbsp;单向插件Z11A(B)-H&nbsp;&nbsp;&nbsp;阀芯内钻孔&nbsp;、带阻尼插件、带缓冲头插件、减压插件、常开型插件<br />\r\n	新型的TLC具有以下特征：&nbsp;<br />\r\n	压差流量特性较老系列产品有明显提高&nbsp;<br />\r\n	插装件的阀芯、阀套等具有多样化的配置性能，可满足客户各种不同需要&nbsp;<br />\r\n	可提供多种面积比&nbsp;<br />\r\n	可提供具有缓冲尾部和不同节流槽的阀芯&nbsp;<br />\r\n	可提供不同的开启压力&nbsp;<br />\r\n	可提供带柔性密封的阀芯&nbsp;<br />\r\n	山东泰丰液压股份有限公司可供产品品种<br />\r\n	一、二通插装阀流量范围为：63L/min-15000L/min<br />\r\n	二、充液阀：Dg40-Dg400通径流量范围为300L/min-35000L/min<br />\r\n	三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8-20<br />\r\n	四、液压缸:1.40T-1200T液压折弯机主油缸及充液阀2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸;3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸;4.各类冶金设备用油缸及工程缸<br />\r\n	五、三大类传统板式滑阀1.溢流阀;2.顺序阀3.单向阀4.电磁方向阀5.液控单向阀6.节流阀7.流量控制阀<br />\r\n	六、螺纹插装阀&amp;lt;br/&amp;gt;<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1499823110liln8.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
