INSERT INTO my_information VALUES ('1526','耐高温350度玄武岩除尘布袋玄武岩收尘袋','136','1499848835','365','1531384835','耐高温350度玄武岩除尘布袋。<br />\r\n&nbsp;&nbsp;&nbsp;玄武岩除尘布袋作为袋式除尘设备的滤料，它是以玄武岩（古生代火山岩的一种）为主要原料，经高温熔化、冷却提炼出岩石绒制成的一种新型的纤维材料。它不仅具备石棉和玻璃纤维产品的许多优良性能,还具备了其他优良特性。耐高温玄武岩除尘布袋&nbsp;是超高温过滤材料,具有耐低温、耐高温、耐腐蚀、化学性能稳定、绿色环保、无污染等特性。填补了过滤材料在280℃-500℃的使用空白，由于玄武纤维本身强度高，耐高温，耐腐蚀，延伸率低等优异性能，因此用玄武岩耐高温除尘布袋制成的滤袋有以下特点：<br />\r\n1.机械强度高，断裂强度一般均在3000N以上;<br />\r\n2.延伸率低，玄武岩纤维本身的断裂伸长只有3%，因而用它制成的滤袋尺寸稳定;<br />\r\n3.机械性能好，可在380℃温度下长期使用;瞬间可达600°。<br />\r\n4.玄武岩耐高温除尘布袋耐腐蚀性能好，可在酸、碱气氛的气体中使用;<br />\r\n5.织物空隙率高，表面光滑，透气性好，空载压损仅为2Pa;<br />\r\n6.玄武岩耐高温除尘布袋收尘效率高，可达99.5%－99%，尤其是对直径0.5mm以下的尘粒，效果更为明显;<br />\r\n&nbsp;&nbsp;耐高温350度玄武岩除尘布袋&nbsp;请联系明辉微信：15189358580','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.66.172','江苏省盐城市电信','1','/attachment/information/201707/pre_1499848835ziajk.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
