INSERT INTO my_information VALUES ('1534','烟台砖厂化验煤炭热量仪器-砖坯热量化验仪器-检测砖坯热卡仪','136','1499858080','365','1531394080','　　砖厂化验煤炭热量仪器-砖坯热量化验仪器-检测砖坯热卡仪咨询电话：186.3920.3323本公司主要系列产品：砖厂热量仪器，煤矸石热量检测仪器，砖厂发热量化验仪，煤矸石热值仪，砖厂煤炭热量卡数检测设备，煤矸石大卡检测仪器，煤炭热值检测大卡仪器<br />\r\n<br />\r\n　　适用范围：<br />\r\n<br />\r\n　　适用于电力、煤炭、冶金、石化、环保、建材、科研院校等行业部门测量煤炭、焦炭、石油等可燃物质的热值。<br />\r\n<br />\r\n　　工作原理<br />\r\n<br />\r\n　　测定可燃物质的发热量，是将一定量的试样置于密封的氧弹中，在充足的氧气条件下，令试样完全燃烧，燃烧所放出的热量被氧弹及其周围的一定量的水(内筒水)吸收，水的温升与试样燃烧释放的热量成正比。<br />\r\n<br />\r\n　　砖厂化验煤炭热量仪器技术参数：<br />\r\n<br />\r\n　　1.采用标准：《煤的发热量测定方法》<br />\r\n<br />\r\n　　2.测量时间：15min<br />\r\n<br />\r\n　　3.测温范围：5~40℃<br />\r\n<br />\r\n　　4.分辨率：0.0001℃<br />\r\n<br />\r\n　　5.精密度：RSD≤0.15%<br />\r\n<br />\r\n　　6.功率：≤100W<br />\r\n<br />\r\n　　7.电源：(220±22)VAC(50±1)HZ<br />\r\n<br />\r\n　　8.主机尺寸（mm）：800×545×500<br />\r\n<br />\r\n　　9.主机重量：60kg<br />\r\n<br />\r\n　　砖厂化验煤炭热量仪器技术特点：<br />\r\n<br />\r\n　　1、低故障率、高稳定性<br />\r\n<br />\r\n　　2、硬件设计技术：采用专业的多层印刷电路板设计及贴片技术，提高了仪器的稳定性和抗干扰性。<br />\r\n<br />\r\n　　3、采用德国进口高精度、高稳定性铂电阻。<br />\r\n<br />\r\n　　4、采用美国原装德州仪器(TI)的24位超高位模数转换技术，使仪器的精度和准确度高<br />\r\n<br />\r\n　　6、独创的水量定容补偿技术，并配合自动水循环系统，准确地自动定量内桶水量。<br />\r\n<br />\r\n　　7,量热桶内的水容量64KG，大水量循环中由大功率磁力泵进行，','meijia222','彭总','513556508','kaipingyiqi@163.com','0392-2121168','0','1','1','','42.230.18.146','河南省鹤壁市联通','1','/attachment/information/201707/pre_1499858080s1tfo.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
