INSERT INTO my_information VALUES ('1539','德阳德国索亚螺柱焊机代理，索亚拉弧式螺柱焊机BMK-12W','136','1499873226','365','1531409226','德阳德国索亚螺柱焊机代理，索亚拉弧式螺柱焊机BMK-12W<br />\r\nBMK-12W&nbsp;是一款拥有全面的综合性能拉弧式螺柱焊机，生产效率高，焊接质量好，具有优良的性价比。焊机为数字显示，具有自保护功能、全自动数字化接口。特别适合手工焊接、自动数字化焊接和机器人焊接。<br />\r\n技术参数<br />\r\n焊接范围：&nbsp;M3&nbsp;-&nbsp;M12或&nbsp;Φ2&nbsp;-&nbsp;11&nbsp;mm<br />\r\n焊接材料：&nbsp;碳钢，不锈钢，耐热钢和铝<br />\r\n标准焊枪：&nbsp;PH-3N&nbsp;电子提升式焊枪<br />\r\n焊接电流：&nbsp;800A<br />\r\n焊接时间：&nbsp;1-1000ms<br />\r\n焊接速度：&nbsp;可达30&nbsp;个/min，具体需参照螺柱直径<br />\r\n输入电源：&nbsp;3X400&nbsp;V~,&nbsp;-&nbsp;50&nbsp;/60Hz-32AT&nbsp;<br />\r\n保护气流量：&nbsp;4-5L/min<br />\r\n自动焊接口：&nbsp;机器人、CNC接口<br />\r\n保护等级：&nbsp;IP21<br />\r\n焊枪电缆：&nbsp;5m，高柔性<br />\r\n地&nbsp;&nbsp;&nbsp;&nbsp;线：&nbsp;2&nbsp;x&nbsp;3&nbsp;m，高柔性<br />\r\n外形尺寸：&nbsp;360&nbsp;x&nbsp;325&nbsp;x500&nbsp;mm&nbsp;(w&nbsp;x&nbsp;h&nbsp;x&nbsp;d)<br />\r\n重&nbsp;&nbsp;&nbsp;&nbsp;量：&nbsp;48&nbsp;kg<br />\r\n颜&nbsp;&nbsp;&nbsp;&nbsp;色：&nbsp;RAL&nbsp;5009&nbsp;天蓝色&nbsp;<br />\r\n索亚(soyer)螺柱焊机是快速焊接螺柱、螺母及类似形状工件的理想设备，可代替铆接、钻孔、手工电弧焊、电阻焊和钎焊，可焊接碳钢、不锈钢、铝、铜及异种金属材料。具有快速、方便、经济、质量可靠的优点。广泛应用于建筑、装修、钢构、汽车、造船、锅炉、航天、电子、仪表、家用电器、厨房设备、空调、医疗器械等行业。<br />\r\n德国索亚螺柱焊机全系列：索亚螺柱焊机，索亚储能螺柱焊机，索亚拉弧螺柱焊机，德国索亚螺柱焊机，进口螺柱焊机，德国索亚进口螺柱焊机，索亚螺母焊机，索亚螺柱焊机配件，索亚螺柱焊机上海总公司欢迎新老客户前来洽谈业务。<br />\r\n本公司专业代理销售德国索亚螺柱焊机全系列，并提供销售、安装、并提供售前、售中、售后一条龙服务，我们以优惠的价格及真诚的服务期待您的垂询！','ai1143052945','吴炯明','1143052945','1143052945@qq.com','021-69785098','0','1','1','','116.225.37.8','上海市青浦区电信','1','/attachment/information/201707/pre_1499873226bzgba.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
