INSERT INTO my_information VALUES ('1553','邢台立体车库最具性价比厂家推荐','136','1499935888','365','1531471888','邢台立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201707/pre_1499935888znqwc.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1554','北京丁基防水密封胶带厂家首选力达科技','136','1499938634','365','1531474634','北京力达科技有限公司是专业的北京丁基防水密封胶带厂家。<br />\r\n防水密封胶带（）http://www.beijingtianshi.com/Pro.asp?type_id=44）<br />\r\n（一））产品介绍：<br />\r\n北京天时牌丁基反水密封胶带&nbsp;<br />\r\n1、材料组成&nbsp;是由丁基橡胶防水密封粘结带是由丁基橡胶与聚异丁烯等主要原料共混而成，经过特殊的工艺流程生产出来的环保型、无溶剂密封粘结材料。<br />\r\n&nbsp;2、防水密封产品特点&nbsp;<br />\r\n（1）优异的机械性能：粘结强度、抗拉强度高，弹性、延伸性能好，对于界面形变和开裂适应性强。&nbsp;（2）稳定的化学性能：具有优良的耐化学性，耐候性和耐腐蚀性。&nbsp;（3）可靠的应用性能：其粘结性、防水性、密封性、耐低温性和追随性好，尺寸的稳定性好。&nbsp;（4）施工操作工艺简单&nbsp;<br />\r\n3、适用范围&nbsp;<br />\r\n（1）新建工程的屋面防水、地下防水、结构施工缝的防水处理及高分子防水卷材搭接密封。&nbsp;（2）市政工程中的地铁隧道结构施工缝的密封防水处理。&nbsp;（3）彩色压型板接缝处的气密、防水、减震。阳光板工程中接缝处的气密、防水、减震。<br />\r\n4&nbsp;汽车装配中的粘接密封处理。&nbsp;<br />\r\n5&nbsp;钢结构施工中接逢处的防水密封处理&nbsp;<br />\r\n6&nbsp;复合铝箔的丁基胶带适合于各种土木屋面，彩钢，钢构，防水卷材，PC板等在阳光照射下的防水密封&nbsp;<br />\r\n二、施工规定&nbsp;<br />\r\n1、总则&nbsp;（1）本规定适用于采用胶带做为防水卷材粘结、金属压型板粘结、PC板粘结等配套材料的土木结构屋面、金属板面&nbsp;的密封防水工程。&nbsp;（2）设计或使用胶带时，应按照有关规定或参照我公司企业标准进行。<br />\r\n&nbsp;2、一般规定&nbsp;<br />\r\n（1）需在-15°C―45°C温度范围施工（超出规定的温度范围时庆采取相应措施）&nbsp;<br />\r\n（2）基层表面必须清理或擦拭干净，保持干燥，无浮土、油污。&nbsp;同时使用。（北京力达橡胶科技010-57195880，QQ：2511991276）欢迎联系北京力达科技有限公司薄净怡索取丁基防水密封胶带资料！','bojingyi','薄净怡','2511991276','2511991276@qq.com','010-57195880','0','1','1','','123.123.152.20','北京市联通','1','/attachment/information/201707/pre_1499938634eoxko.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1555','揭阳验煤机煤热量热卡仪-砖坯发热量大卡机-化验煤矸石大卡','136','1499940076','365','1531476076','　　验煤机煤热量热卡仪/砖坯发热量大卡机/化验煤矸石大卡咨询：186.3920.3323，主要系列产品：砖厂热卡仪，煤炭热值检测大卡仪器，砖厂煤矸石热量化验仪器，砖厂验煤机，化卡机<br />\r\n<br />\r\n　　验煤机煤热量热卡仪适用范围:<br />\r\n<br />\r\n　　该产品用于电力、能源、石油、环保。食品和科研等部门的各种固态和液态物质高精度的热值测量，特别适用低热值可燃物质（粉煤灰、矸石、水泥生料）的测量。<br />\r\n<br />\r\n　　验煤机煤热量热卡仪标准配置<br />\r\n<br />\r\n　　充氧仪一台、减压器一个、氧弹一个、苯甲酸一瓶、不锈钢坩埚五个、氧弹密封胶垫二套、点火丝四卷、微型打印纸十六卷。<br />\r\n<br />\r\n　　砖坯为什么不达标？<br />\r\n<br />\r\n　　砖坯热卡化验机器作用？砖坯内燃料有两条要求。一是掺配量是合适，二是掺配是否均匀。内燃料掺配不均匀，必然使窑内温度产生明显差异或引起波动。又由于这种不均匀无法事先掌握，因而窑内火情也随之呈现无规律的忽大忽小，使得火工无法操作。<br />\r\n<br />\r\n　　如以内烧料掺量不足的砖坯为标准，焙烧时必须采用外投煤的办法来提高温度，但温度一旦提高，含内燃料高的砖坯必然过火，会在同一个窑室内出现过火各欠火两种废品，<br />\r\n<br />\r\n　　验煤机煤热量热卡仪工作原理<br />\r\n<br />\r\n　　是根据氧弹量热法的基本原理设计而成，将一定量的试样放在充有过量氧气的氧弹内燃烧、放出的热量被一定量的水吸收，根据水温的升高来计算试样的发热量（热值、大卡）。<br />\r\n<br />\r\n　　验煤机煤热量热卡仪技术特点<br />\r\n<br />\r\n　　1.专业的多层电路板设计及贴片技术，稳定性更好<br />\r\n　　2.该产品采用当今高位的24位模数转换器<br />\r\n<br />\r\n　　3.德国原装进口温度传感器，精密度更高，稳定性更好<br />\r\n<br />\r\n　　4.精确制冷技术:仪器采用国内先进“循环水降温技术<br />\r\n<br />\r\n　　5.使筒内的水温快速回到接近起始值，保证了测试精度<br />\r\n<br />\r\n　　6.独特的非熔断式点火方式，确保每次点火成功','meijia222','彭总','513556508','kaipingyiqi@163.com','0392-2121168','0','1','1','','42.230.18.146','河南省鹤壁市联通','1','/attachment/information/201707/pre_1499940076jmx6e.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
