INSERT INTO my_information VALUES ('1561','德国索亚SOYER螺柱焊机BMS-8N，德国索亚螺柱焊机','136','1499954334','365','1531490334','德国索亚SOYER螺柱焊机BMS-8N，德国索亚螺柱焊机<br />\r\n德国索亚SOYER螺柱焊机BMS-8N<br />\r\nBMS系列螺柱焊机主要用于国内大型汽车生产线上,用于螺钉焊接.采用Soyer&nbsp;的尖端放电式螺柱焊系统，尖端放电是采用电容瞬时放电产生焊接电弧能。<br />\r\nBMS-8N&nbsp;是一款拥有全面的综合性能储能式螺柱焊机，生产效率高，焊接质量好。<br />\r\n焊接过程:螺柱被放置在底板上<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;电弧通过螺柱与工件之间的尖端放电引燃。&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;螺柱与工件的表面均被熔化<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;然后螺柱自动沉入液体熔池，在0.001-0.003&nbsp;秒内，<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;迅速凝固，就产生一个高强度的焊接接头。焊接电流关闭.<br />\r\nBMS-8N&nbsp;Ⅱ储能式螺柱焊机特点<br />\r\n技术参数<br />\r\n焊接范围：&nbsp;碳钢和不锈钢，M3&nbsp;C&nbsp;M8&nbsp;或&nbsp;Φ3&nbsp;-&nbsp;8&nbsp;mm&nbsp;&nbsp;<br />\r\n铝和铜，M3&nbsp;C&nbsp;M6&nbsp;或&nbsp;Φ3&nbsp;-&nbsp;6&nbsp;mm<br />\r\n焊接原理：&nbsp;EN&nbsp;ISO&nbsp;14555&nbsp;标准，储能焊<br />\r\n标准焊枪：&nbsp;PS-1K&nbsp;接触式焊枪<br />\r\n电容容量：&nbsp;66&nbsp;000ìF&nbsp;(可选:&nbsp;99&nbsp;000ìF加强型)<br />\r\n电容电压：&nbsp;50&nbsp;-&nbsp;200&nbsp;V，无级调节<br />\r\n焊接时间：&nbsp;0.001&nbsp;-&nbsp;0.003S<br />\r\n焊接速度：&nbsp;可达20&nbsp;个/min，具体需参照螺柱直径<br />\r\n输入电源：&nbsp;230&nbsp;V~,&nbsp;-&nbsp;50&nbsp;Hz,&nbsp;5&nbsp;A&nbsp;/&nbsp;115&nbsp;V~,&nbsp;-&nbsp;60&nbsp;Hz,&nbsp;10&nbsp;A&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n焊接电缆：&nbsp;3m，高柔性&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n地&nbsp;&nbsp;&nbsp;&nbsp;线：&nbsp;2&nbsp;x&nbsp;3&nbsp;m，高柔性<br />\r\n外形尺寸：&nbsp;300&nbsp;x&nbsp;120&nbsp;x&nbsp;320&nbsp;mm&nbsp;(w&nbsp;x&nbsp;h&nbsp;x&nbsp;d)<br />\r\n重&nbsp;&nbsp;&nbsp;&nbsp;量：&nbsp;10&nbsp;kg<br />\r\n颜&nbsp;&nbsp;&nbsp;&nbsp;色：&nbsp;RAL&nbsp;5009&nbsp;天蓝色<br />\r\n德国索亚螺柱焊机全系列：索亚螺柱焊机，索亚储能螺柱焊机，索亚拉弧螺柱焊机，德国索亚螺柱焊机，进口螺柱焊机，德国索亚进口螺柱焊机，索亚螺母焊机，索亚螺柱焊机配件，索亚螺柱焊机上海总公司欢迎新老客户前来洽谈业务。<br />\r\n本公