INSERT INTO my_information VALUES ('1563','松原北京北京最好的PVC阻燃防水电工胶带品牌推荐','136','1499955653','365','1531491653','北京北京最好的PVC阻燃防水电工胶带品牌推荐北京力达牌。力达科技是北京最好的PVC阻燃防水电工胶带品牌。<br />\r\n北京力达牌【PVC阻燃电工胶带18801338568】PVC阻燃防水环保胶带<br />\r\n规格：10米、15米/20米/25米/30米，宽度有：17mm/18mm/20mm/30mm/50mm/60mm/100mm<br />\r\n环保电工胶带以软质聚氯乙烯膜为基材，涂上高强度的环保粘剂而成，具有良好的绝缘、耐压、阻燃、<br />\r\n耐寒、环保等优点。用于70摄氏度,600伏特-800伏特以下环境，电线电缆接头绝缘，缠绕,相识标色，电器防护等.<br />\r\nPVC电气高压绝缘胶带、【PVC阻燃胶带】适用于各种电子零件的绝缘、汽车配线、电线缠绕、绝缘保护等&nbsp;<br />\r\n环保型电工胶带：环保PVC基材，各色，电气性能佳；绝缘包扎用。<br />\r\n厚度:0.11mm&nbsp;&nbsp;0.13mm.&nbsp;&nbsp;&nbsp;0.15mm&nbsp;&nbsp;0.17mm&nbsp;&nbsp;0.18mm&nbsp;&nbsp;0.19mm&nbsp;0.20mm<br />\r\n电气绝缘胶带&nbsp;雾面电气胶带<br />\r\nPVC电气胶粘带(阻燃电气胶带】是以软质聚氯乙烯(PVC）薄膜为基材，涂橡胶型压敏胶制造而成，具有良好的绝缘、<br />\r\n耐燃、耐电压、耐寒等特性，适用于汽车配线、电线缠绕、绝缘保护等。聚酯电气胶带，又称迈拉<br />\r\n胶带，是由聚酯膜及溶剂型压敏胶制作而成，拉伸强度大，耐高温，用于各种变压器的制造。&nbsp;<br />\r\n通过欧共体CE认证。&nbsp;<br />\r\n【力达牌阻燃电气胶带】@：18611125567：&nbsp;<br />\r\n阻燃电气胶带，用于汽车线束的缠绕或民用&nbsp;<br />\r\n阻燃型电气胶带，用于汽车线束及消磁线圈的缠绕&nbsp;<br />\r\n无铅阻燃电气胶带：&nbsp;<br />\r\n无铅阻燃电气胶带，不含铅、镉、铬及汞等重金属&nbsp;<br />\r\n聚酯阻燃胶带，适于变压器中线圈的包缠、固定。<br />\r\n本公司还供应上述产品的同类产品：PVC阻燃防水环保胶带、阻燃包带<br />\r\n北京力达胶粘制品有限公司&nbsp;电话：010-57195880&nbsp;18801338568<br />\r\n微信/QQ:2511991276<br />\r\n找北京最好的PVC阻燃防水电工胶带品牌经销商？特别推荐北京力达科技有限公司。','bojingyi','薄净怡','2511991276','2511991276@qq.com','010-57195880','0','1','1','','114.249.77.82','北京市联通','1','/attachment/information/201707/pre_1499955653jlj1f.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
