INSERT INTO my_information VALUES ('1589','TRM系列多路阀，TRM15多路阀，TRM15多路阀','136','1500002624','365','1531538624','TRM系列多路阀，沃尔沃用多路阀，挖机多路阀<br />\r\n	多路阀工作原理可以简单概括为：进口阀块内置三通压力补偿旁通溢流阀,当多路阀停止操作,且各阀均在中位时,该阀则以补偿压力旁通主油路流量。当某一阀工作时,该阀在负载压力作用下旁通口减少,根据负载压力提供所需的流量。如今多路阀在机械、冶金、船舶、医药、矿山等行业都发挥着重要的作用，它是带压力补偿的负载敏感比例换向多路阀设备，相信掌握多路阀工作原理对于多路阀的使用具有十分积极的作用。<br />\r\n	・&nbsp;重量：80kg<br />\r\n	・&nbsp;外形尺寸：350mm<br />\r\n	・&nbsp;驱动方式：液动阀<br />\r\n	・&nbsp;作用和用途：调节阀<br />\r\n	・&nbsp;开关方向：直行程<br />\r\n	・&nbsp;结构特征：滑阀形<br />\r\n	・&nbsp;公称通径：大通径阀门DN为350～1200mmmm<br />\r\n	・&nbsp;连接形式：法兰连接<br />\r\n	・&nbsp;特殊功能：波纹管型/阀杆密封<br />\r\n	・&nbsp;阀体材质：金属材料阀门<br />\r\n	・&nbsp;型号：TRM系列<br />\r\n	・&nbsp;品牌：TAIFENG泰丰<br />\r\n	多路阀TRM20-DX-08-YM换向阀，概述TRM系列多路换向阀是目前引进、消化、吸收国内外最新先进技术研制的一种液压控制元件。它可以替代目前国内外使用的各种同规格尺寸及要求的多路换向阀，适用于各种中小型工程机械、农业机械、市政机械如挖掘机、小型装载机、高空作业车等的液压系统。产品特点通过负载压力反馈来提供工作所需的最高压力和流量。显著地节约了能源并有效的保护了整个系统和最大利用了系统的功率<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15000026242jigz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
