INSERT INTO my_information VALUES ('1599','小客车指标_二手车推荐_北京金眼睛','136','1500016688','365','1531552688','小客车指标_二手车推荐_北京金眼睛&nbsp;|&nbsp;北京顺通恒运商业<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;北京顺通恒运车管家俱乐部_二手车供应商_二手车厂家<br />\r\n	北京顺通恒运车管家俱乐部高价收购合法能用二手车,本公司长期高价收购能用二手车：个人及单位。收购合法能用各种面包车&nbsp;，商务车，轿车，客车，小型汽车等！&nbsp;本公司长期高价收购二手车(个人及单位),现金支付,收购快捷,随时上门看车评估收购，公司有一批专业业务人员队伍，并可为顾客提供专业二手车评估师上门评估车辆、信息咨询、常年高价现金收购二手车等。专业的运营、科学的管理，让您享受到全新的规范化收购流程的便利，业务多元化、服务个性化、让您在收购的同时倍感“宾至如归”“诚信商家”&nbsp;不诚勿扰。13011862222','jdyvwmpzal10','赵国平','758266530','758266530@qq.com','010-57156165','0','1','1','','111.201.16.203','北京市联通紫竹桥互联网数据中心','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1600','特大好消息！厦门金母子小儿推拿培训开课啦！快来报名吧！','136','1500017748','365','1531553748','上课时间：7月15日开始上课&nbsp;&nbsp;&nbsp;每周六上课&nbsp;&nbsp;&nbsp;&nbsp;共3天<br />\r\n上课地址：厦门市嘉禾路388号永同昌大厦3A金母子培训中心（SM城市广场附近）<br />\r\n课程内容：<br />\r\n共计：3天&nbsp;&nbsp;&nbsp;&nbsp;理论加实操<br />\r\n课程内容：<br />\r\n第一讲：小儿推拿生理病特点及小儿饮食护理<br />\r\n第二讲：小儿日常保健常用手法及日常保健常用穴位<br />\r\n第三讲：小儿中医体质辩症（舌诊、面诊、手诊）<br />\r\n第四讲：小儿常见病症处理（发烧、感冒、咳嗽）<br />\r\n第五讲：小儿脾胃系统病症处理（厌食、积食、便秘、腹泻）<br />\r\n第六讲：小儿艾灸日常保健法及小儿推拿临床病例分析<br />\r\n第七讲：医院诊所课间见习<br />\r\n报名方式：<br />\r\n1、现场报名：亲临厦门金母子现场报名<br />\r\n2、转帐方式另有支付宝，微信转帐都可以，可详细联系相关工作人员<br />\r\n注：报名成功以付费为准，先付费后上课。一期人数限定25人，缴费可预留名额。<br />\r\n妈妈班学费：1980元/人，免费复训<br />\r\n父母是孩子最好的家庭医生！早一天学习并运用小儿推拿，孩子早受益！<br />\r\n“手”护宝宝健康！不要让孩子输在健康的起跑线上！<br />\r\n【认识小儿推拿的好处】<br />\r\n推拿功效：小儿推拿根据小孩身体娇嫩柔和、脏腑清灵的生理特点，不借助任何药&nbsp;&nbsp;物和抗生素针剂，只通过体表的按摩推拿，在正确操作的前提下，可以有效达到治愈疾&nbsp;&nbsp;病的目的，同时可以改善儿童体质、提高机体免疫力，兼有治疗和保健双重功效。<br />\r\n适应症广：小儿推拿是绿色疗法，不必打针吃药，没有毒、副作用，安全、有效，也不需要医疗器械，手法简单易学，非常适宜儿童家长学习，小儿推拿疗法适应症广&nbsp;泛，大部分儿科病症都可应用，尤其是小儿常见病，如感冒、发烧、咳嗽、腹泻、便秘、厌食、积食等，小儿推拿是首选的治疗方法。从古至今，小儿推拿对儿童的健康成&nbsp;&nbsp;长都起到了很好的防病、治病的作用。<br />\r\n金母子小儿推拿培训讲师：赖新生<br />\r\n◎&nbsp;中医全科医师<br />\r\n◎厦门市中医院推拿理疗科主治医师<br />\r\n◎&nbsp;厦门小鱼社区论坛健康板块斑竹<br />\r\n◎&nbsp;微信公众号“翳之家”博主<br />\r\n◎&nbsp;擅长：小儿疾病与保健推拿<br />\r\n应用推拿手法治疗小儿咳嗽、哮喘、夜啼、腹泻、厌食、小儿肌性斜颈等以及体质调理；成人颈肩腰腿痛、脾胃病的针灸推拿治疗。<br />\r\n金母子拥有一支实力非常强大的教学师资团队，金母子的培训名师在婴幼儿健康行业，均已深耕十余年，可以毫无保留地与学员们传授实战经验，让学员在实际案例中，能够学以致用。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','125.77.223.243','福建省厦门市电信','1','/attachment/information/201707/pre_1500017748ajyrh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
