INSERT INTO my_information VALUES ('1602','上饶股骨头坏死的饮食注意事项','136','1500021902','365','1531557902','衡水股骨头坏死研究所讲解股骨头坏死的饮食注意事项<br />\r\n&nbsp;&nbsp;<br />\r\n一、减少酒类的摄入：<br />\r\n酒类不利于治疗股骨头坏死。饮白酒、啤酒对人体有百害而无一利，只有饮用少量的葡萄酒有软化血管作用，股骨头坏死患者在刚饮酒后会觉得症状减轻，但长期依赖饮酒止痛，对人体危害不减反增，这是股骨头坏死治疗方法中必须做到的。&nbsp;<br />\r\n二、少吃甘厚味食物：如果肥甘厚味吃的过多，活动量又少，使体内血脂增高，血液粘稠度增加，血流缓慢就会不利于治疗股骨头坏死。&nbsp;<br />\r\n三、主食需搭配适宜：治疗股骨头坏死的食物有米、面、杂粮为主，但要做到品种多样，粗细搭配适宜。&nbsp;<br />\r\n四、不宜吃辛辣食物：<br />\r\n股骨头坏死患者不宜吃辛辣食物，不过量饮酒、戒烟，多食用新鲜蔬菜和水果等。这也是治疗股骨头坏死的方法。&nbsp;<br />\r\n亲爱的读者：<br />\r\n真诚的向您推荐衡水股骨头坏死研究所<br />\r\n特色治疗:李氏三联疗法实现了内外兼治，解决了单一口服中药的弊端，因为单一的口服中药，通过胃的吸收、肝的代谢，再通过血液循环把药送到股骨头内，由于股骨头本身就缺血，所以药起到的作用很小，甚至起不到作用。李氏三联疗法通过口服中药调理肝肾，通过<br />\r\n中药离子导入改善股骨头外周的血液循环，配合按摩理疗疏通下肢经络，最关键的是骨内注射直接把活血生骨药物打到股骨头内，直达病灶部位，改善骨内血液循环，没有任何的药物浪费，达到了内外相结合，最终实现了临床治愈的目的，避免了手术置换带来的创伤。<br />\r\n这种治疗方法对于4岁到80多岁的老人都适用。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n健康热线：0318-8880120&nbsp;13730521391&nbsp;0318-2319901&nbsp;&nbsp;&nbsp;&nbsp;0318-2319159<br />\r\n医院地址：衡水市红旗大街1769号<br />\r\n乘车路线：火车站乘18路，市内7路，16路（二白酒厂）站下车即到<br />\r\n官方网站：http://www.ggt120.net','rmbsc476','史主任','','1049845936@qq.com','0318-2319901','0','1','1','','101.74.191.126','河北省联通','1','/attachment/information/201707/pre_1500021902rdupk.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
