INSERT INTO my_information VALUES ('1605','节流阀厂家山东泰丰专业制造','136','1500080807','365','1531616807','节流阀是通过改变节流截面或节流长度以控制流体流量的阀门。将节流阀和单向阀并联则可组合成单向节流阀。节流阀和单向节流阀是简易的流量控制阀，在定量泵液压系统中，节流阀和溢流阀配合，可组成三种节流调速系统，即进油路节流调速系统、回油路节流调速系统和旁路节流调速系统。节流阀没有流量负反馈功能，不能补偿由负载变化所造成的速度不稳定，一般仅用于负载变化不大或对速度稳定性要求不高的场合','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500080807cgllj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1606','DBDS10P溢流阀厂家,泰丰股份,DBDS10P溢流阀供应','136','1500082096','365','1531618096','DBDS10P溢流阀厂家,泰丰股份,DBDS10P溢流阀供应商&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n山东济宁最好的厂家供应山东泰丰溢流阀品牌推荐泰丰。泰丰股份是济宁最好的厂家供应山东泰丰溢流阀品牌。<br />\r\n溢流阀，一种液压压力控制阀。在液压设备中主要起定压溢流作用和安全保护作用。主要作用定压溢流作用:在定量泵节流调节系统中，定量泵提供的是恒定流量。<br />\r\n产品优点:设计灵活&nbsp;，可靠性高，&nbsp;污染耐受力更大，&nbsp;成本较低&nbsp;压力更高，&nbsp;使用寿命更长，便于维护，&nbsp;尺寸较小，&nbsp;工作效率更高，&nbsp;可控型更好，&nbsp;消除了外泄漏并减少了内泄漏。泰丰新设计找济宁最好的厂家供应山东泰丰溢流阀品牌经销商？特别推荐山东泰丰液压股份有限公司。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15000820961idap.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
