INSERT INTO my_information VALUES ('1609','陵县阳光输送设备|广东304乙型网带选购|广东304乙型网带','136','1500083711','365','1531619711','陵县阳光输送设备|广东304乙型网带选购|广东304乙型网带图片&nbsp;|&nbsp;陵县阳光输送设备有限公司<br />\r\n	广东304乙型网带厂家,陵县阳光输送设备,广东304乙型网带产地&nbsp;<br />\r\n	乙型网带&nbsp;<br />\r\n	&nbsp;乙型网带又称乙字型网带、巧克力网带、梯形网带、一字型网带、条状网带。广泛用于电子行业线路板的固化、固熔、烘干，回流焊。制盖行业滴塑烘干；食品行业用于巧克力、饼干、鱼片烘烤、速冻、干燥之用、乙型网带边缘可采用链条驱动。','pbsjo981','王经理','1260842873','1260842873@qq.com','0534-8892643','0','1','1','','27.221.254.60','山东省联通','1','/attachment/information/201707/pre_1500083711gytuw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1610','南平小戏骨方世玉海选之厦门金母子母婴品牌专场freestyl','136','1500085411','365','1531621411','2017年7月8日，湖南电视台《小戏骨之方世玉》福建海选之厦门金母子母婴品牌专场，小朋友们翘首以待中，在厦门悦享中心正式拉开帷幕。此次活动得到了厦门电视台，海峡导报等十几家媒体的大力宣传和支持，小朋友们在舞台上载歌载舞，现场表演freestyle秀，充分展示了自己的才艺，得到了评委老师的高度评价，吸引了一大批现场观众的阵阵掌声。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;活动开始，厦门电视台著名主持人晓奕老师，和现场评委老师们宣布了本次评选活动的宗旨和意义，并向大家讲述了评分细则。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;湖南广播电视台原创推出的《小戏骨》用小演员“演经典、学经典，演偶像、学偶像”巧妙地用“00后”小戏骨挑大梁，“小孩演大人”、“小孩演大剧”，金母子作为母婴培训行业，这正是我们想要看到的优秀教育！<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;小戏骨栏目也吸引着媒体的关注，厦门电视台炫彩生活全程跟踪报道，更有东南网，厦门小鱼网、腾讯网、新浪、搜狐等媒体持续报道。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;此次活动，特别感谢中.国母婴培训行业领导品牌-厦门金母子的鼎力支持！厦门金母子是从事催乳师、小儿推拿师、产后康复师、母婴保健师、中医灸疗师、育婴师培训的大型母婴培训机构，高度的社会责任感，培养了5000多名高技术专业性强的催乳师、小儿推拿师，累计为100多万的新生妈妈，新生儿提供母婴保健服务。小戏骨节目是为了孩子的才艺，心灵健康，厦门金母子是为了孩子的身体健康。二者结合，碰撞出灿烂的火花，小戏骨福建海选之厦门金母子母婴品牌专场取得圆满成功！<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;评选现场，这些小朋友落落大方，有唱歌的，也有讲故事的，别看她们小小的年纪，不论是节奏明快的说唱，还是柔美温婉的舞蹈，&nbsp;亦或愤慨激昂的歌曲，都能轻松HOLD住场，让大家赞叹不已。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;评委老师们认真的评选着，经过几个环节的选拔，最终决出3名小朋友入围，并由金母子负责保送进入海选！让我们共同期待这部“小戏骨之方世玉吧！<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;金母子现场宣布，将和厦门熹优家庭服务有限公司进行合作，共同为宝妈和宝贝提供系列服务。<br />\r\n厦门金母子（www.xmjmz.cn）是全国母婴健康培训行业领军品牌，福建权威正规培训中心，拥有中医药适宜技术职业化培训资质。培训项目包括催乳师、小儿推拿师，产后康复师，母婴保健师、中医灸疗师、中医月子膳食调理师等，&nbsp;2017年成功携手厦门电视台主持人毛晓奕，成为湖南电视台、湖南卫视打造出《白蛇传》《花木兰》的《小戏骨》栏目新剧《方世玉》福建地区海选官方合作机构。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','121.204.216.94','福建省厦门市电信','1','/attachment/information/201707/pre_1500085411b128t.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
