INSERT INTO my_information VALUES ('1612','进油块，换向片，过载阀，溢流阀，7路换向阀','136','1500090077','365','1531626077','&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;重量：&lt;/span&gt;80kg<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;外形尺寸：&lt;/span&gt;350mm<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;驱动方式：液动阀&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;作用和用途：调节阀&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;开关方向：直行程&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;结构特征：滑阀形&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;公称通径：大通径阀门&lt;/span&gt;DN&lt;span&gt;为&lt;/span&gt;&lt;span&gt;350&lt;/span&gt;&lt;span&gt;～&lt;/span&gt;&lt;span&gt;1200mmmm&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;连接形式：法兰连接&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;特殊功能：波纹管型&lt;/span&gt;/&lt;span&gt;阀杆密封&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;阀体材质：金属材料阀门&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;型号：&lt;/span&gt;TRM&lt;span&gt;系列&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;margin-left:18.0000pt;text-indent:-18.0000pt;&quot;&gt;<br />\r\n	・&amp;nbsp;&lt;span&gt;品牌：&lt;/span&gt;TAIFENG&lt;span&gt;泰丰&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&gt;<br />\r\n	&lt;span&gt;多路阀&lt;/span&gt;TRM20-DX-08-YM&lt;a&nbsp;href=&quot;http://www.eastsoo.com/buy/jx-list-1058.html&quot;&gt;&lt;u&gt;&lt;span&gt;换向阀&lt;/span&gt;&lt;/u&gt;&lt;/a&gt;&lt;span&gt;，概述&lt;/span&gt;TRM&lt;span&gt;系列多路换向阀是目前引进、消化、吸收国内外最新先进技术研制的一种液压控制元件。它可以替代目前国内外使用的各种同规格尺寸及要求的多路换向阀，适用于各种中小型工程机械、农业机械、市政机械如挖掘机、小型装载机、高空作业车等的液压系统。产品特点通过负载压力反馈来提供工作所需的最高压力和流量。显著地节约了能源并有效的保护了整个系统和最大利用了系统的功率&lt;/span&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;text-indent:10.5000pt;&quot;&gt;<br />\r\n	联系人：刘海洪<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;text-indent:10.5000pt;&quot;&gt;<br />\r\n	手机：18660757371<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&gt;<br />\r\n	&amp;nbsp;&amp;nbsp;&lt;span&gt;固话：&lt;/span&gt;0537-2718387<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;text-indent:10.5000pt;&quot;&gt;<br />\r\n	联系人：刘海洪<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&nbsp;style=&quot;text-indent:10.5000pt;&quot;&gt;<br />\r\n	手机：18660757371<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;class=&quot;MsoNormal&quot;&gt;<br />\r\n	&amp;nbsp;&amp;nbsp;&lt;span&gt;固话：&lt;/span&gt;0537-2718387<br />\r\n&lt;/p&gt;<br />\r\n&lt;p