INSERT INTO my_information VALUES ('1638','白吊装带','136','1500253457','365','1531789457','江苏兴胜吊具有限公司⑤②③-⑧⑥⑨③⑤⑧①⑧http://www.jsxingsheng.com/bsdzd.htm生产白色吊装带，白吊装带，白色扁吊带，白色扁吊装带，白色扁平吊装带，白色扁平吊带。<br />\r\n兴胜产品在国内外市场已有相当的市场份额、产品知名度不断提高&nbsp;半成品彩色吊装带价格，公司产品也已经顺利通过ISO9001、CE和GS国际认证，产品也成功挺进中、北欧市场，遍布全球的销售网络正在不断扩大。<br />\r\n1.高强耐酸碱吊带是作业中较为理想的吊带，由于其接触面较宽且平整，不易损伤被吊物。<br />\r\n白色吊装带与彩色吊装带的区别就是原材料不同，彩色吊装带的原材料延展性能好，大吨位的吊装带一般都是彩色的，白色的吊装带只能做到50吨，白色吊装带的好处就是在一些酸碱的环境下可以正常使用，而且紫外线也伤害不到白色吊装带的安全系数，这是彩色吊装带无法比拟的','xuyingtex','徐英特','864050671','xssling@126.com','0523-86935835','0','1','1','','121.230.237.161','江苏省泰州市兴化市电信','1','/attachment/information/201707/pre_1500253457vtvsh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1639','山东泰丰4WE系列电液阀专业供应','136','1500254146','365','1531790146','电液阀是一种软活塞结构电液阀,适应范围广,具有优异的恒流与多段控制功能。相对膜片电液阀，具有线性控制优异，等速响应可调，高流量时低压降小流量可稳定的控制在每一秒一升一下，具有恒流量功能。能很好的解决过冲问题，消除水击现象。以及寿命长。付油精度高等特点。是一种对输送介质的流量、流速实现自动化控制的先进执行器。适宜作为石油、化工、冶金、电力、食品等管道储运中的自动化控制执行装置使用，经中石化、中石油多个油库使用证明该阀性能优异，解决了国内(仿制国外产品)的多功能电液阀水击严重、膜片寿命短、计量不准确(无小流量)等问题，是替代进口产品的首选。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15002541467jwgy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
