INSERT INTO my_information VALUES ('1641','山东梦雅收银机价格招商|收银机价格加盟','136','1500255466','365','1531791466','梦雅收银机价格面向全国火热招商。<br />\r\n外接显示屏，上广告分利润不中毒，不宕机，数据不丢失设备核心硬件由金融机具上市公司生产扫码销售，可外接电子秤，标签打印机内置3G物联卡，省去牵拉网线的成本远程自动升级，无需购买新设备、新软件，软件能强大，支持微信支付、支付宝支付（红包、零钱也能用于支付）、百度钱包、QQ钱包、京东钱包、翼支付等多种在线支付方式，什么钱都能行，还可通过支付平台补贴门店打折促销费用，帮助门店做活动，在选择收银机机、POS机的时候，我们<br />\r\n考虑的第一点应是选择实用还是选择豪<br />\r\n华。因为任何机器都不是万能的，它可<br />\r\n能满足我们95%或98%的需求，但它绝不<br />\r\n可能使我们100%的满意。<br />\r\n选收银机要考虑以下几点：<br />\r\n1.质量还有价格，进口的虽好，可能价高<br />\r\n，在保证利润的状况下，可以考虑国产。<br />\r\n2.软件是否方便，方便的软件可以是效<br />\r\n率提升。<br />\r\n3.耗材的费用，用的打印纸跟色带否很贵<br />\r\n也要考量。收银机价格加盟项目就找青州梦雅科技。梦雅收银机价格招商热线：0138-64617160','bydzgs168','梦雅','364949376','2262363225@qq.com','0138-64617160','0','1','1','','182.32.200.107','山东省济南市电信','1','/attachment/information/201707/pre_1500255466ppv4k.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1642','泰丰股份|500吨双泵系统阀组厂家|500吨双泵系统阀组批发','136','1500256557','365','1531792557','泰丰股份|500吨双泵系统阀组厂家|500吨双泵系统阀组批发&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	YT32-500CV-SB天津双泵500吨系统，主单独调压，无球阀支撑<br />\r\n	<br />\r\n		&nbsp;山东泰丰液压股份有限公司生产的二通插装阀系列产品，品种繁多，规格齐全：从&nbsp;Dg16&nbsp;到&nbsp;Dg160&nbsp;通径均可批量生产，流量范围为：63&nbsp;L/min-15000L/min.<br />\r\n	<br />\r\n	<br />\r\n		泰丰生产的二通插装阀可供客户选择的型号有：<br />\r\n1.YN32-100FXCV<br />\r\n2.YN32-100GSCV&nbsp;带快速缸，下腔Dg10<br />\r\n3.YN32-100FBCV&nbsp;不带顶出缸<br />\r\n4.YN32-100GSBCV&nbsp;不带顶出缸<br />\r\n5.YT32-100RCV&nbsp;不带顶出缸<br />\r\n6.YX32-100DCV&nbsp;不带快速缸，下腔Dg20<br />\r\n7.YZ32-100BCV&nbsp;差动不带顶出缸<br />\r\n8.YZ32-100CV-00R二通插装阀<br />\r\n9.YH32-200TCV二通插装阀<br />\r\n10.XP2CEF-315CV-00b&nbsp;Dg16/25变径<br />\r\n11.YN32-315HGCV&nbsp;均为Dg25<br />\r\n12.YN32-315HGLBCV&nbsp;不带顶出缸，均为Dg25<br />\r\n13.YJ32-315GLCV&nbsp;均为Dg25，下腔带支撑<br />\r\n14.YT32-315BCV&nbsp;Dg16/25变径，不带顶出缸<br />\r\n15.YT32-500CV-SB&nbsp;双泵，不带支撑<br />\r\n16.YT32-500CV-DB&nbsp;单泵，不带支撑<br />\r\n17.YT32-500BCV-SB双泵，均为Dg25，不带支撑，不带顶出缸<br />\r\n18.YT32-500BCV-DB&nbsp;单泵，均为Dg25，不带支撑，不带顶出缸<br />\r\n19.YTD32-500DCV双泵，均为Dg25，带支撑<br />\r\n20.YN32-500HECV&nbsp;均为Dg25，双泵，一泵单独泄压<br />\r\n21.YTD32-500DCV&nbsp;双泵，均为Dg25，带支撑<br />\r\n22.YW32-500CV&nbsp;单泵，均为Dg25，带支撑<br />\r\n23.YN32-500HECV&nbsp;均为Dg25，双泵，一泵单独泄压<br />\r\n24.YN32-500HEBCV&nbsp;500HE不带顶出缸<br />\r\n25.YN32-1250ECV&nbsp;均为Dg32，双泵<br />\r\n26.YN32-1250EBCV不带顶出缸<br />\r\n27.YJ32-315BCV&nbsp;带支撑，不带顶出缸，均为DG25<br />\r\n28.YN32-1250CV-00A顶出缸Dg32，主缸下腔Dg40，主缸上腔Dg32，带支撑<br />\r\n29.XN32-300CV-00A&nbsp;快速缸，单泵，快速缸排油阀为Dg32，其余Dg25<br />\r\n30.XNB29-250CV-00A<br />\r\n31.XNB32-500BCV-00A<br />\r\n32.XNB32-500JCV-00A<br />\r\n33.YX32-500CV-00A<br />\r\n34.YN32-1250BXCV<br />\r\n35.YN32-1250CV','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500256557fpsaz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.000