INSERT INTO my_information VALUES ('1660','4WE系列电磁阀山东泰丰专业供应','136','1500340264','365','1531876264','电磁阀是用电磁控制的工业设备，是用来控制流体的自动化基础元件，属于执行器，并不限于液压、气动。用在工业控制系统中调整介质的方向、流量、速度和其他的参数。电磁阀可以配合不同的电路来实现预期的控制，而控制的精度和灵活性都能够保证。电磁阀有很多种，不同的电磁阀在控制系统的不同位置发挥作用，最常用的是单向阀、安全阀、方向控制阀、速度调节阀等。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500340264y2de1.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1661','河北消防排烟风机箱设备厂家销售','136','1500340339','365','1531876339','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.154.58','山东省德州市电信','1','/attachment/information/201707/pre_1500340339hywbq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1662','注塑机阀块厂家_泰丰股份_注塑机阀块批发','136','1500340655','365','1531876655','注塑机阀块厂家_泰丰股份_注塑机阀块批发&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份HTL4900-4-18注塑机阀块，压力阀板装PQ阀，泰丰股份阀座式阀在液压系统中已使用多年，它们通常被称为两通单向阀。以这种方式，它们用作单，允许沿一个方向自由流动，而封闭反向流动。经过某些改进，这种阀可受控制而克服正常封闭作用，从而可以沿两个方向控制流动。<br />\r\n	高的控制，泰丰插装阀满足了这些需要。<br />\r\n	产品优点:设计灵活&nbsp;，可靠性高，&nbsp;污染耐受力更大，&nbsp;成本较低&nbsp;压力更高，&nbsp;使用寿命更长，便于维护，&nbsp;尺寸较小，&nbsp;工作效率更高，&nbsp;可控型更好，&nbsp;消除了外泄漏并减少了内泄漏。泰丰新设计&nbsp;<br />\r\n	一般来说，二通插装阀用于较大流量的液压系统，目的在于使其高效、更快捷和紧凑。泰丰已经开发的新型TLC二通插装阀和新型TLFA控制盖板采用先导控制、座阀主极、插装式连接的模块化、可配组的集成化液压控制元件，可广泛用于各种固定和移动液压系统的集成控制。产品安装连接尺寸符合ISO&nbsp;7368，&nbsp;DIN&nbsp;24342和GB2877.如今的机械需要成本效益都特别','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500340655f940o.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
