INSERT INTO my_information VALUES ('1703','皮肤系统障碍 白癜风 湿疹等上海矽尚生物科技','136','1500430278','365','1531966278','忍受牛皮癣折磨二十年，自杀多次终治愈!&nbsp;<br />\r\n	我山东菏泽巨野县的一个乡镇的领导，二十年前，突然发现背上长了一小块白皮，谁能想到，这一小块皮屑就是我噩梦的开始，正是这个噩梦苦苦折磨了我二十多年。自从患上了牛皮癣，工作也没法干了，只好请长期病假。痛苦一言难尽，这些年一天天的度日如年，最难忍受的时候家务活都不能干，身上的皮紧的弯腰都弯不下，腿也蹲不下，疼痛难忍，后来严重到皮肤往外渗出血水、脓水、脏水，一夜的时间枕头、被子都能浸湿。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	为了治好牛皮癣，我二十多年来，到处奔波，四处求医，走遍了大大小小的私立、公立医院，拜访了无数名医，试了无数的偏方、药方，罪受了很多，家里花的倾家荡产，欠了20多万的债，其间我在齐齐合尔和西安被所谓神医、妙方两次骗去近十万元。令人意想不到的是，牛皮癣不但没有治好，反而更加的严重。多年来，疾病康复无望，还要继续承受病痛的折磨。我是个好强又要面子的人，曾经三次自杀被家人和亲友劝阻，欲哭无泪。','yeaxing123','张先生','395998237','395998237@qq.com','0370-2690016','0','1','1','','42.228.113.220','河南省郑州市联通','1','/attachment/information/201707/pre_1500430278gqbko.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
