INSERT INTO my_information VALUES ('1740','至尊棋牌房卡版技巧|如何成为一个合格的斗地主高手 济宁','136','1500503991','365','1532039991','至尊棋牌房卡版技巧|如何成为一个合格的斗地主高手<br />\r\n欢迎联系咨询客服：15973218005<br />\r\n《至&nbsp;尊&nbsp;棋&nbsp;牌》牛&nbsp;&nbsp;牛&nbsp;.赢&nbsp;三&nbsp;张&nbsp;.骰&nbsp;&nbsp;宝.&nbsp;万人&nbsp;牛&nbsp;牛&nbsp;.zha&nbsp;金&nbsp;&nbsp;花&nbsp;.杰&nbsp;克&nbsp;21点&nbsp;.广式&nbsp;三公。<br />\r\n记牌<br />\r\n（1）根据自己手里的牌，记住没有的牌，时刻关注是否出过这些牌。牌局中断根据别人手里是否有炸弹灵活调整策略；<br />\r\n（2）记住地主是否出过亮在牌面上的三张底牌，精确到花色，以此来<br />\r\n推断是否有炸，是否有连，几手牌等；<br />\r\n（3）重点记住&quot;王&quot;、&quot;2&quot;、&quot;&nbsp;A&quot;，推算每个人的张数；<br />\r\n（4）记住&quot;10&quot;和&quot;7&quot;,如果&quot;10&quot;和&quot;7&quot;出光，就可断定没有顺子了。<br />\r\n叫牌<br />\r\n（1）牌整齐，有1~3手绝对大牌可以叫牌；<br />\r\n（2）忌赌底牌式叫牌；<br />\r\n（3）叫地主前，先看一下对手的基本信息，胜率/局数，对手是激进型还是保守型，是新手还是老手，做到心中有数。<br />\r\n出牌<br />\r\n一，地主篇<br />\r\n（1）“借力打力，后发制人”，放上家打下家；<br />\r\n（2）轻易不暴漏弱点，被人看出缺对或者缺单就很难打了；<br />\r\n（3）巧用节奏，虚虚实实；<br />\r\n（4）留住一手大牌，关键时刻救命。<br />\r\n二，农民篇<br />\r\n　　（1）压多，估计判断地主牌型，如果地主单多，死都要顶住；如果对多，则要顶住地主的对子；<br />\r\n　　（2）攻少，与压多相对，地主缺什么，则攻击什么；<br />\r\n　　（3）巧用单K，这是有讲究的，如能破开地主的对A或者对2，后面往往会收到奇效；如果地主压A，则同伙可出2获取牌权；<br />\r\n　　（4）以防为主，自己的牌特别好时可转当攻击手；<br />\r\n　　（5）单不放10，双不过6；<br />\r\n　　（6）讲究配合，不轻易放弃。<br />\r\n拆牌<br />\r\n　　拆牌的原则就是两个字：大、少<br />\r\n　　（1）大，牌面牌型尽可能大；<br />\r\n　　（2）少，拆牌后手数尽可能少。<br />\r\n尾牌<br />\r\n　　（1）在对手剩下最后3张牌时，你就是有炸也先不要炸（特别情况除外）。一般情况下，那3张牌起码两手牌。对手多半会留一张，或者出大对子搏命赌你没炸，这个时候，你多半就要开始笑啦，因为你胜券在握；<br />\r\n　　（2）剩三张单时，出中单的胜率最大。如果成功搏下了对手的最大牌，则自己的大牌成为最大牌的概率大增。<br />\r\n欢迎联系咨询客服：15973218005','q15973218005','冯涛','446049840','2780724925@qq.com','0731-0731-55573567','0','1','1','','113.221.152.26','湖南省电信','1','/attachment/information/201707/pre_1500503991u1q2e.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
