INSERT INTO my_information VALUES ('1754','骨胳肌肉系统障碍：颈椎病上海生物科技公司','136','1500514865','365','1532050865','王某，女33岁，家住黑龙江省鸡西市，高中时患类风湿症，十几年多方医治，结果愈加严重：手指偏弯、脊柱强直、牙齿松动、挪步艰难，双手端不住饭碗，多次产生轻生之念。2016年6月经朋友介绍买到干细胞活化素体验装三瓶，患者于2016年7月份开始服用，一周后感觉症状有所缓解，两个月后活动机能明显好转，能做一些简单家务，偶尔还随同伴们跳跳舞。数月后经检查怀孕，大喜之余，更有单膝（据以前的诊断医生讲此患者好转和生育是不可能的）。2017年3月28日她平安生下一男孩，家人万分惊喜，现已痊愈。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;专家坐诊V信：xyw21009','yeaxing123','张先生','395998237','395998237@qq.com','0370-2690016','0','1','1','','42.228.112.30','河南省郑州市联通','1','/attachment/information/201707/pre_1500514865b7b5a.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
