INSERT INTO my_information VALUES ('1761','泰丰股份|电磁换向阀4WE10U供应商|电磁换向阀4WE10','136','1500517807','365','1532053807','泰丰股份|电磁换向阀4WE10U供应商|电磁换向阀4WE10U图片&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	泰丰电磁换向阀4WE10U三位四通阀门厂家批发价泰丰电磁换向阀4WE10U三位四通阀门厂家批发价泰丰电磁换向阀4WE10U三位四通阀门厂家批发价电磁换向阀是用电磁铁直接推动阀芯移位工作的小型方向控制阀，主要用于控制液体的通断和流动方向，也可作为先导控制阀，以控制各种大通径的液压阀，实现对大功率液压阀的先导控制<br />\r\n	特点:<br />\r\n	以直动式电磁铁操作方向滑阀作为标准类型<br />\r\n	安装面符合DIN24340&nbsp;A型&nbsp;ISO&nbsp;4401和CETOP-RP121H<br />\r\n	带可拆卸线圈的湿式直流或交流电磁铁<br />\r\n	电磁铁可旋转90度<br />\r\n	可以迅速而方便的更换电磁铁线圈而不引起液压系','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500517807b4iyx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
