INSERT INTO my_information VALUES ('1765','厂家供应电子厂用防静电除尘滤袋集尘布袋防尘袋','136','1500524385','365','1532060385','电子厂用防静电除尘滤袋集尘布袋防尘袋。<br />\r\n	&nbsp;&nbsp;明辉滤袋是专业生产定制除尘布袋的厂家，可生产供应电子厂用防静电除尘布袋导电性能强，抗静电效果佳。<br />\r\n&nbsp;&nbsp;工业粉尘在浓度达到一定程度后（即极限）如遇静电放电火花或外界点火等因素，则极易导致和火灾。如：电子厂、面粉尘、化工性粉尘、煤粉尘等如遇静电放电都有的可能。在袋式除尘领域，如这些粉尘需用布袋来收集，则要求制做除尘布袋的滤料具有防静电性。&nbsp;<br />\r\n&nbsp;&nbsp;明辉滤袋生产抗静电除尘布袋除了具有生产普通针刺毡的工艺外，还要求在生产针刺毡的基布的经纱中并入导电纤维纱或在化学纤维中混入导电纤维或导电材料，我厂这两种类型的抗静电滤布均可生产。&nbsp;我公司生产的防静电针刺过滤毡及滤布其性能指标在国内处于领先水平，已经过权威部门测试。&nbsp;加导电纤维涤纶防静电针刺毡可用涤纶长丝基布制造。<br />\r\n电子厂防静电除尘袋找明辉滤袋&nbsp;微信号：fnbhzm<br />\r\n	&nbsp;&nbsp;明辉还可供应各类常温中温高温除尘布袋，如涤纶，涤纶三防，亚克力、pps、氟美斯、美塔斯、ptfe等，材质齐全，规格尺寸可定做，一条起订。','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.102.106','江苏省盐城市电信','1','/attachment/information/201707/pre_1500524385uu1se.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
