INSERT INTO my_information VALUES ('1776','丢丢定制_定制广告衫_T恤批发','136','1500543039','365','1532079039','丢丢定制_定制广告衫_T恤批发&nbsp;|&nbsp;济宁市丢丢定制网络科技有限公司<br />\r\n	个性定制T恤衫，广告衫，文化衫，厂家货源，批发零售，本厂为鲁西南最大服装设计制造企业之一,公司位于济宁市经济技术开发区,自有产权土地35亩、经过一期和二期的建设,己经完成投资额6000万元,建成厂房面积18000平米。&nbsp;<br />\r\n	公司主要从事针织休闲类服装服饰的企划、设计、生产和出口，拥有最先进的服装CAD设计系统、自动裁剪、成衣系统、数码喷印热转技术和各类丝印技术设备、日本田岛和百灵达绣花机6台。&nbsp;<br />\r\n	公司业务主要分为国内外知名品牌做OEM生产和国内市场开发自有品牌,　主要OEM客户有韩国衣恋、日本迪斯尼、ＫＡＰＰＡ以及李宁、３６１等国内外知名品牌，年销售收入６０００万。是经衣恋、迪斯尼、ＮＥＷ　ＢＡＬＡＮＣＥ认证并指定生产出口商。&nbsp;<br />\r\n	公司的国内市场销售是以电子商务平台“丢丢定制网站（www.diu8diu.com）”下的代理网络为主要渠道，现有全国600余所大学社团代理，涵盖全国各大知名院校和大中专、职业技校。“丢丢定制网站”上线以来日均访问人数8000人，日电子商务销售订单2000份以上，2014年线上电子商务销售收入1600万元。被山东省商务厅认定为“山东省电子商务重点示范企业”。&nbsp;<br />\r\n	个性定制圆领T恤，POLO衫，工装，团体装，文化衫，广告衫','imjib983','梁丽','970642884','120658115@qq.com','0537-2787802','0','1','1','','218.57.204.42','山东省济宁市联通','1','/attachment/information/201707/pre_1500543039hytdv.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1777','科技园开荒保洁哪家好_清新家园清洁服务_坑子保洁公司','136','1500544838','365','1532080838','科技园开荒保洁哪家好_清新家园清洁服务_坑子保洁公司&nbsp;|&nbsp;深圳市清新家园清洁服务有限公司清洁服务<br />\r\n清新家园清洁服务_科技园开荒保洁哪家好_南山清洁服务价格<br />\r\n	了解开荒保洁一般流程：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;清新家园清洁服务、133&nbsp;1646&nbsp;6444&nbsp;<br />\r\n	<br />\r\n	　　对于咬紧牙自己做保洁的业主，清洁方法和工具都比较有限，这里也就不多讲。而对于选择广州家事无忧保洁公司的业主来说，虽说不用自己亲自动手，但是还是需要了解一下保洁需要做的内容，以及一些易被忽略的部位的清洁。毕竟是自己花了钱的，当然希望能够做到尽善尽美。<br />\r\n	<br />\r\n	　　01&nbsp;保洁第一步：清除垃圾与除尘<br />\r\n	<br />\r\n	　　装修后，地面等都会积累了较多的装修垃圾。因此开荒保洁的第一步就是情理房屋里的装修垃圾，为下一步清洁扫除障碍。然后用多功能吸尘器由上到下全面吸尘，也可以用鸡毛掸子全面拂尘。<br />\r\n	<br />\r\n	　　02&nbsp;重点空间的清洁：厨房+卫生间<br />\r\n	<br />\r\n	　　坚持由上而下的原则，首先认清吊顶材质，看是PVC、铝塑板还是涂料，再根据不同的材质用不同的清洁方法;用清洁球或是板刷清洗墙壁，着重清洗瓷砖缝隙和瓷砖表面上遗留的胶迹、涂料点、水泥渍等;用毛巾清洁卫生间的洁具，用不锈钢清洗液针对各种龙头、管件进行清洁;用洗地机对地面进行最后的清洁，尤其是地面的边角，用清洁球和刀片对洗地机洗不到的角落进行针对性的除污、去除水泥渍等。<br />\r\n	<br />\r\n	　　03&nbsp;重点部位清洁：玻璃清洁<br />\r\n	<br />\r\n	　　先用毛巾把玻璃框擦拭干净，再用涂水器沾稀释后的玻璃水溶液，均匀的从上到下涂抹玻璃，有顽固的污渍用铲刀清除干净，再重复以上工序后用刮子从上到下刮干净，用干毛巾擦净框上留下的水痕，玻璃上的水痕用鹿皮巾擦拭干净。<br />\r\n	<br />\r\n	　　04&nbsp;重点部位清洁：门与框<br />\r\n	<br />\r\n	　　分清门的材质，用专业清洁剂稀释后，用毛巾擦拭，程序也是从上到下，把毛巾叠成方块，从门的顶部开始从左到右的擦拭，不能有遗漏，有胶渍的地方可用除胶剂做处理;框的程序同门;一定要做到无遗漏、无死角。<br />\r\n	<br />\r\n	　　05&nbsp;清洁收尾：地面清洁<br />\r\n	<br />\r\n	　　把所有的做完以后，最后就是地面的清洗了。清洁前，需要分清楚地面是木地板、瓷砖还是石材的，根据材料选择专用清洁剂稀释清洗。地面上的胶渍可用刀片清除，顽固的可用去胶剂处理;而对于地脚线，可用用毛巾擦拭，用刀片去掉各种胶迹、涂料点等;<br />\r\n	<br />\r\n	　　06&nbsp;勿忽视角落等细节部位的清洁<br />\r\n	<br />\r\n	　　开荒保洁并不仅仅包含上面5点，它还包括很多家居细节部位的清洁。看看下表中列出的几点，在开荒保洁时需要督促保洁公司不要忘记这几个部位的清洁。<br />\r\n	<br />\r\n	　　易被忽略的清洁角落<br />\r\n	<br />\r\n	　　玻璃、镜子边角：在玻璃的边角部位，记得一定要将手印、水痕彻底清除。另外，室内外的窗框、飘窗下的窗台等的边角部位也应该重点清洁好。<br />\r\n	<br />\r\n	　　橱柜内部及顶部：在安装橱柜的时候会因为打磨橱柜的石材表面而产生大量的粉尘，虽然安装后清理了一次，但在开荒保洁时需要进行更精细的清洁。<br />\r\n	<br />\r\n	　　推拉门轨道及窗轨：推拉门下方的轨道及窗轨是比较容易存留建筑垃圾和尘土的地方，在长期不做清洁或清洁不彻底的情况下反复推拉、开关门窗都有可能损坏开合零件、造成卡滞或开合不畅等问题。<br />\r\n	<br />\r\n	　　开荒保洁是在家屋清洁中最艰苦，最复杂，最费神的工作，而且清洁程度的好坏直接影响到日后的保洁质量的档次，所以说做好开荒工作是很重要的，广州家事无忧是一家专业保洁公司，拥有先进的清洁工具跟专业的清洁人员，生活有我，家事无忧，广州家事无忧竭诚为您解决开荒保洁难题。<br />\r\n	&nbsp;&nbsp;&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;联系方式;&nbsp;&nbsp;133&nbsp;1646&nbsp;6444&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;深圳清新家园清洁服务有限公司&nbsp;&nbsp;&nbsp;&nbsp;http://www.qxjy66.com&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;友情链接:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.qxjy66.com深圳清新家园清洁服务有限公司13316466444&nbsp;&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.yw999.cc&nbsp;&nbsp;99玖商城&nbsp;&nbsp;&nbsp;99玖商城入驻&nbsp;&nbsp;&nbsp;清洁设备&nbsp;&nbsp;户外用品&nbsp;&nbsp;服装&nbsp;高空设备&nbsp;<br />\r\n	<br />\r\n		&nbsp;&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;http://www.qxjyfs.com&nbsp;&nbsp;深圳清新家园开荒保洁&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.yw99.cc信息发布平台&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;<br />\r\n	<br />\r\n深圳市清新家园清洁服务有限公司提供清新家园清洁服务_科技园开荒保洁哪家好_南山清洁服务价格','yw999999','蒲生','1535546612','3369774560@qq.com','0755-28801006','0','1','1','','183.13.12.38','广东省深圳市电信','1','/attachment/information/201707/pre_1500544838jehyt.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
