INSERT INTO my_information VALUES ('1822','上料架价格|三科机械|彩钢上料架批发','136','1500606035','365','1532142035','上料架价格|三科机械|彩钢上料架批发&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n	涨紧上料架是彩钢设备的专业上料架，结构简单，制作精良，使用广泛，承重大，理论承重在3.5-5吨以内，是应用最广泛的一种上料架，一套分为两部，一个是底坐，一个是轴芯。<br />\r\n	涨紧上料架产品结构设计合理，不断更新换代，节约能量，产品被广泛应用于各种压型设备。<br />\r\n	涨紧上料架也同属于彩钢上料架的一种，比简易上料架要复杂一些，操作上简单，易用性强，还附有刹车片，主要由卷芯和支架两部分组成，卷芯两头有轴承可以自由旋转，卷芯的轴为实心轴，坚固耐用，不变形，是彩钢设备的配套要配件。<br />\r\n	涨紧上料架承载能力大，使用寿命也较长。其特征在于：带刹车，涨芯，其包括机座，所述机座的两端分别安装有丝杆，一侧的丝杆连接带轮，所述两边的丝杆分别套装连接套环，所述套环分别连接支架，所述支架分别通过两侧的侧板镶装于所述机座的表面，所述支架分别通过转轴连接锥形架。<br />\r\n	<br />\r\n		云南涨紧上料架　广西涨紧上料架　<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		销售电话：15373365336微信同号<br />\r\n	<br />\r\n	<br />\r\n		联系人：刘经理<br />\r\n	<br />\r\n	<br />\r\n		qq;3314322143<br />\r\n	<br />\r\n	<br />\r\n		公司传真：0317-8040347<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		公司网址：<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					<br />\r\n						www.sklwjx.com','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','120.10.126.16','河北省沧州市联通','1','/attachment/information/201707/pre_1500606035t916j.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
