INSERT INTO my_information VALUES ('1824','厦门催乳师培训哪家好？金母子8月份中医催乳师培训开课通知','136','1500608208','365','1532144208','催乳师培训开课：8月8号<br />\r\n培训时间：15天<br />\r\n培训方式：理论、实操<br />\r\n报名热线：400-9983-693，13720881939，13850081535微信报名：fantl_520<br />\r\n官方网站：www.xmjmz.cn<br />\r\n报名、培训地址：厦门市嘉禾路388号永同昌大厦3A金母子培训中心<br />\r\n项目介绍<br />\r\n催乳师是指采用人身经络调理、中医按摩推拿等技术手段，为产妇产后少乳、无乳、乳房胀痛、乳汁淤积、乳腺管阻塞、急性乳腺炎等哺乳期乳腺症状妇女提供催乳保健服务与乳房美体的专业人员。<br />\r\n就业方向<br />\r\n催乳师一般自主创业，开设催乳服务中心；或者是在家政服务公司、母婴护理中心、产后恢复机构、社区服务中心从事催乳工作；催乳师服务是按照疗程收费，一个疗程1―2个小时，收费300―500元左右，是一个月收入超万元的金领新职业。<br />\r\n培训目标及要求<br />\r\n1、培训项目名称：催乳师服务技术培训。<br />\r\n2、培训等级：催乳服务技术证。<br />\r\n3、培训目的：培养一大批数以万计的具有相关母乳喂养知识与催乳师服务技能、适应社会需求、胜任母乳喂养咨询与催乳师服务各项任务的复合型、应用型专业人才队伍。<br />\r\n4、培训对象：中专以上学历水平的催乳师从业人员或有志于从事催乳师服务工作的人员培训与评估。<br />\r\n5、培训期限：催乳培训为15天，分为课堂讲授与现场实践.、临床实操三个部分。<br />\r\n6、招生对象和申请条件：18--55岁女性，有志从事催乳服务事业的各界人士。<br />\r\n培训优势<br />\r\n一，品牌优势：厦门金母子健康咨询有限公司，是由国家中医药管理局、中.国中医药科技开发交流中心授权的大型培训中心，福建省正规权威培训中心，国家承认的教学培训机构。<br />\r\n二，师资优势：金母子拥有业内最强大师资团队，均为国家中医药管理局注册师资，从事母婴行业和中医行业十多年经验，有着丰富的实操服务经验和母婴培训经验。<br />\r\n三，教学优势：金母子教学内容，每个项目都严格按照相关的国.家.职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。并提供专业理论教学+真人产妇实操+营销基础等特色教学服务。理论结合实践，学员可到医院和诊所见习。力争让每位学员都学到真本领。<br />\r\n四，证书优势：金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n五，项目优势：金母子母婴培训机构拥有催乳师、小儿推拿师，产后康复师，母婴保健师、中医灸疗师、中医月子膳食调理等六大专业，覆盖范围.最广，技能最全，学员选择方向多，一专多能，必将成为母婴服务行业的佼佼者！','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.23.242','福建省厦门市电信','1','/attachment/information/201707/pre_1500608208egwzr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1825','科技园开荒保洁哪家好|清新家园清洁服务|南山清洁服务价格','136','1500608933','365','1532144933','科技园开荒保洁哪家好|清新家园清洁服务|南山清洁服务价格&nbsp;|&nbsp;深圳市清新家园清洁服务有限公司清洁服务&lt;br&nbsp;/&gt;龙华开荒保洁哪家好_坑子楼盘开荒保洁&nbsp;_清新家园清洁服务&lt;br&gt;&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	了解开荒保洁一般流程：&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&lt;a&nbsp;href=&quot;http://www.qxjy66.com&quot;&nbsp;target=&quot;_blank&quot;&gt;&nbsp;清新家园清洁服务、133&nbsp;1646&nbsp;6444&lt;/a&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　对于咬紧牙自己做保洁的业主，清洁方法和工具都比较有限，这里也就不多讲。而对于选择广州家事无忧保洁公司的业主来说，虽说不用自己亲自动手，但是还是需要了解一下保洁需要做的内容，以及一些易被忽略的部位的清洁。毕竟是自己花了钱的，当然希望能够做到尽善尽美。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　01&nbsp;保洁第一步：清除垃圾与除尘<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　装修后，地面等都会积累了较多的装修垃圾。因此开荒保洁的第一步就是情理房屋里的装修垃圾，为下一步清洁扫除障碍。然后用多功能吸尘器由上到下全面吸尘，也可以用鸡毛掸子全面拂尘。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　02&nbsp;重点空间的清洁：厨房+卫生间<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　坚持由上而下的原则，首先认清吊顶材质，看是PVC、铝塑板还是涂料，再根据不同的材质用不同的清洁方法;用清洁球或是板刷清洗墙壁，着重清洗瓷砖缝隙和瓷砖表面上遗留的胶迹、涂料点、水泥渍等;用毛巾清洁卫生间的洁具，用不锈钢清洗液针对各种龙头、管件进行清洁;用洗地机对地面进行最后的清洁，尤其是地面的边角，用清洁球和刀片对洗地机洗不到的角落进行针对性的除污、去除水泥渍等。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　03&nbsp;重点部位清洁：玻璃清洁<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　先用毛巾把玻璃框擦拭干净，再用涂水器沾稀释后的玻璃水溶液，均匀的从上到下涂抹玻璃，有顽固的污渍用铲刀清除干净，再重复以上工序后用刮子从上到下刮干净，用干毛巾擦净框上留下的水痕，玻璃上的水痕用鹿皮巾擦拭干净。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　04&nbsp;重点部位清洁：门与框<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　分清门的材质，用专业清洁剂稀释后，用毛巾擦拭，程序也是从上到下，把毛巾叠成方块，从门的顶部开始从左到右的擦拭，不能有遗漏，有胶渍的地方可用除胶剂做处理;框的程序同门;一定要做到无遗漏、无死角。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　05&nbsp;清洁收尾：地面清洁<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　把所有的做完以后，最后就是地面的清洗了。清洁前，需要分清楚地面是木地板、瓷砖还是石材的，根据材料选择专用清洁剂稀释清洗。地面上的胶渍可用刀片清除，顽固的可用去胶剂处理;而对于地脚线，可用用毛巾擦拭，用刀片去掉各种胶迹、涂料点等;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　06&nbsp;勿忽视角落等细节部位的清洁<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　开荒保洁并不仅仅包含上面5点，它还包括很多家居细节部位的清洁。看看下表中列出的几点，在开荒保洁时需要督促保洁公司不要忘记这几个部位的清洁。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　易被忽略的清洁角落<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　玻璃、镜子边角：在玻璃的边角部位，记得一定要将手印、水痕彻底清除。另外，室内外的窗框、飘窗下的窗台等的边角部位也应该重点清洁好。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　橱柜内部及顶部：在安装橱柜的时候会因为打磨橱柜的石材表面而产生大量的粉尘，虽然安装后清理了一次，但在开荒保洁时需要进行更精细的清洁。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　推拉门轨道及窗轨：推拉门下方的轨道及窗轨是比较容易存留建筑垃圾和尘土的地方，在长期不做清洁或清洁不彻底的情况下反复推拉、开关门窗都有可能损坏开合零件、造成卡滞或开合不畅等问题。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	　　开荒保洁是在家屋清洁中最艰苦，最复杂，最费神的工作，而且清洁程度的好坏直接影响到日后的保洁质量的档次，所以说做好开荒工作是很重要的，广州家事无忧是一家专业保洁公司，拥有先进的清洁工具跟专业的清洁人员，生活有我，家事无忧，广州家事无忧竭诚为您解决开荒保洁难题。<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&amp;nbsp;&nbsp;&amp;nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&amp;nbsp;&nbsp;&amp;nbsp;联系方式;&nbsp;&amp;nbsp;133&nbsp;1646&nbsp;6444&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&lt;a&nbsp;href=&quot;http://www.qxjy66.com&quot;&nbsp;target=&quot;_blank&quot;&nbsp;se_prerender_url=&quot;complete&quot;&gt;深圳清新家园清洁服务有限公司&lt;/a&gt;&amp;nbsp;&nbsp;&amp;nbsp;&amp;nbsp;&lt;strong&nbsp;style=&quot;text-align:justify;line-height:1.8;background-color:#ffffff;text-indent:178px;font-family:微软雅黑,&nbsp;黑体,&nbsp;新宋体,&nbsp;\'Arial&nbsp;Unicode&nbsp;MS\';white-space:normal;color:#333333;&quot;&gt;&lt;span&nbsp;style=&quot;font-size:19px;&quot;&gt;&lt;a&nbsp;href=&quot;http://www.qxjy66.com&quot;&nbsp;target=&quot;_blank&quot;&gt;&lt;span&nbsp;style=&quot;font-size:10px;&quot;&gt;http://www.qxjy66.com&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;/strong&gt;&nbsp;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&lt;br&nbsp;/&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&nbsp;style=&quot;text-align:justify;&quot;&nbsp;class=&quot;正文&quot;&nbsp;align=&quot;justify&quot;&gt;<br />\r\n	&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;友情链接:&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&nbsp;&amp;nbsp;&lt;strong&nbsp;style=&quot;line-height:1.8;background-color:#ffffff;text-indent:178px;font-family:微软雅黑,&nbsp;黑体,&nbsp;新宋体,&nbsp;\'Arial&nbsp;Unicode&nbsp;MS\';color:#333333;&quot;&gt;&lt;span&nbsp;style=&quot;font-size:19px;&quot;&gt;&lt;a&nbsp;href=&quot;http://www.qxjy66.com&quot;&nbsp;target=&quot;_blank&quot;&gt;&lt;span&nbsp;style=&quot;font-size:10px;&quot;&gt;http://www.qxjy66.com&lt