INSERT INTO my_information VALUES ('1861','安康红肉蜜柚苗之柚子种植技术之整形修剪平和满园丰','136','1500706863','365','1532242863','红肉蜜柚苗,柚子树通过整形修剪，使之树冠形状丰满，并达到丰产、稳产的目的。柚子种植的整形修剪技术要点有哪些呢？<br />\r\n柚子的整形修剪<br />\r\n一、柚子定干干高宜40-60厘米，共培养5-6个主枝。柚树的生物学特性与其它甜橙和红桔不同，树势强盛，树体高大，而且果大，其结果母枝大部分或全部都在树冠内部。我们必须了解它的这些特性，才能掌握修剪技术。<br />\r\n二、结果母枝抽生结果枝的枝梢叫结果母枝。结果母枝大概可以分为三个类型：<br />\r\n1、大侧枝上分生的小侧枝，这种枝条生长较弱，伸不出树冠的营养枝，它连续生长2-3年后，分生无叶结果母枝，抽梢结果；<br />\r\n2、无叶枝条，这种枝条开花、发芽的营养条件不够，一般到三年才开花结果；<br />\r\n3、落花落果枝（俗称瞎眼枝），它们没有萌发的芽，第二年就开花结果。<br />\r\n三、柚子结果枝由结果母枝顶端一芽或附近数芽萌发而成。结果枝分有叶结果枝、花叶俱全结果枝和无叶结果枝。有一花至多花，以无花序和少叶花序的结果枝为最好。<br />\r\n四、柚子种植的整形修剪目的和意义使树冠内部通风透光良好，内堂结果母枝营养充实，结果多而品质好。<br />\r\n五、柚子种植的整形修剪原则做到外空内不空，顶上重剪，四方轻剪，外围重剪，内部轻剪。<br />\r\n六、柚子种植的整形修剪方法注意保留树冠内部侧枝上较纤弱的无叶枝，这些是优良的结果母枝；营养生长旺盛枝叶过于茂密的宜重剪，营养生长较弱的宜轻剪；<br />\r\n七、柚子种植的整形修剪时间和应剪去的枝条采果后应剪去树冠内的上垂直立、下垂枝，剪除干枯枝、病虫枝、荫蔽枝和重垒交叉枝。夏剪：在夏季抹除部分过密、过旺新梢，疏剪过密的纤弱枝、短截徒长。<br />\r\n平和县满园丰苗木有限公司，位于管溪蜜柚原产地平和县，，公司目前是以培育：大三红蜜柚苗（红皮红肉蜜柚苗）、金桔蜜柚苗(红皮黄肉蜜柚苗)、黄肉蜜柚苗(黄金蜜柚苗)，红心蜜柚苗，蜜柚苗,三红蜜柚苗,红心柚子苗,红心蜜柚苗,红肉蜜柚苗,且经营各系列品种蜜柚嫁接枝条(穗条)的批发以及柚子种子小苗销售,并专注于国内外蜜柚新品种研发，和选育、培养，公司目前发展蜜柚产业种植示范基地300多亩，总投资500多万元年培育果苗300万株，年产水果280多万斤，形成了完整三红蜜柚产业链。<br />\r\n本公司所培育的所有三红蜜柚苗，红心蜜柚苗，质量好，适应性强，存活率高，易管理。真正的纯正柚子树苗，我公司是在管溪蜜柚原产地福建平和县，产地直发。<br />\r\n联系人：周朝明<br />\r\n联系电话：13850463261<br />\r\n	http://www.myfmym.com<br />\r\n三红柚子苗&nbsp;三红蜜柚苗&nbsp;红心柚子苗&nbsp;红心蜜柚苗&nbsp;红肉蜜柚苗','alimen998','欧先生','','alimen@242526.com','0592-3366206','0','1','1','','120.41.127.205','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1500706863kgqvm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
