INSERT INTO my_information VALUES ('1863','灸疗师培训哪家好？厦门金母子8月份中医灸疗师培训开课啦','136','1500711874','365','1532247874','想成为灸疗师吗？想月薪上万吗？那就来厦门金母子，参加专业权威的职业培训，成为优秀灸疗师，开始踏上辉煌的职业旅程吧！<br />\r\n艾灸简介：<br />\r\n是用艾叶制成的艾灸材料产生的艾热刺激体表穴位或特定部位，通过激发经气的活动来调整人体紊乱的生理生化功能，从而达到防病治病目的的一种治疗方法。艾灸疗法的适应范围十分广泛，在中.国古代是主要治疗疾病的手段。用中医的话说，它有温阳补气、温经通络、消瘀散结、补中益气的作用。<br />\r\n一、金母子学员待遇<br />\r\n1、外地学员，公司免费提供住宿；<br />\r\n2、提供专业理论教学+真人实操+营销基础等特色教学服务；<br />\r\n3、培训考核合格，为学员颁发国家中医药管理局中医类培训证书，国家官网可查，全国通用。<br />\r\n报名须知：<br />\r\n中医灸疗师，开课时间：8月5日<br />\r\n培训时间：13天<br />\r\n培训方式：理论、实操<br />\r\n报名热线：0592-5537128，13720881939,13850081535（备注：手机号码即微信号，可接受微信报名！）<br />\r\n官方网站：www.xmjmz.cn<br />\r\n报名地点：培训地址：厦门市嘉禾路388号永同昌大厦3楼<br />\r\n收费标准：请来电13720881939咨询<br />\r\n艾灸行业发展前景：<br />\r\n随着社会的发展，人们对生活质量和健康的要求越来越高，现代越来越多的人认识到中医外治法良好的养生保健疗疾作用，特别是艾灸在治疗慢性疼痛性疾病的良好效果和保健作用，近年来艾灸行业迅速发展，各种艾灸养生馆、理疗店遍地开花，且艾灸行业效益比传统行业高，在一线城市普通灸法一次200元左右，督灸的收费一般600-1000每次，脐灸的收费也300-600元，最高的甚至超过1000元，所以一线的艾灸馆营业额每年甚至都能超过千万，二三线城市的艾灸馆也能轻松上几百万，所以灸疗养生事业是很好的创业开店项目。<br />\r\n现在艾灸养生馆的数量和服务还远远不能满足大众的需求，未来艾灸养生行业也必然更受人们喜爱，越来越多的人想要从事艾灸养生行业，为自己和家人的健康保驾护航，做中医药文化的传承者和受益者，同时也为更多的人带来健康。<br />\r\n中医灸疗师课程内容：<br />\r\n(内容以金母子老师安排为准）<br />\r\n课程简介：四大灸法<br />\r\n艾灸：一切灸法的基础<br />\r\n督灸：体寒就用督灸<br />\r\n脐灸：老少咸易的一种灸法<br />\r\n腹灸：宫寒克星<br />\r\n	普通艾灸：<br />\r\n	直接灸：1.瘢痕灸：化脓灸&nbsp;；2.无瘢痕灸:麦粒无瘢痕灸；3.三角灸；<br />\r\n	温和灸：1.悬灸；2.回旋灸；3.雀啄灸；4.循经往返灸<br />\r\n	隔物灸：1.隔姜灸；2.隔蒜灸；3.隔盐灸；4.隔附子灸；5.隔葱灸<br />\r\n	膏&nbsp;&nbsp;&nbsp;灸：1.膏灸产后灸；&nbsp;2.膏灸乳腺增生灸；3.膏灸督灸<br />\r\n	热敏灸：1.穴位的静息态；2.穴位的敏化态<br />\r\n	特种灸法：1.马氏运动灸；2.骑竹马灸；3.苇管器灸；4.隔核桃眼睛灸<br />\r\n	灸器灸：1.随身灸；&nbsp;2.砭灸仪；&nbsp;3.温盒灸；&nbsp;4.魔灸盒灸<br />\r\n	其他灸法：1.雷火灸；&nbsp;2.七星灸；&nbsp;3.十字灸；4.艾熏灸；&nbsp;5.日光灸<br />\r\n	新式灸法：1.砭灸仪拨筋术；2.电刺激灸法；3.负压拔罐；4.负压刮痧：5.负压丰胸；6.负压提臀；7.仪器针灸<br />\r\n	我们的荣誉<br />\r\n厦门金母子健康咨询有限公司拥有中医药适宜技术职业化培训资质，公司自成立以来，培训了许多致力从事催乳师、母婴保健师、小儿推拿保健师、产后康复师的专业人员，学员来自于全国各地!<br />\r\n&nbsp;<br />\r\n2016年获得最美家政人创业全国百强的荣誉称号！<br />\r\n	2017年，厦门金母子母婴健康咨询有限公司成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位！<br />\r\n	2017年加入厦门市婴童产业协会员单位！<br />\r\n	2017年成为湖南电视台打造出《白蛇传》《花木兰》的《小戏骨》栏目新剧《方世玉》福建地区海选专场官方合作机构。<br />\r\n	培训特色及优势：<br />\r\n	1.项目包含：艾灸、督灸、脐灸、膏灸四大灸法，同时也有马氏运动灸、苇管器灸、骑竹马灸、隔核桃灸等特种灸法，让传统经典绽放华彩。<br />\r\n	2.师资力量雄厚：授课老师多为省中医市中医在职教授、讲师，针灸学博士硕士，高水平的教学就是我们给您超值的服务。<br />\r\n	3.理论与实践相结合，重视学员的实操能力，手把手教学，包教包会。<br />\r\n	4.考试合格，颁发国家中医管理局认证“中医灸疗师”证书<br />\r\n	主要面向人群：<br />\r\n	（1）医院和康复中心、基层医疗机构医务人员；<br />\r\n	（2）艾灸馆老板、美容院老板；<br />\r\n	（3）养生会所灸疗技师、艾灸从业者；<br />\r\n	（4）灸疗养生爱好者；<br />\r\n	（5）想从事灸疗行业或想创业的人士。<br />\r\n	师资力量：<br />\r\n	金母子拥有一支实力非常强大的教学师资团队，金母子的培训名师在婴幼儿健康行业，均已深耕十余年，可以毫无保留地与学员们传授实战经验，让学员在实际案例中，能够学以致用。<br />\r\n	在教学方面，每个项目都严格按照相关的国家职业标准的培训教材、教学大纲、培训目标、考核大纲、视频教学产品，每门课程都制定了科学合理的教学计划。理论课、实操课严格按照3:7的比例设置，并且有教师管理、学员管理、实训实操管理、考试管理、学员安全管理等相关制度。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.127.205','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1500711874bauy7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1864','好滋餐饮味_哈尔滨锦州烧烤培训哪里好品牌_哈尔滨锦州烧烤培训','136','1500711912','365','1532247912','好滋餐饮味_哈尔滨锦州烧烤培训哪里好品牌_哈尔滨锦州烧烤培训哪里好加盟&nbsp;|&nbsp;沈阳好滋味餐饮管理有限公司<br />\r\n&nbsp;<br />\r\n	哈尔滨正中锦州烧烤学习哪里好，哈尔滨餐饮培训最正中最好吃。&nbsp;<br />\r\n	.&nbsp;好滋味餐饮集团公司自成立以来，为方便各地学员就近学习，避免周波劳顿，现如今已在全国各地开展多个培训站，如沈阳培训站，哈尔滨培训站，长春培训站，学员可根据自身条件，多方位选择就近选择学习。好滋味始终如一坚持实战化教学，综合化指导，多方面服务。学员学习过程中，注重实践反复练习，全程师傅一对一跟踪教学指导。不限制时间学习，直至学习会为止，当期学不会，终身可以免费复习，终身免费技术更新升级。在教学过程中，我们更细致化得将配料配方进行量化标准，使学员掌握的更牢靠；学习更便捷，后期味道正宗。本公司培训项目多元化，如：拉面及各个种类和各种味道的面条。早餐及中式面点。特色烧烤，骨汤麻辣烫，砂锅米线，韩式烤肉，麻辣拌，等等所有市面能看到的时尚流行小吃技术一对一学习应有尽有。培训项目种类丰富。&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;选择好滋味优势多多：&nbsp;<br />\r\n	优势一：先品尝，满意后在学习，解除您的学前之忧，为后期经营作保障；&nbsp;<br />\r\n	优势二：签订学习保障协议，保障您的权益，让您无后顾之忧；&nbsp;<br />\r\n	优势三：配方透明化，学会都能自己独立配制，而且所有材料在当地市场都能买到。&nbsp;<br />\r\n	优势四：一对一指导，手把手教学，全程动手实际操作。&nbsp;<br />\r\n	优势五：反复练习，制作成品能达到销售标准，使您创业无忧。&nbsp;<br />\r\n	优势六：传授时下流行小吃，品味独占鳌头。&nbsp;<br />\r\n	优势七：&nbsp;终身技术指导，为您创业保驾护航。&nbsp;<br />\r\n	好滋味欢迎各位学员考察学习，详情请拨打电话：沈阳：13998816601宣经理。18940014011赵经理，吉林内蒙古：15140178540，黑龙江：15124512980，（微信同步）。&nbsp;<br />\r\n	郑重承诺：包教包会，学会为止，一期学不会下期免费复学，收费透明，除学费以外没有任何形式收费。','wnptu821','刘经理','995734565','995734565@qq.com','024-23411016','0','1','1','','101.46.192.117','辽宁省沈阳市鹏博士长城宽带','1','/attachment/information/201707/pre_1500711912asit4.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1865','最专业生产大棚弯管机,沧州大棚弯管机厂家,三科机械','136','1500714572','365','1532250572','最专业生产大棚弯管机,沧州大棚弯管机厂家,三科机械&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n	温室大棚弯管机具有操作方便，性能稳定,工作效率高等特点，是蔬菜大棚制造加工行业的理想设备。<br />\r\n	<br />\r\n	<br />\r\n最专业生产大棚弯管机|沧州大棚弯管机厂家|三科机械<br />\r\n	温室大棚弯管机设备性能：<br />\r\n	1、标准显示文字：中文。<br />\r\n	2、在弯管程式记忆容量100组，每组最多可编程10道弯曲。<br />\r\n	3、直接输入弯管加工参数，机器在自动运行时可自动执行、可急停.<br />\r\n	4、作业程式及弯管程式记忆储存时间无限，不会因停电或长期不使用而造成程式流失。<br />\r\n	5、机器在进行自动加工同时，控制器仍可供输入或编辑程式。<br />\r\n	6、弯管程式可在各加工步骤设定各轴独自之动作0-3共三段速度，以针对不同工作物灵活运用，提高工作效率。<br />\r\n	7、配备加工量及加工计数功能。<br />\r\n	8、采用绝对原点系统，每日晨或休息后重新开机，无须复杂手续寻找各轴原点即可马上进入工作待命状态。<br />\r\n	9、电机总功率：6.6KW，双伺服电机。<br />\r\n	10、生产速度：每分钟10米左右。<br />\r\n	<br />\r\n		云南大棚弯管机　广西大棚弯管机　<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		24小时销售电话;15373365336<br />\r\n	<br />\r\n	<br />\r\n		联系人;刘经理<br />\r\n	<br />\r\n	<br />\r\n		qq：3314322143<br />\r\n	<br />\r\n	<br />\r\n		公司传真：0317-8040347<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		公司网址：<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					<br />\r\n						www.sklwjx.com','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','121.16.60.78','河北省沧州市联通','1','/attachment/information/201707/pre_1500714572vijec.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1866','五家渠扬州浩发专业提供市政管道清淤清洗疏通133388631','136','1500715037','365','1532251037','扬州浩发环卫清淤疏通有限公司成立于2012年，服务热线：13338863129，专业提供清理化粪池,清理化油池,吸污车清理污水,抽泥浆,高压车清疏下水道,排污管道疏通,管道清淤,方涵清疏,疏通地下市政管网等工程服务。本公司本着“诚信经营”“客户至上”的服务宗旨，努力做到尽职尽责。我们实施先进的管理方法，运用科学的经营手段，凭着卓越的产品、优质的服务、极佳的清洁效果为扬州以及整个江苏地区创造了良好的信誉。我们将一如既往，开拓进取，以我们至诚的服务为您打造环保、舒适和谐的生活及工作环境！&nbsp;公司投资引进管道高压疏通车，吸污车、抽粪车、抓斗清淤车、垃圾运输车、下水道联合疏通车排污泵，工业高压清洗机，充氧换气泵，防毒，防腐服，有害气体检测仪等现代高科技设备；主要针对市政工程，环卫清运，工业化工，小区物业，宾馆饭店，医院学校，企业厂矿等管道疏通，清洗，清理化粪池,污水池,市政管网,工业废污环保处置工程，取代传统靠人工作业施工方法。&nbsp;【服务项目】：&nbsp;1、管道疏通部：专业大型高压管道疏通车疏通下水道，管渠，市政管道，排水排污管道,雨水管道,管网等；&nbsp;2、涵渠清淤部：专业机械设备市政清淤，清淤明暗箱渠，窑井，沟渠，抽砂，管网，池塘，渠道，污泥涵渠，河涌淤泥等；&nbsp;3、吸污抽粪部：专业吸污车清理吸抽污水池,集淤池,油灌池,沉沙池,化粪池，污水井，油污等;&nbsp;4、管道维修部：管道维护保养，管线内部摄像检测、管内有毒气体检测、管道封堵截流清淤等；&nbsp;5、高压清洗部：专业高压清洗管道，工业清洗，市政管道高压清洗，化学管道清洗等;&nbsp;长年承包维护保养服务：承接市政道路排水管道，城镇、村庄排水管道，工业区、生活小区、酒楼大厦、厂区等管网的长年承包清疏、维护保养。&nbsp;公司以人为本，凝聚了许多的优秀专业人才，构建了一支不怕苦，不怕累，不怕脏的专业团队，核心骨干成员有多年应急处理经验。根椐现场具体情况分析，准确判断，制定可行性施工解决方案，以专业高效、安全环保的优质服务满意客户。&nbsp;【服务对象】：市政环卫，物业小区，工矿企业，商场酒店&nbsp;，事业单位等。&nbsp;【服务范围】：江苏、安徽、湖北、江西、浙江、福建等省均有我们的服务分部，欢迎来电咨询！&nbsp;我们将以热忱的服务，公道的价格和忘我的精神，来回报广大市民和企事业单位。欢迎新老客户随时来电咨询洽谈，我们热诚为客户提供安全、高效和优质的服务！&nbsp;您的满意--我们的追求。公司网址：www.yzhmst.com','liuguoyou123','刘友','','1452100567@qq.com','0514-13338863129','0','1','1','','49.86.105.48','江苏省扬州市电信','1','/attachment/information/201707/pre_1500715037tjjek.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
