INSERT INTO my_information VALUES ('1877','呼吸系统、视觉器官障碍上海西矽尚科技','136','1500861510','365','1532397510','患者丘某，男，11岁，江西遂川县人。3岁时曾患哮喘未愈，伴面色萎黄，厌食，容易感冒，夜晚哮喘严重，冬季哮喘加重，长年靠服药扩张气管维持。2016年8月其父亲在济南听朋友介绍干细胞活化素，就购买了半年的量。患儿服用两个月后就不哮喘了，又坚持了3个月后彻底康复。支气管哮喘病是一个西医很难治愈的疾病，只能终身用药。干细胞活化素是整体调整他的身体，修复受损的免疫因子，他的病自然就会痊愈了。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;专家坐诊V信：xyw21009','yeaxing123','张先生','395998237','395998237@qq.com','0370-2690016','0','1','1','','42.228.114.151','河南省郑州市联通','1','/attachment/information/201707/pre_1500861510qsagd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1878','育婴师培训服务哪家好？厦门金母子','136','1500861747','365','1532397747','育婴师培训、服务哪家好？厦门金母子<br />\r\n育婴师：主要是为3个月以上的婴幼儿提供生活照料、护理和早期教育。育婴师主要掌握婴幼儿的养、护、教，包括饮食、饮水、睡眠、二便、三浴、卫生、生长检测、动作技能训练、智力开发、社会行为及人格培养、个性化教学<br />\r\n职业前景：育婴师是一个近年来新兴的职业，婴幼儿早期教育市场迅猛发展，聘请育婴师进行早期的科学喂养，逐渐成为一个热门职业领域，来为广大婴幼儿家庭提供专业的服务。<br />\r\n就业方向：家政服务公司、母婴护理机构、社区服务中心等。<br />\r\n前两年，炒作得热火朝天的&quot;月嫂&quot;&nbsp;行业，之后是一些高价家庭服务员、高级管家等，不可否认，一部分“月嫂”、“高级管家”在工作中的尽心和努力，但其专业性运作和行业管理缺乏系统性。从业人员整体素质水平参差不齐、专业科学知识匮乏、与用工方在工作内容上的矛盾，存在的问题难以调和。其从业人员大部分为自学人员，对婴幼儿教育缺乏完整的认知，教学内容也只是简单的幼儿园教育。由于缺乏统一管理和教材，也呈现出理论基础薄弱，师资水平参差不齐，商业色彩过浓等方面的问题，需要加以正确的引导和管理。用国家职业标准去规范婴幼儿教育培训教学，理顺培训市场。目前全国各地方出现出很多早期教育机构，从事婴幼儿照料和教育的人员已经形成一定规模、社会需求量处于上升趋势。<br />\r\n1）日常管理机构:秉承职业技能鉴定中心OSTA职业培训的指导思想、培训内容和方法，严格遵守培训、考试的管理原则。所有实施方案广泛征求和吸取项目专家组的意见、建议；贯彻执行职业技能鉴定中心OSTA就业培训指导中心领导的指示，具体主持开展日常工作。<br />\r\n2）专家组:专家组由卫生部前妇幼司司长王凤兰教授、湖南中医药大学副校长黄政德教授等业内专业人士及学者、教授组成，对培训项目的开展进行专业指导，根据国内外信息技术发展新动向，制订培训大纲、教材编写大纲、考试大纲、评审教材和课件（包括光盘）等。<br />\r\n3）CEHL训练基地:针对协会会员单位，经过综合评估，按照大区建制在符合业务条件的机构设立“实训基地”，负责承担由各基地输送的经过了初级专业课程培训的学员的提高课程的教学任务、职前培训、面向社会提供学生岗位实习和就业推荐服务。<br />\r\n	&nbsp;4）中.国妇幼健康培训网:这是面向国内外人力资源市场的家政服务专业人才的全国性交流平台，已经建立以“中.国妇幼健康培训网”为核心的学员学籍管理、项目实习与就业服务保障系统。依托公司打造的遍布全国的就业联盟会员单位共同打造面向国内外市场的“育婴师专业技术人才库”和“人才就业服务平台（绿色通道）”。<br />\r\n	招生对象：幼儿园、早期教育机构、小学、中学范围内，教师、园医、校医、社区儿童家庭服务人员、校外辅导员；青少年活动中心、儿童心理咨询中心、育儿中心、社区服务机构；各医院心理咨询中心及儿科医生等相关工作人员及其他从事或有志从事儿童工作的各界人士，以及关心孩子健康成长的父母们。报名条件：（如有特殊情况可详细咨询400―8628―808）<br />\r\n	1、初级育婴师：高中学历，正在从事或有志从事育婴服务事业的女性。<br />\r\n	2、中级育婴师：要求中专以上学历，或从事育婴服务相关工作2年以上。<br />\r\n	3、高级育婴师：要求大专以上学历，或从事育婴服务相关工作3年以上。<br />\r\n	课程包括：<br />\r\n	（一）第一单元-生活照料-第一节：饮食与营养<br />\r\n	（二）第二单元-保健与护理-第一节&nbsp;常见疾病的家庭护理-第二节&nbsp;常见发育行为问题<br />\r\n	（三）第三单元-教育-第一节&nbsp;婴幼儿教育概述-第二节&nbsp;婴幼儿发展观察与评价-第三节&nbsp;婴幼儿动作的评价和个别化培养-第四节&nbsp;婴幼儿语言、感知和认知发展的观察评价-第五节&nbsp;婴幼儿情感和社会性的主要问题分析与引导<br />\r\n	（四）第四单元-家长指导与培训-第一节&nbsp;家长指导-第二节&nbsp;带教与培训<br />\r\n	授课时以自己的实践经验为例，以《育婴师》教材为主要参考书，再根据育婴师的实际参考一些参考书和参考文献，本学期计划观摩二节带教活动。教学方法以讲授、参与互动式、操作式教学、案例分析等方法相结合。<br />\r\n	课程在涵盖与育婴服务密切相关学科的最新理论和理念的同时，尤其突出育婴师实战所需的素质和能力的培训与训练。授课老师为相关学科的知名专家与教授，拥有丰富的教学经验和工作经验。','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.127.205','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1500861747casr7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1879','阜新金皇朝主管粤体彩销量超百亿元服务民生彰显公益www.jh','136','1500865033','365','1532401033','想玩最新的游戏么?想获得超级回报么，请上金皇朝娱乐平台官网-金皇朝注册登陆开户唯一指定网站www.jhc899.com&nbsp;<br />\r\n金皇朝娱乐平台讯，广东省体育彩票核心新闻，截至7月9日，广东体彩2016年销量已冲破百亿元大关，创历史同期销量新高，筹集公益金约23亿元，为我省社会经济及公益、体育事业发展作出了积极奉献。同时，上半年广东体彩彩民也博得大奖丰产，据统计，上半年广东体彩彩民共播种500万元及以上大奖19注，其中“大乐透”18注、“七星彩”1注，最高奖金为1864万元，为广州彩民金皇朝主管中出，出大奖最多的城市也为广州市。<br />\r\n今年，广东体彩坚持领导感性购彩，营造良好的购彩金皇朝娱乐气氛，通过发展“高频游戏驻点培训”、“竞彩大讲堂”、“体彩大乐透派奖”以及“欧洲杯销售网点主题形象包装”等，有效增进了游戏产品常识及投注技能的遍及，极大提升了民众购彩的趣闻性和休会感，推进市场跟销量稳步提升。上半年，3大类体彩金皇朝彩票均坚持了平衡发展，其中竞猜型彩票销售48.6亿元，同比增长64.4%，占全省总销量的50.6%，占全国竞猜型彩票销量的13.74%，金皇朝登录排名全国第一,金皇朝登录；即开型彩票销售7.9亿元，占总全省总销量的8.2%，占全国即开型彩票销量的11.62%，排名全国第一；概率型彩票销售39.64亿元，占全省总销量的41.2%，占全国概率型彩票总销量的8.05%，同比增加15.2%，排名全国第三。<br />\r\n上半年，广东体彩的网点数目、效益连续提升。广东体彩新建网点约1500个，全省网点数量实现超万个，金皇朝注册网点范围到达历史最高程度，有力进步了民众购彩方便性，更好满意了宽大大众的购彩娱乐需要。广东体彩保持服务民生，通过加大网点搀扶，对新建网点、中低销量网点进行帮扶，送培训下网点等办法有效晋升了网点服务水温和盈利才能。上半年，广东体彩供给社会就业岗位近3万个，体彩网点单点月均佣金收入超万元,金皇朝主管。金皇朝平台本着中.国体育彩票“来之于民、用之于民”的公益主旨，广东体彩今年还踊跃投身公益事业，助推全民健身蓬勃发展，展示了体育彩票的良好品牌形象。<br />\r\n金皇朝娱乐平台www.jhc899.com-国际金融财团巨资打造的新生代在线金皇朝娱乐网站,致力于打造世界顶级的网上娱乐平台。本站提供金皇朝娱乐注册、登录以及客户端下载等服务，承诺配备最优质的投注方法,并辅以最先进的网络资源。欢迎您的加入!平台创建至今，一直致力于为广大彩民提供安全可靠的在线娱乐平台和优质的服务。k彩直营平台实力雄厚,技术强硬,服务热情，多种玩法体验。','alimen998','欧先生','','alimen@242526.com','0592-3366206','0','1','1','','120.41.127.205','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1500865033umhpl.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1880','三科机械|哪里有卖做蔬菜大棚弯管机设备|最新大棚弯管机哪家质','136','1500865055','365','1532401055','三科机械|哪里有卖做蔬菜大棚弯管机设备|最新大棚弯管机哪家质量最好&nbsp;|&nbsp;泊头三科机械设备有限公司<br />\r\n优质大棚弯管机哪家质量好_优质大棚弯管机多少钱_三科机械<br />\r\n	大棚弯管机具有操作方便，性能稳定,工作效率高等特点，是蔬菜大棚制造加工行业的理想设备。<br />\r\n	大棚弯管机由变频电机做动力源，减速机输出力，齿轮传动。卷弯速度可通过变频电机转速来任意调节。卷弯直径的大小由伺服电机调解完成。<br />\r\n	大棚弯管机可弯椭圆管，方管，圆管，几字型钢等多种型材。<br />\r\n	大棚弯管机设备性能：<br />\r\n	1、标准显示文字：中文。<br />\r\n	2、弯管程式记忆容量100组，每组最多可编程10道弯曲。<br />\r\n	3、直接输入弯管加工参数，机器在自动运行时可自动执行、可急停.<br />\r\n	4、作业程式及弯管程式记忆储存时间无限，不会因停电或长期不使用而造成程式流失。<br />\r\n	5、机器在进行自动加工同时，控制器仍可供输入或编辑程式。<br />\r\n	6、弯管程式可在各加工步骤设定各轴独自之动作0-3共三段速度，以针对不同工作物灵活运用，提高工作效率。<br />\r\n	7、配备加工量及加工计数功能。<br />\r\n	8、采用绝对原点系统，每日晨或休息后重新开机，无须复杂手续寻找各轴原点即可马上进入工作待命状态。<br />\r\n	9、电机总功率：6.6KW，双伺服电机。<br />\r\n	10、生产速度：每分钟10米左右。<br />\r\n	云南大棚弯管机　广西大棚弯管机　<br />\r\n泊头三科机械设备有限公司提供优质大棚弯管机哪家质量好_优质大棚弯管机多少钱_三科机械','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','120.10.33.69','河北省沧州市联通','1','/attachment/information/201707/pre_1500865055n0kdd.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1881','升降车出租|广州众誉|路灯车出租','136','1500867140','365','1532403140','升降车出租|广州众誉|路灯车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州路灯车出租路灯车出租电话登高车出租升降平台出租电话<br />\r\n	&nbsp;路灯车出租广州路灯车出租登高车出租广州登高车出租升降车出租广州升降车出租<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	（1）起重量指示器（角度盘，也叫重量限位器）<br />\r\n　　装在臂杆根部接近驾驶位置的角度指示，它随着臂杆仰角而变化，反映出臂杆对地面的夹角，知道了臂杆不同位置的仰角，根据起重机的性能表和性能曲线，就可知在某仰角时的幅度值、起重量、起升高度等各项参考数值。<br />\r\n（2）过卷扬限制器（也称超高限位器）<br />\r\n　　装在臂杆端部滑轮组上限制钩头起升高度，防止发生过卷扬事故的安全装置。它保证吊钩起升到极限位置时，能自动发出报警信号或切断动力源停止起升，以防过卷。<br />\r\n（3）力矩限制器<br />\r\n　　力矩限制器是当荷载力矩达到额定起重力矩时就自动切断起升或变幅动力源，并发出禁止性报警信号的安全装置，是防止超载造成起重机失稳的限制器。<br />\r\n（4）防臂杆后仰装置和防背杆支架<br />\r\n　　防臂杆后仰装置和防背杆支架，是当臂杆起升到最大额定仰角时，不再提升的安全装置，它防止臂杆仰角过大时造成后倾。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.130.228.216','广东省广州市电信','1','/attachment/information/201707/pre_1500867140bbymj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1882','柱塞泵，TFA15VSO180LR柱塞泵，泰丰柱塞泵型号','136','1500869255','365','1532405255','柱塞泵是液压系统的一个重要装置。它依靠柱塞在缸体中往复运动，使密封工作容腔的容积发生变化来实现吸油、压油。柱塞泵具有额定压力高、结构紧凑、效率高和流量调节方便等优点，被广泛应用于高压、大流量和流量需要调节的场合，诸如液压机、工程机械和船舶中。<br />\r\n	柱塞泵分为轴向柱塞泵和径向柱塞泵两种代表性的结构形式；柱塞缸由于径向柱塞泵<br />\r\n	属于一种新型的技术含量比较高的高效泵，随着国产化的不断加快，径向柱塞泵必然会成为柱塞泵应用领域的重要组成部分；具体详见径向柱塞泵百科，以下仅以轴向柱塞泵为例进行解释。<br />\r\n	轴向柱塞泵是利用与传动轴平行的柱塞在柱塞孔内往复运动所产生的容积变化来进行工作的。由于柱塞和柱塞孔都是圆形零件，加工时可以达到很高的精度配合，因此具有容积效率高，运转平稳，流量均匀性好，噪声低，工作压力高等优点，但对液压油的污染较敏感，结构较复杂，造价较高。<br />\r\n	MCY14-1B：定量柱塞泵<br />\r\n	SCY14-1B：手动变量柱塞泵<br />\r\n	YCY14-1B：压力变量柱塞泵<br />\r\n	BCY14-1B：电液控制柱塞泵<br />\r\n	PCY14-1B：恒压变量柱塞泵<br />\r\n	TFB1V特点：<br />\r\n	用于开式回路。<br />\r\n	通过调节斜盘角度，实现流量的无级调节。<br />\r\n	可以自吸方式工作。<br />\r\n	各种变量控制装置具有极高的适应性。<br />\r\n	可通轴驱动，适合附加齿轮泵和轴向柱塞泵（甚至一台具有相同规格）。<br />\r\n	结构紧凑<br />\r\n	效率高<br />\r\n	功率密度高<br />\r\n	噪音低<br />\r\n	山东泰丰液压股份有限公司于2000年11月30日在济宁高新技术产业开发区市场监督管理局登记成立。法定代表人王振华，公司经营范围包括液压元件、液压成套系统、机床设备的制造、销售及技术服务等。<br />\r\n	&nbsp;联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500869255i4f2b.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1883','山东进销存软件管家婆厂家青州梦雅科技最专业','136','1500871915','365','1532407915','青州梦雅科技是最专业的山东进销存软件管家婆厂家。<br />\r\n公司现经营产品包含：软件定制开发项目，（思迅、用友、管家婆）财务软件、进销存软件、生产管理软件、企业erp软件等、潍坊企业网站的建设，涉及软件领域多个行业；其中管家婆代理地区有：潍坊管家婆软件总代理、青州管家婆软件总代理、临朐管家婆软件总代理、寿光管家婆软件总代理、高密管家婆软件总代理、诸城管家婆软件总代理、昌邑管家婆软件总代理、昌乐管家婆软件总代理、安丘管家婆软件总代理、帮企业全面性的优化信息管理。青州市博雅电子商贸有限公司<br />\r\n电话：13864617160&nbsp;进销存软件管家婆厂家咨询电话：0138-64617160','bydzgs168','梦雅','364949376','2262363225@qq.com','0138-64617160','0','1','1','','182.32.200.53','山东省济南市电信','1','/attachment/information/201707/pre_1500871915bypdv.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
