INSERT INTO my_information VALUES ('1885','拉萨明辉厂家供应防静电拒水水防油三防除尘布袋15189358','136','1500876513','365','1532412513','防静电拒水水防油三防除尘布袋<br />\r\n	&nbsp;&nbsp;&nbsp;工业性粉尘浓度达到一定程度（即爆炸极限）时，如遇静电放电火花或处界点火等因素时，则极易导致爆炸和火灾。同时在除尘器运行中的空气粉尘含有较多水份和油性以及吸湿性和易溶解性粉尘，在粉尘表面出现清灰困难，而该针刺毡结合了防水和防静电两种针刺毡的优点，与普通滤料相比，不仅具有防油防湿的特性，而且具有防静电的效果。&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;明辉滤袋上口设计为不锈钢涨圈，外接口，不易被腐蚀，密封性好，滤袋长度长时再滤袋口部和底部清灰易吹破的地方增加了加固布又称‘巴布’，增强易破部位的强度，延长了滤袋的使用寿命；滤袋采用专门的三针六线缝纫技术，使得滤袋缝制牢固结实。<br />\r\n	&nbsp;&nbsp;明辉滤袋专业从事特殊工况下收尘袋生产研发，满足特殊工况除尘、收尘的需要。可根据需要对布料经行&nbsp;烧毛、压光或特氟隆涂层、防静电、防水、防油等处理。<br />\r\n明辉防静电防静电拒水水防油三防除尘布袋&nbsp;微信号：fnbhzm','fnmhccwy2','张明','1120325241','1120325241@qq.com','0515-89794760','0','1','1','','49.83.100.50','江苏省盐城市电信','1','/attachment/information/201707/pre_1500876513n271w.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1886','山东济南小型商用片冰机厂家酒店厨房设备最专业','136','1500878084','365','1532414084','济南丽顺酒店设备有限公司是最专业的山东济南小型商用片冰机厂家。<br />\r\n产品特点；<br />\r\n*小型商用片冰机广泛应用在各大连锁超市，酒店冰鲜，海鲜市场，食品加工及蔬菜保鲜等行业。<br />\r\n*小型商用片冰机应用型号有LR-02T/LR-2.5T,产冰量从200kg/d~2500kg/d.可满足客户的任何需求.<br />\r\n*小型商用片冰机制冷机组所用零部件皆来自美、德、日等具领先制冷技术的国家。<br />\r\n控制系统采用全自动微电脑控制，通过PLC可编程控制器对制冰机进行开、停机自动控制，使冰桶机械运转系统、供水循环系统协调匹配，达到安全高效运行，制冰机的整个制冰过程均设置有缺水，满冰，高低压报警，相序保护，过载保护等电脑智能控制。当机组出现保障时，PLC自动停机保护，并在输入点上显示故障指示灯&nbsp;状态，当故障恢复时，PLC接收信息自动启动机组，实现了全自动化控制。<br />\r\n	技术参数;<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					&nbsp;型号<br />\r\n				<br />\r\n				<br />\r\n					产冰量&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					储冰量&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					制冰量&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					总功率&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					电源&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					制冰剂&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					机组尺寸&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					储冰柜尺寸&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					机组净重&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					LR-02T&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					200&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					150&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					1.2&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					1.1&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					1P/220V/50HZ&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					R22&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					780*750*655&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					790*800*955&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					105&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					&nbsp;LR-05T<br />\r\n				<br />\r\n				<br />\r\n					&nbsp;500<br />\r\n				<br />\r\n				<br />\r\n					&nbsp;300<br />\r\n				<br />\r\n				<br />\r\n					&nbsp;3<br />\r\n				<br />\r\n				<br />\r\n					2.62&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					3P/380V/50HZ&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					R404A&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					1310*890*805&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					1320*1180*1100&nbsp;<br />\r\n				<br />\r\n				<br />\r\n					195&nbsp;<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n	<br />\r\n济南丽顺酒店用品有限公司http://www.jnlsjdyp.com/&nbsp;不锈钢制品、厨房设备、厨房用具、包装机械、食品机械、烘焙设备、制冷设备、开水器、电气设备及配件、消毒柜、家用电器、家具、五金交电、玻璃制品、陶瓷制品、塑料制品、木制品、切片机、办公用品、济南厨房设备、济南酒店设备、济南不锈钢厨房设备、济南食堂设备、济南餐饮设备、济南西餐设备、济南商用厨具、济南商用厨房设备、济南商用餐厅设备、厨房冰柜、厨房冰柜尺寸、厨房冰柜价格、酒店厨房冰柜、厨房冰柜牌子、厨房四门冰柜、厨房六门冰柜，厨房冰柜厂家，济南厨房冰柜，超市冷柜、保鲜柜、冷藏柜、展示柜、蔬菜水果柜、蛋糕展示柜、熟食柜、鲜肉柜、厨房冷柜、饮料展示柜、保鲜冷藏展示设备、济南商用冷藏柜品牌、&nbsp;冷藏柜尺寸、整体厨房设备的设计报价安装维修等，<br />\r\n欢迎您来电咨询:0531-85804217我们将一如既往的真诚的为您服务.<br />\r\n	济南小型商用片冰机厂家咨询电话：0531-85804217','dahvj178','张芳','2878904751','2878904751@qq.com','0531-85804217','0','1','1','','60.208.228.168','山东省济南市联通','1','/attachment/information/201707/pre_1500878084d1uvo.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1887','德州立体车库最具性价比厂家推荐','136','1500881224','365','1532417224','德州立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201707/pre_1500881224743xr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1888','婚姻信息调查推荐_北京金眼睛_北京婚姻外遇信息调查','136','1500885425','365','1532421425','婚姻信息调查推荐_北京金眼睛_北京婚姻外遇信息调查&nbsp;|&nbsp;北京顺通恒运商业<br />\r\n北京北京最好的北京金眼睛婚外情调查中心品牌推荐婚外情调查。北京金眼睛商务调查中心是北京最好的北京金眼睛婚外情调查中心品牌。<br />\r\n北京金眼睛婚外情调查中心是一家以婚姻挽回，小三劝离为主，以促进夫妻和睦，家庭和谐为辅的婚姻调查和咨询服务机构。本中心以人为本，以构建和谐社会，促进家庭幸福为己任。找北京最好的北京金眼睛婚外情调查中心品牌经销商？特别推荐北京顺通恒运商业。1、婚前背景调查：婚前调查主要包括婚前行操和婚前财产两个调查项目。<br />\r\n	&nbsp;2、配偶行为调查：当事人想要知道配偶的日常行为或者想了解配偶是不是有外遇行为，此时可以委托调查公司实施配偶行为调查。配偶行为调查也可以称为夫妻忠诚调查。&nbsp;<br />\r\n	3、外遇查找调查：当事人发现配偶有明显的外遇倾向，想要了解第三者的身份背景等相关信息所委托的调查项目。&nbsp;<br />\r\n	4、外遇查证调查：当事人确定配偶有明确的外遇对象，可以委托调查公司收集配偶婚外情证据。&nbsp;<br />\r\n	5、离婚综合调查：出于离婚的目的，委托调查公司一次性作出全程调查，是配偶行踪、外遇查找、外遇证据、财产证据等相关项目的合并调查。','jdyvwmpzal10','赵国平','758266530','758266530@qq.com','010-57156165','0','1','1','','111.201.25.221','北京市联通紫竹桥互联网数据中心','1','/attachment/information/201707/pre_1500885425zzq82.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
