INSERT INTO my_information VALUES ('1901','山东消防排烟风机箱尺寸','136','1500952191','365','1532488191','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.144.138','山东省德州市电信','1','/attachment/information/201707/pre_1500952191csdwq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1902','广州众誉,佛上登高车电话,番禺登高车出租','136','1500953897','365','1532489897','广州众誉,佛上登高车电话,番禺登高车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州登高车出租服务全广东随叫随到13600005563佛山<br />\r\n	广州登高车出租登高车出租&nbsp;佛山登高车出租佛山登高车出租电话<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。<br />\r\n	<br />\r\n	吊车的种类：<br />\r\n	<br />\r\n		A．可移动式：汽车吊、履带吊、行吊等；B．固定式：码头吊、塔吊、龙门吊等。<br />\r\n	<br />\r\n	<br />\r\n		1、汽车吊<br />\r\n汽车吊俗称为随车吊，随车吊的概念是把汽车和吊机相结合，可以自行形式不用组装直接可以工作。<br />\r\n优点：方便灵活、工作效率高、转场快、提高工作效率。<br />\r\n缺点：&nbsp;受地形限制、大型设备（1000-2000KG）不能完成。（随车吊最大吨位20吨.）。<br />\r\n	<br />\r\n	<br />\r\n		2、履带吊<br />\r\n履带吊是履带起重机的简称，是一种下车地盘是履带行走机构，靠履带行走的吊车。<br />\r\n优点：&nbsp;起重量大，可以吊重行走。具有较强的吊装能力。<br />\r\n缺点：&nbsp;拆装麻烦，起重臂不能自由<br />\r\n伸缩，局限性太强。合适大型工厂，在厂区内工作。<br />\r\n	<br />\r\n	<br />\r\n		3、轮胎吊<br />\r\n轮胎吊是利用轮胎式底盘行走的动臂旋转起重机。&nbsp;轮胎吊是把起重机构安装在加重型轮胎和轮轴组成的特制底盘上的一种全回转式起重机，其上部构造与履带式起重机基本相同。汽车吊也是轮胎吊的一种。<br />\r\n优点：&nbsp;车身短，作业移动灵活，工作效率高。<br />\r\n缺点：&nbsp;受地形限制、大型设备不能完成。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.131.77.248','广东省广州市电信','1','/attachment/information/201707/pre_1500953897gi5ng.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
