INSERT INTO my_information VALUES ('1908','二通插装阀，剪板机插装阀组，锻压机械插装阀','136','1500965987','365','1532501987','二通插装阀用于较大的流量,目的在于更高效,更快,和更紧凑的液压系统。<br />\r\n	二通插装阀由插装件、控制盖板，先导控制阀、集成块体，四部分组成　　1.插装件&nbsp;―又称主伐组件，它由阀芯、阀套、弹簧和密封圈四种零件组成。主要功能是用来控制主油路方向、压力和流量。　　2.控制盖板－&nbsp;由盖板内嵌微型先导控制元件（节流螺塞）以及其它零件等构成。它主要用来固定插装件并保证密封；沟通控制油路和主伐控制腔之间的联系，并实施控制。　　3.先导控制阀―&nbsp;安装于控制盖板上（也可以&nbsp;直接安装集成块体上），是实施对主伐插装件动作&nbsp;控制的较小规格的控制阀。主要有￠6和￠10痛&nbsp;径的标准电磁换向阀，比例调压阀，可调阻尼器，缓冲器等。主伐规格较大的可根据需要用较小的二通插装阀进行二级控制。符合ISO及国家标准尺寸电磁阀，可同国内外同类产品互换安装。　　4.集成块体―&nbsp;用来安装插装件、控制盖板和其它控制阀，沟通主油路和控制油路的块体。<br />\r\n	山东泰丰液压股份有限公司可供产品品种<br />\r\n	一、二通插装阀系列产品：Dg16-Dg160通径&nbsp;流量范围为：63&amp;amp;L/min-15000L/min<br />\r\n	二、充液阀(CF型、TCF型、TRCF型、弹簧CF型、弹簧JPF型)：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min<br />\r\n	三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n	四、液压缸:1.40T-1200T液压折弯机主油缸及充液阀2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸4.各类冶金设备用油缸及工程缸五、三大类传统板式滑阀<br />\r\n	1.溢流阀;2.顺序阀3.单向阀;4.电磁换向阀5.液控单向阀6.节流阀7.流量控制阀<br />\r\n	六、螺纹插装阀二通插装阀集成系统1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统4、500-50000KN铝型材挤压机二通插装阀集成系统5、1600-30000克注塑机二通插装阀集成系统;6、2500-20000KN压铸机二通插装阀集成系统7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	厂家优势：;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商.欢迎您来电咨询，来厂参观。<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1500965987pwyif.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
