INSERT INTO my_information VALUES ('1910','南昌网页设计培训班_南昌零基础网页设计培训中心_师大高端','136','1500967971','365','1532503971','南昌网页设计培训班_南昌零基础网页设计培训中心_师大高端&nbsp;|&nbsp;师大高端电脑学校<br />\r\n	南昌网页设计培训班|南昌零基础网页设计培训学校|师大高端<br />\r\n	南昌网页设计培训班|南昌零基础网页设计培训学校|师大高端&nbsp;课程设置：<br />\r\n【1】Photoshop初中级图像处理课程。<br />\r\n具备图像编辑、图像合成、校色调色及特效制作等强大功能的图像处理软件，集图像输入与输出于一体，深受广大平面设计人员和电脑美术爱好者的欢迎。<br />\r\n【2】Dream&nbsp;weaver网页设计<br />\r\n集网页制作和管理网站于一身的所见即所得网页编辑器，利用它可以轻而易举地制作出跨越平台限制和跨越浏览器限制的充满动感的网页。&nbsp;<br />\r\n【3】Flash动画设计<br />\r\n是一种动画创作与应用程序开发于一身的创作软件，通过添加图片、声音、视频和特殊效果，构建包含丰富媒体的Flash应用程序。<br />\r\n【4】后台程序+数据库开发：（ASP.NET或PHP课程二选一学习）<br />\r\n1、PHP动态网站开发+My&nbsp;SQL数据库开发（参与实站B2C电子商务网站开发）。<br />\r\n2、ASP.NET动态网站开发+SQL数据库开发（web&nbsp;service技术，熟悉MVC三层架构技、B/S架构的网站开发（参与实战B2C电子商务网站开发）。<br />\r\n【5】SEO网站优化技术<br />\r\n1、对网站进行优化，提高排名，更容易搜索网站（搜索引擎蜘蛛跟踪分析，页面最佳SEO布局，内部链接优化布局操作等）<br />\r\n2、综合实践＋实际项目开发（B2C电子商务网站实践开发）。<br />\r\n【6】商务礼仪与就业指导课程（免费赠送课程）<br />\r\n1、求职技巧与就业岗位选择技巧；<br />\r\n2、面试技巧与礼仪，掌握面试仪容仪表、着装、姿势仪态的注意要点；<br />\r\n3、商务场合中待人接物、语言艺术的技能；<br />\r\n4、掌握拜访客人时的礼仪――公司推销的成功砝码。<br />\r\n南昌网页设计培训班|南昌零基础网页设计培训学校|师大高端就业方向：网页设计师、网页美工设计师、网站开发工程师、游戏开发工程师。<br />\r\n	&nbsp;<br />\r\n	我们的优势：<br />\r\n	1.&nbsp;上课小班培训，联机讲座，一人一机实践练习，每节课两小时，一小时讲座，一小时上机操作，操作当中有不懂老师会在身边指导点拨。<br />\r\n	2.上课时间有白班、有晚班&nbsp;可随学员自由调配上课时间<br />\r\n	3.实力师资，我们的老师水平绝对够；<br />\r\n	4.免费试听，推荐就业；<br />\r\n	5.一次不会免费二次重修，过了为止<br />\r\n	南昌网页设计培训班|南昌零基础网页设计培训学校|师大高端&nbsp;&nbsp;&nbsp;&nbsp;高端电脑培训中心位于物华天宝，人杰地灵的英雄城南昌。2012年，被评为全国百强电脑培训学校，江西省诚信教育机构联盟单位，已成为江西省IT技能岗位深造首选，专业最全最具特色，实力最雄厚的计算机职业教育机构之一，为社会培养了一批又一批的IT紧缺性人才。<br />\r\n&nbsp;<br />\r\n	联系人：张老师&nbsp;0791-87677815','fkrcp752','刘君龙','291594009','969486465@qq.com','0791-87677815','0','1','1','','218.64.36.36','江西省南昌市电信','1','/attachment/information/201707/pre_1500967971hji3b.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1911','漳州实验室用的分散机串激电机碳刷 SF0.4 SF400 S','136','1500968074','365','1532504074','实验室用的分散机串激电机碳刷&nbsp;SF0.4&nbsp;SF400&nbsp;SF1100&nbsp;SF1.1&nbsp;GF1100<br />\r\n湖北枣阳有发机械有限公司专业生产销售各种型号涂料分散机专用碳刷。<br />\r\n碳刷是有刷电机里面顶在换相器表面的部件，电机转动的时候，将电能通过换相器输送给线圈，由于其主要成分是碳，称为碳刷，它是易磨损的。应定期维护更换，并清理积碳。<br />\r\n本碳刷为单相串激电机专用碳刷，适用于各类小型高速分散机、小型多用机、小型砂磨机等设备上，此类设备的电机功率一般为400W、450W、750W、1100W。<br />\r\n碳刷部分尺寸：21x12x5.6mm&nbsp;（长×宽×厚）<br />\r\n拉簧部分尺寸：45&nbsp;mm&nbsp;（长度）好处：保护电机，防止用户因为购买比原碳刷更硬的材质，造成电机转子的损坏。襄樊1100碳刷型号湖北枣阳有发机械有限公司最全。','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','1','1','','121.63.158.89','湖北省襄阳市电信','1','/attachment/information/201707/pre_1500968074m09rm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1912','菏泽立体车库最具性价比厂家推荐','136','1500971322','365','1532507322','菏泽立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201707/pre_1500971322rsqsj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
