INSERT INTO my_information VALUES ('1914','最新大棚弯管机哪家质量好|三科机械|最新大棚弯管机多少钱','136','1500974737','365','1532510737','最新大棚弯管机哪家质量好|三科机械|最新大棚弯管机多少钱<br />\r\n	大棚弯管机具有操作方便，性能稳定,工作效率高等特点，是蔬菜大棚制造加工行业的理想设备。<br />\r\n	大棚弯管机由变频电机做动力源，减速机输出力，齿轮传动。卷弯速度可通过变频电机转速来任意调节。卷弯直径的大小由伺服电机调解完成。<br />\r\n	大棚弯管机可弯椭圆管，方管，圆管，几字型钢等多种型材。<br />\r\n	大棚弯管机设备性能：<br />\r\n	1、标准显示文字：中文。<br />\r\n	2、弯管程式记忆容量100组，每组最多可编程10道弯曲。<br />\r\n	3、直接输入弯管加工参数，机器在自动运行时可自动执行、可急停.<br />\r\n	4、作业程式及弯管程式记忆储存时间无限，不会因停电或长期不使用而造成程式流失。<br />\r\n	5、机器在进行自动加工同时，控制器仍可供输入或编辑程式。<br />\r\n	6、弯管程式可在各加工步骤设定各轴独自之动作0-3共三段速度，以针对不同工作物灵活运用，提高工作效率。<br />\r\n	7、配备加工量及加工计数功能。<br />\r\n	8、采用绝对原点系统，每日晨或休息后重新开机，无须复杂手续寻找各轴原点即可马上进入工作待命状态。<br />\r\n	9、电机总功率：6.6KW，双伺服电机。<br />\r\n	10、生产速度：每分钟10米左右。<br />\r\n	云南大棚弯管机　广西大棚弯管机　<br />\r\n泊头三科机械设备有限公司提供最新大棚弯管机哪家质量好|三科机械|最新大棚弯管机多少钱','lpwxo933','刘经理','3314322143','3314322143@qq.com','0317-15373365336','0','1','1','','121.16.222.116','河北省沧州市沧县联通','1','/attachment/information/201707/pre_15009747378par6.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
