INSERT INTO my_information VALUES ('1935','供应武汉武汉洪山区公司注册洪山区财税公洪山区财税代理公司','136','1501051988','365','1532587988','武汉卓海永道信息技术有限公司供应武汉武汉洪山区公司注册洪山区财税公洪山区财税代理公司<br />\r\n武汉卓海永道财税咨询服务有限公司是一家专业的财税代办公司。专业办理：公司注册，代理记账报税，一般纳税人申报，办公场地提供，虚拟注册地址，工商年检，商标注册，等专业的财税咨询服务！承接各行业小规模纳税人，一般纳税人财务业务（含郊区）。本公司由会计师专业资格人员和综合业务素质较强人员组成。熟练处理各种行业的工业、商业等各种业务，有效控制公司各项费用。公司使用专业财务软件，为企业提供优质专业的业务服务。公司坚决奉行独立、客观、公正、保密的原则，以高效、专业、透明、诚信为大家带去专业的财税咨询服务。主要为中小型企业提供：武汉公司注册，武汉工商代办，武汉代理记账、武汉代理报税、武汉企业变更、武汉清理乱账、内部核算、财务管理咨询、代办大额增资、验资。代办各类经营许可证及提供公司注册场地。代办营业执照、代办代码证、代办税务登记证，代办开户许可证、代办营业执照年检等各项业务。<br />\r\n武汉工商注册代理；武汉工商注册公司；武汉市工商注册<br />\r\n<br />\r\n武汉卓海永道财税咨询有限公司<br />\r\n总机：027-87102462&nbsp;&nbsp;手机&nbsp;18707187177&nbsp;&nbsp;姚经理<br />\r\nQQ：403975830&nbsp;&nbsp;www.0-2-7.cn<br />\r\n地址：武汉市洪山区街道口鹏程国际A座2217室本公司地址:湖北武汉湖北武汉市','qq403975830','姚经理','','1503200952@qq.com','027-87102462','0','1','1','','59.174.212.108','湖北省武汉市电信','1','','0','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1936','德州消防排烟风机箱尺寸','136','1501052533','365','1532588533','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.160.70','山东省德州市电信','1','/attachment/information/201707/pre_1501052533ohvbn.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
