木制品、切片机、办公用品、济南厨房设备、济南酒店设备、济南不锈钢厨房设备、济南食堂设备、济南餐饮设备、济南西餐设备、济南商用厨具、济南商用厨房设备、济南商用餐厅设备、厨房冰柜，厨房冰柜尺寸，厨房冰柜价格，酒店厨房冰柜，厨房冰柜牌子，厨房四门冰柜，厨房六门冰柜，厨房冰柜厂家，济南厨房冰柜，整体厨房设备的设计报价安装维修澳柯玛商用制冰机牌子就选酒店厨房设备。地址：济南北园路','dahvj178','张芳','2878904751','2878904751@qq.com','0531-85804217','0','1','1','','60.216.197.169','山东省济南市联通','1','/attachment/information/201707/pre_1501058919prnhq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1941','烟台立体车库最具性价比厂家推荐','136','1501060096','365','1532596096','烟台立体车库最具性价比厂家推荐就找开封共创停车科技，开封共创停车科技10年专注于立体车库的研发、生产、安装、制造、维护，为您的停车保驾护航。<br />\r\n共创立体车库产品特点<br />\r\n1、结构灵活，可根据用户要求及现场条件进行最优布局；<br />\r\n2、可根据用户要求设计全包装式、半包装式、简易包装式及无包装式等包装形式。<br />\r\n3、设备占地面积小，空间利用率高，停放车辆数量为平面停车场停放数量的5倍左右；<br />\r\n4、设备造价低、维保费用低。<br />\r\n5、运行平稳，噪音低，存取车方便；<br />\r\n6、人车误入报警、限位保护、松绳保护、防坠落保护、车辆超长报警、延时保护、过（欠）压保护<br />\r\n过流、断电自锁、紧急停车等全方位安全防护；<br />\r\n7、全自动PLC控制，采用按钮、IC卡、遥控等多种控制方式，操作简单。<br />\r\n共创立体车库适用场合<br />\r\n该设备为地上停车设备，适用于居民区、商业中心、办公楼、车站、医院等场所。<br />\r\n电话:400-001-7281.','gongchuang68','孔先生','2910174837','2910174837@qq.com','0371-23125688','0','1','1','','123.15.62.66','河南省郑州市联通','1','/attachment/information/201707/pre_1501060096cwkse.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1942','南平厦门金母子率先推出七日培训班，母婴教育领导品牌','136','1501060287','365','1532596287','母婴教育领导品牌&nbsp;&nbsp;厦门金母子率先推出七日培训班<br />\r\n	好消息，金母子重磅推出七日课程，所有课程上课时间为七天，全为干货。不仅大大缩短了大家的时间，费用也大幅下降。课程大家可自助学习，报名后没限时间，在一年内学习完成即可，一期学员满10人即可开课。所有金母子学员，报名7天课程中的任何一项，可在原课程费用上再优惠500元。（课程表可联系老师发送）<br />\r\n厦门金母子介绍：<br />\r\n金母子拥有中医药适宜技术职业化培训资质，公司（总部在厦门）自成立以来，培训了许多致力从事催乳师、小儿推拿师、产后康复师、母婴保健师、中医灸疗师、育婴师等专业人员。每个项目都严格按照相关的国家职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。致力打造母婴行业高技术人才。<br />\r\n培训机构拥有办公室，教学场地和实操产地供学员学习，所有师资均为人社部注册师资，不仅拥有本科学历以上医学专业背景，还具有家庭服务实践经验和多年职业培训经验，在教学方面，每个项目都严格按照相关的国家职业标准的培训教材、教学大纲、培训目标、考核大纲、视频教学产品，每门课程都制定了科学合理的教学计划。理论课、实操课严格按照3:7的比例设置，并且有教师管理、学员管理、实训实操管理、考试管理、学员安全管理等相关制度。<br />\r\n金母子积极引导从业人员参加职业培训和技能考核鉴定，并全力安置就业，扶持创业。一是坚持家庭服务人员的“规范化”“职业化”建设。二是坚持先培训后上岗制度。三是鼓励创业、扶持创业。对有意向自主创业从事家庭服务业的学员，金母子组织创业培训班，许多学员在公司的指导下开办了母婴护理中心和家庭服务中心，在实现创业的同时带动了更多人的就业。<br />\r\n七日培训班多少钱？<br />\r\n1.小儿推拿师培训<br />\r\n学费考证：3700&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不考证：3200&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n2、产后恢复培训<br />\r\n学费考证：4100&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不考证：3600&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n3、灸疗师培训<br />\r\n学费考证：4400&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不考证：3900&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n4、催乳师培训<br />\r\n学费考证：3300&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不考证：2800&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;老学员优惠500元&nbsp;<br />\r\n	&nbsp;<br />\r\n	金母子母婴职业培训优势：&nbsp;<br />\r\n	一，品牌优势：厦门金母子健康咨询有限公司，是由国家中医药管理局、中.国中医药科技开发交流中心授权的大型培训中心，福建省正规权威培训中心，国家承认的教学培训机构。厦门金母子拥有中医药适宜技术职业化培训资质，荣获最美家政人员创业全国百强的荣誉称号。厦门金母子成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位。2017年成为湖南电视台打造新剧《小戏骨之方世玉》福建地区海选专场官方合作机构。&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	二，师资优势：金母子拥有业内最强大师资团队，金母子的教学老师，均为国家中医药管理局注册师资，从事母婴行业和中医行业十多年经验，有着丰富的实操服务经验和母婴培训经验。&nbsp;在金母子学习，有厦门医学院教授倾囊相授；有福建首位小儿推拿医师、厦门中医院小儿推拿专家医师临床授课；我们的老师，也是各大社区母乳喂养的特聘讲师。&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	三，教学优势：金母子教学内容，每个项目都严格按照相关的国.家.职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。并提供专业理论教学+真人产妇实操+营销基础等特色教学服务。理论结合实践，学员可到医院和诊所见习。力争让每位学员都学到真本领。金母子已培育了5000多名来自全国各地的学员，并且还在增加之中。&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	四，证书优势：金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	五，项目优势：金母子母婴培训机构拥有催乳师、小儿推拿师，产后康复师，母婴保健师、中医灸疗师、中医月子膳食调理等六大专业，覆盖范围最广，技能最全，学员选择方向多，一专多能，必将成为母婴服务行业的佼佼者！&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	六，后勤支持优势：外地学员，公司免，费提供住宿，解除生活上的后顾之忧，专心学习。金母子积极引导培训学员参加职业培训和技能考核鉴定，并全力安置就业，扶持创业。对有意向自主创业从事家庭服务业的学员，金母子组织创业培训班，许多学员在公司的指导下开办了母婴护理中心和家庭服务中心，在实现创业的同时带动了更多人的就业。&nbsp;<br />\r\n	我要更好，我选金母子。选择金母子，成就伟业&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	来厦门金母子，参加专业权威的职业培训，成为优秀催乳师、小儿推拿师、产后康复师、灸疗师、育婴师，开始踏上辉煌的职业旅程吧！&nbsp;<br />\r\n	&nbsp;&nbsp;<br />\r\n	全国报名热线：400-9983-693&nbsp;&nbsp;&nbsp;微信报名：fantl_520&nbsp;<br />\r\n	官方网站：www.xmjmz.cn&nbsp;<br />\r\n	报名地点：培训地址：厦门市嘉禾路388号永同昌大厦3A','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','59.57.234.139','福建省厦门市电信','1','/attachment/information/201707/pre_1501060287ou4h1.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
