INSERT INTO my_information VALUES ('1945','山东肉牛肉牛肉羊肉羊厂家山东盛强养殖场最专业','136','1501077513','365','1532613513','山东盛强牧业是最专业的山东肉牛肉牛肉羊肉羊厂家。<br />\r\n购牛羊客商，络绎不绝，牛羊购销两旺，销售范围辐射全国，并远销国外。入世以来，每年交易肉牛6万头以上，（西门塔尔“红白花”肉牛犊、育成牛、架子牛、波尔山羊、小尾寒羊）货源充足。这里的牛羊生产起步早、改良好、品种纯，已有多年的历史，是我国首批引进良种牛羊繁育改良的定点示范地区，是经过长期严格本品种选育成的专业化大型肉用品种牛羊。养殖场以雄厚的经济实力，一流的种畜质量，庞大的专家阵容为前提，以现代制度为保障，将&nbsp;“诚信”&nbsp;作为一以贯之的理念精髓，其核心精神是对客户的承诺及股东权益的尊重。我们对调拨的良种严把质量关、价格关、防疫关、运输关，将以热忱的服务，优质的良种，崇高的信誉服务于广大新老客户，欢迎有志之士来我牧业引调良种，共创畜牧事业。肉牛肉牛肉羊肉羊厂家咨询电话：0537-13793793711','lsdjxsqmy','范经理','510571666','sdjxwjmy@126.com','0537-13793793711','0','1','1','','27.198.240.85','山东省济宁市联通','1','/attachment/information/201707/pre_1501077513nesbz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
