INSERT INTO my_information VALUES ('1948','鞍山供应上海松下自动门机组 正品','136','1501117806','365','1532653806','鞍山供应上海松下自动门机组&nbsp;正品<br />\r\n上海供应上海松下自动门机组&nbsp;正品<br />\r\n松下150自动门&nbsp;松下自动门销售店&nbsp;价格更低，正品保证&nbsp;松下150<br />\r\n<br />\r\n上海海栌门控科技松下自动门销售店，提供松下150自动门，正品<br />\r\n，价格便宜，全国发货，松下全系列自动门批发，松下自动安装和松下自动门维修：&nbsp;电&nbsp;话：021-5169&nbsp;2106&nbsp;。<br />\r\n<br />\r\nSub&nbsp;navigation&nbsp;of&nbsp;Feature<br />\r\n特点<br />\r\n静音设计<br />\r\n系统构成<br />\r\n特点<br />\r\n装备新技术马达，改善马达结构，优化减速装置设计，进一步降低噪音；<br />\r\n优化控制器程序，配合新马达设计，运行更平稳，更流畅；<br />\r\n采用高强度聚氨酯滑轮，滚动摩擦噪音更低；<br />\r\n采用全新研发的传感器；<br />\r\n系统构成<br />\r\n发动机箱<br />\r\n用高轻度、耐磨铝材制成。能够简单切割，即使在店铺等各种开口宽度的地方，也可现场调整、用最佳<br />\r\n<br />\r\n尺寸进行安装。以2.5米为基本单&nbsp;元长度，按照单开、双开配置不同数量，既便于运输，又为开口提高<br />\r\n<br />\r\n提供可能。<br />\r\n控制器模块<br />\r\n接受传感器或者其他信号开关的检测信号，驱动马达，控制门体按照合适的方式运动。面向中.国设计，<br />\r\n<br />\r\n不必使用变压器。新增内置两组辅&nbsp;助光线传感器接口、辅助功能接口，进一步提高产品安全性、多功能<br />\r\n<br />\r\n性。<br />\r\n电动机模块<br />\r\n采用体积小、功率大的直流无碳刷马达，配合传动效率高、噪音小的告诉齿轮箱系统减速，然后驱动皮<br />\r\n<br />\r\n带。内部有安全装置，即使频繁开&nbsp;闭，也可长期无故障运行。电机传动皮带轮金属制造，免修理。<br />\r\n平开式样单开双开单开双开<br />\r\n门体重量150kg以下150kg以下×2枚<br />\r\n门体宽度DW=600-1250mm<br />\r\n安装方法表面内藏表面内藏表面内藏表面内藏<br />\r\n开启速度14-41cm/秒（遥控可调）14-40cm/秒（遥控可调）14-41cm/秒（遥控可调）14-34cm/秒（遥控<br />\r\n<br />\r\n可调）<br />\r\n关闭速度10-40cm/秒（遥控可调）10-38cm/秒（遥控可调）10-39cm/秒（遥控可调）14-34cm/秒（遥控<br />\r\n<br />\r\n可调）<br />\r\n开放时间0-9秒<br />\r\n停电时手动开启力46N（4.7kgf）61.7N（6.3kgf）63.7N（6.5kgf）89.2N（9.1kgf）<br />\r\n环境温度-20℃&nbsp;-&nbsp;+50℃<br />\r\n电压AC200-250V&nbsp;50/60Hz<br />\r\n鞍山供应上海松下自动门机组&nbsp;正品<br />\r\n本公司地址:上海市漕河泾开发区漕宝路1243号','weixiuzdmjk2','海栌','','sh51707606@163.com','021-51692106','0','1','1','','116.232.199.88','上海市徐汇区电信','1','/attachment/information/201707/pre_1501117806pmjuf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1949','泰丰股份_高压柱塞泵供应商_高压柱塞泵批发','136','1501119223','365','1532655223','泰丰股份_高压柱塞泵供应商_高压柱塞泵批发&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				&nbsp;TFB1V/1XSO特点：<br />\r\n用于开式回路<br />\r\n可通过调节斜盘角度，实现流量的无级调节<br />\r\n可以自吸方式工作<br />\r\n各种变量控制装置具有极高的适应性<br />\r\n可通过轴驱动，适合附件齿轮泵和轴向柱塞泵（甚至一台具有相同规格）。<br />\r\n结构紧凑<br />\r\n功率高<br />\r\n功率密度高<br />\r\n噪音低&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公司建有“国家电液控制工程技术研究中心济宁分中心”、“山东省液压控制工程技术研究中心”、“山东省企业技术中心”、“山东泰丰液压工程技术研究院”、“山东省院士工作站”等研发机构，全面实施数字化设计、智能化制造、网络化管理。同时，公司还组建了由中.国工程院院士、德籍液压博士、国内液压专家组成的6人顾问团队，并通过与浙江大学、燕山大学及上海交大的产学研深度合作，进一步推动了产品升级和技术创新，提升了公司的核心竞争力。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;公司已引进各类先进加工设备和精密检验检测仪器250&nbsp;余台，其中包括7个国家30余台数控机床和柔性制造生产线（包括日本大隈FMS柔性化生产线、马扎克FMS柔性生产线、新泻FMC六工位镗铣加工中心、因克代斯车铣复合加工中心、马扎克9轴5联动复合机床、美国哈挺高精度车削中心、瑞士克林贝格数控万能外圆磨床、美国肯纳热能去毛刺设备、赛科沃克真空热处理炉、德国蔡司三坐标测量仪、泰勒圆度仪、英特诺曼污染度检测仪、工业内窥镜、4000L/min大流量型式试验台、高温试验台等）；同时拥有3000平方米的24工位集物流、装配、试验为一体的十万级净化标准装配恒温车间和承重1200Kg、货位数1824个的智能仓储系统。通过各类先进制造装备和计量检测技术的柔性组合，公司形成了从毛坯投入、加工制造、检查、试验及质量控制到成品入库等较为完善的自动化生产体系，成为了中.国液压行业首家数字化智能型液压控制系统产品专业制造企业。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15011192235o3a2.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
