INSERT INTO my_information VALUES ('1952','傲中消防排烟风机箱销售商','136','1501120054','365','1532656054','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.150.141','山东省德州市电信','1','/attachment/information/201707/pre_1501120054hmzrx.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1953','730吨注塑机阀块报价,泰丰股份,730吨注塑机阀块厂家','136','1501120465','365','1532656465','730吨注塑机阀块报价,泰丰股份,730吨注塑机阀块厂家&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	HTL7300-4-18.1标准730吨注塑机阀块，注射阀板，泰丰液压<br />\r\n	<br />\r\n		&nbsp;&nbsp;TFJK二通插装阀集成控制模块是基于我公司开发的TLC二通插装阀插装件和TLFA控制盖板制成的通用叠加式模块。TFJK集成控制块依据“液阻”理论，采用“分解式”回路设计法，对先导控制回路和主级功率回路进行了优化，从而更加合理和充分地发挥了二通插装阀的模块化、可配组。集成化的优点和优势。TLJK集成控制块采用了计算机辅助设计，包括三维设计等方法，以提高设计的效率、柔性。可视化和可靠性。<br />\r\n	<br />\r\n	<br />\r\n		TFJK集成控制块采用了立式多层次叠加方式。通过对主级功率回路和先导控制回路模块的选择和组合，可以组成十分多样化和全球变型的组合。它结构紧凑，连接简单可靠，其中，先导控制模块化不仅便于集成化的组合设计和变型，对整个控制回路和系统的调试、维护和故障检修等都有十分有利。<br />\r\n	<br />\r\n	<br />\r\n		TFJK集成块的块头采用钢质和表面化学镀镍等成熟的材料和工艺，具有使用寿命长，表面放腐蚀等优点，基于上述优点，TFJK可以用于中等功率固定液压系统中通径16-40范围内的控制集成化，如各种冶金工程和设备、各种立式和卧式和液压机、各种中等流量的生产线液压站以及水利、船舶工程。在大中型的移动设备液压控制中也有广阔的应用前景。TFJK集成控制块有底块、油源块、三通块、四通块、附加功能块、变径块和顶块等多种类型。在三通和四通控制块中都相应配置了先导控制块。<br />\r\n	<br />\r\n	<br />\r\n		如何合理的选择TFJK，以组成所需要的控制回路和系统，请用户和本公司技术部联系，我们乐意提供详细资料和进一步的支持。<br />\r\n	<br />\r\n	<br />\r\n		山东泰丰液压专业从事液压控制系统二通插装阀集成阀块、高性能液压控制元件和油缸的研发、制造和销售，最大可设计制造单体25吨重的二通插装阀集成阀块，年产量可达3万套（按重量计约为5000吨），各种先导控制元件、插入元件及控制盖板可达110万件，是目前国内产销规模最大的二通插装阀集成阀块设计和制造企业。','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15011204659r3b5.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
