INSERT INTO my_information VALUES ('1955','宜宾小儿推拿保健师服务培训哪家好','136','1501121005','365','1532657005','小儿推拿保健师服务培训哪家好？厦门金母子<br />\r\n	&nbsp;<br />\r\n	职业概述：<br />\r\n	<br />\r\n小儿推拿保健师是运用“小儿推拿”这一绿色疗法来保障孩子的身心健康，达到有病治病、无病保健的目的。小儿推拿是以中医辩证理论为基础，通过穴位点按推拿、调节脏腑、疏通经络、调和气血、平衡阴阳的方式来改善儿童体质、提高机体免疫力的一种保健、治疗方式。小儿推拿是纯绿色疗法，可替代部分化学药品，减少化学药品毒副作用，增强孩子机体的自然抗病能力，预防病毒侵蚀和滋生，达到有病治病、无病保健的目的。随着现代人们健康理念的更新，很多家长都开始信任和采用纯绿色疗法----小儿推拿，目前，该疗法已成为国际儿童保健、治疗的重要方法之一<br />\r\n	&nbsp;<br />\r\n	市场前景<br />\r\n	<br />\r\n实践证明，小儿推拿疗法是一种简单易行、安全有效的方法。从患儿的各个方面看来，不需要复杂的设备，不给小儿带来恐惧感、不用打针服药，避免了药物的毒副作用。同时帮助家长解决了喂药困难的情况，减轻了孩子的痛苦，达到健脾胃、强壮身体、益智、预防近视的作用。再者，小儿推拿操作简单、一学就会、一用就灵，非常适用于家庭应用，既有利于家庭保健又有助于亲子间的感情交流，更有助于孩子的身心健康成长。<br />\r\n近几年来，中.国每年新出生人数均在1500万以上。儿童家长对小儿推拿培训服务、上门服务和实体店服务的需求与日俱增。小儿按摩网的顾问、国内著名的小儿推拿名家们建议：小儿每周至少接受2次保健推拿，将大大降低小儿生病的几率，每天都做效果更好。因此，小儿推拿有着巨大的市场需求和发展潜力，是一个新兴的朝阳行业、黄金行业。<br />\r\n	&nbsp;<br />\r\n	中医药管理局<br />\r\n	<br />\r\n《中医药适宜技术职业化培训证书》，此证书考核技术项目被列为国家中医药适宜技术推广项目，并纳入“中医药适宜技术职业化培训工程”。<br />\r\n证书可以同时在：国家中医药管理局中.国中医药科技开发交流中心官方网站（www.tcm.cn）、国家中医药管理局人才交流中心（www.hrtcm.org）查询。<br />\r\n根据国家中医药管理局2016年1月13日红头文件《国家中医药局关于促进中医养生保健服务发展的指导意见》的规定，“允许中医养生保健机构有资质的职业技能人员经考核在医疗卫生机构提供调理服务。”该证书是目前为止唯一由政府职能部门红头文件规定可以在“医疗卫生机构提供调理服务”的职业技能培训证书。<br />\r\n	&nbsp;<br />\r\n	教材信息<br />\r\n	&nbsp;<br />\r\n	采用国家中医药管理局中.国中医药科技开发交流中心、国家中医药管理局人才交流中心组织编写的《全国小儿推拿职业培训教材》，该教材已纳入“中医药适宜技术职业化培训工程”小儿推拿师职业培训的指定教材。主要授课内容分为两部分：基础知识和操作技能。。该教材已纳入人力资源和社会保障部和中.国家庭服务业协会小儿推拿保健师职业培训的指定教材。课程包括中医基础理论、中医四诊方法、解剖学理论、小儿生理病理特点、小儿推拿发展简史及作用原理、小儿推拿治疗概要、小儿推拿常用手法、小儿各部位常用穴位、小儿推拿保健中医辨证分型方法、小儿推拿流派介绍、小儿常用中成药介绍、小儿常见不适症的推拿等特色学科的专业知识。&nbsp;<br />\r\n	&nbsp;<br />\r\n	金母子优势<br />\r\n	&nbsp;<br />\r\n&nbsp;<br />\r\n	金母子在行业内品牌知名度比较高，拥有非常好的公共资源(政府资源、专家资源、媒体资源、客情信息等)&nbsp;<br />\r\n	金母子师资团队、网络推广团队、市场团队等人力资源团队相对稳定，可塑性强。同心多元化盈利模式得到市场认可，已有领先于同行业的营运模式可供复制，具备快速发展的条件。&nbsp;<br />\r\n	金母子可以将您理论的前瞻性与技能的实用性相结合。&nbsp;<br />\r\n	金母子注重培训期间的实践操作，实战性强。&nbsp;<br />\r\n	&nbsp;<br />\r\n	厦门金母子健康咨询有限公司<br />\r\n联系人：范桃连老师<br />\r\n地址：福建省厦门市湖里区嘉禾路388号永同昌大厦3A<br />\r\n手机：13720881939<br />\r\n电话：0