INSERT INTO my_information VALUES ('1956','生殖泌尿系统障碍肾病综合症上海矽尚生物科技','136','1501121261','365','1532657261','陆某，男，47岁，2016年9月检查确诊为由肾血流量和肾小球滤过率减少，内毒素血症和钠、水代谢紊乱诱发的肝硬化引起的肝肾综合症。在医院住院治疗，每天大量静脉给药（具体药物不详）1月后病症仍未改善，实在没办法了，只能出院，到处求医。在北京陆军总医院一个医生那里知道干细胞活化素消息后，就购买了四盒产品其连续服用3个疗程后，自发性少尿或无尿、氮质血症、稀释性低钠血症和低尿钠等症状已完全消失，2017年后又继续服用干细胞活化素巩固至今。现已重返工作岗位。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;专家坐诊V信：xyw21009','yeaxing123','张先生','395998237','395998237@qq.com','0370-2690016','0','1','1','','61.53.233.231','河南省商丘市联通','1','/attachment/information/201707/pre_1501121261lcsmu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1957','专业批发各种广东东莞肉羊肉牛','136','1501123735','365','1532659735','山东盛强牧业专业批发各种广东东莞肉羊肉牛<br />\r\n肉牛养殖肥育方式：由于自然条件和饲养方法的差别，肥育的方式主要有以下几种：<br />\r\n1、6月龄犊牛的肥育方式；<br />\r\n2、12-14月龄的幼牛肥育方式；<br />\r\n3、4月龄以上架子牛的肥育方式；<br />\r\n4、易地肥育方式。<br />\r\n二、肉牛养殖饲养技术<br />\r\n1、饲草饲料相对稳定，防止突然变换牛肥育期间，尤其强度肥育或快速催肥，这就需要饲草料相对稳定。若突然变换，必然引起瘤胃内环境改变，直接影响瘤胃微生物区系和发酵活动，导致降低发酵度和饲草料的消化和吸收率，甚至引起消化道的疾病。（标准的牛舍设备）<br />\r\n2、注意观察牛只挑食和厌食，须给予足够的粗饲料，改善日粮的适口性，可添加少量糖蜜，多喂些麸皮、大麦、燕麦，或用大麦片代替粉状饲料。临近肥育期厌食，应考虑及时出栏。<br />\r\n3、定时饲喂，少给勤添。日喂三次，上、下午各饮水一次，草料拌匀再饲喂，先喂后饮。<br />\r\n4、饲草饲料多样化，合理搭配：牛的日粮一般由粗（青）饲料和精料两部分构成，不仅要求有适当容积和采食量（干物质），还需要保证质和量的满足。正如农民所说“杂花草混合料，牛爱吃，易上膘”。<br />\r\n5、饮水充足，保持清洁。肥育期间，牛的饮水量与饲料性质和气候条件有很大关系。牛肥育自由采食，应设常备水槽，随渴随喝。放牧肥育或栓系饲养，定时饮水，每日2-3次，以饮足为原则，水需常更换，保持清洁。<br />\r\n6、日粮中精粗饲料结构要合理通常情况下，随着肥育期的进展，日粮中精粗比例也有所不同：初期：粗饲料占70%，精料占30%。中期：粗饲料占30%，精料占70%。未期：粗饲料占10%，精料占90%。欢迎联系山东盛强牧业批发广东东莞肉羊肉牛。','lsdjxsqmy','范经理','510571666','sdjxwjmy@126.com','0537-13793793711','0','1','1','','27.198.240.85','山东省济宁市联通','1','/attachment/information/201707/pre_1501123735bzqgf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
