INSERT INTO my_information VALUES ('1961','黄山防撞桶厂家_黄山防撞桶价格_山东圣铎交通设施有限公司','136','1501128661','365','1532664661','防撞桶尺寸：580*820mm<br />\r\n1、防撞桶为一次性成型，耐热、耐寒、耐冲击，不易老化。&nbsp;注满水后更具缓冲弹性，放空水后可灵活移动。&nbsp;<br />\r\n2、防撞桶桶色为橘红色，色泽鲜明亮丽，贴上红白反光膜夜间更加醒目。sdjiaotong.com<br />\r\n用途：主要设置在公路及城市道路上容易发生汽车与路中固定设施发生碰撞的部位，如：路的转弯处，路中岗亭、收费站及高架路的进出口，起到隔离作用，对驾驶员有明显的警士作用，当汽车与该设备碰撞时，能有效地减小冲击力，因此，能显著地降低车与人员损伤。&nbsp;<br />\r\n	其表面贴有的反光膜，可以根据需要贴上指示标签。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n		产品规格：1000*800mm<br />\r\n	<br />\r\n	<br />\r\n		产品颜色：黄色，反光膜红白或者黄黑。<br />\r\n	<br />\r\n	<br />\r\n		装水或装沙：200kg<br />\r\n	<br />\r\n	<br />\r\n		产品性能：玻璃钢产品质轻强度高、防火、耐腐耐候性强、抗融冻防潮（水）、整体一次性强，装饰性好。<br />\r\n	<br />\r\n	<br />\r\n		产品用途<br />\r\n	<br />\r\n	<br />\r\n		1.本产品一般常用于高速公路的出口作为紧急出口使用，还有各级公路，十字路口、收费站、道路、桥梁、停车场、车站、码头、商场、高速公路养护、酒店、小区、体育场所，危险地区和道路施工地段，集会低点等场所作为道路分道区域隔离分流导向等！<br />\r\n	<br />\r\n	<br />\r\n		2.适合任何道路，桥梁、停车场、收费站及高速临时封道口使用。起到隔离作用，对驾驶员有明显的警示作用。<br />\r\n	<br />\r\n	<br />\r\n		3.当汽车与该产品碰撞时，能有效地减小冲击力，能显著地降低车与人员损伤。加贴反光膜后夜间指示更清晰，对驾驶者有明显的警示作用，并能降低肇事人车伤亡程度，形成安全的保护。有效减少车辆的交通事故及损失。','sdjiaotong','孙经理','3414612001','3414612001@qq.com','0539-5500010','0','1','1','','39.67.14.32','山东省临沂市联通','1','/attachment/information/201707/pre_1501128661nkxka.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
