INSERT INTO my_information VALUES ('1964','凉山彝族重庆火锅加盟哪家好？推荐重庆老社长知青火锅','136','1501136960','365','1532672960','重庆火锅加盟哪家好？推荐重庆老火锅加盟品牌重庆老社长知青火锅<br />\r\n<br />\r\n渝北西政的老社长知青火锅很不错！重庆有几家火锅品牌连锁企业都加盟老社长后发展至今！<br />\r\n<br />\r\n重庆老社长知青火锅13年品牌优势，自品牌创立历经13年发展依旧展现出蓬勃的生机，加盟店遍布全国，存活时间长达7年之久，远远超过餐饮门店的平均生命周期！<br />\r\n<br />\r\n一、重庆老社长知青火锅的技术培训不是只给个配方！因为配方网上一搜就大堆！同样的配方，还有原材料的选择、加工工艺、火候等方面的因素所影响！<br />\r\n<br />\r\n二、重庆老社长知青火锅的技术培训是依拓强大的技术资源体系，主要以上门带店培训、实地操作培训为主，并同时对店面的装修、设备配置、员工培训、促销宣传提出合理化的建议或意见！<br />\r\n<br />\r\n三、重庆老社长知青火锅的技术培训从一开始就注重标准化操作的建设，所以学习后，不会因为地方变了，味道就变了，不会因为操作人员变了，味道就变了！<br />\r\n<br />\r\n四、做吃的这一行，虽然现在说店面位置、装修环境很重要，但回归本质还是味道，味道是一个店生存、发展和经营的基础。要想长远发展，留住回头客的，让顾客记得住的还是你的产品质量！所以，重庆老社长知青火锅坚持用味道说话，用质量求发展！<br />\r\n<br />\r\n五、重庆老社长知青火锅所有培训技术均会符合国家要求，符合食品加工规范，不投机取巧，不乱用食品添加剂，发挥中华传统美食文化，回归本真原味，但不失特色是重庆老社长知青火锅一贯作风！<br />\r\n<br />\r\n加盟电话：023-60362400;18702362999<br />\r\n网址：www.laoshezhanghg.com','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.187.173','重庆市电信','1','/attachment/information/201707/pre_1501136960xt2fh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1965','潮州金母子催乳师培训快速提升班，7天实现女性金领梦想！','136','1501139186','365','1532675186','好消息！金母子重磅推出七日课程，所有课程上课时间为七天，全为干货。不仅大大缩短了大家的时间，费用也大幅下降。课程大家可自己选择有空的时间来学习，（小班制，连上7天）报名后，在一年内学习完成即可，一期学员满10人即可开课。所有金母子学员，报名7天课程中的任何一项，可在原课程费用上再优惠500元。<br />\r\n	都说女人撑起半边天，这个时代，女人的社会地位已经不同往日。对于想要经济自由的女性来说，选择一个适合的职业至关重要。一个对的职业可以让女人少奋斗几年，一个对的职业可以让女人更轻松地走向成功。而母乳喂养指导师（催乳师）就是一个特别适合女性的职业！时间自由，可兼顾家庭，市场需求旺盛，收入还不菲。这样一个职业，自然吸引了不少有眼光的女性加入。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n你想要成为月入万元的职业金领吗？你想要成为时间自由安排的高端手艺人吗？你想要自主创业吗？你一定要来金母子母婴健康培训机构，金母子母婴培训快速提升班，最低只要7天，一定会助你达成梦想！<br />\r\n	<br />\r\n金母子母婴培训项目介绍：<br />\r\n拥有职业培训六大项目：中医催乳师、中医小儿推拿保健师、中医产后康复师、中医母婴保健师、育婴师、中医灸疗师<br />\r\n在金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n	<br />\r\n厦门金母子荣誉资质：（部分）<br />\r\n	&nbsp;<br />\r\n	七日培训班多少钱？<br />\r\n1.小儿推拿师培训<br />\r\n学费考证：3700，不考证：3200&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n2、产后恢复培训<br />\r\n学费考证：4100&nbsp;&nbsp;&nbsp;不考证：3600&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n3、灸疗师培训<br />\r\n学费考证：4400&nbsp;&nbsp;&nbsp;不考证：3900&nbsp;&nbsp;老学员优惠500元<br />\r\n4、催乳师培训<br />\r\n学费考证：3300&nbsp;&nbsp;&nbsp;不考证：2800&nbsp;&nbsp;&nbsp;老学员优惠500元<br />\r\n	<br />\r\n证书介绍&nbsp;：<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	<br />\r\n《中医药适宜技术职业化培训证书》：证书可以同时在：国家中医药管理局中.国中医药科技开发交流中心官方网站（www.tcm.cn）、国家中医药管理局人才交流中心（www.hrtcm.org）查询。&nbsp;<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	该证书“允许中医养生保健机构有资质的职业技能人员经考核在医疗卫生机构提供调理服务。”该证书是目前为止唯一由政府职能部门红头文件规定可以在“医疗卫生机构提供调理服务”的职业技能培训证书。有了此证就可以从事这方面的工作。<br />\r\n	金母子母婴职业培训优势：<br />\r\n一，品牌优势：厦门金母子健康咨询有限公司，是由国家中医药管理局、中.国中医药科技开发交流中心授权的大型培训中心，福建省正规权威培训中心，国家承认的教学培训机构。厦门金母子拥有中医药适宜技术职业化培训资质，荣获最美家政人员创业全国百强的荣誉称号。厦门金母子成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位。2017年成为湖南电视台打造新剧《小戏骨之方世玉》福建地区海选专场官方合作机构。<br />\r\n二，师资优势：金母子拥有业内最强大师资团队，金母子的教学老师，均为国家中医药管理局注册师资，从事母婴行业和中医行业十多年经验，有着丰富的实操服务经验和母婴培训经验。<br />\r\n在金母子学习，有厦门医学院教授倾囊相授；有福建首位小儿推拿医师、厦门中医院小儿推拿专家医师临床授课；我们的老师，也是各大社区母乳喂养的特聘讲师。<br />\r\n三，教学优势：金母子教学内容，每个项目都严格按照相关的国家职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。并提供专业理论教学+真人产妇实.操+营销基础等特色教学服务。理论结合实践，学员可到医院和诊所见习。力争让每位学员都学到真本领。金母子已培育了5000多名来自全国各地的学员，并且还在增加之中。<br />\r\n四，证书优势：金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n五，项目优势：金母子母婴培训机构拥有催乳师、小儿推拿师，产后康复师，母婴保健师、中医灸疗师、中医月子膳食调理等六大专业，覆盖范围最广技能最全，学员选择方向多，一专多能，必将成为母婴服务行业的佼佼者！<br />\r\n六，后勤支持优势：外地学员公司免费提供住宿，解除生活上的后顾之忧，专心学习。金母子积极引导培训学员参加职业培训和技能考核鉴定，并全力安置就业，扶持创业。对有意向自主创业从事家庭服务业的学员，金母子组织创业培训班，许多学员在公司的指导下开办了母婴护理中心和家庭服务中心，在实现创业的同时带动了更多人的就业。<br />\r\n来厦门金母子，参加专业权威的职业培训，成为优秀催乳师，小儿推拿师，产后康复师，开始踏上辉煌的职业旅程吧！<br />\r\n	<br />\r\n全国报名热线：400-9983-693&nbsp;&nbsp;13720881939&nbsp;&nbsp;13850081535（备注：手机号码即微信号，可接受微信报名！）<br />\r\n官方网站：www.xmjmz.cn<br />\r\n报名地点：培训地址：厦门市嘉禾路388号永同昌大厦3A','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','121.204.218.10','福建省厦门市电信','1','/attachment/information/201707/pre_1501139186rljqy.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1966','大同供应上海松下自动门吊轮松下正品价格更低上海海栌门控','136','1501139570','365','1532675570','大同供应上海松下自动门吊轮松下正品价格更低上海海栌门控<br />\r\n松下75自动门<br />\r\n上海海栌门控松下自动门销售店，提供松下自动门，松下自动感应门批发，松下75自动门松下横帝系列自动门找上海海栌门控松下自动门销售店，正品，价格更低，全国发货，电&nbsp;话：&nbsp;021-5169&nbsp;2106&nbsp;。<br />\r\n<br />\r\n产品名称：新恒帝（长寿命系列）<br />\r\n恒久品质经得起时间考验<br />\r\n产品特征详细规格Sub&nbsp;navigation&nbsp;of&nbsp;Feature<br />\r\n长寿命<br />\r\n新马达<br />\r\n新指示标贴<br />\r\n新质保<br />\r\n安全<br />\r\n新传感器<br />\r\n新吊架<br />\r\n长寿命<br />\r\n全新开发马达耐低温，耐磨损，防漏油。<br />\r\n全新开发传感器寿命更长，灵敏度更高，使用更方便。<br />\r\n安全<br />\r\n全新吊架，运行安全平稳。<br />\r\n新马达<br />\r\n采用新式直流无刷马达，体积小，功率大，寿命长；优化减速装置，配合传动效率高，噪音小的高速齿<br />\r\n<br />\r\n轮箱系统减速；一体化电机，密封好，&nbsp;润滑油不外泄，安心使用。<br />\r\n新传感器<br />\r\n采用先进技术制造感应探头，感应更加灵敏，使用更安全，性能更稳定。<br />\r\n探头角度可上下调节，应用范围更广泛，使用更加人性化。<br />\r\n传感器外盖开启方便，安装便捷，方便施工。<br />\r\n传感器接线柱，设计优化，稳固牢靠，防止接线插拔时损坏。<br />\r\n外观独特，仅松下独家所有。<br />\r\n新指示标贴<br />\r\n设计美观,采用荧光材料，夜间可视。<br />\r\n<br />\r\n新吊架<br />\r\n新吊架采用斜槽止脱方式，止脱性能大幅提高。<br />\r\n利用工程力学原理设计，止脱器强度大幅提高。<br />\r\n通过耐冲击性试验，重力撞击试验，重物静力下压试验，ANSYS强度计算等多方面验证；<br />\r\n制脱性能，吊架强度，安全性大幅提升。<br />\r\n大同供应上海松下自动门吊轮松下正品价格更低上海海栌门控<br />\r\n本公司地址:上海市漕河泾开发区漕宝路1243号','weixiuzdmjk2','海栌','','sh51707606@163.com','021-51692106','0','1','1','','116.232.199.88','上海市徐汇区电信','1','/attachment/information/201707/pre_1501139570gps7y.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
