INSERT INTO my_information VALUES ('1973','泄压块，液压块，油源块，插装阀块','136','1501147057','365','1532683057','选择我们，你是对的，质量可靠，品质卓越，让您满意是我们的心愿！&amp;lt;br/&amp;gt;折弯机特点：&amp;lt;br/&amp;gt;机架采用有限元分析设计，振动时效消除内应力，使机身具有超高钢性和稳定性；&amp;lt;br/&amp;gt;采用内置式机械挡块定位，确保了滑块的定位精度；<br />\r\n	数控系统采用折弯系统，配置了滚珠丝杆、伺服电机、线轴承、圆导轨，大大提高了折弯机的定位精度；&amp;lt;br/&amp;gt;系统主要功能：中文菜单、存储记忆、自动退让、手动脉冲微调；&amp;lt;br/&amp;gt;上模设置了挠度补偿，保证了工作的加工精度；<br />\r\n	后挡料支座紧贴机身，保证了板料通过的宽度，增加了后挡料稳定性<br />\r\n	厂家优势：<br />\r\n	1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.<br />\r\n	&nbsp;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商.<br />\r\n	&nbsp;卖点：&nbsp;1、我们是厂，薄利多销，重在跑量，旨在打造全网低价拼的是质量，比的是价格，不怕您比价，就怕您不比价<br />\r\n	山东泰丰液压股份有限公司&nbsp;主营：二通插装阀、电磁阀、充液阀、各种规剪板机、折弯机油缸、三大类滑阀元件&nbsp;<br />\r\n	经营范围：液压元件、液压成套系统、；机床设备及零件的批发零售；机电设备维修；液压元件进出口。<br />\r\n	山东泰丰液压股份有限公司可供产品品种<br />\r\n	&nbsp;一、二通插装阀系列产品：Dg16-Dg160通径流量范围为：63?L/min-15000L/min<br />\r\n	二、充液阀(CF型、TCF型、TRCF型、弹簧CF型、弹簧JPF型)：Dg40-Dg400通径&nbsp;流量范围为300L/min-35000L/min<br />\r\n	三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8&nbsp;-20&nbsp;<br />\r\n	四、液压缸:1.40T-1200T液压折弯机主油缸及充液阀2.Q12Y－12×3200-60×6000液压剪板机和压料脚油缸3.Q12Y－6×3200-60×6000液压剪板机和压料脚油缸4.各类冶金设备用油缸及工程缸<br />\r\n	五、三大类传统板式滑阀<br />\r\n	1.溢流阀;2.顺序阀3.单向阀;4.电磁换向阀5.液控单向阀6.节流阀7.流量控制阀<br />\r\n	六、螺纹插装阀二通插装阀集成系统1、Y27;Y28;Y32;Y61;Y71;Y81;Y94系列630-50000KN液压机二通插装阀&nbsp;&nbsp;&nbsp;&nbsp;集成系统2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统4、500-50000KN铝型材挤压机二通插装阀集成系统5、1600-30000克注塑机二通插装阀集成系统;6、2500-20000KN压铸机二通插装阀集成系统7、THP10-10000T万吨框架液压机二通插装阀集成系统<br />\r\n	厂家优势：;1、本公司专业生产销售，可为企业加工定制配套服务,拥有国内最领先的电磁阀、插装阀技术.本公司提供的产品质量过硬.;2、本公司可以根据客户购买的产品数量给到相应的优惠，量多从优。欢迎咨询、问价，欢迎代理商和机械厂商.欢迎您来电咨询，来厂参观<br />\r\n	&nbsp;联系人：刘海洪<br />\r\n	手机：18660757371<br />\r\n	&nbsp;&nbsp;固话：0537-2718387<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;QQ:&nbsp;3518774709','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1501147057qzn3t.jpg','1','1','0','1','0','0','0','0','其它生活服务'