INSERT INTO my_information VALUES ('1974','中.国校外教育杂志 中.国校外教育杂志社','136','1501147426','365','1532683426','《中.国校外教育杂志&nbsp;中.国校外教育杂志社》杂志由中.国教育协会、中央教育科学研究所和中.国儿童中心联合主办，是经国家新闻出版总署批准的国家一级纯教育类刊物，是国家期刊奖百种重点期刊及“双效期刊”，教育部“2+1”项目教材的辅导专刊，是具有国际国内双刊号的学术性权威期刊，向国内外公开发行。杂志为正本大16开，168页码。<br />\r\n《中.国校外教育》杂志1995年至2008年先后获得全国双效期刊、优秀期刊、中.国教育类期刊排名前100名等荣誉。《中.国校外教育》杂志由中华全国妇女联合会主管，中.国儿童中心主办，多家权威教育部门联合协办，是经国家新闻出版署批准的国家一级纯教育类权威期刊，具有国际、国内双刊号，面向国内外公开发行。杂志为正本大16开，168页码。中.国期刊网、中.国知网、龙源期刊网、万方数据库全文收录。&nbsp;<br />\r\n国内统一刊号：CN11-3173/G4<br />\r\n国际标准刊号：ISSN&nbsp;1004-8502<br />\r\n国内邮发代号：80-351<br />\r\n国际邮发代号：M4078<br />\r\n主要栏目设置：<br />\r\n主要开辟专家论坛、治校方略、课堂教学、课程探索、科研指导、教研视角、高考与教学、青年园地、课件交流、基础教育论坛、教育时评、新课程改革、经验大家谈、教师手记、班主任之家、师德建设、多媒体教学、素质教育、现代教管、师资建设、德育天地、教改探索、新课程实施、教学法新探、优秀课件、优秀教案、优秀说课、班主任工作等栏目。<br />\r\n联系人：石编辑&nbsp;QQ2851209624','xuyongjun1','徐','173065458','173065458@qq.com','0530-3126206','0','1','1','','222.133.79.196','山东省菏泽市联通','1','/attachment/information/201707/pre_1501147426akuij.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
