INSERT INTO my_information VALUES ('1976','孝感上海松下自动门电机上海海栌松下自动门销售店正品价格低','136','1501150422','365','1532686422','孝感供应上海松下自动门电机上海海栌松下自动门销售店正品价格更低<br />\r\n上海供应上海松下自动门电机<br />\r\n松下120自动门<br />\r\n上海海栌门控松下自动门销售店，提供松下120自动门，正品保证，安装简单，价格低，松下120自动门订购电话&nbsp;021-5169&nbsp;2106&nbsp;。<br />\r\nSub&nbsp;navigation&nbsp;of&nbsp;Feature<br />\r\n特点<br />\r\n静音设计<br />\r\n系统构成<br />\r\n特点<br />\r\n装备新技术马达，改善马达结构，优化减速装置设计，进一步降低噪音；<br />\r\n优化控制器程序，配合新马达设计，运行更平稳，更流畅；<br />\r\n采用高强度聚氨酯滑轮，滚动摩擦噪音更低；<br />\r\n采用全新研发的传感器；<br />\r\n系统构成<br />\r\n发动机箱<br />\r\n用高轻度、耐磨铝材制成。能够简单切割，即使在店铺等各种开口宽度的地方，也可现场调整、用最佳<br />\r\n<br />\r\n尺寸进行安装。以2.5米为基本单&nbsp;元长度，按照单开、双开配置不同数量，既便于运输，又为开口提高<br />\r\n<br />\r\n提供可能。<br />\r\n控制器模块<br />\r\n接受传感器或者其他信号开关的检测信号，驱动马达，控制门体按照合适的方式运动。面向中.国设计，<br />\r\n<br />\r\n不必使用变压器。新增内置两组辅&nbsp;助光线传感器接口、辅助功能接口，进一步提高产品安全性、多功能<br />\r\n<br />\r\n性。<br />\r\n电动机模块<br />\r\n采用体积小、功率大的直流无碳刷马达，配合传动效率高、噪音小的告诉齿轮箱系统减速，然后驱动皮<br />\r\n<br />\r\n带。内部有安全装置，即使频繁开&nbsp;闭，也可长期无故障运行。电机传动皮带轮金属制造，免修理。<br />\r\n平开式样单开双开单开双开<br />\r\n门体重量120kg以下120kg以下×2枚150kg以下150kg以下×2枚<br />\r\n门体宽度DW=600-1250mm<br />\r\n安装方法表面内藏表面内藏表面内藏表面内藏<br />\r\n开启速度14-41cm/秒（遥控可调）14-40cm/秒（遥控可调）14-41cm/秒（遥控可调）14-34cm/秒（遥控<br />\r\n<br />\r\n可调）<br />\r\n关闭速度10-40cm/秒（遥控可调）10-38cm/秒（遥控可调）10-39cm/秒（遥控可调）14-34cm/秒（遥控<br />\r\n<br />\r\n可调）<br />\r\n开放时间0-9秒<br />\r\n停电时手动开启力46N（4.7kgf）61.7N（6.3kgf）63.7N（6.5kgf）89.2N（9.1kgf）<br />\r\n环境温度-20℃&nbsp;-&nbsp;+50℃<br />\r\n电压AC200-250V&nbsp;50/60Hz<br />\r\n孝感供应上海松下自动门电机上海海栌松下自动门销售店正品价格更低<br />\r\n本公司地址:上海市漕河泾开发区漕宝路1243号','weixiuzdmjk2','海栌','','sh51707606@163.com','021-51692106','0','1','1','','116.232.199.88','上海市徐汇区电信','1','/attachment/information/201707/pre_1501150422nk3fh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
