INSERT INTO my_information VALUES ('1983','CF型充液阀，TCF型充液阀，CF1H-125B充液阀','136','1501204493','365','1532740493','直销CF型充液阀&nbsp;充液阀&nbsp;泰丰充液阀&nbsp;<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					产品名称：&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					充液阀&nbsp;<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					产品类别：&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					机械及工业制品&nbsp;&amp;gt;&nbsp;液压机械及部件&nbsp;<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					型&nbsp;&nbsp;&nbsp;&nbsp;号：&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					CF&nbsp;<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				<br />\r\n					品&nbsp;&nbsp;&nbsp;&nbsp;牌：&nbsp;<br />\r\n				<br />\r\n			<br />\r\n			<br />\r\n				<br />\r\n					泰丰&nbsp;<br />\r\n				<br />\r\n			<br />\r\n		<br />\r\n	<br />\r\n	充液阀，主要用于高压回路与低压回路的无泄露隔离。只用于防气腐蚀功能和冲夜，安装维修都非常方便，可替代进口产品，该系列产品通经32用于螺纹连接，通经40以上用于法兰连接，带或不带预卸压功能可选择，产品具有压力低，复位可靠，可直接安装于液压缸上，结构紧凑，外形尺寸较小等优点。&nbsp;<br />\r\n	简介&nbsp;<br />\r\n	充液阀是一种液控单向阀，一个方向止流，另一个方向自由流通，先导动作是由油口供压的控制阀芯用液压实现的，由此而直接打开主阀。这种阀是为叠加系统而设计的，即在一个基础件上可以叠加各种各样的其它类别的液压阀。&nbsp;<br />\r\n	结构特点&nbsp;<br />\r\n	充液阀采用弹簧加载式盘式截止结构，能使活塞在压力作用下快速充放，充液阀也可以设置预开启压力，具有可靠的密封性能。加工精良，精密高度，无泄漏，保压性能良好。&nbsp;自身带缓动阀芯，能有效减少动声和振动。&nbsp;<br />\r\n	用途及原理&nbsp;<br />\r\n	广泛应用于锻压机械、高速度冲床、压力机、注塑机等机器。在锻压机械中能使压机油缸起到快速充油和排油的作用。在高压与大流量时，能起到卸荷作用，并避免卸荷冲击。充液阀一般作为液压和油箱间的吸排油阀使用。大型压力机在快速行进时，油缸要大量补充油液，自动向油箱吸油；慢进加压时要防止油液从油缸反窜油箱。反向时油液可从油缸排回油箱。&nbsp;<br />\r\n	典型型号列举&nbsp;<br />\r\n	产品名称&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;型号&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;规格<br />\r\n	TCF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TCF1(2)-H**B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;40-100<br />\r\n	CF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;CF1(2)-DG24-H***B-NX&nbsp;&nbsp;100-400<br />\r\n	TRCF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TRCF1(2)-***A1-10&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;100-300<br />\r\n	STF型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;STF-H40NX-V&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;25-160<br />\r\n	CFK型充液阀&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;CFK-H25B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;25-40<br />\r\n	厂家直销CF型充液阀&nbsp;充液阀&nbsp;泰丰充液阀<br />\r\n	联系人：刘海洪<br />\r\n	手机：18660757371','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1501204493ctkcw.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1984','泰丰股份,电磁换向阀4WE6D-50排名,电磁换向阀4WE6','136','1501204833','365','1532740833','泰丰股份,电磁换向阀4WE6D-50排名,电磁换向阀4WE6D-50品牌&nbsp;|&nbsp;山东泰丰液压股份有限公司<br />\r\n	电磁换向阀是用电磁铁直接推动阀芯移位工作的小型方向控制阀，主要用于控制液体的通断和流动方向，也可作为先导控制阀，以控制各种大通径的液压阀，实现对大功率液压阀的先导控制<br />\r\n	特点:<br />\r\n	以直动式电磁铁操作方向滑阀作为标准类型<br />\r\n	安装面符合DIN24340&nbsp;A型&nbsp;ISO&nbsp;4401和CETOP-RP121H<br />\r\n	带可拆卸线圈的湿式直流或交流电磁铁<br />\r\n	电磁铁可旋转90度<br />\r\n	可以迅速而方便的更换电磁铁线圈而不引起液压系统漏油<br />\r\n	可选的手动应急操作','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_15012048334m8vj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1985','淮安QGB25 40 50 80气动隔膜泵铝合金涂料化工泵','136','1501204921','365','1532740921','淮安QGB25&nbsp;40&nbsp;50&nbsp;80气动隔膜泵铝合金涂料化工泵排名靠前，价格好、服务好。<br />\r\n2寸铝合金气动隔膜泵&nbsp;隔膜泵&nbsp;橡胶膜片高效率气动隔膜泵气动隔膜泵为枣阳市有发机械有限公司自主开发专利的品质，流量足出液有劲，永不堵塞、永不死机首先将过滤装置装在浆液入口处；<br />\r\n气路应设置调压器、压力表及气路开关；<br />\r\n使用前将排污阀门打开，关闭隔膜泵阀门，将锈蚀污物及冷凝剂排净；在关闭排污阀门，开启隔膜泵阀门；<br />\r\n打开气路开关时应逐步升压，使气泵逐步进入高频状态。<br />\r\n使用前试运行3-5分钟，检查各接口及管路是否有泄流；<br />\r\n使用后尤其是在抽吸易冻介质后须将泵体内介质排干净，以免造成下次开泵困难，同时清洗也有助于延长泵膜片的寿命，尤其是介质酸碱度较高或杂质较多时。使用后应将进气口及介质进出口加防护盖。<br />\r\n气动隔膜泵是一种新型输送机械，采用压缩空气为动力源，对于各种腐蚀性液体，带颗粒的液体，高粘度、易挥发、易燃、剧毒的液体，均能予以抽光吸尽。<br />\r\n好的使用习惯和维护方法是&nbsp;气动隔膜泵正常减少维修的前途。多谢你的了解。欢迎登录www.fk360.cn&nbsp;大型专业隔膜泵研发、生产、销售企业了解最新咨询。对于各种腐蚀性液体，带颗粒的液体，高粘度、易挥发、易燃、剧毒的液体，只要我们的泵在均能予以抽光吸尽。联系企鹅475248546手机13308675011欢迎联系。厂家厂价。淮安QGB25&nbsp;40&nbsp;50&nbsp;80气动隔膜泵铝合金涂料化工泵','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','1','1','','121.63.156.189','湖北省襄阳市电信','1','/attachment/information/201707/pre_1501204921pk2jm.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1986','河北消防排烟风机箱生产厂家','136','1501205559','365','1532741559','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.155.140','山东省德州市电信','1','/attachment/information/201707/pre_1501205559xe4xa.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1987','佛山路灯维修车|番禺路灯维修车|广州众誉','136','1501206223','365','1532742223','佛山路灯维修车|番禺路灯维修车|广州众誉&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;广州路灯维修车出租路灯维修车电话13600005563<br />\r\n	广州路灯车维修&nbsp;路灯车维修&nbsp;广州路灯车维修电话&nbsp;佛山路灯车维修&nbsp;电话<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','119.130.231.79','广东省广州市天河区电信','1','/attachment/information/201707/pre_1501206223q2uau.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1988','铜陵现货供应GF1100分散机|高速分散机|GF-1100','136','1501207744','365','1532743744','铜陵现货供应GF1100分散机|高速分散机|GF-1100湖北枣阳有发机械有限公司是沃的牌GF1100型高速分散机生产厂家，价格好、服务好。<br />\r\n沃的牌GF-1100型高速分散机是一种新型产品，该产品可分散2L-20L，是实验室人员理想的实验设备。<br />\r\n本设备采用电子恒力调速线路，数字直接显示转轴速，并配有多种分散叶轮。能适应实验室不同的试验需要，并可根据显示的转轴速度直接计算分散叶轮的线速度与物料粘度及化学反应速率之间的关系，为大规模投产提供正确的数据。(手动升降,220V电压)<br />\r\n高速分散的最常用途是把极微细的固体粒子加入液体中，做成悬浮粒子。&nbsp;悬浮粒子的特性是微细粒子不受地心吸力而沉淀。&nbsp;在分散的过程中，几个过程同时进行。<br />\r\n相关关键词如下：<br />\r\n北京分散机,上海,天津,重庆,香港,澳门,台湾,深圳,郑州,广州,东莞,苏州,西安,济南分散机,杭州,佛山分散机,武汉分散机,青岛,成都,潍坊,南京,<br />\r\n沧州,温州分散机,无锡,保定,南宁,厦门,济宁分散机,新乡,福州,长沙,昆明,烟台,常州,沈阳,宁波分散机,廊坊,唐山分散机,长春分散机,泉州,衡水分散机,泰州分散机,<br />\r\n大连临沂邢台合肥襄樊分散机&nbsp;购买沃的牌GF1100型高速分散机就选信得过的-湖北枣阳有发机械有限公司。','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','0','1','','121.63.156.189','湖北省襄阳市电信','1','/attachment/information/201707/pre_1501207744bwgfj.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1989','皮肤系统障碍牛皮癣上海矽尚生物科技','136','1501208039','365','1532744039','忍受牛皮癣折磨二十年，自杀多次终治愈!<br />\r\n	我山东菏泽巨野县的一个乡镇的领导，二十年前，突然发现背上长了一小块白皮，谁能想到，这一小块皮屑就是我噩梦的开始，正是这个噩梦苦苦折磨了我二十多年。自从患上了牛皮癣，工作也没法干了，只好请长期病假。痛苦一言难尽，这些年一天天的度日如年，最难忍受的时候家务活都不能干，身上的皮紧的弯腰都弯不下，腿也蹲不下，疼痛难忍，后来严重到皮肤往外渗出血水、脓水、脏水，一夜的时间枕头、被子都能浸湿。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	为了治好牛皮癣，我二十多年来，到处奔波，四处求医，走遍了大大小小的私立、公立医院，拜访了无数名医，试了无数的偏方、药方，罪受了很多，家里花的倾家荡产，欠了20多万的债，其间我在齐齐合尔和西安被所谓神医、妙方两次骗去近十万元。令人意想不到的是，牛皮癣不但没有治好，反而更加的严重。多年来，疾病康复无望，还要继续承受病痛的折磨。我是个好强又要面子的人，曾经三次自杀被家人和亲友劝阻，欲哭无泪。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	2016年8月，在上海打工的一个侄子给我介绍上海的干细胞活化素，抱着最后一试想法，买了一个疗程的，想不到一个月银屑就退掉了。2017年的春节已经彻底好转，从服用肝细胞活化素至今有九个月，已经痊愈了。我是一个有点文化的人，查阅资料，才知道牛皮癣属于自体免疫系统疾病，只有细胞活化才能治愈牛皮癣，在此我忠心感谢我的侄子和干细胞活化素给了我第二次生命！！！！！！&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;专家坐诊V信：xyw21009','yeaxing123','张先生','395998237','395998237@qq.com','0370-2690016','0','1','1','','42.228.113.254','河南省郑州市联通','1','/attachment/information/201707/pre_1501208039sdppq.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1990','教学管理与教育研究杂志社','136','1501208452','365','1532744452','《教学管理与教育研究》是由国家新闻出版广电总局批准，教育部主管、语文出版社主办的国家级教育类学术期刊（半月刊），国内刊号：CN10-1390/G4。本刊面向全国学校教育的发展管理、教学研究、科研创新和师资培养等领域，展示我国学校教育科研领域的最新成果，交流教学管理与课程建设方面的新鲜经验，研究教育改革与发展中的重大现实和理论问题。现面向全国广大中小学、各类高校教师和教育行政管理工作者以及高校在读研究生征稿。<br />\r\n主要栏目：教学管理、教育研究、特别报道、名家访谈、教学赏析&nbsp;、教师教育、教育成果、德育与心理、国际交流、互联网教育（互联网+&nbsp;教育）、图书评论、师生互动、热点聚焦。<br />\r\n投稿邮箱：zfqikan@vip.163.com（来稿注明：《教学管理与教育研究》投稿）<br />\r\n编辑QQ:2851209624&nbsp;石编辑','xuyongjun1','徐','173065458','173065458@qq.com','0530-3126206','0','1','1','','27.206.98.172','山东省菏泽市联通','1','/attachment/information/201707/pre_1501208452lyxur.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('1991','河北消防排烟风机箱性能参数','136','1501211179','365','1532747179','消防排烟风机箱产品介绍：<br />\r\n<br />\r\n傲中消防排烟风机箱是一种高风压大风量、低噪声离心式风机箱，具有耐高温，高温排烟系统电机与气流隔离分开，确保风机在300摄氏度高温情况下，连续运行60分钟以上、性能优良、结构新颖紧凑、振动小、重量轻、安装使用方便等优点，是宾馆、饭店、礼堂、影剧院、地下室、厂矿企业、办公楼等场所通风排烟的理想设备，是高层建筑用消防排烟风机的更新换代产品，现已畅销各国各地，深受用户好评。<br />\r\n<br />\r\n消防排烟风机箱特点<br />\r\n<br />\r\n1、&nbsp;结构扎实。箱体采用框架、箱板拼装设计。框架采用国内先进的金属冷弯成形机组一次拉伸而成，箱板为复式板结构，内层为消声材料，进一步降低了噪声。<br />\r\n<br />\r\n2、&nbsp;公司为不同和客户不同的现场情况提供多种不同的进出口方向，设备配件采用精密模具化生产，尺寸精度高，拆散后可组装，便与运输产生物流高成本。<br />\r\n<br />\r\n3、&nbsp;风机叶轮吸与国内外大专院校合作开发的基础上，全部采用模具化生产。为多叶翼前倾叶轮，具有效率高、噪声低、风量大、运行平稳、质量稳定、经久耐用等特点。蜗壳采用优质镀锌板或碳钢板，机械化生产。<br />\r\n<br />\r\n山东傲中空调设备有限公司<br />\r\n<br />\r\n联系人：王经理<br />\r\n<br />\r\n手&nbsp;&nbsp;机：13395440001<br />\r\n<br />\r\n电&nbsp;&nbsp;话：0534-2108781<br />\r\n<br />\r\n传&nbsp;&nbsp;真：0534-2107781<br />\r\n<br />\r\n邮&nbsp;&nbsp;编：253000<br />\r\n<br />\r\n邮&nbsp;&nbsp;箱：aozhongxs@163.com<br />\r\n<br />\r\n网&nbsp;&nbsp;址：www.sdazkt.com<br />\r\n<br />\r\n地&nbsp;&nbsp;址：山东德州经济开发区','sdazkt','王峰','','sdazkt@163.com','0534-2108781','0','1','1','','122.5.155.140','山东省德州市电信','1','/attachment/information/201707/pre_1501211179ah25e.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
