INSERT INTO my_information VALUES ('1993','杭州金母子小儿推拿师七天培训班，七天圆您金领梦！','136','1501213387','365','1532749387','实践证明，小儿推拿疗法是一种简单易行、安全有效的方法。从患儿的各个方面看来，不需要复杂的设备，不给小儿带来恐惧感、不用打针服药，避免了药物的毒副作用。同时帮助家长解决了喂药困难的情况，减轻了孩子的痛苦，达到健脾胃、强壮身体、益智、预防近视的作用。再者，小儿推拿操作简单、一学就会、一用就灵，非常适用于家庭应用，既有利于家庭保健又有助于亲子间的感情交流，更有助于孩子的身心健康成长。<br />\r\n近几年来，中.国每年新出生人数均在1500万以上。儿童家长对小儿推拿培训服务、上门服务和实体店服务的需求与日俱增。小儿按摩网的顾问、国内著名的小儿推拿名家们建议：小儿每周至少接受2次保健推拿，将大大降低小儿生病的几率，每天都做效果更好。因此，小儿推拿有着巨大的市场需求和发展潜力，是一个新兴的朝阳行业、黄金行业。<br />\r\n你想要成为月入万元的职业金领吗？你想要成为时间自由安排的高端手艺人吗？你想要自主创业吗？你一定要来金母子母婴健康培训机构，金母子母婴培训7天班，最低只要7天，一定会助你达成梦想！<br />\r\n所有课程上课时间为七天，全为干货。不仅大大缩短了大家的时间，费用也大幅下降。课程大家可自己选择有空的时间来学习，（小班制，连上7天）报名后，在一年内学习完成即可，一期学员满10人即可开课。所有金母子学员，报名7天课程中的任何一项，可在原课程费用上再优惠500元。（课程表可联系老师发送）<br />\r\n金母子7天培训项目有哪些？<br />\r\n1.催乳师培训7天班<br />\r\n2.小儿推拿培训7天班<br />\r\n3.产后康复培训7天班<br />\r\n4.中医灸疗师培训7天班<br />\r\n详细课程表和培训项目内容，请联系：13720881939，13850081535&nbsp;（手机号也是微信号，也可微信报名）<br />\r\n	金母子母婴培训项目介绍：<br />\r\n	金母子拥有国家中医药管理局，中.国中医药科技开发交流中心授权培训中心，福建省正规权威培训中心。<br />\r\n	拥有职业培训六大项目，中医催乳师、中医小儿推拿保健师、中医产后康复师、中医月子膳食调理师、育婴师、中医灸疗师<br />\r\n	在金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n	金母子获得最美家政创业全国百强的荣誉称号！金母子成中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位，<br />\r\n	厦门市婴童产业协会员单位，2017湖南电视台打造新剧《小戏骨之方世玉》福建地区海选专场官方合作机构。<br />\r\n	金母子母婴职业培训优势：<br />\r\n	一，品牌优势：厦门金母子健康咨询有限公司，是由国.家中医药管理局、中.国中医药科技开发交流中心授权的大型培训中心，福建省正规权威培训中心，国家承认的教学培训机构。<br />\r\n	二，师资优势：金母子拥有业内最强大师资团队：金母子的教学老师，均为国家中医药管理局注册师资，从事母婴行业和中医行业十多年经验，有着丰富的实操服务经验和母婴培训经验。<br />\r\n	在金母子学习，有厦门医学院教授倾囊相授；有福建首位小儿推拿医师、厦门中医院小儿推拿专家医师临床授课；我们的老师，也是各大社区母乳喂养的特聘讲师。<br />\r\n	三，教学优势：金母子教学内容，每个项目都严格按照相关的国.家.职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。并提供专业理论教学+真人产妇实.操+营销基础等特色教学服务。理论结合实践，学员可到医院和诊所见习。力争让每位学员都学到真本领。金母子已培育了5000多名来自全国各地的学员，并且还在增加之中。<br />\r\n	四，证书优势：金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n	五，项目优.势：金母子母婴培训机构拥有催乳师、小儿推拿师，产后康复师，月子膳食调理师、中医灸疗师、育婴师，等六大专业，覆盖范围.最.广，技.，能，最，全，学员选择方向多，一专多能，必将成为母婴服务行业的佼佼者！<br />\r\n	六，后勤支持优势：外地学员，公司免，费提供住宿，解除生活上的后顾之忧，专心学习。金母子积极引导培训学员参加职业培训和技能考核鉴定，并全力安置就业，扶持创业。对有意向自主创业从事家庭服务业的学员，金母子组织创业培训班，许多学员在公司的指导下开办了母婴护理中心和家庭服务中心，在实现创业的同时带动了更多人的就业。<br />\r\n	来厦门金母子，参加专业权威的职业培训，成为优秀催乳师，小儿推拿师，产后康复师，开始踏上辉煌的职业旅程吧！<br />\r\n&nbsp;<br />\r\n	&nbsp;<br />\r\n	全国报名热线：400-9983-693&nbsp;&nbsp;&nbsp;&nbsp;，13720881939，13850081535（备注：手机号码即微信号，可接受微信报名！）<br />\r\n	官方网站：www.xmjmz.cn<br />\r\n	报名地点：培训地址：厦门市嘉禾路388号永同昌大厦3A','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','0','1','','120.41.169.75','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1501213387qswqs.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
