INSERT INTO my_information VALUES ('2004','YHZ32-500CV湖州压机二通插装阀泰丰液压生产','136','1501294634','365','1532830634','二通插装阀由插装件、控制盖板，先导控制阀、集成块体，四部分组成　　1.插装件&nbsp;―&nbsp;又称主伐组件，它由阀芯、阀套、弹簧和密封圈四种零件组成。主要功能是用来控制主油路方向、压力和流量。　　2.控制盖板－&nbsp;由盖板内嵌微型先导控制元件（节流螺塞）以及其它零件等构成。它主要用来固定插装件并保证密封；沟通控制油路和主伐控制腔之间的联系，并实施控制。　　3.先导控制阀―&nbsp;安装于控制盖板上（也可以&nbsp;直接安装集成块体上），是实施对主伐插装件动作&nbsp;控制的较小规格的控制阀。主要有￠6和￠10痛&nbsp;径的标准电磁换向阀，比例调压阀，可调阻尼器，缓冲器等。主伐规格较大的可根据需要用较小的二通插装阀进行二级控制。符合ISO及国家标准尺寸电磁阀，可同国内外同类产品互换安装。　　4.集成块体―&nbsp;用来安装插装件、控制盖板和其它控制阀，沟通主油路和控制油路的块体。&nbsp;<br />\r\n一、二通插装阀系列产品：Dg16-Dg160通径流量范围为：63&nbsp;L/min-15000L/min&nbsp;　　二、充液阀：Dg40-Dg400通径流量范围为300L/min-35000L/min&nbsp;　　三、电液成套系统：可为用户提供电液一体化成套装置容积为0.8-20&nbsp;　　四、液压缸：&nbsp;　　1.40T-1200T液压折弯机主油缸及充液阀&nbsp;　　2.Q12Y12×3200-60×6000液压剪板机和压料脚油缸&nbsp;　　3.Q12Y6×3200-60×6000液压剪板机和压料脚油缸&nbsp;　　4.各类冶金设备用油缸及工程缸&nbsp;　　五、三大类传统板式滑阀：&nbsp;　　1.溢流阀&nbsp;　　2.顺序阀&nbsp;　　3.单向阀&nbsp;　　4.电磁方向阀&nbsp;　　5.液控单向阀&nbsp;　　6.节流阀&nbsp;　　7.流量控制阀&nbsp;　　六、螺纹插装阀&nbsp;　　可供产品目录：&nbsp;　　&nbsp;　　二通插装阀集成系统：&nbsp;　　1、Y27；Y28；Y32；Y61；Y71；Y81；Y94系列630-50000KN液压机二通插装阀集成系统&nbsp;　　2、WC67Y系列400-8000KN液压折弯机二通插装阀集成系统&nbsp;　　3、QC12Y系列6×3200-50×12000液压剪板机二通插装阀集成系统&nbsp;　　4、500-50000KN铝型材挤压机二通插装阀集成系统&nbsp;　　5、1600-30000克注塑机二通插装阀集成系统&nbsp;　　6、2500-20000KN压铸机二通插装阀集成系统&nbsp;　　7、THP10-10000T万吨框架液压机二通插装阀集成系统&nbsp;　　8、THP98C-1000T研配及试模液压机二通插装阀集成系统&nbsp;　　9、THP27-3000T框架单动液压机二通插装阀集成系统&nbsp;　　10、THP29-3000T汽车纵梁液压机二通插装阀集成系统&nbsp;　　11、THP61-1250T轴头挤压生产线二通插装阀集成系统&nbsp;　　12、THP24-4000/5200T框架双动液压机二通插装阀集成系统&nbsp;　　13、YH73-500精密数控热压成型液压机二通插装阀集成系统&nbsp;　　14、YH24-1000/2000封头液压机二通插装阀集成系统&nbsp;　　15、RZU2000HC快速液态模锻液压机二通插装阀集成系统&nbsp;　　16、3500T锻造液压机二通插装阀集成系统&nbsp;　　&nbsp;　　电液成套系统：&nbsp;　　1、3×500T、5×500T、6×500T、7×500T汽车纵梁联动液压机电液成套系统&nbsp;　　2、350立方米高炉炉顶、槽下液压成套系统&nbsp;　　3、厚板坯连铸机钢包回转台液压成套系统&nbsp;　　4、固定锯、移动锯、矫直机二通插装阀成套系统&nbsp;　　5、连轧机层流冷却电液成套系统&nbsp;　　6、冷轧薄板四机架及酸洗线电液成套系统&nbsp;　　7、φ114焊管机组电液成套系统&nbsp;　　8、1600×2500板坯联铸机液压成套系统&nbsp;　　9、步进式加热炉、冷床液压成套系统&nbsp;　　10、厚板联坯铸机滑动水口液压伺服成套系统&nbsp;　　11、厚板联坯铸机维修区整体段、扇形段液压成套系统&nbsp;　　12、铁水脱流扒渣液压成套系统&nbsp;　　13、转炉钢水包竖直揭盖机液压成套系统&nbsp;　　14、高速线材清洗线液压成套系统&nbsp;　　15、100T&nbsp;LF加热炉、VD加热炉液压成套系统&nbsp;　　16、φ406-2440，φ466-2200，φ508-2200螺旋焊机组液压成套系统&nbsp;　　17、1600-3200KN水压试管机液压成套系统&nbsp;　　18、十一辊板材矫正机液压成套系统&nbsp;　　19、φ340，φ278无缝钢管生产线环形炉、步进炉、推缸机、穿孔机、轧管机、精整区液压成套系统','kujxx544','盛经理','1526664328','1526664328@qq.com','0537-2718611','0','1','1','','112.53.81.18','山东省德州市移动','1','/attachment/information/201707/pre_1501294634qvvjn.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
