INSERT INTO my_information VALUES ('2007','湘潭火锅加盟哪家好?重庆老火锅加盟老社长','136','1501312793','365','1532848793','火锅加盟哪家好?重庆老火锅加盟老社长<br />\r\n<br />\r\n火锅加盟哪家好?老社长知青火锅教你玩转火锅店！<br />\r\n<br />\r\n开一家火锅店，不仅仅是简单的前提投入，而且更多的是后期的营销方案！老社长知青火锅，13年品牌影响力，开启“先加盟后付费”的加盟合作模式。同时老社长知青火锅教你玩好营销套路，开店选址装修一条龙全程火锅加盟支持选老社长知青火锅！<br />\r\n<br />\r\n如何经营一家火锅店?老社长知青火锅总部给你节省人力，降低本钱。大量实体店案例分析，详解落地实用的火锅店创新营销方法。<br />\r\n<br />\r\n老社长知青火锅加盟一直都有一个品牌风格清晰的品牌定位、系统的品牌形象识别与完善的品牌体系，为了能够比较有实力打造大牌品质，实力总部多角度护航，让加盟者轻松致富，重庆火锅加盟――老社长知青火锅加盟一直都在探索比较新奇的服务以及品牌定位这就是一个品牌的上进之路。对于现代人来说喜欢追求新颖时尚的这也是每个人的一种本性，那么老社长知青火锅充分从消费者的心理动身，不同锅底带来的不同心情，以此来满足不同年龄段的美食享受。<br />\r\n<br />\r\n旺店考察&nbsp;开店模式一手掌握<br />\r\n<br />\r\n加盟电话：023-60362400;18702362999<br />\r\n网址：www.laoshezhanghg.com&nbsp;<br />\r\n<br />\r\n学习不停，考察不止，新鲜的餐饮模式，一次学习，打包带走。少走弯路，多赚钱。老社长知青火锅属于一站式经营项目，从开店选址到后期运营都是有专业技术指导，手把手教你开店赚钱!现在开家老社长知青火锅店，不受店面面积的直接影响，店面可大可小，选址多集中在商场、购物中心、超市、步行街、休闲广场、学校周边、居民区等地方，只要是有人流量的地方都能经营。<br />\r\n<br />\r\n火锅加盟哪家好?咨询老社长知青火锅官网发送您的姓名+电话+所在地区)会有专业的技术人员根据您所在地的经济人口情况，以及您的个人需求详细谋划开店方案，以及投资预算!<br />\r\n<br />\r\n原文标题：火锅加盟哪家好老社长知青火锅教你经营火锅店','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.189.19','重庆市电信','1','/attachment/information/201707/pre_1501312793ogdvz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2008','酒泉金母子中医催乳师培训班，7天成就女性金领职业梦想！','136','1501321004','365','1532857004','好消息！金母子重磅推出七日课程，所有课程上课时间为七天，全为干货。不仅大大缩短了大家的时间，费用也大幅下降。课程大家可自己选择有空的时间来学习，（小班制，连上7天）报名后，在一年内学习完成即可，一期学员满10人即可开课。所有金母子学员，报名7天课程中的任何一项，可在原课程费用上再优惠500元。&nbsp;&nbsp;<br />\r\n	都说女人撑起半边天，这个时代，女人的社会地位已经不同往日。对于想要经济自由的女性来说，选择一个适合的职业至关重要。一个对的职业可以让女人少奋斗几年，一个对的职业可以让女人更轻松地走向成功。而母乳喂养指导师（催乳师）就是一个特别适合女性的职业！时间自由，可兼顾家庭，市场需求旺盛，收入还不菲。这样一个职业，自然吸引了不少有眼光的女性加入。&nbsp;<br />\r\n	<br />\r\n	<br />\r\n你想要成为月入万元的职业金领吗？你想要成为时间自由安排的高端手艺人吗？你想要自主创业吗？你一定要来金母子母婴健康培训机构，金母子催乳师七天培训班，最低只要7天，一定会助你达成梦想！&nbsp;<br />\r\n	金母子母婴培训项目介绍：<br />\r\n拥有职业培训六大项目：中医催乳师培训、小儿推拿培训、产后康复师、中医月子膳食调理师培训、育婴师培训、中医灸疗师培训&nbsp;<br />\r\n厦门金母子荣誉资质：（部分）&nbsp;<br />\r\n	&nbsp;<br />\r\n	1、中医小儿推拿师7天培训班<br />\r\n2、中医产后恢复师7天培训班<br />\r\n3、中医灸疗师7天培训班<br />\r\n4、中医催乳师7天培训班&nbsp;<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	在金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n《中医药适宜技术职业化培训证书》：证书可以同时在：国家中医药管理局中.国中医药科技开发交流中心官方网站（www.tcm.cn）、国家中医药管理局人才交流中心（www.hrtcm.org）查询。&nbsp;&nbsp;<br />\r\n	该证书“允许中医养生保健机构有资质的职业技能人员经考核在医疗卫生机构提供调理服务。”该证书是目前为止唯一由政府职能部门红头文件规定可以在“医疗卫生机构提供调理服务”的职业技能培训证书。有了此证就可以从事这方面的工作。&nbsp;<br />\r\n	金母子母婴职业培训优势：<br />\r\n一，品牌优势：厦门金母子健康咨询有限公司，是由国家中医药管理局、中.国中医药科技开发交流中心授权的大型培训中心，福建省正规权威培训中心，国家承认的教学培训机构。厦门金母子拥有中医药适宜技术职业化培训资质，荣获最美家政人员创业全国百强的荣誉称号。厦门金母子成为中.国民间中医医药研究开发协会母婴家庭保健分会常务理事单位。2017年成为湖南电视台打造新剧《小戏骨之方世玉》福建地区海选专场官方合作机构。<br />\r\n二，师资优势：金母子拥有业内最强大师资团队，金母子的教学老师，均为国家中医药管理局注册师资，从事母婴行业和中医行业十多年经验，有着丰富的实操服务经验和母婴培训经验。<br />\r\n在金母子学习，有厦门医学院教授倾囊相授；有福建首位小儿推拿医师、厦门中医院小儿推拿专家医师临床授课；我们的老师，也是各大社区母乳喂养的特聘讲师。<br />\r\n三，教学优势：金母子教学内容，每个项目都严格按照相关的国家职业标准培训教材，教学大纲，考核大纲等，每项课程都制定了科学合理的教学计划。并提供专业理论教学+真人产妇实操+营销基础等特色教学服务。理论结合实践，学员可到医院和诊所见习。力争让每位学员都学到真本领。金母子已培育了5000多名来自全国各地的学员，并且还在增加之中。<br />\r\n四，证书优势：金母子培训合格的学员均频发国家证书，全国通用，出境有效，国家官网可以查询。<br />\r\n五，项目优势：金母子母婴培训机构拥有中医催乳师培训、小儿推拿师培训，产后康复师培训，育婴师培训、中医灸疗师培训、中医月子膳食调理师培训等六大专业，覆盖范围最广技能最全，学员选择方向多，一专多能，必将成为母婴服务行业的佼佼者！<br />\r\n六，后勤支持优势：外地学员公司免费提供住宿，解除生活上的后顾之忧，专心学习。金母子积极引导培训学员参加职业培训和技能考核鉴定，并全力安置就业，扶持创业。对有意向自主创业从事家庭服务业的学员，金母子组织创业培训班，许多学员在公司的指导下开办了母婴护理中心和家庭服务中心，在实现创业的同时带动了更多人的就业。<br />\r\n来厦门金母子，参加专业权威的职业培训，成为优秀催乳师，小儿推拿师，产后康复师，育婴师，中医灸疗师，中医月子膳食调理师，开始踏上辉煌的职业旅程吧！','xmjmz6666','范桃连','2017013620','2017013620@qq.com','0592-5537128','0','1','1','','120.41.169.75','福建省电信(CDMA全省共用出口)','1','/attachment/information/201707/pre_1501321004txoiz.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2009','衢州YFGZ30B涂料灌装机价格实惠品质上乘专业生产厂家','136','1501376805','365','1532912805','YFGZ30B涂料灌装机&nbsp;&nbsp;湖北枣阳有发机械YFGZ30B涂料灌装机价格实在,规格齐全,品质上乘。<br />\r\nYFGZ30B涂料灌装机适用于各种不同材质的开口以及上盖封闭的硬质容器，称重控制从0―60公斤。适用于各种润滑油、机用矿物油、食用油、洗涤剂、果酒饮料、酱油、糖浆.涂料、油漆、油墨、胶粘剂、固化剂、有机溶剂、日化、洗涤剂、农药、医药、及各种可流动液体。有粘、无粘、有、无腐蚀性液体的大量灌装。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;YFGZ30B涂料灌装机湖北枣阳有发机械专业有发生产，获得国家专利，专业生产销售涂料灌装机，种类齐全，质优价廉，涂料灌装机耗能低，专业设计团队为您服务，保期内出现的损坏免费更换和维修。<br />\r\nYFGZ30B涂料灌装机主要特点：<br />\r\n1.&nbsp;定量值有0-60kg（可任意设定）.<br />\r\n2.&nbsp;称重数值即时显示.<br />\r\n3.&nbsp;净重/毛重二种灌装方式.<br />\r\n4.&nbsp;可设定和存贮配方.<br />\r\n5.&nbsp;加料快/慢二级速度.<br />\r\n6.&nbsp;可更换式出料阀口.<br />\r\n7.&nbsp;快拆式灌装头方便清洗.<br />\r\n8.&nbsp;该灌装阀以其先进的机械结构，独特的动作方式，保证了高速高精度灌装<br />\r\n9.&nbsp;采用了二级灌装动作控制，动作快而准确，可靠性高，最大程度的防止滴漏现象。<br />\r\n10.&nbsp;自动/手动二种操作方式.<br />\r\n&nbsp;<br />\r\nGZ-30B&nbsp;防爆灌装机主要用于化工原料的定量自动灌装，特别适用于化工行业油料的自动液体定量灌装也适用于食品、制药行业乳液类物料自动定量灌装。<br />\r\n一台机器即可进行不同规格、不同形状、不同重量进行灌装，多用途并保持精确度不变，适用于涂料、油墨、粘合剂（胶水）、树脂、化工溶剂、固化剂、润滑油、农药、医药、日化、食用油等各种可流动液体领域。<br />\r\nGZ-30B&nbsp;防爆灌装机<br />\r\n灌装高度可调、适合圆、方、扁、各种罐型及口径高粘度液体灌装；&nbsp;<br />\r\n一体机型、移动方便、一机多用；&nbsp;<br />\r\n双速灌装“快准”&nbsp;稳定性好。&nbsp;<br />\r\n应用范围：涂料，油墨，粘合剂，树脂，润滑油，农药，日化，食用油及各种可流动液体.&nbsp;<br />\r\n主要功能：数字输入设定重量，修改一个灌装数值就完成设定，简单。&nbsp;<br />\r\n动态灌装运行状态指示.&nbsp;<br />\r\n自动零位跟踪,&nbsp;桶数量累计与重量累计.&nbsp;<br />\r\n灵活移动,防爆配置,操作特别智能化，容易.&nbsp;湖北枣阳有发机械有限公司地址:兴隆镇杨楼教育大道','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','1','1','','121.63.156.189','湖北省襄阳市电信','1','/attachment/information/201707/pre_1501376805lntsu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2010','广州众誉_云梯车租赁_番禺云梯车出租','136','1501378776','365','1532914776','广州众誉_云梯车租赁_番禺云梯车出租&nbsp;|&nbsp;广州众誉机械设备租赁有限公司<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;云梯车出租广州云梯车出租佛山云梯车出租番禺云梯车出租电话<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.gzzyjx99.com<br />\r\n	云梯车出租广州云梯车出租云梯车出租价格云梯车出租电话佛山云梯车出租番禺云梯车出租<br />\r\n	广州众誉机械设备租赁有限公司是一家实力雄厚的高空作业设备出租公司，高空作业车有：14米高空车出租、16米高空车租赁、18米高空作业车出租、24米高空作业车租赁和多种高空作业平台出租，业务覆盖整个广东地区，主要包括深圳高空车出租、东莞升降车出租、广州高空车租赁、惠州升降机出租、中山高空车租赁和珠海高空作业车出租等。<br />\r\n&nbsp;&nbsp;&nbsp;高空作业车广范应用于工程建设、厂房施工、厂房维护、市政、电力、路灯、通讯、园林、交通、工矿、工业安装、设备检修、立体仓库、影视广告的制作拍摄、高空管路的铺设、各种场馆的物业维护、高架桥梁的建造和涂装等各种需要登高作业的场合。通过广州众誉高空设备租赁有限公司高空车出租服务来降低客户使用大型高端高空作业平台的门槛，减少建设和运营成本。极大地提高了施工企业的工作效率，很大程度上降低了工作成本，同时施工安全也得到明确的保障。解决了施工单位在安全上的顾虑。<br />\r\n	&nbsp;&nbsp;&nbsp;租赁项目：高空车出租、高空作业平台出租、升降机租赁、升降车出租、铝合金脚手架租赁、高空作业车出租、剪叉式高空作业平台出租、路灯安装车出租、路灯维修车租赁、升降平台出租、登高作业车出租、登高作业平台出租、云梯车出租及各种高空平台租赁等服务项目。<br />\r\n	&nbsp;&nbsp;&nbsp;广州众誉机械设备租赁有限公司的宗旨是“以安全为基础，以服务为宗旨，以客户为中心”，目标是创建一流的专业高空作业设备租赁公司，对社会负责，让客户满意，成为新老客户信赖的合作伙伴。','gzzyjx99','张先生','2535012167','zdjxlh112513@126.com','020-13600005-563','0','1','1','','218.19.99.60','广东省广州市海珠区/荔湾区电信','1','/attachment/information/201707/pre_1501378776rwyq3.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2011','深圳模特招聘,深圳夜总会模特招聘,滚石夜总会','136','1501390745','365','1532926745','深圳模特招聘,深圳夜总会模特招聘,滚石夜总会&nbsp;|&nbsp;淮安滚石夜总会有限公司<br />\r\n深圳洋派对夜总会模特招聘<br />\r\nWX:cnamzpw<br />\r\nWX:cnamzpw<br />\r\n&nbsp;<br />\r\n	夜总会在进行的招聘时候，不仅仅需要普通的工作人员，而且还需要很多文职人员。这些文职人员在工作当中，需要做出很多的事情，才能保证夜总会当中所有的信息资料是没有任何问题的。这些文职人员在深圳夜总会招聘过程当中，会发现对于文职人员的要求比较高。基本上要达到大学专科学历才能够应聘。<br />\r\n	但是深圳夜总会招聘文员在薪水情况要比较高一些，和一些其他的公司相比，它的薪水要高出30%到50%，正是因为工资水平待遇非常好，所以很多大学毕业生，对于这份工作都非常的期待。希望通过自己的努力，能够应聘成为这个夜总会当中的文职人员。<br />\r\n这样自己就可以拿比较高的收入。而且夜总会当中的所有的制度都相对比较人性化，在这里工作可以让自己感觉到非常的轻松，不会有太大的压力。','nvtdk250','鸿飞','','1073052139@qq.com','0755-6141666','0','1','1','','14.103.159.224','广东省深圳市鹏博士长城宽带','1','/attachment/information/201707/pre_1501390745rsivh.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2012','海口模特招聘_滚石夜总会_海口招聘礼仪','136','1501394120','365','1532930120','海口模特招聘_滚石夜总会_海口招聘礼仪&nbsp;|&nbsp;淮安滚石夜总会有限公司<br />\r\n海口帝国公馆夜总会招聘模特礼仪<br />\r\nVX-cnamzpw<br />\r\nVX-cnamzpw<br />\r\n海南夜场招聘可以通过网络申请<br />\r\n网络的发达给我们的生活带来了很大的改变，很多人会发现现在不仅仅通过网络可以进行购物，通过网络可以进行交费。而且在找工作的时候，还可以通过网络直接申请，对于选择合适的工作，能够给予有效地帮助。<br />\r\n海南夜场招聘是可以直接通过网络平台来进行申请，对于工作项目比较有兴趣的用户，只要把自己的个人简历上传到官方网站当中，会有专门的人事工作者来进行审核。如果能够达到海南夜场招聘的相关要求，就会通知这个人来面试。<br />\r\n在面试时只要没有太大的问题，基本上都可以面试成功。所以这个夜场的招聘是可以通过网络来进行申请的，自己如果对于这方面的工作相对比较有兴趣的话，就可以经常打开它的官方网站来进行了解。对于了解是否有合适自己的工作，可以有帮助。','nvtdk250','鸿飞','','1073052139@qq.com','0755-6141666','0','1','1','','14.103.159.224','广东省深圳市鹏博士长城宽带','1','/attachment/information/201707/pre_1501394120l5jtu.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2013','合肥山东电诺焊机_电焊机厂家批发_等离子切割机','136','1501394212','365','1532930212','逆变直流电焊机_山东电诺电焊机_小型电焊机_电焊机功率_电焊机厂家_电焊机品牌_直流电焊机_电焊机价格<br />\r\n产品的优越性能<br />\r\nBT工业双模块+双阀控制数控使用效果更完美<br />\r\n山东电诺电焊机等离子切割机性能与特点：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;一、与数控切割机系统配套使用，独特的高频起弧方式，高频时间短，大大减少对数控切割系统的干扰。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;二、具有弧压信号接口、起弧成功信号接口，与数控系统连接可实现行走，割炬高度自动调节，以提高切割稳定性及切割质量。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;三、缺水，缺气保护功能，有效保护焊炬。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;四、独立风道设计，防护等级IP23，在恶劣条件下工作可靠性高，负载率100%。<br />\r\nLGK-160术参数hanjizhijia.com<br />\r\n	<br />\r\n		<br />\r\n			<br />\r\n				项目名称<br />\r\n			<br />\r\n			<br />\r\n				数值<br />\r\n			<br />\r\n			<br />\r\n				项目名称<br />\r\n			<br />\r\n			<br />\r\n				数值<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				额定输入电压(V)<br />\r\n			<br />\r\n			<br />\r\n				380V+15%<br />\r\n			<br />\r\n			<br />\r\n				额定工作电压（V）<br />\r\n			<br />\r\n			<br />\r\n				144<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				频率（HZ）<br />\r\n			<br />\r\n			<br />\r\n				50/60<br />\r\n			<br />\r\n			<br />\r\n				推力调整(V)<br />\r\n			<br />\r\n			<br />\r\n				--<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				额定输入功率(KVA)<br />\r\n			<br />\r\n			<br />\r\n				29.6<br />\r\n			<br />\r\n			<br />\r\n				切割厚度(MM)<br />\r\n			<br />\r\n			<br />\r\n				60<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				空载电压(V)<br />\r\n			<br />\r\n			<br />\r\n				380<br />\r\n			<br />\r\n			<br />\r\n				负载持续率(%)<br />\r\n			<br />\r\n			<br />\r\n				60<br />\r\n			<br />\r\n		<br />\r\n		<br />\r\n			<br />\r\n				输出电流调整(A)<br />\r\n			<br />\r\n			<br />\r\n				20-160<br />\r\n			<br />\r\n			<br />\r\n				绝缘等级<br />\r\n			<br />\r\n			<br />\r\n				F','hanjizhijia','石经理','845425007','845425007@qq.com','0539-8873551','0','1','1','','39.67.6.51','山东省临沂市联通','1','/attachment/information/201707/pre_1501394212mjdyr.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu