INSERT INTO my_information VALUES ('2027','承载梦想的舞台，卓一为你打造','136','1501490193','365','1533026193','专业品牌公关策划机构，专业品牌策划、活动策划、营销策划、企业CIS战略、VI策划设计，专题片影视广告拍摄等；15年专业策划团队，31名广告策略、营销、策划、设计核心团队，1000多个中.国知名企业成功案例。<br />\r\n我们是卓一，专业服务体系以活动管理、品牌传播为核心。竭心为您提供最用心、最优质的服务。','zhuoyi20','李冰晶','2429035568','2429035568@qq.com','020-36226722','0','1','1','','113.111.171.131','广东省广州市电信','1','/attachment/information/201707/pre_1501490193cykx7.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
INSERT INTO my_information VALUES ('2028','泸州重庆老火锅加盟老品牌老社长知青火锅','136','1501490768','365','1533026768','重庆老火锅加盟老品牌老社长知青火锅<br />\r\n<br />\r\n看到哪些正宗老火锅店的火锅，香气十足，这又是什么原因造成的呢？今天老社长知青火锅为大家带来煮火锅一直不香的原因。<br />\r\n<br />\r\n火锅不香，问题可以分解成：火锅已经脱香了;热火锅的第一个30分钟的味道还是香，后来香味变得越来越亮，甚至味道苦。<br />\r\n<br />\r\n我相信这通常是当我们吃火锅时遇到两个最明显的问题！<br />\r\n<br />\r\n老社长知青火锅<br />\r\n加盟电话：023-60362400;18702362999<br />\r\n网址：www.laoshezhanghg.com<br />\r\n<br />\r\n1，火锅一直没有香气的原因<br />\r\n<br />\r\n首先，选择香料类型，混合比例和重量是合适的。如香料应更多选择芳香类，苦涩级，香型不宜太多;根据“君臣佐使”调整中药比例，配合兼容原则，同时注意各种香料的优点，缺点是失调味道不但不香，而且会受到香料的总重量，应以比例煎炸比例的增减，否则出味不会因为香味浓郁而浓郁，味道太香<br />\r\n<br />\r\n二，油炸前检查是否处理香料到位。如香料被标记为粗粉，这样有利于香气，而对于草果，水果等香料，也要先去除种子，否则味道肯定会受到影响。另外，已经被标记为餐的香料，而且还用高度的酒浸湿，这有利于香味。<br />\r\n<br />\r\n三、炒油温度，加热时间应予以控制。在香料锅里，油温应该是低的（三热到更好），改变小火，加热时间不要太长，特别是避免香料油炸。<br />\r\n<br />\r\n2、火锅30分钟过后就不香了的原因<br />\r\n<br />\r\n一，在炒料时下香料的时机和方式是否正确。香料一般都要分两次下油锅里炒制。第一次是在把糍粑辣椒和豆瓣炒香出色后，放入部分香料（粗粉）炒出香味，利用火锅油的余温继续浸泡使其出香；<br />\r\n<br />\r\n二、在火锅油过滤出来后，再把剩余的香料粗粉放入底料里边，加热炒香即可。一般说来，第一次放的香料量要占香料总量的2/3，这里先放的香料可作为“头香”，而后面添加的香料，则是在持续加热的过程中，陆续释放香味，以弥补烫食过程中所散失的香味。<br />\r\n<br />\r\n三、在配制锅底时，火锅油与底料的比例不合理。一般情况下，每300克底料可加2000~2500毫升的火锅油，调匀便作为锅底，当然这个比例也并非一成不变，而是可根据实际情况去灵活变通。要让火锅的香味持久，或是增加底料的用量，或是减少第一次加入香料的比例，加重第二次添加香料的比例。<br />\r\n<br />\r\n据了解，一些调好品牌火锅，其浓郁的味道可以持续2个小时左右，这只是客人吃了一个火锅的时间消耗。<br />\r\n<br />\r\n这也是正宗的重庆火锅的独特之处，你不信，你可以来到老社长知青火锅试试。尝试知道什么是正宗的重庆老锅味道。','tiwhv395','吕先生','909773772','cqda2017@126.com','023-60362400','0','1','1','','125.82.184.49','重庆市电信','1','/attachment/information/201707/pre_1501490768nw4ch.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
