INSERT INTO my_information VALUES ('2054','佛山金皇朝主管新闻联播播音员李修平离别前台转作幕后配音','136','1501555233','365','1533091233','金皇朝注册平台www.jhc899.com，京华时报报道&nbsp;继2014年5月李瑞英、张宏夷易近退出《新闻联播》后，昨日另一元老级的播音骨干李修平也离别播音一线，退居幕后，郎永淳微博发文证实了此新闻。央视新闻核心播音部副主任康辉泄露，李修平不再出镜，“台里出台规定，《新闻联播》主播满52周岁要转幕后工作。修平本年已满52周岁，她提出转做幕后配音。”<br />\r\n　　康辉：因年龄新规李修平转幕后。<br />\r\n	央视新闻中央播音部副主任康辉回应称：“修平事情确有调剂，不再出镜，因为台里出台规定，《新闻联播》主播满52周岁要转幕后工作。修平本年已满52周岁，她提出转做幕后配音事情，事情关联还在咱们新闻播音部，她标志性的声音不会消散。同时修平兼任我台播音员营业指示委员会副秘书长，负责部分营业治理和培训事情。”<br />\r\n　　郎永淳：规则硬性真的很难舍，金皇朝主管<br />\r\n　　央视新闻掌管人郎永淳对于李修平的告别抒发了不舍之情：“真的很难舍！规矩很硬性,金皇朝娱乐！……春节后，刚到52岁的修平姐主动请求告别辛苦播报26年的主播台，今日起转到幕后做更多的营业管理跟指导事情了。和她互助促多少年，还未细致研究和掌握她的亲切、平实、端庄、自由，咱们会接续努力！修平姐还在新闻播音部，她的标记性声音不会消失。庆祝修平先生在新闻主播的营业管理和培训方面做出新成绩！”<br />\r\n想玩最新的游戏么?想获得超级回报么，请上金皇朝娱乐平台官网-金皇朝注册登陆开户唯一指定网站www.jhc899.com&nbsp;<br />\r\n	李修平1963年生于兰州，1983年来京就学。1987年大学毕业后回甘肃电视台工作。1989年进入央视，在《新闻联播》的播音岗位上工作了20多年。在《新闻联播》的一次直播中，她零失误口播一篇长达16分钟的稿件，激发观众的广泛好评。<br />\r\n　　李修平受访时曾表现认同“做直播经常有如履薄冰的感觉”这个说法。谈及掌管法门，她表现做新闻直播，最怕的便是突发变乱，稿件来得比较晚，并且急，但却最有新闻价值。这时刻心细的李修平每每在两人播音的过程中，拿起下一条稿过一遍,金皇朝主管，哪怕不是自身播，也会帮着把生僻字赶快查了注上。她表现作为一个新闻主播，有三点必须具备：政治素质、业务素质和生理素质。据其身边同伙泄漏，李修生平活中也善谈，存在亲和力。<br />\r\n　　剩7位主播70后是主力，金皇朝登录<br />\r\n　　李修平陪伴《新闻联播》的观众走过20多年，不少网友表现遗憾，有网友叹其主持功力踏实，赞其“知性优雅有学识”,称不像52岁。<br />\r\n　　今朝《新闻联播》播音组剩下7位主持人，分别是王宁、康辉、郭志坚、郎永淳、海霞、欧阳夏丹、李梓萌，除了51岁的王宁外，其余均为70后<br />\r\n金皇朝娱乐平台（www.jhc899.com）国际金融财团巨资打造的新生代在线金皇朝娱乐网站,致力于打造世界顶级的网上娱乐平台。&nbsp;本站提供金皇朝娱乐注册、金皇朝登录以及金皇朝主管客户端下载等服务，许诺装备最优质的投注方式,并辅以最进步的网络资源。&nbsp;欢送你的参加!金皇朝平台创立至今，始终致力于为宽大彩民供给保险牢靠的在线娱乐平台和优质的服务。k彩直营平台实力雄厚,技巧强硬,服务热忱，多种弄法休会。','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','0','1','','59.57.233.42','福建省厦门市电信','1','/attachment/information/201708/pre_15015552336yctf.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
