INSERT INTO my_information VALUES ('2064','枣阳有发机械专业批发供应400W实验室兴安盟分散机说明介绍','136','1501565637','365','1533101637','湖北枣阳有发机械有限公司专业批发各种400W实验室分散机说明介绍<br />\r\n400W实验室分散机说明介绍<br />\r\n优惠广大新老客户！共促销50台，先到先得，优惠期间只需要1600元每台！特价期间所有机子只按标配发货，配置为：304材质ф50mm&nbsp;不锈钢分散盘一个，专用调速器一个，如需另加配置请与厂家联系可按厂价另计。<br />\r\n0.4KW实验室分散机说明介绍<br />\r\n该实验室研磨分散设备广泛应用于油漆、涂料、非矿行业、磁记录材料等工业部门的实验室，结构简单，使用方便，是实验室必备的小试设备。<br />\r\nSDF400型试验多用分散机采用国外新技术设计新型产品，该产品集中了搅拌、砂磨、分散多种设备的功能于一体，是实验室人员最理想的实验设备。<br />\r\n本设备采用电子恒力调速线路，数字直接显示转轴转速，并配有分散叶轮与砂&nbsp;磨叶盘。能适应实验室不同的试验需要，并可根据显示的转轴速度直接计算搅拌、分散、砂磨叶片的线速度与物料粘度及化学反应速率之间的关系，为大规模投产提供正确的数据。湖北枣阳有发机械官方联系电话0710-6655739欢迎联系咨询。<br />\r\nSDF400型试验多用分散机结构特点：<br />\r\n1、本机采用双轴恒力升降系统，，升降方便。<br />\r\n2、采用串激整流子电动机，通过智能型电机调速控制仪。对电机实行无级调速。应用数字PID技术，控制精度高，数字直接显示转轴转速。<br />\r\n3、分散叶轮和砂磨叶盘与转轴用螺纹直接连接。<br />\r\n4、由左右夹持器对料筒固定，筒体采用夹套式结构，可通冷却水，用不锈钢材料加工而成。欢迎联系湖北枣阳有发机械有限公司批发400W实验室分散机说明介绍。','youfafensji','薛波','1536335099','aaa6655785@163.com','0710-6655739-1','0','0','1','','121.63.156.189','湖北省襄阳市电信','1','/attachment/information/201708/pre_1501565637fybwp.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
