INSERT INTO my_information VALUES ('2071','汕尾金皇朝注册北京6家娱乐场所因涉黄涉赌所被执法整顿www.','136','1501571773','365','1533107773','金皇朝娱乐报讯（www.jhc668.com）昨日上午，北京警方称，西城区塞纳河俱乐部、海淀区紫御国际俱乐部、海淀区豪锦期间国际会所、旭日区嘉乐丽歌厅、朝阳区紫水晶歌厅、旭日区今夜星光歌厅6家金皇朝娱乐场所因存在涉黄、涉赌违法行为被责令休业整顿。<br />\r\n北京警方表示，本年4月在全市发展以住宿业安全制度落实、取缔无照场所、严控涉黄、涉赌警情为重点的专项清理整治行动以来，发现存在问题场所261家，依法罚款处分52家，责令整改204家，取消黑开旅馆22家，行政扣押守法人员17人。<br />\r\n整治活动开展至今，警方已控制卖淫嫖娼违法犯法团伙68个，抓获涉黄违法犯罪职员600余人。5月12日，治安总队根据相关线索,金皇朝娱乐，会同旭日分局对旭日区北苑路一足道养生会所开展突击查处行为，抓获涉嫌组织介绍卖淫职员、嫖娼、卖淫违法职员共计16人。金皇朝平台，5月14日，依据线索，治安总队会同丰台分局在丰台区马家堡河汉苑一居民楼内，将利用QQ招嫖方式进行卖淫嫖娼的杨某某、高某某等6人抓获。<br />\r\n市公安局相关负责任人表示，北京警方将接续保持首善标准，对黄赌违法行为始终坚持“零容忍”。金皇朝注册<br />\r\n值得一提的是，这也是王小洪履新北京市副市长、市公安局局长后，首次对涉黄、涉赌文娱场合“放大招”。据媒体报道，2013年11月，王小洪到任河南省公安厅厅长3个月，位于郑州的“皇家一号”国际文娱会所就被警方“端掉”。<br />\r\n■&nbsp;探访<br />\r\n俱乐部称关门因“装修”<br />\r\n在警方整顿的6家文娱场所中，三家在旭日区、两家在海淀区，一家在西城区，有四家位于北京四环内。此中，紫御国际俱乐部邻接高校，今夜星光歌厅邻近三里屯使馆区。<br />\r\n昨日下午，金皇朝主管实地探访了六家涉事场所。除西城区塞纳河俱乐部已整理终了、恢复正规业务外，其他五家均闭门歇业，整理期时长也不限。<br />\r\n在位于东三环亮马河年夜厦负一层的今夜星光歌厅内一名保洁员称，歌厅几天前已关停整理，不知道恢复业务的具体时间，对关停缘故原由“不清楚”。<br />\r\n在位于旭日望京的嘉乐丽宾馆，事情职员也称，宾馆部属的嘉乐丽歌厅上个月就曾经关停，详细开业时间不明。而在旭日门临近的紫水晶歌厅，门内反栓了锁链，露出灯光。<br />\r\n6家被整顿的文娱场所中，只有西城区塞纳河俱乐部已恢复业务。客服职员说，俱乐部前段时间因五楼餐厅在装修，因此休业十多天。北京市公安局治安总队相关负责人表示，事实是，该场所为洗浴中心，违法环境较轻，整理期曾经结束。金皇朝登录<br />\r\n不过，当金皇朝主管以顾客身份致电6家场所询问休业缘故原由时，塞纳河俱乐部、紫御国际俱乐部、紫水晶歌厅等三家场所客服职员均称是因为“下水道疏通”、“内部装修”，其他几家则称“不清晰缘故原由”。<br />\r\n员工举报老板旗下其余会所<br />\r\n昨日，金皇朝主管以顾客身份致电海淀区紫御国际俱乐部，会所职员表示正在休业整顿，后向记者举报起俱乐部老板的另一家会所。<br />\r\n起初，该职员称俱乐部前段时间曾经关停，缘故原由是“装修”，预计少则三个月，多则半年之后才能恢复业务。但在听金皇朝主管说自身是“老顾客”之后，该职员坦言关停是因“本年以来查得严”，八月份即能从新开业。随后，他直接问“玩多少的照样更高价钱的（蜜斯）？”并举报称北京火车站附近某家国际会所“条件跟装修也不错”，和紫御国际俱乐部是“一个老板”，且发来短信见告详细地址。<br />\r\n	金皇朝娱乐平台（www.jhc668.com）国际金融财团巨资打造的新生代在线娱乐网站,致力于打造世界顶级的网上娱乐平台。本站提供金皇朝娱乐注册、金皇朝登录以及金皇朝主管客户端下载等服务，许诺装备最优质的投注方式,并辅以最进步的网络资源。欢迎你的参加!金皇朝平台创立至今，始终致力于为广大彩民提供保险牢靠的在线娱乐平台和优质的服务。k彩直营平台实力雄厚,技巧强硬,服务热忱，提供多种玩法体验。<br />\r\n	想玩最新的游戏么?想获得超级回报么，请上金皇朝娱乐集团-金皇朝平台注册登陆开户官方网站www.jhc668.com','dechang998','夏长','1665418818','dechang99@242526.com','0592-3366206','0','0','1','','59.57.233.42','福建省厦门市电信','1',