INSERT INTO my_information VALUES ('2079','居家养老呼叫系统_老年人看护系统_养老健康解决方案-吉祥星科','136','1501579128','365','1533115128','智慧养老系统是面向老年人群体,现代家庭,社区,物业和周边商户的需求,充分利用物联网技术,云服务器技术,互联网综合服务相结合的一项社区平台系统,以各类智能终端为载体,结合智能家居的应用,面向老年人群体推出的一项社区综合应用平台。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		安全人居：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		社区居民尤其是老人,孩子等特殊群体的安全保障,调度急救,便利服务,以及家庭<br />\r\n安全防护等需求,为构建安全人居的生活环境奠定了坚实的基础。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		和谐家庭&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		物业通过移动信息化手段与居民互动,向居民发布物业通知,费用催缴,并通过居民对社区的信息订制,小区建设信息调查等将物业服务与居民生活紧密结合起来,从而实现共建谐家庭的宗旨。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		便利生活：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		立足社区居民对衣食住行,家政,医疗,教育,娱乐等全方位资讯需求和便捷生活,优质服务的需求,通过O2O,居民即可畅享便利生活。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		二,系统构成：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		安全防护：通过智能安防设备,使老年人的人身安全得到全方位的保护。<br />\r\n智能控制：通过智能家居设备,使老年人在家中的生活畅通无阻。<br />\r\n社区服务：社区服务为老年人提供办事指南,社区团购,优惠卷下载,预定预约,租售等居民衣食住行资讯信息<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		1,安全防护：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		SOS：SOS紧急报警功能&nbsp;<br />\r\n身份识别：老年人回家的身份识别功能&nbsp;<br />\r\n燃气泄露：燃气泄露时的自动报警和自动关闭燃气阀门的功能&nbsp;<br />\r\n视频监控：视频监控功能,能随时观察老人在家的活动。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		智能设备及功能介绍：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		电话拨号报警器：&nbsp;遇到紧急情况时,按下中间的SOS急救按扭,可以自动拨打预设的报警电话<br />\r\n智能门锁：&nbsp;老人出去到家时,利用指纹开锁,家人可以在手机客户端收到老人已经回家的信息。<br />\r\n燃气报警器：&nbsp;遇到燃气泄露时,燃气报警器可以联动电话拨号报警器报出预设的报警电话,也可以自动关闭燃气阀门<br />\r\n摄像头：&nbsp;通过手机客户端,可以随时查看老年人在家的行动及安全状况。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n2,智能控制：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		灯光控制：通过方便的情景面板或是手机客户端能轻松打开灯光&nbsp;<br />\r\n窗帘控制：通过智能窗帘控制器或是遥控器能自动打开或是关闭窗帘&nbsp;<br />\r\n起夜灯光：老人晚上起夜时走廊和厕所的灯能自动打开&nbsp;<br />\r\n智能调温：在室温达到预设的值时,可以自动打开空调调节室内的温度<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n智能设备及功能介绍&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n	<br />\r\n	<br />\r\n		智能开关和情景面板：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		实现方便的开关灯的功能,如在床头或是伸手可接触的地方放置情景面板；<br />\r\n	<br />\r\n	<br />\r\n		窗帘电机,窗帘遥控器,窗帘控制器：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		用手触控窗帘控制器或是用遥控器,可以方便的打开或是关闭窗帘；<br />\r\n	<br />\r\n	<br />\r\n		人体探测器,智能开关,自动感应灯：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		探测到走廊有人走动时可自动打开感应灯,人体探测探测到有人时,也可联动开关面板自动打开灯；<br />\r\n	<br />\r\n	<br />\r\n		温湿度感应器,红外转发器：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		室内达到一定温度或湿度时,可以联动打开空调来调节室内的温度或湿度。<br />\r\n	<br />\r\n	<br />\r\n		<br />\r\n3,社区服务系统&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		社区服务系统是针对老年人的便利生活,主要表现小区商圈的O2O服务上,老人利用室内主机,可以轻松的实现网上下单,商户上门服务的功能：如上门剪发,送菜到家,送饭到家,日用品送到家。为老年人的日常的生活提供了极大的便利。<br />\r\n	<br />\r\n	<br />\r\n		&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		三,系统特点：&nbsp;<br />\r\n	<br />\r\n	<br />\r\n		社区系统基于强大的功能,使用多样化的信息手段,通过最简便的操作,服务最广泛的社区居民。<br />\r\n	<br />\r\n	<br />\r\n		用户群广：既服务普通居民,更针对老人,孩子等特殊人群提供更周到的服务。<br />\r\n方式多样：支持手机客户端及室内的控制操作。<br />\r\n功能强大：满足您正常生活,突发状况等情况下的高要求<br />\r\n操作简便：只需按动一键,即可帮实现智能化的效果<br />\r\n	<br />\r\n	<br />\r\n		吉祥星是专注智慧养老解决方案，致力于互联网+养老及相关产品的公司，产品涉及：智能投影仪,智能微型投影仪,微型投影仪等，养老服务咨询：400-263-203,官网：http://www.luckystar.com.cn/','eplav503','邱小姐','1581155313','2729411755@qq.com','0755-82956345','0','1','1','','119.123.124.121','广东省深圳市电信','1','/attachment/information/201708/pre_1501579128ulpph.jpg','1','1','0','1','0','0','0','0','其它生活服务','qitafuwu','1','0','','0.00000000000000000','0.00000000000000000','','1','0','0');
